var book = {
	"name": "အဲၫစ့ယၫ",
	"numChapters": 66,
	"chapters": {
		"1": {
			"1": "<sup>1</sup> စအၫမူၭအဖိၪခွၫ စအဲၫစ့ယၫအဒၪဘၪဆၧလၧယၫ လခီၫနီၪ, လၧအဒၪဘၪလၧယုဒၫ, ဒဲယရုစလံၫ့အဂဲး အကၠီၪ့, လၧယုဒၫအစဎွၩၥံၪ, စအၧၭဇဲအၫ, ဒဲစယိၥၫ့, စအၫဟဇၭ, စဟ့ၭဇကဲအၫအမုနံၩလဖၪအဖၧၩ့လီၫ.",
			"2": "<sup>2</sup> နါဂၧၫ့ဆံၭမူၭခိၪဧ့,ဒိၭနနါဆံၭ, ဂၪ့ခိၪဧ့ၬ အဂဲး ဘဲၫယီၩယဟိဝၩချဲၩ့ဆၧလီၫ. ယဒုၭဒိၪထၪ့,ဒဲလုအၪ့ လုအီၩဖိၪခွၫလဖၪတၭ, အဝ့ၫၥံၪဒၪလ့ၬပိၩ့ထၪ့ယၧၩ",
			"3": "<sup>3</sup> လီၫ.- ချီဖၫၥ့ၪယၫအကဆါ, ဒဲကၥ့ၪယီၩ့ၥ့ၪယၫအက ဆါဒုၭအၪ့အဆၪအလးလီၫ. အ့ၪမွဲအံၫစရ့လၭၥ့ၪယၫ",
			"4": "<sup>4</sup> ဆၧအ့ၬး ယၡၩခမျၧးၥံၪဆီၫ့မီၪ့ဝ့ၫအ့ၬၬ- ၦဆၧဒဲၩဘၭ ဖိၪလဆၨၩဧ့,နၥံၪဘၪအၡၪ့လီၫ. ၦခမျၧးလၧအဘၪ ယိၭဆၧအၧၩ့ဆၧၥၫ့ဎၧၫ့း ၦမၩဆၧအၧၩ့အချံၫအၥၪၬ ဖိၪလဖၪလၧအမၩစံၪစၪဆၧလီၫ. အဝ့ၫၥံၪစဲၪ့ဒၪခွံၬ ယဟိဝၩယူၭး အဝ့ၫၥံၪမၩၥၭထၪ့ယူၭအံၫစရ့လၭအ ဆၧဆံၫ့ဎံၪလဂၩယူၭတၭ, ထဲၩ့ထဲၩ့ယူၭလၧအလးခဲၫ့ ယူၭ.",
			"5": "<sup>5</sup> နၥံၪမိဘၪဆၧထးဒံၭနၥံၪ လၧအလးလစီၪ့စီၪ့လဲၪ. နၥံၪမိပိၩ့ထၪ့ဒံၭ ဆၧဒံၩ့အၪဒံၭလီၫ. ဆၧအခိၪဎွံၪနီၪ ဆၫဝ့ၫထၧၫ့ဖျိၪ့ယၫး ဒဲဆၧအၥၭနီၪ လၩ့ဘဲၩဝ့ၫထၧၫ့",
			"6": "<sup>6</sup> ဖျိၪ့ယၫလီၫ.- လၧအခၪ့ယၫၥၭဖိးလၧအခိၪဎွံၪနီၪဆၧ အလးအယၪဂ့ၩ အီၪလၧအဖၧၩ့အ့ၬ. မွဲဆၧဘၪဆ့ၭ အလး,ဆၧဖၧၩ့လးဒဲဆၧထးအဖၧၩ့လးနီၪလီၫ. ဘၪ ဆၧဆံထိၬဝ့ၫအ့ၬ, ဘၪဆၧဘီၪ့ဝ့ၫအ့ၬ. တၭဘၪဆၧ",
			"7": "<sup>7</sup> မၩဆါဝ့ၫလၧၥိၪၥံၪချၫၥံၪဆ့အ့ၬ.- နၥံၪအခးနီၪအီၪ ယူဝ့ၫ,နၥံၪဒိၩ့ၥံၪမ့ၪအၪ့ခွံၬဝ့ၫဒၪတၭ, နၥံၪအဂၪ့ခိၪ နီၪၦလခီၫဘၩ့မုးဖိၪအၪ့ခွံၬဝ့ၫ လၧနၥံၪအမ့ၬယၫတၭ, အီၪယူဝ့ၫဘဲၫၦလခီၫဘၩ့မုးဖိၪ မၩနၧၩ့မၩစၪဆၧအ",
			"8": "<sup>8</sup> ၥိၭနီၪလီၫ.- ဇံအိၫ့အဖိၪမုၪအီၪလၩ့ထး ဘဲၫတဲၩလ ဖျိၪ့လၧစဘံၭ အလးဖၧၩ့အၥိၭ, ဘဲၫကၠၩ့လဖျိၪ့လၧ ထံၩၥၪအလးဖၧၩ့အၥိၭ, ဘဲၫဒိၩ့လၧအဒုၪအဒၩ ဝၩ့",
			"9": "<sup>9</sup> ထၬဝ့ၫအၥိၭလီၫ.- ၥုၭမုခမျၧးအယဟိဝၩအ့ၪလဒုၭ အီၪလၩ့ထးဘၪၦၡၩလၧဆၧလၩ့ထးလဆံၭတၭ, ပမိ မၩပၥၭဘဲၫစီဒၧၫ့, ပမိလၩ့ဂၬဂမိရၫနီၪလီၫ.",
			"10": "<sup>10</sup> ခိၭနၪယဟိဝၩအလူဆံၭး စီဒၧၫ့အၦဒိၪၥံၪဧ့,ဒိၭန့ ပယွၩအဆၧၥီၪ့ဆၧၥၫ့ဆံၭ, ဂမိရၫအၡၩခမျၧးၥံၪဧ့,",
			"11": "<sup>11</sup> နၥံၪလုထၪ့ယၧၩလၧဆၧအၪအၪလ့ၬနီၪး မွဲဘၪလဲၪ, ယဟိဝၩစံၭဝ့ၫဒၪ ယဘျဲၩအၪ့လၧၥိၪဖၫအဆၧလုမ့ၪ, ဒဲဆၧဖိၪဆၧဎါအဘီၪအၥိၪလီၫ. တၭဘၪယၥၭလၧချီ",
			"12": "<sup>12</sup> ဖၫဒဲၥိၪဖိၪ, ဒဲဘ့ၪဖၫအၥွံၪအ့ၬ.- ထီးနၥံၪအ့ၪဂဲၫထၪ့ လၧယမ့ၬယၫ ဘဲၫၥိၭနၥံၪမိယဲးယဝၩ့ဖၧၩ့တၭ, မွဲပ လၫအၪ့ကံၩ့ဆၧနီၪလမံၩ့ လၧနၥံၪအစူၪဖၧၩ့လဂၩ",
			"13": "<sup>13</sup> လဲၪ.- ဂဲၫဆိၬလၧၩ့ဆၧမၩဘိၪ့ပျီၩပျီၩနီၪလဂ့ၩ, ဆၧ ဆူၭခဲၩနၧၫ့မၧၫ့နီၪမွဲဆၧၥၭလိၪလၧယဂးလီၫ. လၩၥံၫ အနံၩ,ဒဲမးၥံၫအနံၩ, ဒဲကိၭကီၪ့ဆၧနီၪ မွဲဘဲၫနီၪၥိၭ တၭးဆၧအၧၩ့ဆၧၥၫ့, ဒဲဘိၪ့ဆၧဘၩဆၧအဆၧအီၪ",
			"14": "<sup>14</sup> ကီၪ့နီၪယထိးကဲၪအ့ၬ.- နၥံၪအလၩၥံၫအနံၩ, ဒဲနၥံၪ ဖၭမုနံၩအဆၧအီၪကီၪ့နီၪ ယၥၭဂဲၫ့ယဝ့ၫတၭ, ကဲၪ ယူၭဆၧဎၧၫ့လၧယလီၩ့ယူၭတၭ, ယအွံၪယယိၭနီၪ,",
			"15": "<sup>15</sup> ဆၧပွံၭယၥၭယူၭ.- ထီးနၥံၪယူၬထၪ့နၥံၪအစူၪတၭ, ယမိအီၪက့ၪၥူၪခွံၬ ယမ့ၬၥၪလၧနၥံၪတၭ, ထီးနၥံၪမၩ အၪထၪ့နၥံၪအဆၧဘၩဆိၪဖၪတၭ, ယခိၭနၪအ့ၬး န ၥံၪအစူၪဎွ့ၩဝ့ၫလၧဆၧၥွံၪလီၫ.",
			"16": "<sup>16</sup> ၥူၫဝၭခွံၬနၥံၪအၥၭ, မၩဆံၫ့ထၪ့နၥံၪအၥၭ, နၥံၪမၩ ဆၧအအၧၩ့နီၪၥုၭခွံၬလၧယမ့ၬယၫဆံၭး မၩလၧၩ့ဆၧ",
			"17": "<sup>17</sup> အၧၩ့လဂ့ၩ.- မၩလိၪမၩဆၧဂ့ၩဆံၭ. အၪ့ဎၬဆၧစ့ၩ ရၫ့တီၩ,မၩဆၧၩ့ ၦၡၩလၧအဘၪဆၧမၩအၧၩ့မၩနၭ",
			"18": "<sup>18</sup> ဝ့ၫ,စ့ၩရၫ့တီၩန့ၦဖိၪဎွ့ၪ, မၩဆၧၩ့ၦမုၪမဲၫဆံၭ.- ဂဲၫ ဘီၪ,ယဟိဝၩစံၭဝ့ၫဒၪ, မွဲပကိၪ့လိၬၡီၩ့ပၥၭဆံၭ. န ၥံၪအဆၧဒဲၩဘၭမွဲဘဲၫဆၧဝီၩယဲအၥိၭလါနၫ့တၭ, မိ ဘွၩထၪ့ဝ့ၫ ဘဲၫမူၭခိၪဖီၫအၥိၭနီၪလီၫ. အ့ၪဝီၩဘဲၫ ဆၧဝီၩလုၭဖုၭအၥိၭလါနၫ့တၭ, မိမၩအၥၭဘဲၫၥိၪအ",
			"19": "<sup>19</sup> ဆီၪ့အၥိၭလီၫ.- နၥံၪအၥၭအ့ၪအီၪ, ဒဲခိၭနၪဆၧတၭ,",
			"20": "<sup>20</sup> နၥံၪမိအၪ့ထံၫၥံၪခးၥံၪနီၪအဆၧဂ့ၩလီၫ.- အ့ၪမွဲနၥံၪ အ့ၪဂဲးလိၬတ့ၭလိၬ, ဒဲပိၩ့ထၪ့ဆၧတၭ, ဖၩ့ၥံၪနၭၥံၪမိ အၪ့ခွံၬနၥံၪလီၫ. အဂဲးဘဲၫယီၩယဟိဝၩအနိၭချဲၩ့ဆၧ နီၪလီၫ.",
			"21": "<sup>21</sup> ဒိၩ့လၧအလူတီၩနီၪကဲၪထၪ့ယူၭ ၦမဲၩဎွဲၩမုၪမၬကၨၬ လၧအၥၫ့ဎွ့ၩယူၭဝ့ၫလၧဆၧစ့ၩရၫ့တီၩ, ဆၧတီၩဆၧ လီၩ့အီၪဝဲၩလၧအဖၧၩ့ယူၭး အ့ၪမွဲဘိၩ့နဲၪ့ယီၩ, ၦမၩ",
			"22": "<sup>22</sup> ၥံၫၦၡၩၥံၪလီၫ.- နစ့ၩကဲၪထၪ့အအ့ၪ, နစဘံၭထံၫနီၪ",
			"23": "<sup>23</sup> လဲၩဎုၬအၥၭလၧထံၫလီၫ.- နၦဒိၪဖၭဒိၪၥံၪမွဲၦလၧအ ပိၩ့ထၪ့ဆၧတၭ, ထၧၫ့ထံၩထၧၫ့ၥိၭလၧၦအၪ့ဂူၪအၪ့ ဘျၪဆၧ, အဲၪလၬဆီၪ့ကိၭအဂၩဒ့ၭတၭ, အၪ့ဎၬဆၧ ဖ့ၪလၫ့လီၫ. အဝ့ၫၥံၪစ့ၩရၫ့န့ၦဖိၪဎွ့ၪအ့ၬ ၦမုၪမဲၫအ ခွးနီၪဂဲၫဘၪလၧအအီၪဆ့အ့ၬ.",
			"24": "<sup>24</sup> မၩအၥၭဘဲၫနီၪတၭ, ကဆါ, ဆၧၥုၭမုခမျၧးအယ ဟိဝၩအံၫစရ့လၭအဆၧဒိၪဆၧဆီၪ့လဂၩ စံၭဝ့ၫဒၪ, အၩလါၬ ယမိမၩမုၬထၪ့ထဲၩ့ယၥၭ လၧၦထၫ့ဒုၪဒၩ ယၧၩတၭ, ယမိမၩဆၧၫ့ဆၧအၧၩ့ လၧယဒုၪယဒၩၥံၪ",
			"25": "<sup>25</sup> နီၪလီၫ.- ယမိကၠၪယစူၪလၧနအီၪတၭ,ယမိမၩဖံၪထၪ့",
			"26": "<sup>26</sup> ခွံၬနစ့ၩအအ့ၪ, ဒဲမၩန့ခွံၬနၡၬထီးအလူၬး- တၭယမိ ဒုၭအီၪထၪ့ထဲၩ့နၡၩစ့ၩရၫ့ဆၧ ဘဲၫလၧအဝံခိၪအၥိၭ နီၪ,ဒဲနၡၩဒုၭကိၪ့ဆၧဘဲၫလၧအခၪ့ထံၭ အၥိၭနီၪလီၫ. လၧခဲၫ့ထဲၩ့ဆၧမိကိၭနၧၩ လၧဆၧတီၩဆၧလီၩ့အဒိၩ့,",
			"27": "<sup>27</sup> ဒိၩ့လၧအလူတီၩလီၫ.- ဆၧမိဎွ့ၩန့ထဲၩ့ဇံအိၫ့လၧဆၧ စ့ၩရၫ့, အၡၩလၧအဂဲၫထဲၩ့လဖၪ လၧဆၧတီၩဆၧလီၩ့",
			"28": "<sup>28</sup> လီၫ.- ၦမၩမၪဆၧဒဲၦဆၧဒဲၩဘၭဖိၪနီၪ မိထီၩ့လၧဆၧ ဂၭဂီၩ့လစီၪ့ဎးတၭ, ၦလၧအစဲၪ့ဒၪယဟိဝၩနီၪမိလူၬ",
			"29": "<sup>29</sup> ခွံၬဝ့ၫလီၫ.- အဂဲးဘဲၫယီၩ အဝ့ၫၥံၪအမ့ၬမိမဲလၧၥံၪ့ ထိၭဖၫၥံၪလၧနၥံၪဆိၫ့န့ဝ့ၫအကၠီၩ့တၭ, နၥံၪမိအီၪက့ၪ မဲနၥံၪအမ့ၬ လၧကျိၭၥံၪ လၧနၥံၪရွံန့ဝ့ၫ အကၠီၩ့နီၪ",
			"30": "<sup>30</sup> လီၫ.- အဂဲးဘဲၫယီၩ နၥံၪမိမၩနၥံၪအၥၭဘဲၫၥံၪ့ထိၭ ဖၫလထံၭ လၧအလၪလၩ့ယံၭအၥိၭ, ဒဲဘဲၫကျိၭလၧ",
			"31": "<sup>31</sup> ထံၫလအီၪဘၪလၧအဖၧၩ့အၥိၭနီၪလီၫ.- တၭၦအဂဲး ဆီၪ့နီၪမိကဲၪထၪ့ဘဲၫလူၪကၩ့အအ့ၪအၥိၭ, ဒဲအမၩ ဆၧဘဲၫမ့ၪဖီၫအၥိၭတၭ, မ့ၪမိအၪ့ခွံၬဝ့ၫလစီၪ့ဎးတၭ, ဆၧမိမၩလၩ့ဖံၬခွံၬဝ့ၫနးဂၩအ့ၬ."
		},
		"2": {
			"1": "<sup>1</sup> ဆၧလၧစအၫမူၭအဖိၪခွၫ စအဲၫစ့ယၫဒၪဘၪဝ့ၫလၧ ယုဒၫး ဒဲယရုစလံၫ့အဂဲး.",
			"2": "<sup>2</sup> လၧမုနံၩအခဲၫ့ထုၬ လဖၪနီၪ ဆၧမိမၩအၥၭ လၧ ယဟိဝၩအဂံၪ့အခိၪလီၩ့နီၪ မိအီၪဂုးအီၪခၧၫ့ လၧခိၪ လီၩ့ဒၩ့ခိၪတၭ, မိဘၪဆၧအီၪက့ၪထၪ့ထီၫနဲၪ့ဒံၭဆၧ စီၩ့ခိၪၥံၪတၭ, ၦကိၭဆၨၩဒ့ၭမိလၩ့ယွၩဝ့ၫလၧအအီၪ",
			"3": "<sup>3</sup> လီၫ.- ၦခမျၧးအၪဆၨၩမိလ့ၩတၭစံၭဝ့ၫ, ဂဲၫဘီၪ, မွဲပ မိလ့ၩထၪ့ၡီၩ့လၧယဟိဝၩအခိၪလီၩ့ လၧစယၫကူၭ အယွၩအဂံၪ့နီၪဆံၭ. တၭအဝ့ၫဒၪမိနဲၪလိၪပၧၩလၧအ ဖၧၩ့ၥၭၥံၪတၭ,ပမိဖိၬအဖၧၩ့ၥၭလဖၪလီၫ. အဂဲးဘဲၫ ယီၩဆၧၥီၪ့ဆၧၥၫ့မိစဲၪ့ထၪ့ခွံၬ လၧဇံအိၫ့အဖၧၩ့, ယ",
			"4": "<sup>4</sup> ဟိဝၩအလူအထၫလၧယရုစလံၫ့အဖၧၩ့လီၫ.- အဝ့ၫ ဒၪမိစ့ၩရၫ့ဆၧလၧၦဆၨၩၥံၪအကျၩတၭ, မိအၪ့ၥီၪ့ၦ ခမျၧးအၪဆၨၩတၭ, အဝ့ၫၥံၪမိနဲၫ့ထဲၩ့ အနၭၥံၪမၩ ကဲၪထၪ့ထဲၫအနါ, ဒဲအဖၩ့ၥံၪ ကဲၪထၪ့ဎ့ၬဖ့ၬၥံၪ့လီၫ. တၭၦလဆၨၩမိယၩ့ထၪ့လၧနၭ လၧအထၫ့ဒုၪဒၩၦ လဆၨၩဒၪနီၪဆ့အ့ၬး ဒဲမၩလိၪလၧၩ့ ဆၧဒုၭၥုၭဆ့",
			"5": "<sup>5</sup> အ့ၬ.- စယၫကူၭအဂံၪ့ဖိၪၥံၪဧ့, ဂဲၫနၥံၪဝ့ၫဘီၪ, မွဲပမိ လ့ၩၡီၩ့လၧယဟိဝၩအဆၧဖၩ့အဖၧၩ့နီၪဆံၭ.",
			"6": "<sup>6</sup> အဂဲးဘဲၫယီၩ နစဲၪ့ဒၪယူၭနၡၩခမျၧးစယၫကူၭအဂံၪ့ ဖိၪယူၭ.အဂဲးဘဲၫယီၩ အဝ့ၫၥံၪဎွ့ၩဝ့ၫလၧဆၧလၧမုထၪ့ လခီၫ,ဒဲၦမၩကဒၩၦမ့ၬဘဲၫၦဖလံၡၫဖိၪအၥိၭနီၪတၭ,",
			"7": "<sup>7</sup> ဖီၪ့လိၬအစူၪလၧၦလခီၫဘၩ့မုးဖိၪလီၫ.- အဝ့ၫၥံၪအ ထံၫအခးဎွ့ၩဝ့ၫလၧကျိၪၥံၪစ့ၩၥံၪ, ထီၫ့ၥံၪလွ့ၫၥံၪတၭ, အဆၧအီၪက့ၪကီၪ့ဆၧနီၪ အထုၬအီၪအ့ၬ. အထံၫအ ခးဎွ့ၩဝ့ၫလၧကၥ့ၪဆ့, ဒဲအလဲၪ့ၥုၭလဖၪနီၪအထုၬအီၪ",
			"8": "<sup>8</sup> အ့ၬ.- အထံၫအခးဎွ့ၩဝ့ၫလၧဆၧဂၩ့ဆၧဖၪ့ဆ့း ဆၧ လၧအစူၪမၩဝ့ၫ, ဆၧလၧအစူၪနိၩ့မၩကဲၪထၪ့ဝ့ၫလဖၪ",
			"9": "<sup>9</sup> နီၪအဝ့ၫၥံၪဘိၪ့ထၪ့ဘၩထၪ့ဝ့ၫဒၪလီၫ.- တၭၦအၡၪ့ ၡီၫ့လၩ့အခိၪ, ဒဲၦအဒိၪဆၪ့လၩ့အၥၭလီၫ. အခိးမွဲန ကွဲၪဖျါအဝ့ၫၥံၪအဆၧမၪအ့ၬ.",
			"10": "<sup>10</sup> လ့ၩနုၬလၧလိးဖၧၩ့လဲၫ့ဖၧၩ့တၭ, မၩဘံၭမၩဘၧၩ့ နၥၭလၧဂၪ့ခိၪမုၬအကျၩ, လၧဆၧၥၭမဲၪယဟိဝၩအ ကၠီၩ့, ဒဲလၧအကယးကဖး အလၩအဖၩ့ အကၠီၩ့နီၪ",
			"11": "<sup>11</sup> ဆံၭ.- ဆၧလၧမုလနံၩနီၪ ၦၡၩအမ့ၬအီၪထၪ့ထီၫနီၪ မိဘၪဆၧဒုၭဆၪ့လၩ့ဝ့ၫတၭ, ၦၡၩအဆၧထၪ့ထီၫနီၪ မိဘၪဆၧဒုၭဆၪ့လၩ့ဝ့ၫတၭ, လၧမုလနံၩနီၪယဟိဝၩ မိဘၪဆၧအီၪက့ၪထၪ့ထီၫဝ့ၫလဂၩဎးလီၫ.",
			"12": "<sup>12</sup> အဂဲးဘဲၫယီၩ ဆၧၥုၭမုခမျၧးအယဟိဝၩ အမုလ နံၩမိဘၪကယဲဆၧ လၧအအီၪက့ၪဖိၫလိၫအၥၭ ဒဲအီၪ က့ၪထၪ့ထီၫအၥၭ, ဒဲကယဲဆၧအီၪက့ၪထၪ့ထီၫဝ့ၫထီး",
			"13": "<sup>13</sup> အလူၬနီၪ,မိဘၪဆၧဆၪ့လၩ့ဝ့ၫလီၫ.- မိဘၪကယဲလ့ၭ ဘနၧၫ့အၥံၪ့ၡိၫအ့ရ့ၭလၧအထီၫ, ဒဲမိဘၪဘၫၡၫ့အၥံၪ့",
			"14": "<sup>14</sup> ထိၭဖၫထီးအလူၬ.- ဒဲမိဘၪကယဲခိၪလီၩ့ထီၫ,ဒဲကယဲ",
			"15": "<sup>15</sup> ဆၧစီၩ့ခိၪထၪ့ထီၫ,- မိဘၪကယဲတၨၭထၪ့ထီၫ, ဒဲမိ",
			"16": "<sup>16</sup> ဘၪကယဲဆၧအခိၪဒၧၩ့,လၧၦထၪ့လၥ့ၪဘၪး- မိဘၪ ကယဲတၫၡံၭအကဘၩ့, ဒဲမိဘၪ ကယဲဆၧအဖျီၪဂ့ၩ",
			"17": "<sup>17</sup> ထီးအလူၬလီၫ.- ၦၡၩအဆၧထၪ့ထီၫနီၪမိဘၪဆၧခွံၬ လၩ့ခွံၬဝ့ၫတၭ, ၦၡၩအၥၭထၪ့ထီၫနီၪမိဘၪဆၧဆၪ့ လၩ့ဝ့ၫတၭ,လၧမုလနံၩနီၪယဟိဝၩမိဘၪဆၧအီၪက့ၪ ထၪ့ထီၫဝ့ၫလဂၩဎးလီၫ.",
			"18": "<sup>18</sup> တၭဆၧဂၩ့ဆၧဖၪ့နီၪ မိလၩ့မါခွံၬဝ့ၫ ထီးအလူၬ",
			"19": "<sup>19</sup> လီၫ.- တၭၦလဖၪမိလ့ၩနုၬလၧလိးအိၩဖၧၩ့,ဒဲဂၪ့ခိၪ အိၩဖၧၩ့လၧအဆၧၥၭမဲၪ ယဟိဝၩအကၠီၩ့, ဒဲလၧအ ကယးကဖးအလၩအဖၩ့အကၠီၩ့, လၧအဂဲထုၪ့မၩၡိၩ့ ၡိၬဂၪ့ခိၪနၭနၭလ့ၬအဘိၩ့ဘၭနီၪလီၫ.",
			"20": "<sup>20</sup> ဆၧလၧမုလနံၩနီၪၦၡၩအဆၧဂၩ့စ့ၩ, ဒဲအဆၧဂၩ့ ထီၫ့လၧအတဲၩ့ဝ့ၫလၧအနၫ့ဆါလဂၩဘၪလဂၩမိဘၩ ဝ့ၫအဂးနီၪမိခွံၬၡိၭခွံၬဝ့ၫလၧဝံၩၥံၪ, ဒဲဖျၪၥံၪအအီၪ,",
			"21": "<sup>21</sup> ဘဲၫအမိလ့ၩနုၬလၧလိးထ့ဖၭအဖၧၩ့, ဒဲလၧလဲၫ့ခိၪစူၩ ထၪ့လၩ့အိၪ့ၥံၪအဖၧၩ့, လၧယဟိဝၩမၩၥၭမဲၪဆၧအ ကၠီၩ့,ဒဲအကယးကဖးအလၩအဖၩ့အကၠီၩ့, လၧအဂဲ ထုၪ့မၩၡိၩ့ၡိၬဂၪ့ခိၪနၭနၭလ့ၬ အဘိၩ့ဘၭနီၪလီၫ.",
			"22": "<sup>22</sup> ထီးဒိၭနဲၩ့နၥံၪအၥၭလၧၦၡၩလၧအၥၭအီၪဝ့ၫလၧ အနၫဖၧၩ့နီၪလဂ့ၩး အဂဲးဘဲၫယီၩဆၧမိအီၪက့ၪအဝ့ၫ ဒၪလၧဆၧနီၪလမံၩ့လဲၪ."
		},
		"3": {
			"1": "<sup>1</sup> အဂဲးဘဲၫယီၩ, ယိခွါ, ကဆါ,ဆၧၥုၭမုခမျၧးအ ယဟိဝၩနီၪ, မၩန့ထၪ့ခွံၬလၧယရုစလံၫ့,ဒဲလၧယုဒၫ အဖၧၩ့ဆၧမၩခၧၫ့ထၪ့ၦၡၩအၥၭ, ဒဲဆၧဒိၭနဲၩ့အၥၭ အလး,ဆၧဒိၭနဲၩ့အၥၭအကိၪထီးအလူၬ, ဒဲဆၧဒိၭ",
			"2": "<sup>2</sup> နဲၩ့အၥၭအထံၫထီးအလူၬ,- ၦအဆီၪ့ဒဲၦၡၩၥုၭဖိၪ,",
			"3": "<sup>3</sup> ၦစ့ၩရၫ့ခွး,ဒဲမီၪ, ၦဖၭဆၧ, ဒဲၦၥုၪ့က့ၭၥၭၡါ,- ၦယဲ ဆံၫအခိၪဒဲၦဘၪဆၧယူၭယၪ့ဝ့ၫ, ၦဒုၭကိၪ့ဆၧ, ဒဲၦ",
			"4": "<sup>4</sup> ကိၪ့မၩဆၧၥ့ၪ, ဒဲၦမၩကဒၩၦမ့ၬလီၫ.- ယမိအီၪက့ၪ ထၪ့ဖိၪၥၪၥံၪလၧၦဒိၪဖၭဒိၪအလးတၭ, ဖိၪၥၪဆံၭလ",
			"5": "<sup>5</sup> ဖၪမိပၧၩ့ဘၪအဝ့ၫၥံၪလီၫ.- တၭၦခမျၧးၥံၪမိမၩအၧၩ့ လိၬအၥၭဆုၬဆုၬ, လဂၩဘၪလဂၩလီၫ. ၦၥၭဘၪ့မိ မၩကြၩ့ထမးၦၥၭၡါလဖၪ, ဒဲၦလၧအလၩအဖၩ့လ အီၪဘၪနီၪမိမၩကြၩ့ထမး ၦလၧအလၩအဖၩ့အီၪလီၫ.",
			"6": "<sup>6</sup> ထီးနီၪလဖၧၫ့ ၦလဂၩမိဖီၪ့ထၬအထၧၫ့ဖုဝဲလၧအဖါ အၡၩဂံၪ့ဖိၪအကျၩတၭ, စံၭဝ့ၫ,နအီၪလၧဆၧကီၩ့ဆၧ ၥိၭ, နဘၪကဲၪထၪ့ၦဒိၪပၧၩ့ပၧၩတၭ, ဆၧလၩ့ဎီးယီၩ",
			"7": "<sup>7</sup> မိအီၪလၧနစူၪအဖၫ့လၬလီၫ.- ဆၧလၧမုလနံၩနီၪအဝ့ၫ ဒၪမိထုၭထၪ့အလူတၭ, စံၭဝ့ၫ,ယကဲၪၦမၩဘျၪထဲၩ့ ဆၧအ့ၬးတၭကိၪမွဲဂ့ၩ, ဆၧကီၩ့ဆၧၥိၭမွဲဂ့ၩ, အီၪလၧ ယဂံၪ့ဖၧၩ့အ့ၬ. အီၪက့ၪယၧၩလၧၦခမျၧးအၦဒိၪပၧၩ့",
			"8": "<sup>8</sup> ဆၧနီၪလဂ့ၩ.- အဂဲးဘဲၫယီၩယရုစလံၫ့လၩ့ဎီးခွံၬဝ့ၫ, ဒဲယုဒၫဂၭဂီၩ့ဝ့ၫလီၫ. အဂဲးဘဲၫယီၩအဝ့ၫၥံၪအဖျ့ၩဒဲ အဆၧမၩနီၪထၫ့ဒုၪဒၩယဟိဝၩ ဘဲၫၥိၭအမိမၩဆၫအ",
			"9": "<sup>9</sup> ဆၧလၩဖၩ့အမ့ၬၥၪလီၫ.- အဝ့ၫၥံၪအမ့ၬဘျီၪထၪ့,ထိး အၥၭထၫ့ဒုၪဒၩအဝ့ၫၥံၪလီၫ. တၭအဝ့ၫၥံၪဒုၭဖျီၪအ ဆၧဒဲၩဘၭဘဲၫစီဒၧၫ့အၥိၭ, အီၪက့ၪၥူၪဝ့ၫအ့ၬ. အဝ့ၫ ၥံၪအၥၭဘၪအၡၪ့း အဂဲးဘဲၫယီၩ မွဲအမၩအၧၩ့လၩ့",
			"10": "<sup>10</sup> အၥၭဒၪဝ့ၫလီၫ.- စံၭနၥံၪဝ့ၫလၧၦတီၩၦလီၩ့နီၪ, လၧ ဆၧမိမုၬလၧအဝ့ၫဒၪအဂးနီၪဆံၭ. အဂဲးဘဲၫယီၩမွဲအ",
			"11": "<sup>11</sup> မိအၪ့ဘၪအဆၧမၩအဆၧၥၪလီၫ.- ၦအၧၩ့နီၪဘၪအ ၡၪ့လီၫ. အဂဲးဘဲၫယီၩဆၧမိဖ့ၪလၫ့အဝ့ၫဒၪ ဘဲၫအစူၪ",
			"12": "<sup>12</sup> မၩဆၧအၥိၭနီၪလီၫ.- ယၡၩခမျၧးယီၩ, ဆၧမၩအၧၩ့ ဝ့ၫနီၪမွဲဖိၪၥၪၥံၪ, ဒဲၦမုၪၥံၪပၧၩ့ဘၪဝ့ၫလီၫ. ယၡၩ ခမျၧးၥံၪဧ့,ၦလၧအၥိၫ့နၧၩ လဖၪနီၪ ဒုၭဂၭဖျိၭနၧၩ တၭ,မၩဂၭဂီၩ့ခွံၬနဖၧၩ့ၥၭ အဆၧလ့ၩဝ့ၫလီၫ.",
			"13": "<sup>13</sup> ယဟိဝၩဆၧၫ့ထုၪ့ဝ့ၫဘဲၫၥိၭအမိချဲၩ့ခွးတၭ, ဂဲထုၪ့ဝ့ၫ",
			"14": "<sup>14</sup> ဘဲၫၥိၭအမိစ့ၩရၫ့ၦဆၨၩၥံၪလီၫ.- ယဟိဝၩမိလ့ၩနုၬလၧ ဆၧစ့ၩရၫ့အဖၧၩ့, လၧအၡၩခမျၧးအၥုၪ့က့ၭၥၭၡါ, ဒဲ အၦဒိၪဖၭဒိၪလဖၪလီၫ. အဂဲးဘဲၫယီၩနၥံၪဝ့ၫဒၪယီၩ နၥံၪအၪ့ခွံၬယူၭ စဘံၭမုအလးယူၭ, ဆၧအၪ့ဂူၬန့လၧ",
			"15": "<sup>15</sup> ၦၡၪ့ဖိၪယၬဖိၪနီၪအီၪဝ့ၫလၧနၥံၪအဂံၪ့ဖၧၩ့လီၫ.- နၥံၪ ထးလၩ့ဘျ့ၭယၡၩခမျၧး, နၥံၪဂူၬန့ၦၡၪ့ဖိၪယၬဖိၪနီၪ မွဲဘၪလဲၪ. ကဆါ,ဆၧၥုၭမုခမျၧးအယဟိဝၩစံၭဝ့ၫဒၪ.",
			"16": "<sup>16</sup> ယဟိဝၩစံၭဝ့ၫဒၪ, မွဲလၧဇံအိၫ့အဖိၪမုၪၥံၪ,အၥၭ ထၪ့ထီၫတၭ, လ့ၩဆၧလၧအခိၬ ဘိၭထၪ့အၥၭတၭ, အၪ့လွ့ၫဆၧလၧအမ့ၬၥၪၥံၪတၭ, လ့ၩဆၧထွ့ၫအခၪ့ဒုၭ",
			"17": "<sup>17</sup> ဒုၭ,ဒဲမၩၥီၫဎွံၩ့ၥၪလၧအခၪ့,- တၭယဟိဝၩမိမၩချၩ ဇံအိၫ့အဖိၪမုၪအခိၪဎွံၪတၭ, ယဟိဝၩမိနဲၪဖျီၪထၪ့အ",
			"18": "<sup>18</sup> ခံးအဂၩ့အီၪၥူၪလဖၪအဆၧမ့ၬမဲလီၫ.- ဆၧလၧမုလနံၩ နီၪယဟိဝၩမိမၩန့ထၪ့ခွံၬအကယၧၩ့ဎွံၩ့ၥၪ, ဒဲအခိၪ",
			"19": "<sup>19</sup> ဖျၪ့,ဒဲဆၧအဝၩ့ဘဲၫလၩအၥိၭ,- ၥွ့ၫၥံၪ, ဒဲထဲၫ့ဎွံၪၥံၪ",
			"20": "<sup>20</sup> ဖဲၫၥံၪ,ဒဲအဆၧမၩဘံၭမ့ၬ,- ခိၪချၩ့ၥံၪ,ဒဲခၪ့ဒူၪအဆၧက ယၧၩ့ၥံၪ, ဒဲခၧၩ့ယးၥံၪ, ဒဲဆၧနၧၫ့မၧၫ့အကီၩ့ၥံၪ, ဒဲနါ ခွၩ့ၥံၪ,",
			"21": "<sup>21</sup> စူၪၥံၭၥံၪ,ဒဲနၫအခွၩ့ၥံၪ,- ဆၧအကီၩ့အ ၥိၭလၧအလူဒိၪဎွ့ၩဒိၪ, ဒဲဆဲၫ့ဖၭထီၫ, ဒဲဖၬဘဲၩ့ဖၭလဲ,",
			"23": "<sup>23</sup> ဒဲစ့ၩအထိၪ့,- ဒဲမ့ၬထံၫလၩၥံၪ,ဒဲဆဲၫ့ဖၫ့လၬ,ဒဲခိၪဖုၪ့,",
			"24": "<sup>24</sup> ဒဲဆၧမၩဘံၭမ့ၬလီၫ.- ဆၧမိမၩအၥၭလၧဆၧနၧၫ့မၧၫ့ အလးနီၪ, ဆၧနၧၫ့အုၪမိအီၪထၪ့တၭ,လၧခၧၩ့ယးအ လးနီၪဆၧအဖျံၩ, ဒဲလၧခိၪၥူၫဂ့ၩဘၪစဲၪအလးနီၪချၩ ခိၪ,ဒဲလၧဆၧကီၩ့ဆၧၥိၭဖၭလဲအလးနီၪ ရၧၬအခၧၩ့ ယးလၧဆၧအဎံၫအလၩအလးနီၪ ဆၧခိဎီၩအလး",
			"25": "<sup>25</sup> မိအီၪဝ့ၫလီၫ.- နၡၩခွၫၥံၪမိလၩ့ထံၩဖါလၧနၭ, နၡၩအ",
			"26": "<sup>26</sup> ဆီၪ့နီၪလၧဆၧဒုၭၥုၭအဖၧၩ့လီၫ.- အတရၫ့မိဂၪ့ဝ့ၫ ယၧၩ့ဝ့ၫတၭ,ၦမုၪနီၪအီၪယူဝ့ၫတၭ,မိဆၧၩ့နၩ့လၧဂၪ့ ခိၪအလီၩ့လီၫ."
		},
		"4": {
			"1": "<sup>1</sup> ဆၧလၧမုလနံၩနီၪ, ၦမုၪနွ့ၫဂၩမိဖီၪ့ထၬၦခွၫလ ဂၩတၭ,စံၭဝ့ၫ, ပမိအၪ့ပကိၪဒၪပဝ့ၫ, ဒဲပမိကီၩ့ၥိၭပ ကီၩ့ပၥိၭဒၪပဝ့ၫလီၫ. န့ၫအယီၩ, ဒုၭဖျိၬပၧၩလၧနမံၩ့ ဘဲၫၥိၭအမိမၩဖီၩ့ဖျ့ၭဆၧဒုၪဒွ့ၪပၧၩဆံၭ.",
			"2": "<sup>2</sup> ဆၧလၧမုလနံၩနီၪ ယဟိဝၩအထဲၩ့အဖၫ့မိအီၪလၧ ဆၧအဎံၫအလၩ, ဒဲဆၧလၩဖၩ့တၭ,ဂၪ့ခိၪအဆၧၥၪ လၧအဂ့ၩအဎံၫအလၩ, မွဲလၧၦအံၫစရ့လၭဖိၪလၧအ",
			"3": "<sup>3</sup> ဖီၩ့ဖျ့ၭဆၧအဂးလီၫ.- ဆၧမိမၩအၥၭလၧၦလၧအအီၪ လၩ့ထးလၧဇံအိၫ့အလီၩ့, ဒဲၦလၧအအီၪဒံၭလၧယရု စလံၫ့အဖၧၩ့နီၪ မိဘၪဆၧကိၭဝ့ၫလၧၦဆံၫ့ဎံၪ, ကယဲ ၦလၧအမံၩ့ကွ့ၭအၥၭလၧၦအမၧၫ့ လၧယရုစလံၫ့အ",
			"4": "<sup>4</sup> ကျၩနီၪး- ထီးယဟိဝၩအ့ၪၥူၫဝၭဆံၫ့ခွံၬဇံအိၫ့အဖိၪ မုၪၥံၪအကံၪအမူၭဂီၩ့, ဒဲမၩဆံၫ့ခွံၬ ယရုစလံၫ့အၥွံၪ လၧအကျၩလၧဆၧစ့ၩရၫ့အၥၭ, ဒဲလၧမ့ၪအၪ့ဆၧအ",
			"5": "<sup>5</sup> ၥၭလီၫ.- လၧခိၪလီၩ့ဇံအိၫ့ထၧၫ့ဖျိၪ့ယၫအလီၩ့, ဒဲလၧ အဆၧအီၪကီၪ့လဖၪအဖၫ့ခိၪနီၪ ယွၩမိတဲၩ့ဆၧအုၪ့ဒဲမ့ၪ ခူၪလၧမုဆၫလခီၫ,ဒဲမ့ၪလၪအခဲၩဖၩ့ လၧမုနၩလခီၫ လီၫ.အဂဲးဘဲၫယီၩ လၧဆၧလၩဖၩ့ထီးအလူၬအဖၫ့ ခိၪနီၪဆၧချႃၬဘံၭမိအီၪဝ့ၫလီၫ.",
			"6": "<sup>6</sup> တၭတဲၩမိအီၪဝ့ၫနးဖျိၪ့ လၧဆၧကဒုၩအဂးလၧဆၧ ခိလၧမုဆၫလခီၫအကၠီၩ့, ဒဲလၧဆၧဖလ့ၬအလးအဂး, ဒဲလၧဆၧအီၪကဒုၩအလး လၧလံၩမုအကၠီၩ့,ဒဲလၧ ဆၧဂဲၫဆၧၩ့အကၠီၩ့လီၫ."
		},
		"5": {
			"1": "<sup>1</sup> တၭယမိၥံၫကျံၩထၪ့ၦလၧယအဲၪဝ့ၫ, ၦလၧယအဲၪ ဝ့ၫအစဘံၭကျိၭ အဂဲးအကၠီၪ့လီၫ. ၦလၧယအဲၪဝ့ၫ လဂၩအီၪလၧအစဘံၭကျိၭ လၧခိၪလီၩ့ဖိၪအလီၩ့ဂၪ့",
			"2": "<sup>2</sup> ခိၪဂ့ၩလီၫ.- အဝ့ၫဒၪထနါထၬဝ့ၫတၭ, အၪ့ထုၫ့ထၪ့ခွံၬ လိးၥံၪတၭ, ၥုၪ့လၩ့စဘံၭမုအဂ့ၩထုၬ, မၩတၨၭခိၭ ဆၧလၧအၥၭကျၩလဖျိၪ့တၭ, ခုၪ့န့ဆၧယဲးစဘံၭၥၪ အလးလီၫ. အဝ့ၫဒၪယိလါ လၧအမိၥၪထၪ့စဘံၭၥၪ",
			"3": "<sup>3</sup> တၭးၥၪထၪ့ဝ့ၫလၧစဘံၭမံၩ့အၥၪလီၫ.- တၭဘိၩ့နဲၪ့ ယီၩ,ၦအီၪဝ့ၫလၧယရုစလံၫ့အဖၧၩ့, ဒဲယုဒၫအၡၩၥံၪ ဧ့,စ့ၩရၫ့လါဆၧလၧယၧၩဒဲယစဘံၭမုအလးနီၪဆံၭ.",
			"4": "<sup>4</sup> ဆၧမၩလၧယစဘံၭမုအဂးလၧယလမၩဘၪနီၪ, မွဲအ အီၪဒံၭလမံၩ့မံၩ့လဲၪ. ယယိလါလၧအမိၥၪထၪ့စဘံၭ ၥၪတၭ,ၥၪထၪ့စဘံၭမံၩ့အၥၪနီၪမွဲအဘၪဆၧနီၪလဲၪ.",
			"5": "<sup>5</sup> တၭဘိၩ့နဲၪ့ယီၩဂဲၫဘီၪ, ယမိဒုၭၥ့ၪယၫနၥံၪလၧဆၧ လၧယမိမၩယစဘံၭမုအလးနီၪလီၫ. ယမိထုၭခွံၬအ ထနါတၭ,မိကဲၪထၪ့ဆၧအၪ့အဆၪအလး, ယမိမၩ လၩ့ဎီးအခိၪဒၧၩ့တၭ, မိကဲၪထၪ့ဆၧယဲးထဲးအလး",
			"6": "<sup>6</sup> လီၫ.- တၭယမိအီၪက့ၪဝ့ၫလၧဆၧအီၪယူတၭ, မိဘၪ ဆၧဖ့ၬခိၫဝ့ၫအ့ၬ, ဆၧခုၪ့ဘိၪ့ထၪ့ဝ့ၫဆ့အ့ၬ. အ့ၪမွဲ ဆၧဆူၪအၪမံၩ့မိမဲၪထၪ့တၭ, ယမိမၪလူၬဆၧအုၪ့လၧ",
			"7": "<sup>7</sup> အထီးဒုၭဆၧၩ့လၩ့ဆၧဆၧၩ့လၧအဖၫ့ခိၪလဂ့ၩ.- အ ဂဲးဘဲၫယီၩ ဆၧၥုၭမုခမျၧးအယဟိဝၩ အစဘံၭမုအ လးနီၪမွဲအံၫစရ့လၭအဂံၪ့, ဒဲယုဒၫအၡၩနီၪ, မွဲအဆၧ ၥုၪ့လၩ့လမံၩ့ လၧအဘၪအၥၭလီၫ. တၭမွဲအယိလါ ဆၧစ့ၩရၫ့အဖၧၩ့ၥၭလါနၫ့တၭ, ယိခွါ,ဆၧလူၫလၩ့ ဆၧၥွံၪ,ယိလါဆၧတီၩဆၧလီၩ့အဖၧၩ့ၥၭတၭ, ယိခွါ, ဆၧကိၭၡၭထၪ့လီၫ.",
			"8": "<sup>8</sup> ၦလၧအမၩဘုၭစိၩဂံၪ့လဂံၪ့ဘၪလဂံၪ့, ဒဲလၧအအီၪ က့ၪဆံၬလးလလးဘၪလလး, ထီးအလးလအီၪလၧၩ့ ဘၪ, နၥံၪဝ့ၫဧ့,နၥံၪအီၪလၩ့ထ့ၬလဂၩဎးလၧခးအၥၭ",
			"9": "<sup>9</sup> ကျၩနီၪ, ဘၪအၡၪ့လီၫ.- လၧယနါဖၧၩ့ဆၧၥုၭမုခမျၧး အယဟိဝၩစံၭဝ့ၫ, မွဲမၬဂံၪ့အၪဖျိၪ့မိအီၪယူဝ့ၫ, အဖၭ ဒိၪဒဲအဂ့ၩတၭ, ၦၡၩမိအီၪဘၪလၧအဖၧၩ့နးဂၩအ့ၬ.",
			"10": "<sup>10</sup> အဂဲးဘဲၫယီၩ စဘံၭလးအ့ကၧၫလဆံၫနီၪ မိန့လဘၭ တၫ,ဆၧအချံၫဆံၫပိၩ့မိန့ထဲၩ့ဒီၭလပိၩ့လီၫ.",
			"11": "<sup>11</sup> ၦလၧအဂဲထုၪ့လၧဂီၩလခီၫဂီၩဂီၩလ့ၬ ဘဲၫၥိၭအမိ အီၩၥံၭထံၫဂၬထံၫအီၪဝ့ၫ ထီးမုဂၪလၩ့ထီးစဘံၭထံၫ",
			"12": "<sup>12</sup> ထိၪဂဲၩဝ့ၫနီၪ, ဘၪအၡၪ့လီၫ.- တၭနါဒံၩ့,ၥၫ့ထီး,ဒိၩ့ ၥံၪ,ပံၩၥံၪ,ဒဲစဘံၭထံၫနီၪအီၪဝ့ၫ လၧဆၧမၩဘိၪ့မၩပွ့ၩ အဖၧၩ့လီၫ. အ့ၪမွဲယဟိဝၩအဆၧမၩနီၪ အဝ့ၫၥံၪအီၪ က့ၪဝ့ၫလၧဆၧနးမံၩ့အ့ၬ. ဆၧလၧအမၩဝ့ၫလၧအစူၪ",
			"13": "<sup>13</sup> နီၪယိဆီၫ့မီၪ့ဝ့ၫဆ့အ့ၬ.- မၩအၥၭဘဲၫနီၪတၭ, ယၡၩ ခမျၧးလ့ၩကဲၪဎီးလၧဆၧၥ့ၪယၫ လအီၪဘၪအကၠီၩ့ တၭ,အၡၩလၧအလၩအဖၩ့အီၪလဖၪနီၪ ဘၪဆၧၥၭဝံ လၩ့ဒိၩ,ဒဲအဝ့ၫၥံၪအၡၩခမျၧးနီၪ ဎဲၫ့ထၬဝ့ၫလၧဆၧ",
			"14": "<sup>14</sup> ၥၭဝံအၥၭလၧထံၫအကၠီၩ့လီၫ.- မၩအၥၭဘဲၫနီၪတၭ, ဖျႃဖၧၩ့မၩလဲထၪ့အၥၭတၭ, အၩ့ထၪ့အနိၭဆံၭလဲ, ဆံၭလဲလဲၪနီၪအဆၧထိၪအီၪအ့ၬ. တၭအလၩအဖၩ့, ဒဲအၦဒိၪဖၭဒိၪၥံၪ, ဒဲအၡၩခမျၧး, ဒဲၦလၧအၥုၪ့ဎွံၫၥၭ",
			"15": "<sup>15</sup> ယီၫလၧအဖၧၩ့နီၪလ့ၩလၩ့ဝ့ၫထီးနီၪလီၫ.- ၦအၡၪ့ဘၪ ဆၧဆၪ့လၩ့ဝ့ၫ ဒဲၦဒိၪၦၡါၥံၪ ဘၪဆၧခွံၬလၩ့ခွံၬဝ့ၫ, ဒဲၦအီၪက့ၪဖိၫလိၫအၥၭ အမ့ၬၥၪဘၪဆၧဆၪ့လၩ့ဝ့ၫ",
			"16": "<sup>16</sup> လီၫ.- အ့ၪမွဲၥုၭမုခမျၧးအယဟိဝၩမိဘၪဆၧအီၪက့ၪ ထၪ့ထီၫဝ့ၫလၧဆၧစ့ၩရၫ့အဖၧၩ့, ဒဲယွၩအဆၧဆံၫ့ဎံၪ လဂၩမိဘၪဆၧအီၪက့ၪဆံၫ့ဎံၪဝ့ၫ လၧဆၧတီၩဆၧ",
			"17": "<sup>17</sup> လီၩ့အဖၧၩ့လီၫ.- တၭၥိၪဖိၪၥံၪမိအၪ့ ဆၧလၧအဆၧ အၪ့အဆၪအလး,ဒဲဆၧအဘီၪ့ၥံၪအလးအီၪယူဝ့ၫနီၪ ၦလခီၫဘၩ့မုးဖိၪမိအၪ့ဝ့ၫလီၫ.",
			"18": "<sup>18</sup> ၦလၧအမီၩ့ဆၧအၧၩ့ဆၧၥၫ့ လၧဆၧပျီၩပျီၩအဖျံၩ နီၪ,ဒဲမၩဆၧဒဲၩဘၭ လၧလဲၪ့အဖျံၩနီၪ, ဘၪအၡၪ့တၭး",
			"19": "<sup>19</sup> မွဲၦလၧအစံၭမွဲအမၩအ့ၪချဲၫ့တၭ, ဒုၭအီၪထၪ့အဆၧ မၩလၧအဆိၫအချဲၫ့ ဘဲၫၥိၭပမိဒၪဘၪဝ့ၫဆံၭ. တၭ ဘဲၫၥိၭပမိၥ့ၪယၫ အံၫစရ့လၭအဆၧဆံၫ့ဎံၪလဂၩအ",
			"20": "<sup>20</sup> ကိၪ့ထၪ့ဖၭလၩ့နီၪ, မွဲအၥုၭဘူၭအၥၭဆံၭ.- ၦလၧအ စံၭဆၧအၧၩ့မွဲဆၧဂ့ၩ, ဒဲဆၧဂ့ၩမွဲဆၧအၧၩ့, လၧအအီၪ က့ၪဆၧခံၭလၧဆၧဖၩ့အဂး, ဒဲဆၧဖၩ့လၧဆၧခံၭအဂး လၧအအီၪက့ၪဆၧခၪ လၧဆၧဆၧၫ့အဂး, ဒဲဆၧဆၧၫ့",
			"21": "<sup>21</sup> လၧဆၧခၪအဂးနီၪ,မွဲအဘၪအၡၪ့လီၫ.- ၦလၧအမွဲၦ ကိၪ့ၥ့ၪလၧအမ့ၬၥၪဒၪဝ့ၫအဖၧၩ့, ဒဲၦလၧအၥုၪ့ဖၭအ",
			"22": "<sup>22</sup> ၥၭဖၭလၧအမ့ၬယၫဒၪဝ့ၫအဖၧၩ့နီၪဘၪအၡၪ့လီၫ.- ၦ လၧအဆီၪ့ဝ့ၫဘဲၫၥိၭအမိအီၩစဘံၭထံၫ, ဒဲၦလၧအဂဲး",
			"23": "<sup>23</sup> အဘၭဆီၪ့ဘဲၫၥိၭအမိလဲၩဎုၬၥံၭထံၫဂၬထံၫ,- လၧအ အီၪက့ၪၦအၧၩ့လၧၦအဆၧမၪလအီၪဘၪ လၧလၬဆီၪ့ အကၠီၩ့တၭ, ထုၭထၪ့ခွံၬၦတီၩအဆၧတီၩနီၪ,မိဘၪအ",
			"24": "<sup>24</sup> ၡၪ့လီၫ.- မၩအၥၭဘဲၫနီၪတၭ,ဘဲၫမ့ၪလၪအဖျ့ၩအၪ့ ခွံၬလီထိၭအၥိၭ,ဒဲဘဲၫနၪ့ၥံၪမံၩ့ၥံၪအဎဲၫ့ လၧမ့ၪအၪ့ လၩ့ဘိၪဝ့ၫအၥိၭနီၪ, အဝံကဲၪထၪ့ဆၧအုၪဆၧကျၪတၭ, အဖီၫမိလ့ၩထၪ့ ဘဲၫဂၪ့ခိၪမုၬအၥိၭနီၪလီၫ. အဂဲး ဘဲၫယီၩ,မွဲအခွံၬၡိၭခွံၬယူၭ ဆၧၥုၭမုခမျၧးအယဟိ ဝၩအဆၧၥီၪ့ဆၧၥၫ့တၭ, လဒူၩလယၪ့ဘၪအံၫစရ့လၭ",
			"25": "<sup>25</sup> အဆၧဆံၫ့ဎံၪလဂၩ အလူအထၫလီၫ.- မၩအၥၭဘဲၫ နီၪတၭ, ယဟိဝၩအၥၭထၪ့ခဲၩထၪ့ဘၪ အၡၩခမျၧး တၭ,ယၩ့ထၪ့အစူၪထၫ့ဒုၪဒၩ အဝ့ၫၥံၪတၭ, ထးဝ့ၫ တၭ,ခိၪလီၩ့ၥံၪဝၭထိၬဝ့ၫတၭ, အဝ့ၫၥံၪအစွၪအီၪဝ့ၫ လၧဖၧၩ့ၥၭဖၧၩ့ဘဲၫဆၧအ့ၪအၥိၭနီၪလီၫ. လၧဆၧထီး အလူၬအကၠီၩ့နီၪအၥၭထၪ့လဆါလၩ့ဘၪတၭ, အစူၪ ယၩ့ထၪ့ဒံၭအၥၭလီၫ.",
			"26": "<sup>26</sup> အဝ့ၫဒၪမိဘိၭထၪ့ၥုၭဖိၪအလၫ့ လၧၦဆၨၩလၧအ အီၪလၧအယဲၩ့အဂးတၭ, မိယူၪလၧၦအီၪဝ့ၫလၧဂၪ့ ခိၪအထုၬၥံၪအဂးတၭ, ယိခွါ,အဝ့ၫၥံၪ မိဂဲၫချဲၫ့ချဲၫ့",
			"27": "<sup>27</sup> လီၫ.- ဆၧပွံၭအၥၭနးဂၩအ့ၬး တၭအခၪ့ဘၪထၧၩ့နး ဂၩအ့ၬးၦမံၫဒဲမံၫခံၫ့နးဂၩအ့ၬး တၭအခၧၩ့ယးလၩ့",
			"28": "<sup>28</sup> ပၠၪအ့ၬးတၭအခၪ့ဖံၭဖျံၩထ့ၬဘၪအ့ၬး- အဖျါစူၩဝ့ၫ တၭ,ဆၪ့ထၪ့အချံၪၥံၪထီးအလူၬ, အကၥ့ၪအခၪ့မံၪ မၩအၥၭဘဲၫလိးမ့ၪအၥိၭတၭ, အလဲၪ့ပၪဘဲၫလံၩၥဝံၭ",
			"29": "<sup>29</sup> အၥိၭလီၫ.- အဝ့ၫၥံၪမိယုၩ့ဆၧဘဲၫဆၬလၥၧၫ့အၥိၭ တၭ,ယုၩ့ဆၧဘဲၫဆၬလၥၧၫ့ဖိၪအၥိၭတၭ, မွဲမၬ, မိ ယုၩ့ဆၧဒဲဖီၪ့န့ဆၧ, ဒဲထဲၩ့ဆိၬခွံၬဆၧတၭ, ဆၧမၩဂၭ",
			"30": "<sup>30</sup> ဖျ့ၭအီၪအ့ၬ.- ဆၧလၧမုလနံၩနီၪ အဝ့ၫၥံၪမိယုၩ့ဆၧ ထၫ့ဒၩအဝ့ၫၥံၪ ဘဲၫမၫဆမံၭၥီၫအၥိၭနီၪလီၫ. တၭၦ မိယိဆၧလၧခးနီၪတၭ, ယိခွါ, ဆၧခံၭဒဲဆၧခိဆၧဝီၩ ဒဲဆၧဖၩ့လၧဆၧဖိၭဖၫ့ခံၭလၩ့ဝ့ၫဒၪလီၫ."
		},
		"6": {
			"1": "<sup>1</sup> လၧစဎွၩအၧၭဇဲအၫၥံၫဝ့ၫလနံၪ့နီၪ ယဒၪဘၪကဆါ ဆၧၫ့နၩ့လၧအလးဆီၩ့ဆီထၪ့ထီၫဝ့ၫ ထီၫထီၫလ့ၬအ ဖၫ့ခိၪတၭ, အဝိၬလိၫ့အခၪ့ထံၭနီၪဎွ့ၩအနီးဖၧၩ့လီၫ.",
			"2": "<sup>2</sup> စ့ၫရဖံၫ့ၥံၪ ဆၧၫ့ထုၪ့လၧအဖၫ့ခိၪလီၫ. လဂၩအီၪလၧ အဒံၭဎူၫဘံၪ့,လဂၩအဒံၭဎူၫဘံၪ့လီၫ. မၩဘံၭအမ့ၬ နံၫဘံၪ့,မၩဘံၭအခၪ့နံၫဘံၪ့, ဒဲယူၩဝ့ၫလၧအဒံၭနံၫ",
			"3": "<sup>3</sup> ဘံၪ့နီၪလီၫ.- အလဂၩကိၭထၪ့လၧအလဂၩဒၪနီၪတၭ, စံၭဝ့ၫဒၪ, ဆၧၥုၭမုခမျၧးအယဟိဝၩနီၪ, ဆံၫ့ဎံၪဝ့ၫၬ ဆံၫ့ဎံၪဝ့ၫၬဆံၫ့ဎံၪဝ့ၫလီၫၬ တၭဂၪ့ခိၪယီၩဎွ့ၩဝ့ၫလၧ အလၩအဖၩ့ဎံၩ့ဎံၩ့လ့ၬလီၫ.",
			"4": "<sup>4</sup> တရၫ့အထုၪ့ဝၭဝ့ၫ လၧၦလၧအကိၭထၪ့ဆၧအၥီၫ အကၠီၩ့တၭ, ဂံၪ့ဎွ့ၩဝ့ၫလၧမ့ၪခူၪလီၫ.",
			"5": "<sup>5</sup> ထီးနီၪလဖၧၫ့ယစံၭ,ယဘၪယဝ့ၫဆၧအၡၪ့ဖီၩၬ အဂဲးဘဲၫယီၩယဘၪဆၧမၩဂၭဂီၩ့ယၧၩ လၧယမွဲၦလၧ အနိၭဖျံၩလဆံၫ့ဘၪလဂၩ, ဒဲယအီၪလၧၦလၧအနိၭ ဖျံၩလဆံၫ့ဘၪလဆၨၩအကျၩအကၠီၩ့နီၪလီၫ. အဂဲး ဘဲၫယီၩယမ့ၬၥၪဒၪဘၪယူၭစဎွၩလဂၩ, ဆၧၥုၭမုခ",
			"6": "<sup>6</sup> မျၧးအယဟိဝၩယူၭ.- ထီးနီၪလဖၧၫ့ စ့ၫရဖံၫ့လဂၩ ယူၩဝ့ၫထီၩ့လၧယအီၪ မ့ၪအၧၩ့ဖၭအီၪဝ့ၫ လၧအစူၪ ဖၧၩ့လၧအမၩန့ခွံၬဝ့ၫလၧနိၪထံၬ လၧဆၧလုလးအဖၫ့",
			"7": "<sup>7</sup> ခိၪး- ဒုၭထိၭဝ့ၫလၧယနိၭတၭ, စံၭဝ့ၫဒၪ, ယိခွါ, ဆၧ ယီၩထိၭယူၭနနိၭဖျံၩယူၭး တၭဆၧကွဲၪဖျါယူၭနဆၧ အမၪယူၭး တၭနဆၧဒဲၩဘၭဖီၩ့ဖျ့ၭဝ့ၫလီၫ.",
			"8": "<sup>8</sup> တၭယနါဂၧၫ့ဆ့ကဆါအလူစံၭဝ့ၫဒၪ, ယမိအၪ့မၧၫ့ လၩ့ပလၫလဂၩလဲၪ. တၭမွဲပလၫမိလ့ၩလၧပဂးလဲၪ. တၭ,ယစံၭ, ယိခွါ,ယၧၩတၭ အၪ့မၧၫ့လၩ့န့ယၧၩ",
			"9": "<sup>9</sup> ဘီၪ.- အဝ့ၫနီၪစံၭဝ့ၫဒၪ, လ့ၩဘီၪ, လီၩဘၪၦခမျၧး ယီၩ,နါဂၧၫ့ဆၧနီၪနၥံၪနါဂၧၫ့ဘၪလါနၫ့တၭ, နၥံၪနၪ ဆၧၥ့ၪအ့ၬ. ဒၪဆၧနီၪနၥံၪဒၪဘၪလါနၫ့တၭ, နၥံၪၥ့ၪ",
			"10": "<sup>10</sup> ယၫဆၧအ့ၬ.- မၩဘီၪ့ၥိၪၦခမျၧးယီၩအၥၭ, မၩဎၧၫ့အ နါ,ဒဲဒုၭဘံၪ့အမ့ၬဆံၭ. မိဒၪဘၪခိၬဆၧလၧအမ့ၬ, ဒဲ နါဂၧၫ့ဘၪခိၬဆၧလၧအနါ, ဒဲနၪၥ့ၪဘၪခိၬဆၧလၧအ ၥၭ,ဒဲကၠၪလီၩ့ဘၪခိၬအၥၭဒဲဘျၪထဲၩ့ဝ့ၫလီၫ.",
			"11": "<sup>11</sup> ထီးနီၪလဖၧၫ့ယစံၭ, ကဆါဧ့,ဆံၭယံၬလဲၪ. တၭ အဝ့ၫဒၪစံၭ, ထီၩ့လၧဒိၩ့ၥံၪမိအီၪယူဝ့ၫလၧၦၡၩလအီၪ ဘၪအကၠီၩ့, ဒဲဂံၪ့ၥံၪမိအီၪယူဝ့ၫလၧၦၡၩလအီၪ",
			"12": "<sup>12</sup> ဘၪအကၠီၩ့တၭ, ထံၫၥံၪခးၥံၪအီၪယူအီၪယီၫ့,- ထီး ယဟိဝၩမိအီၪက့ၪခွံၬၦၡၩလၧအယဲၩ့တၭ, ဆၧလ့ၩ",
			"13": "<sup>13</sup> ဒၪခွံၬဖၭဒိၪမိအီၪလၧခးအၥၭကျၩနီၪလီၫ.- မွဲလါနၫ့ ဘဲၫနီၪတၭ, ဆံၫပိၩ့လပိၩ့မိအီၪလၩ့ထး လၧအဖၧၩ့ တၭ,အနီၪမိဂဲၫထဲၩ့တၭ, ဆၧမိမၩဂၭဂီၩ့ဝ့ၫဒၪလီၫ. မွဲလါနၫ့ဘိၩ ဘဲၫၥံၪ့ဖၭဒိၪ, ဘဲၫၥံၪ့ထိၭဖၫ လၧအခါ လၩ့တၭ,အခိၪဆုၪ့အီၪလၩ့ထးအၥိၭနီၪ, ဆၧအချံၫ ဆံၫ့ဎံၪမိအီၪဒံၭဝ့ၫဘဲၫနီၪၥိၭလီၫ."
		},
		"7": {
			"1": "<sup>1</sup> တၭလၧယုဒၫအစဎွၩအၧၭဇဲအၫအဖိၪခွၫ, စယိၥၫ့ အဖိၪခွၫ,စအၫဟဇၭအမုနံၩလဖၪနီၪ, ဆၧမၩအၥၭ လၧၦစံရအၫအစဎွၩရံဇံၫ့, ဒဲအံၫစရ့လၭအစဎွၩရ့ၫ မလဲအၫအဖိၪခွၫစပံကၫနီၪ ဂဲၫထၪ့ဝ့ၫလၧယရုစလံၫ့ ဘဲၫၥိၭအမိဒုၭထၫ့ဒုၪဒၩဝ့ၫ, မွဲလါနၫ့ဘိၩဒုၭထၫ့ဒၩဝ့ၫ",
			"2": "<sup>2</sup> န့အ့ၬ.- တၭၦလီၩဘၪစဒၫဝံၭအၡၩဂံၪ့ဖိၪ, စံၭဝ့ၫ,စံရ အၫနီၪအီၪက့ၪဎုၬအၥၭလၧအံဖြံၫ့လီၫ. တၭစဎွၩအ ၥၭဒဲၦခမျၧးအၥၭနီၪဘၪဆၧထိၪဂဲၩဝ့ၫဘဲၫၥံၪ့လၧမံၩ့ လၬကျၩလၧလံၩမၩဝၭဝ့ၫအၥိၭနီၪလီၫ.",
			"3": "<sup>3</sup> တၭယဟိဝၩစံၭစအဲၫစ့ယၫ, လ့ၩအၪ့ဂၬစအၫဟ ဇၭ,နဝ့ၫဒၪ ဒဲနဖိၪခွၫစၡံအၫယၫၡၧၭ ထီးကမၫအထုၬ လၧထၭလစီၪ့ထီးၦအၪ့ဆူၫဝၭဆၧအဂၪ့ခိၪဝၩ့အဖၧၩ့",
			"4": "<sup>4</sup> ၥၭမုဆံၭ.- စံၭအဝ့ၫဒၪထီးလၩ့နၥၭတၭ, အီၪလၩ့မါ ပံၭဆံၭး ၥၭမဲၪဆၧလဂ့ၩ, ထီးအီၪက့ၪလၩ့ဆါ နၥၭ လၧမ့ၪလၧအမ့ၪခူၪထၪ့နံၫဘီၩ့နီၪ, လၧစရံဇံၫ့, ဒဲၦစံရ အၫဖိၪဒဲစရ့ၫမလဲအၫအဖိၪခွၫအၥၭထၪ့ဆီၪ့အကၠီၩ့",
			"5": "<sup>5</sup> နီၪလဂ့ၩ,- မွဲလၧစံရအၫ,အံဖြံၫ့,ဒဲစရ့ၫမလဲအၫအဖိၪ",
			"6": "<sup>6</sup> ခွၫကိၪ့ထၪ့ဆၧအၧၩ့ထၫ့ဒုၪဒၩနၧၩတၭ, စံၭဝ့ၫ,- မွဲပ လ့ၩထၪ့ထၫ့ဒုၪဒၩၡီၩ့ယုဒၫ, ဒဲမၩၥၭမဲၪဝ့ၫဆံၭး မွဲပ အၪ့နၩ့ဖၭန့လၧပဂးဒၪပဝ့ၫတၭ, အီၪက့ၪထၪ့စဎွၩနး ဂၩလၧအၥၭကျၩ, စတၫဘအ့လၭ အဖိၪခွၫနီၪဆံၭ.",
			"7": "<sup>7</sup> ကဆါယဟိဝၩစံၭဝ့ၫဘဲၫယီၩ, ဆၧနီၪ,အီၪဂုးအီၪခၧၫ့ ဘၪအ့ၬး မၩဘၪအၥၭဘဲၫနီၪဆ့အ့ၬ.",
			"8": "<sup>8</sup> အဂဲးဘဲၫယီၩစံရအၫအခိၪ မွဲဒမၭစကၧၭတၭ,ဒမၭ စကၧၭအခိၪမွဲစရံဇံၫ့တၭ, လၧဎူၫဆံၫယဲနံၪ့အထးဖၧၩ့ နီၪ,အံဖြံၫ့မိခါလၩ့ဝ့ၫတၭ, ကဲၪလၧၩ့ၦလဆၨၩအ့ၬ.",
			"9": "<sup>9</sup> အဂဲးဘဲၫယီၩ အံဖြံၫ့အခိၪ မွဲစမ့ရအၫတၭ, စမ့ရအၫ အခိၪမွဲစရ့ၫမလဲအၫအဖိၪခွၫလီၫ. နၥံၪအ့ၪလနဲၩဘၪ တၭ,နၥံၪမိအီၪဂုးအီၪခၧၫ့ဘၪအ့ၬ.",
			"10": "<sup>10</sup> ယဟိဝၩချဲၩ့ဒီၭဆၧလၧစအၫဟဇၭတၭစံၭဝ့ၫဒၪ,",
			"11": "<sup>11</sup> အၪ့ကံၩ့ဆၧမၩနဲၪ့နးမံၩ့ လၧယဟိဝၩနယွၩလၧနဂး ဒၪနဝ့ၫဆံၭ. လၧဆၧယိၬဖၧၩ့မွဲဂ့ၩ, လၧဆၧထၪ့ထီၫ",
			"12": "<sup>12</sup> မွဲဂ့ၩ,အၪ့ကံၩ့နဝ့ၫဆံၭ.- တၭစအၫဟဇၭစံၭဝ့ၫဒၪ, ယအၪ့ကံၩ့အ့ၬ, ယကျဲၩ့ဖစီၩ့ယဟိဝၩဆ့အ့ၬ.",
			"13": "<sup>13</sup> တၭစအဲၫစ့ယၫစံၭဝ့ၫဒၪ, စဒၫဝံၭအၡၩဂံၪ့ဖိၪၥံၪဧ့, ခိၭနၪဘီၪး မၩထံၬထၬၦၡၩနီၪမွဲဆၧအဆံၭလမံၩ့တၭ,",
			"14": "<sup>14</sup> မွဲနၥံၪမိမၩထံၬထၬယွၩဆ့ဧၪ.- မၩအၥၭဘဲၫနီၪတၭ, ယဟိဝၩအနၫ့ဆါဒၪဝ့ၫ, မိဖ့ၪလၫ့နၥံၪလၧဆၧမၩနဲၪ့ နးမံၩ့,ယိခွါ, ၦမုၪနၩ့လဂၩမိဒၧၩ့ထၪ့တၭ, ဆီၫ့အီၪန့",
			"15": "<sup>15</sup> အဖိၪခွၫတၭ, မိဖျိၬအမံၩ့အမၫ့နုၫအ့လၭလီၫ.- အဝ့ၫ ဒၪမိအၪ့ထီပၭ ဒဲန့ၫစၩ့ထီးအၥ့ၪယၫခွံၬၡိၭဆၧအၧၩ့,",
			"16": "<sup>16</sup> ဒဲရွံန့ဆၧဂ့ၩလီၫ.- အဂဲးဘဲၫယီၩ ဘိၩ့ဖိၪၥၪလချႃၭၥ့ၪ ယၫခွံၬၡိၭဆၧအၧၩ့, ဒဲရွံန့ဆၧဂ့ၩဒံၭဘၪနီၪတၭ, စဎွၩ နံၫဂၩလၧအမၩခိမၩဝီၩနၧၩအခးနီၪမိအီၪယူဝ့ၫလီၫ.",
			"17": "<sup>17</sup> မွဲလါနၫ့တၭ,ယဟိဝၩမိဒုၭဘၪနၧၩ, ဒဲနၡၩခမျၧးဒဲ နဖါအၡၩဂံၪ့ဖိၪနီၪမုနံၩလဖၪလၧအဂဲၫဘၪ, ခီၫလၧမု နံၩလၧအံဖြံၫ့စဲၪ့ဖၭယုဒၫ ဘဲၫၦစံၭဆၧအၥိၭအစံရအၫ",
			"18": "<sup>18</sup> အစဎွၩနီၪလီၫ.- တၭလၧမုလနံၩနီၪဆၧမိမၩအၥၭ လၧယဟိဝၩမိယူၪဝ့ၫ လၧဒူၩလၫလၧအအီၪလၧအံဇံၭ အထံၫမိၡါၥံၪအနဲၩ့အဂး, ဒဲန့ၫလၧအအီၪဝ့ၫ လၧအ",
			"19": "<sup>19</sup> စံရအၫအခးဖၧၩ့အဂးလီၫ.- အဝ့ၫၥံၪမိဂဲၫဝ့ၫတၭ,ထီး အလူၬမိဆီးလၩ့ဝ့ၫ လၧခိၪလီၩ့ဆူၭအီၪယူအဖၧၩ့,ဒဲ လၧလိးၥံၪလဲၫ့ၥံၪအဆူၭဖၧၩ့, ဒဲလၧဆၧဆူၪထီးအလူၬ အလီၩ့, ဒဲလၧကယဲဆၧအၪ့အဆၪအလးထီးအလူၬ",
			"20": "<sup>20</sup> အဖၧၩ့လီၫ.- ဆၧလၧမုလနံၩနီၪယဟိဝၩမိလိၩ့ဆၧ အခိၪၥူၫလၧဒီၩလိၩ့ဆၧ လၧအဘၪဆၧအၪ့လံၩ့ဝ့ၫလ ဘံၪ့လၧၦအီၪလၧထံၫမိၡါဝါလခီၫ, လၧစံရအၫအ စဎွၩ,အခိၪဎွံၪဒဲအခၪ့ဆီၪ့တၭး မိမၩလူၬခွံၬဝ့ၫအနိၭ ဆီၪ့ဆ့လီၫ.",
			"21": "<sup>21</sup> တၭလၧမုလနံၩနီၪဆၧမိမၩအၥၭလၧၦလဂၩမိအၪ့",
			"22": "<sup>22</sup> ဘုၪချီမိအဘၪ့နးဒုၩ,ဒဲၥိၪနံၫဒုၩလီၫ.- တၭဆၧမိမၩအ ၥၭလၧအဝ့ၫဒၪမိအၪ့ဘၪထီပၭလၧဆၧနူထံၫအၪလၧ အဝ့ၫၥံၪမိဖ့ၪလၫ့အကၠီၩ့လီၫ. အဂဲးဘဲၫယီၩၦလၧအ အီၪလၩ့ထးလၧခးဖၧၩ့နီၪ, မိအၪ့ထီပၭ, ဒဲန့ၫစၩ့ကိၭ",
			"23": "<sup>23</sup> ဂၩဒ့ၭလီၫ.- တၭမုနံၩနီၪဆၧမိမၩအၥၭလၧထီးဒၪအ လးလၧစဘံၭမုအီၪလထီၫ့ကြၨၭလၧစ့ၩလထီၫ့လစီၪ့",
			"24": "<sup>24</sup> လါလါနီၪမိကဲၪထၪ့ဆၧဆူၪအၪမံၩ့အလးလီၫ.- ၦၡၩ မိဂဲၫထီးနီၪ လၧဖျါၥံၪဒဲလၧချံၪၥံၪး အဂဲးဘဲၫယီၩခး",
			"25": "<sup>25</sup> ထၧၫ့ဘံၪ့ယၫနီၪ အီၪလၧဆၧဆူၪအၪမံၩ့လီၫ.- တၭ ကယဲခိၪလီၩ့ထိၩ့ချိၬလၧၦခုၪ့ဝ့ၫလၧဎ့ၬချီၩ့နီၪ ၦလ လ့ၩဘၪလၧအလီၩ့ လၧဆၧၥၭမဲၪ ဆၧဆူၪၥံၪအကၠီၩ့ လီၫ.အ့ၪမွဲမိကဲၪထၪ့ချီၥံၪလ့ၩဆၧအလး, ဒဲၥိၪၥံၪဘ့ၪ ၥံၪလ့ၩဝံၩ့ဝၩ့ဆၧအလးလီၫ."
		},
		"8": {
			"1": "<sup>1</sup> ယဟိဝၩစံၭယၧၩ, မၩန့ဆၧပၪပဲၪဖၭဒိၪနးဘံၪ့လၧ နဂးတၭ, ကွ့ၭမဟၧၫၡလၫဟၭၡဘၭ အဂဲးအကၠီၪ့",
			"2": "<sup>2</sup> လၧအလီၩ့လၧၦၡၩအထိၪဒံၭဆံၭ.- တၭယဝ့ၫဒၪယီၩ ယမၩန့ၦထိးအၥၭ အမွဲအတီၩ ၦလုဆၧစယုၫရဲအၫ, ဒဲစယ့ၭဘြံၫခဲအၫအဖိၪခွၫစဇ့ၭခရဲအၫ, ဘဲၫၥိၭအမိ",
			"3": "<sup>3</sup> ထိးအၥၭလီၫ.- ယၥုၭဘူၭယၥၭ လၧမီၪမုၪအအီၪ တၭ,အဝ့ၫဒၪဒၧၩ့ထၪ့ဝ့ၫတၭ, ဆီၫ့အီၪန့အဖိၪခွၫလ ဂၩလီၫ.ထီးနီၪလဖၧၫ့ ယဟိဝၩစံၭယၧၩ, ဖျိၬအမံၩ့",
			"4": "<sup>4</sup> မဟၧၫၡလၫဟၭၡဘၭနီၪဆံၭ.- အဂဲးဘဲၫယီၩဖိၪၥၪ လချႃၭၥ့ၪယၫကိၭဆၧ, ယမိဧ့,ဒဲယဖါဧ့နီၪတၭ, ၦမိ ဆိၬထၪ့ခွံၬဒမၭစကၧၭအစူၪလးအခၪ့ခိၪ, ဒဲစမ့ရအၫ အဆၧအၪ့ဂူၬန့ လၧအစံရအၫအစဎွၩအမ့ၬယၫလီၫ.",
			"5": "<sup>5</sup> မွဲလၧၦခမျၧး ယီၩခွံၬၡိၭခွံၬၡလိအၫအထံၫၥံၪ လၧအလၩ့ယွၩၡီၪ ၡီၪတၭ, ၥၭထိၬဝ့ၫလၧစရံဇံၫ့ ဒဲစရ့ၫမလဲအၫအဖိၪခွၫ",
			"7": "<sup>7</sup> အကၠီၩ့တၭ,- ယိခွါ,ကဆါမိဒုၭဂဲၫလၧအဖၫ့ခိၪထံၫ မိၡါအထံၫဆီၪ့ဒဲအၪ, အစံရအၫအစဎွၩ,ဒဲအကယး ကဖးထီးအလူၬတၭ, မိထၪ့ထီၫနဲၪ့အကၠီၪ့ၥံၪထီးအ",
			"8": "<sup>8</sup> လူၬတၭ,မိလုၬဘံၭအနဲၩ့ထီးအလူၬလီၫ.- မွဲအမိခၫ့ ဂၬယုဒၫတၭ, မိလုၬဘံၭဆၧတၭ,လ့ၩဆၧလၧအဖၫ့ ခိၪလီၫ.မိထၪ့ဘၭၦအခိၬတၭ, အယၩ့ထၪ့အဒံၭမိ",
			"9": "<sup>9</sup> ဎွ့ၩနခး, အမၫ့နုၫအ့လၭဧ့ၬ- အီၪကီၪ့မၩၡီၩ့လိၬနၥံၪ အၥၭ,ၦခမျၧးၥံၪဧ့, တၭနၥံၪမိဘၪဆၧမၩခါလၩ့ဘျ့ၭ နၥံၪဝ့ၫလီၫ. ၦအီၪလၧခးယဲၩ့ၥံၪဧ့,ခိၭနၪဆံၭ, ခဲးထူၬ နၥံၪအယးဒံၩ့လါနၫ့တၭ, နၥံၪမိဘၪဆၧမၩခါလၩ့ ဘျ့ၭနၥံၪဝ့ၫလီၫ. ခဲးထူၬနၥံၪအယးဒံၩ့လါနၫ့တၭ, န",
			"10": "<sup>10</sup> ၥံၪမိဘၪဆၧမၩခါလၩ့ဘျ့ၭနၥံၪဝ့ၫလီၫ.- ကိၪ့လိၬဆၧ ဆံၭးမွဲလါနၫ့တၭမိကဲၪထၪ့ဆၧပျီၩပျီၩလီၫ. ချဲၩ့ဆၧ ချဲၩ့ဆံၭ,မွဲလါနၫ့မိအီၪဂုးအီၪခၧၫ့အ့ၬ. အဂဲးဘဲၫယီၩ ယွၩအီၪလၧပၥိၭလီၫ.",
			"11": "<sup>11</sup> အဂဲးဘဲၫယီၩ ယဟိဝၩစံၭယၧၩဘဲၫယီၩ, လၧအ စူၪဆီၪ့, ဒဲၥီၪ့ထဲၩ့ယၧၩဘဲၫၥိၭယထီးဖိၬၦခမျၧးယီၩ",
			"12": "<sup>12</sup> အဖၧၩ့ၥၭလဂ့ၩ.- တၭစံၭဝ့ၫဒၪ, ကယဲဆၧလၧၦခ မျၧးယီၩကိၭဝ့ၫ, အဆၧမၩၡီၩ့လိၬအၥၭလမံၩ့လါလါ နီၪ,ကိၭနၥံၪဝ့ၫ လၧဆၧမၩၡီၩ့လိၬအၥၭနီၪလဂ့ၩ, တၭဆၧလၧအဝ့ၫၥံၪ ၥၭမဲၪအလးနီၪၥၭမဲၪနၥံၪဝ့ၫလ",
			"13": "<sup>13</sup> ဂ့ၩး အၪ့ယိၪဆၧလဂ့ၩ.- မွဲနၥံၪအီၪက့ၪဆံၫ့ဎံၪဆၧ ၥုၭမုခမျၧးအယဟိဝၩ အနၫ့ဆါဒၪဝ့ၫနီၪဆံၭ, အဝ့ၫ ဒၪမိကဲၪထၪ့နၥံၪၥၭမဲၪဆၧအလး, ဒဲနၥံၪအၪ့ယိၪဆၧ",
			"14": "<sup>14</sup> အလးလီၫ.- အဝ့ၫဒၪမိကဲၪထၪ့ဆၧဆံၫ့ဎံၪအလး,ဒဲ လိးဘၪထၧၩ့ဘၪထံၭအလး, ဒဲလိးလၩ့ထံၩဖါအလး လၧအံၫစရ့လၭနံၫဂံၪ့လူၬအဂး ဒဲၡၬ ဒဲဖျံၩခွၩ့လၧၦ",
			"15": "<sup>15</sup> ယရုစလံၫ့ဖိၪအဂးလီၫ.- ၦအၪဂၩလၧအကျၩနီၪမိ ဘၪထၧၩ့ဘၪထံၭ, ဒဲမိလၩ့ထံၩဖါ,ဒဲမိဘၪဆၧမၩခါ လၩ့ဝ့ၫ, ဒဲမိဘၪဖျံၩခွၩ့ ဒဲမိဘၪဆၧဖီၪ့န့ဝ့ၫလီၫ.",
			"16": "<sup>16</sup> ထူၫထၪ့ဆၧထိးအၥၭ, စဲၩနဲၪ့ထၬဆၧၥီၪ့ဆၧၥၫ့လၧ",
			"17": "<sup>17</sup> ယထံၩယဖျဲအကျၩဆံၭ.- တၭယမိအီၪခိၭယဟိဝၩ လၧအအီၪက့ၪၥူၪခွံၬအမ့ၬ လၧစယၫကူၭ အဂံၪ့ဖိၪ",
			"18": "<sup>18</sup> တၭ,ယမိယိလါအဖၧၩ့ၥၭလီၫ.- ယိခွါ,ယဝ့ၫဒၪဒဲယ ဖိၪၥံၪလၧယဟိဝၩဖ့ၪလၫ့ယၧၩယီၩ, မွဲလၧဆၧမၩနဲၪ့ လၩ့လၭ, ဒဲဆၧလၩ့လိလၩ့လၭအဂးလၧအံၫစရ့လၭ အကျၩ, လၧဆၧၥုၭမုခမျၧးအယဟိဝၩ အအီၪလၧ",
			"19": "<sup>19</sup> အအီၪဝ့ၫလၧခိၪလီၩ့ဇံအိၫ့အလီၩ့လီၫ.- တၭထီးၦ စံၭနၥံၪ,အၪ့ဎူၫအၪ့ဎၬ ဆၧလၧၦလၧဆၧနၪအီၪလၧ အလီၩ့အအီၪ, ဒဲၦလၧဆၧယူၬအီၪလၧအချဲၩ့ဘံၪၥွံၫ ဆၧနီၪတၭး စံၭ,ၦခမျၧးမိအၪ့ဎၬဘၪဆၧလၧယွၩအ အီၪနီၪ,မွဲအ့ၬဧၪ. ဆၧဘၪဆဲၫ့လၧၦအမၧၫ့နီၪ,မွဲအဝ့ၫ",
			"20": "<sup>20</sup> ၥံၪမိအၪ့ဎူၫအၪ့ဎၬ လၧၦအၥံၫအအီၪဆ့ဧၪ.- အၪ့ဎူၫ အၪ့ဎၬဆၧလၧဆၧၥီၪ့ဆၧၥၫ့အအီၪနီၪဆံၭ. အဝ့ၫၥံၪ အ့ၪလချဲၩ့ဘၪဘဲၫဆၧချဲၩ့နီၪအၥိၭတၭ, မွဲလၧဆၧဖၩ့ အီၪလၧအဖၧၩ့နးဆံၭအ့ၬ.",
			"21": "<sup>21</sup> အဝ့ၫၥံၪမိခၫ့ဂၬထံၫၥံၪခးၥံၪတၭ, ဘၪဆၧကၪဆၧဂဲၩ ဒဲဆၧၥၭဝံလၩ့ဒိၩတၭ, ဆၧမိမၩအၥၭ ထီးဆၧၥၭဝံအ ၥၭနီၪအၥၭမိခိထၪ့ဝ့ၫတၭ, မိဆိၪအၧၩ့အစဎွၩ ဒဲအ",
			"22": "<sup>22</sup> ယွၩတၭ,- မိယိထၪ့ဆၧ လၧထၭလခီၫး ဒဲမိယိဆၧ လၧဂၪ့ခိၪတၭး ယိခွါ, ဆၧခိဆၧဝီၩဒဲဆၧခံၭ, ဒဲအဝ့ၫ ၥံၪမိခံၭလၩ့ဝ့ၫ လၧဆၧခိဆၧဝီၩအကၠီၩ့တၭ, ဘၪဆၧ နၫ့ထၪ့ခွံၬဝ့ၫလၧဆၧခံၭကျၩလီၫ."
		},
		"9": {
			"1": "<sup>1</sup> မွဲလါနၫ့ဘဲၫနီၪတၭ, ဆၧခံၭနီၪအီၪဘဲၫလၧအဘၪ ဆၧမၩအၧၩ့မၩနၭဝ့ၫအၥိၭနီၪမွဲအ့ၬ. ဘဲၫအဆၧၫ့အ ထီအခၪ့ထံၭလၧအမၩကြၩ့ထမးခးဇ့ၭဘလၧၫ့, ဒဲခး နၭၥလဲၫအၥိၭနီၪ, အဆၧၫ့အထီလၧအလးခဲၫ့တၭး မၩ ၡၪ့မၩနၭအၪနဲၪ့လၧမၫဆမံၭအဖၧၩ့ၥၭ, ယီၫဒၫ့အနဲၩ့ ထံၭးဂၫလလံၫဘၪဆဲၫ့လၧၦဆၨၩလဖၪဘဲၫနီၪၥိၭလီၫ.",
			"2": "<sup>2</sup> ၦခမျၧးလၧအလ့ၩဆၧ လၧဆၧခံၭကျၩနီၪဒၪ ဘၪဆၧဖၩ့ဖၭဒိၪယူၭ. တၭၦလၧအအီၪဝ့ၫလၧဆၧ ၥံၫအလၩၡုၪအခးဖၧၩ့နီၪ ဆၧဖၩ့ဖၩ့ထၪ့ဘၪယူၭအ",
			"3": "<sup>3</sup> ဝ့ၫၥံၪယူၭ.- နမၩအၪထၪ့ၦဆၨၩယီၩ, နမၩဒိၪထၪ့အ ဆၧၥၭထိၬလီၫ. အဝ့ၫၥံၪၥၭထိၬဝ့ၫလၧနမ့ၬယၫဘဲၫ ဆၧကူၭဘုၪအထီအဆၧၥၭထိၬအၥိၭတၭ, ဘဲၫဆၧ ၥၭထိၬလၧအအၪ့နၩ့ဖၭ ဆၧအၪ့ဂူၬန့အဘိၩ့ဘၭအ",
			"4": "<sup>4</sup> ၥိၭနီၪလီၫ.- အဂဲးဘဲၫယီၩအဆၧအယိၭအနိၪယိၭဘီၩ့, အခိၬထံၭခိၪအနိၪယိၭဘီၩ့, ၦမၩၡၪ့မၩနၭဝ့ၫလဂၩ အနိၪထးနီၪ, နဘိၭခါခွံၬဝ့ၫဘဲၫလၧမံဒအၫ့အမုနံၩအ",
			"5": "<sup>5</sup> ၥိၭနီၪလီၫ.- အဂဲးဘဲၫယီၩၦအီၪလၧစူၪဝဲၩလၧအဒုၭ ၥုၭအၥီၫအဖၧၩ့နီၪ ထီးအလူၬတၭ, ဆၧကီၩ့ဆၧၥိၭ ချံးအၥၭလၧဆၧၥွံၪအဖၧၩ့နီၪ မိကဲၪထၪ့ဝ့ၫလၧဆၧ",
			"6": "<sup>6</sup> ဆူၭခဲၩမ့ၪအဂးလၧမ့ၪဆၪလီၫ.- အဂဲးဘဲၫယီၩဖိၪၥၪ လဂၩအီၪဖျဲၪလၧပဂး, ဆၧဖ့ၪလၫ့ပၧၩလၧဖိၪခွၫလီၫ. တၭ အဆၧစ့ၩရၫ့အီၪလၧအခိၬထံၭခိၪတၭ, ဆၧမိကိၭ အမံၩ့လၧဆၧလၩ့လၭ,ဆၧကိၪ့လိၬလဂၩ, ဆၧ ဆီၪ့ယွၩ, အဆိၩဆိၩအကၠၪကၠၪအဖါ, ဆၧ ဘၪလိၬအိၭလိၬ အၦဒိၪဖၭဒိၪလဂၩလီၫ.",
			"7": "<sup>7</sup> အဘၩ့အမုးဒိၪထၪ့လဲထၪ့ ဒဲအဆၧဘၪလိၬအိၭလိၬ နီၪအထုၬအီၪအ့ၬ. လၧစဒၫဝံၭအလးဆီၩ့ဆီအဖၫ့ ခိၪ,ဒဲလၧအဘၩ့အမုးအဖၫ့ခိၪ ဘဲၫၥိၭအမိမၩဝ့ၫလၧ အဂုးအခၧၫ့, ဒဲအီၪက့ၪခၧၫ့ဝ့ၫလၧဆၧစ့ၩရၫ့ဒဲဆၧတီၩ ဆၧလီၩ့, ထီးယီၩလၧယၫလၩ့ဆိၩလၩ့ကၠၪလီၫ. ဆၧ ၥုၭမုခမျၧးအယဟိဝၩအၥၭဆီၪ့မိမၩဆၧနီၪလီၫ.",
			"8": "<sup>8</sup> ကဆါအၪ့မၧၫ့လၩ့ဆၧချဲၩ့လထံၪ လၧစယၫကူၭ",
			"9": "<sup>9</sup> တၭ,လၩ့ဘၪဝ့ၫလၧအံၫစရ့လၭ,- တၭကယဲၦခမျၧး ၥ့ၪယၫဝ့ၫလီၫ. အံဖြံၫ့,ဒဲစမ့ရအၫဖိၪ လၧအၥၭထၪ့",
			"10": "<sup>10</sup> ထီၫအီၪက့ၪဖိၫလိၫအၥၭနီၪ,စံၭဝ့ၫ,- အၩ့ကတဲၩလ ဖၪလၩ့ဎီးယူၭတၭ, ၦမိမၩထဲၩ့လၧလိး လၧၦစိၭန့ဝ့ၫ နီၪလီၫ. ၥံၪ့ကူၪလဖၪနီၪ ဘၪဆၧခူၬခွံၬယူၭ. တၭပမိ အီၪက့ၪၥံၪ့ၡိၫအ့ရ့ၭ လၧအဝ့ၫၥံၪအလးနီၪလီၫ.",
			"11": "<sup>11</sup> ယဟိဝၩမိအီၪက့ၪထၪ့ထီၫ စရံဇံၫ့အဒုၪအဒၩထၫ့ဒၩအ",
			"12": "<sup>12</sup> ဝ့ၫဒၪ,ဒဲထိၪဂဲၩဝ့ၫအဒုၪအဒၩဒၪဝ့ၫလီၫ.- ၦစံရအၫ ဖိၪလၧမုထၪ့, ဒဲၦဖလံၡၫဖိၪလၧမုနုၬတၭ, မိအၪ့ခွံၬ အံၫစရ့လၭလၧအနိၭ အၩ့ထၪ့အၥၭလီၫ. လၧဆၧ ထီးအလူၬအကၠီၩ့နီၪအၥၭထၪ့လၩ့ဆါအ့ၬး တၭအ စူၪယၩ့ထၪ့ဒံၭအၥၭလီၫ.",
			"13": "<sup>13</sup> တၭၦခမျၧးကၠၪအၥၭ လၧၦလၧအထးဝ့ၫအအီၪနီၪ မွဲအ့ၬ. တၭအဝ့ၫၥံၪအၪ့ဎူၫအၪ့ဎၬဆၧၥုၭမုခမျၧးအ",
			"14": "<sup>14</sup> ယဟိဝၩဆ့အ့ၬ.- မၩအၥၭဘဲၫနီၪတၭ,ယဟိဝၩမိဒၪ့ ထ့ၬခွံၬအံၫစရ့လၭ အခိၪဎွံၪဒဲအမ့, ဒဲအထဲၩ့ဒဲဖီး,",
			"15": "<sup>15</sup> လၧမုလနံၩဎးလီၫ.- ၦၥၭၡါဒဲၦအီၪလၧအလၩအဖၩ့ နီၪမွဲအခိၪလီၫ. တၭမီၪလၧအၥီၪ့ထဲၩ့ဆၧအဘျံၭအ",
			"16": "<sup>16</sup> ဘျၪနီၪမွဲအမ့လီၫ.- တၭၦခမျၧးယီၩအခိၪလဖၪအၪ့ လွ့ၫကဒံၩကဒၩဝ့ၫ, ဒဲၦလၧအဘၪဆၧၥိၫ့ဝ့ၫလၧအဝ့ၫ",
			"17": "<sup>17</sup> ၥံၪနီၪဘၪဆၧအၪ့ယုလၩ့ခွံၬဝ့ၫဒၪလီၫ.- မၩအၥၭဘဲၫ နီၪတၭ,ယဟိဝၩၥၭထိၬ လၧအဝ့ၫၥံၪအၡၩဖိၪၥၪခွၫ အကၠီၩ့နီၪအ့ၬ. တၭအၥၭအီၪအဝ့ၫၥံၪ အၡၩဖိၪဎွ့ၪ ဒဲအၡၩမုၪမဲၫအ့ၬ. အဂဲးဘဲၫယီၩမွဲၦၡၩအအၧၩ့, ဒဲ ၦမၩဆၧအၧၩ့ကိၭဂၩဒ့ၭ, ဒဲၦအနိၭ ချဲၩ့ဆၧပျီၩပျီၩ လီၫ.လၧဆၧထီးအလူၬအကၠီၩ့နီၪ အၥၭထၪ့လၩ့ဆါ အ့ၬ.တၭအစူၪယၩ့ထၪ့ဒံၭအၥၭလီၫ.",
			"18": "<sup>18</sup> အဂဲးဘဲၫယီၩ, ဆၧအၧၩ့အၪ့ခွံၬဆၧ ဘဲၫမ့ၪအၥိၭ တၭ,အၪ့ခွံၬဆၧဆူၪဆၧမဲၪနီၪတၭ, ဆူၭခဲၩဆၧလၧ ၥံၪ့တၪ့အကျၩတၭ, အဝ့ၫၥံၪမိထၪ့ထီၫဘဲၫမ့ၪခူၪထၪ့",
			"19": "<sup>19</sup> ထီၫအၥိၭနီၪလီၫ.- လၧဆၧၥုၭမုခမျၧးအယဟိဝၩအ ၥၭခဲၩထၪ့အကၠီၩ့နီၪ ဆၧခံၭန့ထံၫၥံၪခးၥံၪတၭ, ၦခ မျၧးနီၪမၩအၥၭဘဲၫၥံၪ့မုလၧမ့ၪအဂးလီၫ. ၦယၫ့ၥၭ",
			"20": "<sup>20</sup> အထၧၫ့ဖုဝဲနးဂၩအ့ၬ.- မိအဲၪ့ထ့ၬဆၧလၧအစူၪထွ့ၪ လခီၫလါနၫ့ဘိၩဆၧၥၭဝံအၥၭတၭ, မိအၪ့ခွံၬဆၧလၧ အစူၪစ့ၪတၭ, ဘျဲၩအၪ့အ့ၬ. တၭအဝ့ၫၥံၪမိအၪ့အစူၪ",
			"21": "<sup>21</sup> ဒူၪဒၪဝ့ၫအယၪကိၭဂၩဒ့ၭလီၫ.- မနၭစ့ၫ, အံဖြံၫ့း ဒဲအံ ဖြံၫ့,မနၭစ့ၫတၭး အဝ့ၫၥံၪလစီၪ့ဎးနီၪ ထၫ့ဒုၪဒၩယုဒၫ လီၫ.လၧဆၧထီးအလူၬအကၠီၩ့နီၪ အၥၭထၪ့လၩ့ဆါ အ့ၬ,တၭအစူၪယၩ့ထၪ့ဒံၭအၥၭလီၫ."
		},
		"10": {
			"1": "<sup>1</sup> ၦလၧအစ့ၩရၫ့ဆၧမၪလူၬအအၧၩ့, ဒဲၦကွ့ၭဆၧမၩ",
			"2": "<sup>2</sup> အၧၩ့လၧအစ့ၩရၫ့ကွ့ၭဝ့ၫနီၪ,- ဘဲၫၥိၭအမိဘိၭကၠၪ ခွံၬၦၡၪ့ဖိၪလၧဆၧစ့ၩရၫ့ ဒဲဘဲၫၥိၭအမိမၩန့ဆီၪ့ယ ၡၩခမျၧးအၡၩ ၡၪ့ဖိၪယၬဖိၪအခွး,လၧၦမုၪမဲၫမိကဲၪ ထၪ့အဆၧအၪ့ဂူၬန့, ဒဲလၧအမိမၩန့ဆီၪ့ ၦဖိၪဎွ့ၪအ",
			"3": "<sup>3</sup> ဆၧနီၪ,ဘၪအၡၪ့လီၫ.- တၭလၧဆၧစ့ၩရၫ့အမုနံၩ နီၪ,ဒဲလၧဆၧမၩယူဆၧလၧအမိဂဲၫ လၧအယဲၩ့နီၪ, မွဲ နၥံၪမိမၩဘဲၫၥ့ၪလဲၪ. နၥံၪမိစဲၪ့လၧဆၧမၩဆၧၩ့အဂး လၧပလၫအအီၪ နးဂၩလဲၪ.နၥံၪမိအီၪက့ၪလၩ့နၥံၪ",
			"4": "<sup>4</sup> အၡၩအီၪ လၧအလၩအဖၩ့နီၪ ခီၫခီၫလဲၪ.- ယဝ့ၫဒၪ ယီၩယလအီၪဘၪတၭ, အဝ့ၫၥံၪမိခိၭလၩ့ဝ့ၫ လၧၦ စၧၩ့ထၬဖိၪအကျၩတၭ, မိလၩ့ထံၩဖါလၧၦဘၪဆၧ မၩၥံၫဝ့ၫအကျၩလီၫ. လၧဆၧထီးအလူၬအကၠီၩ့နီၪ, အၥၭထၪ့လၩ့ဆါအ့ၬ, အစူၪယၩ့ထၪ့ဒံၭအၥၭလီၫ.",
			"5": "<sup>5</sup> ၦအစံရအၫဖိၪၥံၪ, ယၥၭထၪ့အနိၪထးနီၪဘၪအၡၪ့ လီၫ.နိၪထိၭလၧအဝ့ၫၥံၪအစူၪဖၧၩ့နီၪ မွဲယၥၭခဲၩထၪ့",
			"6": "<sup>6</sup> လီၫ.- ယမိအၪ့မၧၫ့လၩ့အဝ့ၫဒၪလ့ၩထၫ့ဒၩ ၦအၪ့လီၫ ဆၧလဆၨၩတၭ, ယမိမၪလူၬဝ့ၫလၧယဆၧၥၭထၪ့အ ၡၩလဆၨၩအဂဲးအကၠီၪ့နီၪ, ဘဲၫၥိၭအမိအၪ့ဂူၬဆီၪ့န့ ဆၧအၪ့ဂူၬဆီၪ့, ဒဲအၪ့ဂူၬန့ဆၧအၪ့ဂူၬနီၪတၭ,ဘဲၫၥိၭ အမိယဲးထဲးအဝ့ၫၥံၪ ဘဲၫဖံၬလၧဖၧၩ့ၥၭအဖၧၩ့အၥိၭ",
			"7": "<sup>7</sup> နီၪလီၫ.- မွဲလါနၫ့ဘိၩ အဝ့ၫဒၪနီၪ ကိၪ့ဝဲၩဆၧဘဲၫနီၪ အ့ၬးတၭဆီၫ့မီၪ့ဆၧလၧအၥၭဘဲၫနီၪဆ့အ့ၬ. အ့ၪမွဲ ဆၧအီၪလၧအၥၭလၧအမိမၩဂၭဂီၩ့ဆၧ, ဒဲလၧအမိဒၪ့",
			"8": "<sup>8</sup> ထ့ၬခွံၬၦအဆၨၩၡၩခိၬအ့ၬ.- အဂဲးဘဲၫယီၩ စံၭဝ့ၫ, ယၦဒိၪဖၭဒိၪၥံၪ မွဲတၡါစဎွၩၥံၪမွဲအ့ၬဧၪ.-",
			"9": "<sup>9</sup> ကၫလနိၫ မၩအၥၭဘဲၫ ကၫခမံၭအၥိၭမွဲအ့ၬဧၪ.- ဟၫမၭနီၪ မၩအၥၭဘဲၫအၫဖၭအၥိၭမွဲအ့ၬဧၪ. စမ့ရအၫနီၪမၩ",
			"10": "<sup>10</sup> အၥၭဘဲၫဒမၭစကၧၭအၥိၭမွဲအ့ၬဧၪ.- ဘဲၫယစူၪမၩန့ ဆၧဂၩ့ဆၧဖၪ့ၥံၪ အဘၩ့အမုး ဒဲအဆၧဂၩ့ဆၧဖၪ့ၥံၪ လၧအအၪနဲၪ့ဒံၭ ယရုစလံၫ့ဒဲစမ့ရအၫအဆၧအၥိၭ",
			"11": "<sup>11</sup> နီၪ,- ဘဲၫယမၩစမ့ရအၫဒဲအဆၧဂၩ့ဆၧဖၪ့ၥံၪအၥိၭ နီၪ,ယမိမၩယရုစလံၫ့ဒဲ အဆၧဂၩ့ဆၧဖၪ့ၥံၪ ဘဲၫနီၪ ၥိၭမွဲအ့ၬဧၪ.",
			"12": "<sup>12</sup> တၭဆၧမိမၩအၥၭ လၧကဆါမၩဂီၩ့အဆၧမၩထီး အလူၬ လၧခိၪလီၩ့ဇံအိၫ့အလီၩ့, ဒဲလၧယရုစလံၫ့အ ဖၧၩ့နီၪတၭ, ယမိစ့ၩရၫ့အစံရအၫအစဎွၩ လၧအအီၪ က့ၪဖိၫလိၫအၥၭ ဒဲအမ့ၬထၪ့ထီၫအဎံၫအလၩနီၪလီၫ.",
			"13": "<sup>13</sup> အဂဲးဘဲၫယီၩ အဝ့ၫဒၪစံၭ, ယမၩဆၧယီၩလၧယစူၪ ဆီၪ့,ဒဲလၧယဆၧကိၪ့ဘၪကိၪ့ၥ့ၪလီၫ. အဂဲးဘဲၫယီၩ ယၥုၪ့ဆၭယၥၭဆၭတၭး ယၥုၭၦဆၨၩလဖၪ အခး ဆၧၫ့အဆၧမၩနဲၪ့, ယမၩန့ဆီၪ့အဆၧလူဒိၪဎွ့ၩဒိၪ ၥံၪ,ယမၩနၧၩ့မၩစၪၦခးဖိၪလဖၪ ဘဲၫၦအဂဲးဆီၪ့လ",
			"14": "<sup>14</sup> ဂၩအၥိၭလီၫ.- တၭယစူၪဒၪန့ယူၭၦခမျၧးအစူၪလး ခၪ့ခိၪ,ဘဲၫထိၪၥွံၫအၥိၭတၭ, ဘဲၫၦအၪ့ထုၫ့ကီၪ့ထိၪဒံၪ အီၪလၩ့ထးအၥိၭနီၪ, ယအၪ့ထုၫ့ကီၪ့ယူၭ ဂၪ့ခိၪ အ ဆၧထီးအလူၬတၭ, ဆၧမၩဂဲၩအဒံၭမွဲဂ့ၩ, အၩ့ထၪ့",
			"15": "<sup>15</sup> အနိၭမွဲဂ့ၩ, ဂၪ့ကိၭမွဲဂ့ၩအီၪနးဂၩအ့ၬ.- မွဲကွၩမိအီၪ က့ၪဖိၫလိၫအၥၭလၧ ၦလၧအခူၬဆၧအဖၫ့ခိၪနီၪဆ့ဧၪ. လွၭမိအီၪက့ၪဒိၪအၥၭ လၧၦဘုၭဆၧအဖၫ့ခိၪနီၪဆ့ဧၪ. မၩအၥၭဘဲၫနိၪခုၪ ထၫ့ဒုၪဒၩအၥၭ လၧၦလၧအယၩ့ ထၪ့ဝ့ၫအၥိၭနီၪ, မၩအၥၭဘဲၫနိၪထိၭအီၪက့ၪထၪ့ထီၫ",
			"16": "<sup>16</sup> အၥၭဘဲၫအလမွဲဘၪၥံၪ့အၥိၭနီၪလီၫ.- မၩအၥၭဘဲၫ နီၪတၭ,ကဆါဆၧၥုၭမုခမျၧး အယဟိဝၩမိအၪ့မၧၫ့ လၩ့ဆၧဎွ့ဆိးဎွ့ဘၩ့ လၧအၡၩဘီၪ့ဖိၪ အလီၩ့တၭ, လၧအလၩဖၩ့အဖၫ့လၬဆၧမိဆူၭခဲၩဆၧဘဲၫဆၧဆူၭ",
			"17": "<sup>17</sup> ခဲၩမ့ၪအၥိၭနီၪလီၫ.- အံၫစရ့လၭအဆၧဖၩ့မိအီၪလၧ မ့ၪအဂးဒဲအၡၩဆံၫ့ဎံၪလဂၩလၧမ့ၪလၪအဂးတၭ, မိ ဆူၭထၪ့တၭ, အၪ့ခွံၬအဆၧဆူၪဆၧခဲၩ့လၧမုလနံၩဎး",
			"18": "<sup>18</sup> လီၫ.- အၥံၪ့အဝၪလစီၪ့, ဒဲဂၪ့ခိၪအဝၩ့လၧအၥၪထၪ့ လဖၪအလၩအဖၩ့ လၧအၥၭ, ဒဲမိၡါနီၪမိလူၬခွံၬဝ့ၫ တၭ,မိမၩအၥၭဘဲၫၦဆၫ လၧအဎွ့လၩ့ခွံၬ အၥိၭနီၪ",
			"19": "<sup>19</sup> လီၫ.- ဆၧအီၪလၩ့ထးလၧအၥံၪ့အဝၪလဒီၪ့ မိအီၪၡၩ ခိၬထုၪ့တၭ, ဖိၪၥၪလဂၩကွ့ၭဝ့ၫဒၪၥ့ၪလီၫ.",
			"20": "<sup>20</sup> တၭဆၧလၧမုလနံၩနီၪ ဆၧမိမၩအၥၭလၧၦအီၪလၩ့ ထးလၧအံၫစရ့လၭ ဒဲယၫကူၭအၡၩဂံၪ့ဖိၪလၧအဖီၩ့ ဖျ့ၭဆၧလဖၪနီၪ ဒိၭနဲၩ့လၧၩ့အၥၭလၧၦလဖၪလၧအ ထးဝ့ၫနီၪအ့ၬ. အ့ၪမွဲမိဒိၭနဲၩ့တၡါအၥၭလၧယဟိဝၩ",
			"21": "<sup>21</sup> အံၫစရ့လၭ အဆၧဆံၫ့ဎံၪလဂၩလီၫ.- ဆၧအီၪလၩ့ ထးမိဂဲၫထဲၩ့ဝ့ၫ, ယၫကူၭအဆၧအီၪလၩ့ထးလၧဆၧ",
			"22": "<sup>22</sup> ဆီၪ့ယွၩလဂၩအအီၪလီၫ.- အဂဲးဘဲၫယီၩအံၫစရ့လၭ ဧ့,နၡၩခမျၧးမွဲမၩအၥၭ ဘဲၫမၫဆမံၭအမ့ၭအၥိၭလါ နၫ့တၭ,န့ၫၦလနၩ့လၧအအီၪလၩ့ထး မိဂဲၫထဲၩ့လီၫ. ဆၧမၩဂၭဂီၩ့လူၬဝ့ၫနီၪ စ့ၩရၫ့ယူၭအၥၭယူၭ. တၭ",
			"23": "<sup>23</sup> လုၬဘံၭဝ့ၫလၧဆၧတီၩဆၧလီၩ့လီၫ.- အဂဲးဘဲၫယီၩ မိမၩဂၭဂီၩ့လူၬဝ့ၫ, လၧအစ့ၩရၫ့ယူၭ အၥၭယူၭနီၪ, ကဆါဆၧၥုၭမုခမျၧးအယဟိဝၩ မိမၩဝ့ၫလၧခးထၧၫ့ ဘံၪ့ယၫအၥၭကျၩလီၫ.",
			"24": "<sup>24</sup> မၩအၥၭဘဲၫနီၪတၭ, ကဆါဆၧၥုၭမုခမျၧးအယ ဟိဝၩစံၭဝ့ၫဒၪ, ယၡၩခမျၧးအီၪဝ့ၫလၧဇံအိၫ့အလီၩ့ၥံၪ ဧ့,ထီးၥၭမဲၪၦအစံရအၫဖိၪလဂ့ၩ, အဝ့ၫဒၪမိထးနၧၩ လၧနိၪထးတၭ, မိယၩ့ထၪ့နိၪထိၭထၫ့ဒုၪဒၩနၧၩ ဘဲၫ",
			"25": "<sup>25</sup> အံဇံၭအၥိၭနီၪလီၫ.- အဂဲးဘဲၫယီၩ အီၪဒံၭလဆိဖိၪ တၭ,ဆၧၥုၪ့ဒိၪၥၭဂဲၫ့မိလူၬတၭ, ယၥၭထၪ့လၧအဝ့ၫၥံၪ",
			"26": "<sup>26</sup> မိလူၬဝ့ၫအဂဲးနီၪလီၫ.- တၭဆၧၥုၭမုခမျၧးအယဟိ ဝၩမိဒုၭအီၪထၪ့နိၪထးနးဘီၩ့လၧအဂး, ဘဲၫဆၧထး မံဒအၫ့ထီးလဲၫ့ဟိရ့ၭအအီၪၥိၭနီၪတၭ, ဘဲၫအနိၪထး အီၪဝ့ၫလၧမၫဆမံၭအဖၫ့ခိၪအၥိၭနီၪ, မိယၩ့ထၪ့ဝ့ၫ",
			"27": "<sup>27</sup> ဘဲၫလၧအံဇံၭအၥိၭလီၫ.- တၭလၧမုလနံၩနီၪ ဆၧမိ မၩအၥၭလၧဆၧမိဆိၬခွံၬ အဆၧအွံၪဆၧယိၭ လၧန ခိၬထံၭခိၪအဖၫ့ခိၪ, ဒဲအနိၪယိၭဘီၩ့ လၧနခိၬလီၩ့ မိခါလၩ့ခွံၬလၧ ဆၧဘီၪ့ဆၧၥိၪအကၠီၩ့လီၫ.",
			"28": "<sup>28</sup> အဝ့ၫဒၪဂဲၫထီၩ့ယူၭလၧအဲအၭ လ့ၩဖီၩ့ခွံၬယူၭလၧ မံၭကြၧၫ့လၧမံၭမၭနီၪ အီၪက့ၪကီၪ့ယူၭ အဆၧဖိၪဆၧ",
			"29": "<sup>29</sup> လံၩ,- အဝ့ၫၥံၪဖီၩ့ခွံၬယူၭခိၪလီၩ့ဆူၭယူၭ. အီၪဝ့ၫလၧ မုနၩလခီၫလၧဂံဘၫအဖၧၩ့လီၫ. ရၫမၫဝၭထိၬဝၭတ့ၭ",
			"30": "<sup>30</sup> ဝ့ၫ,ဂံဘအၫစီလူၫစဲၪ့ဖျိၭဝ့ၫလီၫ.- ဂၫလံၫ့အဖိၪမုၪဧ့, ကိၭၡၭထၪ့နလူဘီၪ, လၫအံၭဧ့, ခိၭနၪဆံၭ. အၫ့နၥီၭ",
			"31": "<sup>31</sup> လၧအဘၪၡၪ့ဘၪနၭဧ့,- မၭဒမံနၫဂၭဝ့ၫ, ၦဂံဘံၫ့ဖိၪ",
			"32": "<sup>32</sup> စဲၪ့ဝ့ၫဒဲအဆၧဖိၪဆၧလံၩလီၫ.- မွဲလါနၫ့တၭ, ဆၧလၧ မုလနံၩနီၪအဝ့ၫဒၪမိအီၪဝ့ၫလၧနီဘၭအဖၧၩ့လီၫ. တၭ မိမၩဝၭအစူၪလၧဇံအိၫ့အဖိၪမုၪအခိၪလီၩ့ ယရုစလံၫ့",
			"33": "<sup>33</sup> အဆၧစီၩ့ခိၪနီၪလီၫ.- ယိခွါ, ကဆါဆၧၥုၭမုခမျၧးအ ယဟိဝၩမိဖ့ၬထ့ၬဆၧအထဲၩ့နီၪ, ဒဲဆၧၥၭမဲၪၥၭဖျဲၩ့ တၭ,ဆၧအထီၫနီၪမိဘၪဆၧခူၬလၩ့ခွံၬဝ့ၫတၭ, ဆၧအ",
			"34": "<sup>34</sup> ထၪ့ထီၫလဖၪနီၪမိဘၪဆၧဆၪ့လၩ့ဝ့ၫဒၪလီၫ.- မိခူၬ လၩ့ခွံၬၥံၪ့ၥံၪဝၪၥံၪအတၪ့လဖၪလၧထၭ, ဒဲလ့ဘနၧၫ့ ယီၩ မိလၩ့ဒၩဝ့ၫလၧဆၧအဆီၪ့လဂၩနီၪလီၫ."
		},
		"11": {
			"1": "<sup>1</sup> ၥံၪ့လဲၫ့ဒူၪမိကဲၪထၪ့ လၧယ့ၭစံၫအခိၪဆုၪ့တၭ,ထဲၩ့ လထဲၩ့မိမဲၪထၪ့လၧအဝံတၭၥၪထၪ့ဝ့ၫလီၫ.",
			"2": "<sup>2</sup> တၭယဟိဝၩအၥၭမိအီၪဂုးလၧအလီၩ့, ဆၧကိၪ့ဘၪ ကိၪ့ၥ့ၪဒဲဆၧၥုၪ့ဖၭၥၭဖၭအၥၭ, ဆၧကိၪ့ထၪ့ဖၭလၩ့ဒဲ ဆၧအစီၩ့အမၩ့အၥၭ, ဆၧၥ့ၪယၫအၥၭ, ဒဲဆၧၥၭမဲၪ",
			"3": "<sup>3</sup> ယဟိဝၩတၭး- ဆၧမိမၩမုၬလၩအဝ့ၫဒၪလၧဆၧၥၭမဲၪ ယဟိဝၩအဖၧၩ့တၭ, လစ့ၩရၫ့ဘၪဘဲၫဆၧလၧအဒၪ ဘၪလၧအမ့ၬၥၪအၥိၭနီၪတၭ, စ့ၩရၫ့စၪဝ့ၫဘဲၫဆၧလၧ",
			"4": "<sup>4</sup> အနါဂၧၫ့လၧအနါအၥိၭဆ့အ့ၬ.- အ့ၪမွဲအမိစ့ၩရၫ့ၦ ၡၪ့ဖိၪယၬဖိၪလၧဆၧတီၩ, ဒဲမိစ့ၩရၫ့စၪၦဂၪ့ခိၪဖိၪလၧ ဆၧၡၪ့ဆၧနၭလၧဆၧလီၩ့တၭ, မိထးဂၪ့ခိၪလၧအနိၭ အနိၪထး, ဒဲလၧအနိၭဖျံၩအၥၪထၪ့နီၪ မိမၩၥံၫၦအၧၩ့",
			"5": "<sup>5</sup> ဖိၪလီၫ.- တၭဆၧတီၩဆၧလီၩ့မိကဲၪထၪ့အယးဒံၩ့အ ခၧၩ့ယး, ဒဲဆၧမွဲဆၧတီၩအယးဒံၩ့ အခၧၩ့ယးလီၫ.",
			"6": "<sup>6</sup> ထွံၪမံၩ့မိအီၪလၧၥိၪဖိၪအၥိၭတၭ, ခ့ၫစံၫဖီးမိခိၬလၩ့ လၧဘ့ၪဖိၪအၥိၭတၭ, ချီဖိၪဒဲဆၬလၥၧၫ့ဖိၪ, ဒဲဆၧဘီၪ့",
			"7": "<sup>7</sup> ဖိၪၥံၪမိအီၪစီၪ့ဎးတၭ,ဖိၪၥၪမိမီၩ့ဝ့ၫလီၫ.- တၭချီမိဒဲဖုၫ ထၫ့မိအီၪအၪ့အဆၧစီၪ့ဎး, အဖိၪလဖၪမိခိၬလၩ့စီၪ့ဎး တၭ,ဆၬလၥၧၫ့မိအၪ့လီခၫ့ ဘဲၫချီဖၫအၥိၭနီၪလီၫ.",
			"8": "<sup>8</sup> ဖိၪၥၪအၪ့နူမိလိၬကွ့ၩ လၧဂူအၧၩ့အဖၧၩ့အဖၫ့ခိၪတၭ, ဖိၪၥၪလၩ့ၡၪနူ မိအီၪက့ၪအစူၪလၧဂူၥၫ့အဖၧၩ့အဖၫ့",
			"9": "<sup>9</sup> ခိၪလီၫ.- တၭဆၧမိမၩအၧၩ့ဒဲမၩဂၭဂီၩ့လၧယခိၪလီၩ့ ဆံၫ့ဎံၪထၧၫ့ဖျိၪ့ယၫအလီၩ့ဆ့အ့ၬ. အဂဲးဘဲၫယီၩဂၪ့ ခိၪမိဎွ့ၩဝ့ၫလၧဆၧၥ့ၪယၫယဟိဝၩ ဘဲၫထံၫလုၬဘံၭ မၫဆမံၭအၥိၭနီၪလီၫ.",
			"10": "<sup>10</sup> တၭဆၧလၧမုလနံၩနီၪ စယ့ၭစံၫအဝံမိအီၪက့ၪဆၧၫ့ ထုၪ့အၥၭမိကဲၪထၪ့ၥုၭဖိၪအလၫ့ လၧၦဆၨၩလဖၪအ ဂးလီၫ. ၦဆၨၩလဖၪမိစဲၪ့လၧအအီၪတၭ, အအီၪပွံၭ",
			"11": "<sup>11</sup> အလးနီၪမိအီၪလၧအလၩအဖၩ့လီၫ.- တၭလၧမုလ နံၩနီၪဆၧမိမၩအၥၭလၧယဟိဝၩမိယၩ့ထၪ့အစူၪဎွ့ၩ ထၪ့နံၫဘျၩ့လဘျၩ့နီၪ, ဘဲၫၥိၭအမိမၩန့ဆၧအီၪလၩ့ ထးဘၪဆဲၫ့လၧအၡၩခမျၧး, လၧအအီၪလၩ့ထးလၧ အစံရအၫ, ဒဲလၧအံဇံၭ, ဒဲလၧပၫၥြီၭ, ဒဲလၧကုၡၫ,ဒဲ လၧအံလၫ့, ဒဲလၧၡဲနၫ, ဒဲလၧဟၫမၭ, ဒဲလၧမၫဆမံၭ",
			"12": "<sup>12</sup> အကျိၩ့လဖၪနီၪလီၫ.- အဝ့ၫဒၪမိဘိၭထၪ့ၥုၭဖိၪအလၫ့ လၧၦဆၨၩလဖၪအဂးတၭ, မိဒုၭအီၪကီၪ့အံၫစရ့လၭ အၡၩစဲၪ့ဝံၩ့ဝၩ့ဖိၪတၭ, မိအီၪက့ၪကီၪ့ ယုဒၫအၡၩ",
			"13": "<sup>13</sup> လၩ့မုလၩ့ဖၭလၧဂၪ့ခိၪအနိၫ့ လံခီၫလ့ၬနီၪလီၫ.- အံ ဖြံၫ့အၥၭကဲၪ့နီၪ မိစဲၪ့ထၪ့ခွံၬတၭ, ယုဒၫအဒုၪအဒၩ လဖၪနီၪမိဘၪဆၧဒၪ့ထ့ၬခွံၬဝ့ၫလီၫ. အံဖြံၫ့မိၥၭကဲၪ့",
			"14": "<sup>14</sup> ဘၪယုဒၫအ့ၬ, ဒဲယုဒၫမိမၩအၧၩ့အံဖြံၫ့ဆ့အ့ၬ.- တၭ အဝ့ၫၥံၪမိယူၩဘၪ လၧၦဖလံၡၫဖိၪ အခိၬထံၭခိၪဖိး လၧမုနုၬလခီၫမိအၪ့ဂူၬန့ ၦမုထၪ့ဖိၪအဆၧလစီၪ့ဎး,မိ ယၩ့ထၪ့အစူၪလၧအံဒၧၫ့, ဒဲလၧမိအၭအဖၫ့ခိၪတၭ, ၦအၫမၧၫ့ဖိၪမိခိၭနၪဝ့ၫဒၪလီၫ.",
			"15": "<sup>15</sup> ယဟိဝၩမိမၩဂၭဂီၩ့ အံဇံၭအမၫဆမံၭအဖျ့ၩတၭ မိဝါအစူၪ လၧထံၫမိၡါအဖၫ့ခိၪ လၧလံၩဆီၪ့ဒဲအၪ့နၩ့ ဖၭဝ့ၫလၧထံၫချိၬဖိၪနွ့ၫဘီၩ့တၭ, ဒုၭလ့ၩၦၡၩလၧခၪ့",
			"16": "<sup>16</sup> ဖံၭလီၫ.- တၭဖၧၩ့ၥၭမုမိအီၪနးဘီၩ့ လၧအၡၩခမျၧး အအီၪလၩ့ထးအဂး, လၧအမိအီၪလၩ့ထး လၧအစံရ အၫ. ဘဲၫအအီၪလၧအံၫစရ့လၭ လၧမုနံၩအထးဖၧၩ့ လၧအဂၭထၪ့လၧခးအံဇံၭအဖၧၩ့အၥိၭနီၪလီၫ."
		},
		"12": {
			"1": "<sup>1</sup> တၭဆၧလၧမုလနံၩနီၪနမိစံၭ, ယဟိဝၩဧ့,ယမိ စံၭထၪ့အၪ့အူၭနၧၩလီၫ. အဂဲးဘဲၫယီၩနၥၭထၪ့ယၧၩ လါနၫ့ဘိၩ, နဆၧၥၭထၪ့နီၪကၠၪခွံၬအၥၭတၭ, နမၩ",
			"2": "<sup>2</sup> မုၬထၪ့ထဲၩ့ယၧၩလီၫ.- ယိခွါ, ယွၩမွဲယဆၧထိးထဲၩ့ တၩ့ထဲၩ့တၭ,ယမိဒိၭနဲၩ့ယၥၭ ဒဲလၥၭမဲၪဘၪဆၧ နီၪးအဂဲးဘဲၫယီၩယဟိဝၩယွၩမွဲယဂဲးယဘၭ,ဒဲယ ဆၧၥံၫကျံၩတၭ, ကဲၪထၪ့ယဆၧထိးထဲၩ့တၩ့ထဲၩ့ဆ့",
			"3": "<sup>3</sup> လီၫ.- မၩအၥၭဘဲၫနီၪတၭ,နၥံၪမိအၪ့ဒုၪ့ထၪ့ထံၫလၧ ဆၧထိးထဲၩ့တၩ့ထဲၩ့အထံၫဖၧၩ့ၥံၪလၧဆၧၥုၪ့ထိၬၥၭ ထိၬလီၫ.",
			"4": "<sup>4</sup> တၭလၧမုနံၩနီၪနၥံၪမိစံၭ, စံၭထၪ့အၪ့အူၭယဟိဝၩ, ကိၭထၪ့အမံၩ့, ဒုၭၥ့ၪယၫအမၩဆၧလၧအၡၩခမျၧး ၥံၪအကျၩ, ဒုၭနၪ့ထၪ့ထဲၩ့အဝ့ၫဒၪလၧအမံၩ့အီၪလၧ",
			"5": "<sup>5</sup> ဆၧထၪ့ထီၫဆံၭ.- ၥံၫကျံၩထၪ့ယဟိဝၩဆံၭ. အဂဲး ဘဲၫယီၩ, မွဲအမၩယူၭဆၧလၩ့မဲၩလၩ့လၭလဖၪလီၫ.",
			"6": "<sup>6</sup> ၥ့ၪယၫဆၧယီၩလၧဂၪ့ခိၪထၧၫ့ဖျိၪ့ယၫဆံၭ.- ကိၭၡၭ ဆၧ,ဒဲၥံၫကျံၩဆၧၦဇံအိၫ့ဖိၪဧ့, အဂဲးဘဲၫယီၩ အံၫ စရ့လၭအဆၧဆံၫ့ဎံၪလဂၩနီၪဒိၪဝ့ၫလၧနကျၩလီၫ."
		},
		"13": {
			"1": "<sup>1</sup> ဆၧအလူလၩ့ဘၪလၧဘၭဘလၧၫ့အဂဲး လၧစအၫ မူၭအဖိၪခွၫ စအဲၫစ့ယၫဒၪဘၪဝ့ၫလီၫ.",
			"2": "<sup>2</sup> လၧခိၪလီၩ့ထီၫအဒၩ့ခိၪနီၪ ဘီၩ့ထၪ့ၥုၭဖိၪအလၫ့, ကိၭၥီၫထၪ့လူလၧအအီၪ, ဝါနၥံၪအစူၪ, ဘဲၫၥိၭအဝ့ၫ",
			"3": "<sup>3</sup> ၥံၪမိလ့ၩနုၬလၧၦဒိၪဖၭဒိၪအတရၫ့အဖၧၩ့နီၪဆံၭ.- ယ ဝ့ၫဒၪယီၩ ယမၪလူၬယူၭ ၦလၧယအီၪက့ၪဆံၫ့ဎံၪဝ့ၫ လဖၪယူၭ,ယကိၭထၪ့ယူၭဆ့, ယၡၩအဆီၪ့ၥံၪလၧ ယၥၭခဲၩထၪ့အဂး, ယၡၩလၧအၥၭထိၬ လၧယဆၧ",
			"4": "<sup>4</sup> ထၪ့ထီၫအဖၧၩ့ယူၭလီၫ.- တၭၦခမျၧးအၥီၫအီၪဝ့ၫ လၧခိၪလီၩ့အလီၩ့, မၩအၥၭဘဲၫၦခမျၧး အၪဂၩအ ၥိၭး ၦဆၨၩၥံၪ အဘၩ့အမုး အီၪကိၩ့အီၪကီၪ့ အၥီၫ တုၩ့ထၪ့တုၩ့လၩ့နီၪလီၫ. ဆၧၥုၭမုးခမျၧးအယဟိဝၩ",
			"5": "<sup>5</sup> အီၪက့ၪကီၪ့ဆၧၥုၭမုလၧဆၧဒုၭၥုၭအဂးလီၫ.- အဝ့ၫ ၥံၪဂဲၫဝ့ၫလၧထံၫယဲၩ့ ခးယဲၩ့လၧမူၭခိၪအထုၬ, ယဟိ ဝၩဒဲအဆၧၥၭထၪ့အစူၪဝဲၩ ဘဲၫၥိၭအမိမၩဂၭဂီၩ့ခး ထၧၫ့ဘံၪ့ယၫလီၫ.",
			"6": "<sup>6</sup> အိၩ့ယိၩ့ထၪ့ဆံၭး အဂဲးဘဲၫယီၩယဟိဝၩအမုနံၩ အီၪဘူၭထၪ့ယူၭ, မိဂဲၫဘဲၫဆၧဂၭဂီၩ့လၧဆၧၥ့ၪဆၧ",
			"7": "<sup>7</sup> လူၬအအီၪအၥိၭနီၪလီၫ.- မၩအၥၭဘဲၫနီၪတၭ, ကယဲၦ လၧအစူၪမိလၩ့ဆါ, ဒဲကယဲၦအၥၭမိဖံၪထၪ့ဝ့ၫလီၫ.",
			"8": "<sup>8</sup> အၥၭမိဆၫဝ့ၫတၭ, ဆၧဆိၭက့ၭ ဒဲဆၧဎဲၫမိဖီၪ့န့ဝ့ၫ, ဘဲၫၦမုၪလၧအဂူၭဆၫအၥိၭနီၪ မိဘၪဆၧဆိၭက့ၭလီၫ. အဝ့ၫၥံၪမိထီၫမံၫထီၫမၪလိၬအၥၭလဂၩ ဒဲလဂၩလီၫ. အမ့ၬမိကဲၪထၪ့မ့ၪလၪအမ့ၬလီၫ.",
			"9": "<sup>9</sup> ယိခွါ, ယဟိဝၩအမုလနံၩဂဲၫဝ့ၫ, ဆၧၥၭမဲၪအလး, ဒဲဆၧၥၭထၪ့, ဒဲဆၧၥၭခဲၩထၪ့ဘဲၫၥိၭအမိဒုၭအီၪယူ ခးတၭ,အဆၧဒဲၩဘၭဖိၪလၧအဖၧၩ့နီၪ, အဝ့ၫဒၪမိမၩ",
			"10": "<sup>10</sup> ဂၭဂီၩ့ခွံၬဝ့ၫလီၫ.- အဂဲးဘဲၫယီၩမူၭခိၪအၡၪၥံၪ, ဒဲ အၡၪအီၪကီၪ့လဖၪနီၪ မိဖၩ့ထၪ့ဝ့ၫအ့ၬ. ထီးမုလ့ၩ ထၪ့နီၪမိခံၭလၩ့ဝ့ၫတၭ, လၩနီၪမိဒုၭဖၩ့ထၪ့အဆၧဖၩ့",
			"11": "<sup>11</sup> အ့ၬ.- တၭယမိစ့ၩရၫ့ၦဂၪ့ခိၪဖိၪ လၧအဆၧအၧၩ့အ ကၠီၩ့,ဒဲၦအၧၩ့ဖိၪ လၧအဆၧမၩအၧၩ့အကၠီၩ့နီၪလီၫ. ၦလၧအအီၪက့ၪထၪ့ထီၫအၥၭနီၪ ယမိဒုၭထုၬအအီၪ က့ၪဖိၫလိၫအၥၭတၭ, ၦမၩအၧၩ့ဆၧအဆၧထၪ့ထီၫ",
			"12": "<sup>12</sup> နီၪယမိဆၪ့လၩ့လီၫ.- ယမိမၩၦၡၩၥံၪၡၩနဲၪ့ဒံၭထီၫ့ ဆံၫ့းဒဲၦဂၪ့ခိၪဖိၪၡၩနဲၪ့ဒံၭအိဖၧၫအထီၫ့ဒၪလ့ၬလီၫ.",
			"13": "<sup>13</sup> မၩအၥၭဘဲၫနီၪတၭ, ယမိမၩဝၭမူၭခိၪတၭ, ဂၪ့ခိၪမိ ၥုၭအလးလၧဆၧၥုၭမုခမျၧးအယဟိဝၩ အၥၭထၪ့ အကၠီၩ့,လၧအၥၭခဲၩထၪ့အမုနံၩအထးဖၧၩ့နီၪလီၫ.",
			"14": "<sup>14</sup> တၭမိမၩအၥၭဘဲၫခံၫဘၩ့မိ လၧဆၧလီၩ့ဝ့ၫအၥိၭ, ဒဲ ဘဲၫၥိၭလၧၦဒုၭအီၪကီၪ့ဝ့ၫ လအီၪဘၪတၭ, ၦမိကၠၪ ထဲၩ့အၥၭလဂၩဘၪလဂၩ လၧအဆၨၩဒၪဝ့ၫတၭ, မိ",
			"15": "<sup>15</sup> စဲၪ့လၧအခးဒၪဝ့ၫ လဂၩဘၪလဂၩဆုၬဆုၬလီၫ.- က ယဲၦလၧအဒၪန့ဝ့ၫဘၪဆၧဆ့ၭဖျီၫ့ဝ့ၫတၭ, ကယဲၦလၧ အဘုၭထၬလၧၦလဖၪနီၪ မိလၩ့ထံၩဖါလၧနၭလီၫ.",
			"16": "<sup>16</sup> တၭအဖိၪၥၪၥံၪနီၪ မိဘၪဆၧခွံၬလၩ့ဘျ့ၭဝ့ၫလၧအမ့ၬ ယၫ,အဂံၪ့လဖၪမိဘၪဆၧအၪ့ဂူၬန့အဆၧတၭ, အမၫ",
			"17": "<sup>17</sup> ၥံၪမိဘၪဆၧဖိၭဆီၪ့ဝ့ၫလီၫ.- ယိခွါ, ယမိထိၪဂဲၩၦ မံဒအၫ့ဖိၪလၧအလဒူၩလယၪ့ဘၪကျိၪၥံၪစ့ၩၥံၪ,ဒဲလ",
			"18": "<sup>18</sup> ဘၪဘၪအၥၭလၧထီၫ့ၥံၪလွ့ၫၥံၪလီၫ.- အဝ့ၫၥံၪအချံၪ ၥံၪဖျါၥံၪမိထးလၩ့ဘျ့ၭဖိၪၥၪအခွၫ, လယၫ့ၥၭဘၪဆၧ ဒၧၩ့လးအၥၪတၭ, ဖိၪဒံၩဖိၪၥၪနီၪအဝ့ၫၥံၪလီၫ့ကီၩ့ ဝ့ၫအ့ၬ.",
			"19": "<sup>19</sup> တၭဘၭဘလၧၫ့နီၪ, ဘၩ့ၥံၪမုးၥံၪအလၩအဖၩ့, ၦ ခၫလဒံအၫဖိၪၥံၪ အီၪက့ၪအၥၭထၪ့ထီၫအလး လၧအ ကယၧၩ့ကယီၫနီၪ မိမၩအၥၭ ဘဲၫယွၩမၩဂၭဂီၩ့ စီဒၧၫ့",
			"20": "<sup>20</sup> ဒဲဂမိရၫအၥိၭနီၪလီၫ.- အထံၫဖိၪခးဖိၪၦၡၩမိအီၪဝ့ၫ နးဆိၭအ့ၬ, ၦၡၩလဆိၩဘၪလဆိၩမိအီၪဝ့ၫလၧအ ဖၧၩ့နီၪဆ့အ့ၬ, ၦၡၩလဆိၩ ဘၪလဆိၩမိအီၪဝ့ၫလၧအ ဖၧၩ့နီၪဆ့အ့ၬ. တၭၦအရ့ဘၠၫဖိၪ မိၥုၪ့ဘၪ အတဲၩထီး နီၪအ့ၬ. တၭၦယူၬၥိၪ ဒုၭခိၬလၩ့ဘၪ ဆၧထီးနီၪဆ့",
			"21": "<sup>21</sup> အ့ၬ.- မံၩ့လၬကျၩ အဆၧဖိၪဆၧဎါအမံၩ့ မိခိၬလၩ့ ထီးနီၪတၭ, အဂံၪ့မိဎွ့ၩလၧဆၧကိၭၡၭတၭ, ဆၧၥီၫ အဖိၪမိအီၪထီးနီၪတၭ, ဆၧမိၡါအဆီၪ့ထီၫ မိဂဲထုၪ့",
			"22": "<sup>22</sup> လံထီးနီၪ,- တၭထွံၪမံၩ့မိမၩ့ဆၧၫ့လိၬအၥၭလၧအနီး ဖၧၩ့,ဒဲထွံၪဂၪ့ခိၪလၧအနီးမုၬလဖၪအဖၧၩ့လီၫ. တၭ အဆၧၫ့အထီဘူၭထၪ့ယူၭတၭ, ဆၧၥုၭဘၪအနံၩအ ၥၫ့အ့ၬ."
		},
		"14": {
			"1": "<sup>1</sup> အဂဲးဘဲၫယီၩယဟိဝၩမိယၫ့ၥၭယၫကူၭတၭ, မိ ရွံန့ဒံၭအံၫစရ့လၭတၭ, မိဒုၭအီၪပွံၭဝ့ၫလၧအခးဒၪဝ့ၫ အဖၧၩ့တၭ, ၦလခီၫဘၩ့မုးဖိၪ မိအိၭလိၬလၧအဝ့ၫၥံၪ",
			"2": "<sup>2</sup> တၭ,မိဘုၭထၬလၧယၫကူၭအဂံၪ့လီၫ.- ၦခမျၧးလဖၪ နီၪမိမၩန့ဝ့ၫတၭ ဂဲၫဆိၬလၧအလးဒၪဝ့ၫတၭ, ၦအံၫစ ရ့လၭအဂံၪ့ဖိၪမိမၩန့အဝ့ၫၥံၪ လၧယဟိဝၩအခးဖၧၩ့ လၧအဎီးအၡၩခွၫအဂး, ဒဲလၧအဎီးအၡၩမုၪအဂး တၭ,မိမၩန့အၪ့မၧၫ့ဎီးၦလၧအမွဲယူၭ ၦအၪ့မၧၫ့ဎီးအ ဝ့ၫၥံၪတၭ, မိပၧၩ့ဘၪၦၡၩလၧအမၩအၧၩ့မၩနၭအဝ့ၫ ၥံၪလီၫ.",
			"3": "<sup>3</sup> ဆၧမိမၩအၥၭလၧမုလနံၩနီၪ, လၧယဟိဝၩဒုၭအီၪ ပွံၭနၧၩလၧနမၩဆၧကၪ, ဒဲနဝၭထိၬ, ဒဲမၩဆီၪ့ဆၧလၧ",
			"4": "<sup>4</sup> ၦအၪ့မၧၫ့ဆီၪ့နမၩဆၧတၭ,- နမိချဲၩ့ထၪ့ဆၧချဲၩ့အ ဒီၩ့ယီၩလၧဘၭဘလၧၫ့ အစဎွၩအဂဲးအကၠီၪ့တၭ,နမိ စံၭ,ၦမၩအၧၩ့ဆၧနီၪ အီၪထီဝ့ၫဘဲၫၥ့ၪလဲၪး ဆၧအၪ့ ကံၩ့ဆီၪ့ထီၫ့နီၪအီၪထီဝ့ၫဘဲၫၥ့ၪလဲၪၬ",
			"5": "<sup>5</sup> ယဟိဝၩမၩခါယူၭၦအၧၩ့ဖိၪအနိၪထိၭ, ၦပၧၩ့ဆၧ",
			"6": "<sup>6</sup> အနိၪထိၭအစဎွၩလီၫ.- ၦလၧအထးၦဆၨၩၥံၪ လၧအ ၥၭထၪ့လၧအထးဆၧလၧအလအီၪထီဘၪ, ၦပၧၩ့ဘၪ ၦဆၨၩၥံၪလၧအၥၭခဲၩထၪ့လၧအပၧၩ့ဆၧတၭ, ဆၧပ",
			"7": "<sup>7</sup> ဒၩ့ဝ့ၫအီၪနးဂၩအ့ၬ.- ၦဂၪ့ခိၪဖိၪအီၪလၩ့မါပံၭတၭ, အီၪပွံၭထီးအလူၬလီၫ. အဝ့ၫၥံၪမၩထၪ့ ထၭခိၪၥံၫ",
			"8": "<sup>8</sup> ကျံၩဆၧလီၫ.- မွဲမၬ, ၥံၪ့ၡိၫၥၭထိၬဆ့ လၧနဖၫ့ခိၪ, လ့ၭဘနၧၫ့အၥံၪ့ၡိၫအ့ရ့ၭစံၭဝ့ၫ, လၧနမံၫနၩ့အလးခဲၫ့ နီၪၦခူၬလၩ့ဆၧဂဲၫထၪ့ဘၪပၧၩအ့ၬ.",
			"9": "<sup>9</sup> ဖျႃဖၧၩ့လၧလၬလခီၫ ဝၭဝ့ၫလၧနကၠီၩ့ ဘဲၫၥိၭထီး နအ့ၪဂဲၫတၭ,မိအၪ့ဂၬနၧၩလီၫ. အဝ့ၫမိထိၪဂဲၩၦၥံၫ အလၩလဖၪလၧနဂး, ကယဲဂၪ့ခိၪအဆၧဒိၪ ထီးအ လူၬ,အဝ့ၫဒုၭဂဲထုၪ့ၦဆၨၩအစဎွၩထီးအလူၬ လၧအ",
			"10": "<sup>10</sup> ဝ့ၫၥံၪအလးဆီၩ့ဆီအဖၫ့ခိၪလီၫ.- အဝ့ၫၥံၪထီးအလူၬ မိချဲၩ့ဆၧတၭ,စံၭနၧၩ, နဝ့ၫဒၪနလၩ့ဆါဘဲၫပၥိၭဆ့",
			"11": "<sup>11</sup> ဧၪ.နကဲၪထၪ့ဘဲၫပၥိၭဆ့ဧၪ- နဆၧထၪ့ထီၫနီၪဘၪ ဆၧဒုၭဂဲၫလၩ့ဝ့ၫလၧဖျႃဖၧၩ့, နနါဒံၩ့အၥီၫလီၫ. လိၪ့ ၥံၪဒၩလၩ့အၥၭလၧနဖၫ့လၬတၭ, ဆၧချႃၬဘံၭနၧၩနီၪ",
			"12": "<sup>12</sup> မွဲဆၧအဎိၩ့အဎါလီၫ.- နလၩ့ထ့ၬလၧမူၭခိၪဘဲၫၥ့ၪ လဲၪ,ၡၪထူဂီၩ, မုဆဲၪ့အဖိၪခွၫဧ့ၬ ၦလၧအမၩနၧၩ့မၩ စၪၦဆၨၩလဖၪနီၪ, နဝ့ၫဧ့း မွဲနဘၪဆၧခူၬလၩ့ယူၭလၧ",
			"13": "<sup>13</sup> ဂၪ့ခိၪအဖၫ့ခိၪဘဲၫၥ့ၪလဲၪး- အဂဲးဘဲၫယီၩ နစံၭလၧ နၥၭခံဖၧၩ့,ယမိထၪ့ဘၭလၧမူၭခိၪ, ယမိအီၪက့ၪယ လးဆီၩ့ဆီလၧယွၩအၡၪလဖၪအဖၫ့ခိၪ, ယမိဆၧၫ့နၩ့ လၧဆၧအီၪကီၪ့အခိၪလီၩ့, လၧမုဖၩအထုၬနီၪလီၫ.",
			"14": "<sup>14</sup> ယမိထၪ့ဘၭဆၧအုၪ့အဆၧထၪ့ထီၫအဖၫ့ခိၪ, ယမိအီၪ က့ၪယၥၭဘဲၫဆၧထၪ့ထီၫထုၬလဂၩ အၥိၭနီၪလီၫ.",
			"15": "<sup>15</sup> မွဲလါနၫ့ဘိၩ ဆၧမိဒုၭလ့ၩလၩ့နၧၩ လၧဖျႃဖၧၩ့, လၧ",
			"16": "<sup>16</sup> ဆၧဖၧၩ့အယိၬဖၧၩ့လီၫ.- ၦလၧအဒၪဘၪနၧၩမိယိထံၫ ယိဆၭနၧၩတၭ,စံၭၦလၧအမၩၡိၩ့ၡိၬဂၪ့ခိၪနီၪ, လၧ",
			"17": "<sup>17</sup> အမၩဝၭဘၩ့မုးလဖၪ, မွဲၦလဂၩယီၩဧၪ.- ၦလၧအ ဒုၭကဲၪထၪ့ဂၪ့ခိၪ ဘဲၫၡါမုနၧၫ့ဖၫအၥိၭ, ဒဲမၩဂၭဂီၩ့ အဒိၩ့ၥံၪးကွဲၪဖျါၦလၧအဖီၪ့န့ဝ့ၫနီၪ ဒုၭထဲၩ့လၧအဂံၪ့",
			"18": "<sup>18</sup> အ့ၬ.- ၦဆၨၩၥံၪအစဎွၩထီးအလူၬ, အဝ့ၫၥံၪထီးအ လူၬ,မံၫနၩ့လၧဆၧလၩဖၩ့အဖၧၩ့, လဂၩလၧအၥွၪခိၪ ဒၪဝ့ၫအဖၧၩ့, လဂၩလၧအၥွၪခိၪဒၪဝ့ၫအဖၧၩ့လီၫ.",
			"19": "<sup>19</sup> အ့ၪမွဲနဝ့ၫဒၪ နဘၪဆၧနၫ့ထၪ့ခွံၬ လၧနၥွၪခိၪအဖၧၩ့ ဘဲၫဆၧအထဲၩ့ လၧဆၧၥၭလိၪဝ့ၫအၥိၭနီၪ, ဘၪဆၧ လုၬဘံၭလၧၦဘၪဆၧမၩၥံၫဝ့ၫလဖၪနီၪ, ၦဆ့ၭဖျီၫ့လၧ နၭလ့ၩလၩ့လၧဆၧဖၧၩ့အလိးအမ့ၭအကျၩ, ဘဲၫဆၧ အစွၪလၧၦယဲးထဲးဝ့ၫ လၧအခၪ့ဖၫ့လၬအၥိၭနီၪလီၫ.",
			"20": "<sup>20</sup> နဘၪဆၧခုၪ့လၩ့ဘၧၩ့ဎုၬလၧအဝ့ၫၥံၪအ့ၬး အဂဲးဘဲၫ ယီၩနမၩဂၭဂီၩ့ယူၭနထံၫနခး, နမၩၥံၫနၡၩခမျၧးလီၫ. မွဲၦမၩဆၧအၧၩ့အချံၫအၥၪနီၪ မွဲဆၧထီးဎွံၩ့ဘၪအမံၩ့",
			"21": "<sup>21</sup> လၩ့ဆိၩလၩ့ကၠၪလဂ့ၩ.- တဲၩ့ဝဲၩဆၧမၩၥံၫလၧအ ဖိၪခွၫၥံၪအဂး လၧအဖါလဖၪအဆၧအၧၩ့အကၠီၩ့နီၪ ဆံၭ.မွဲအထီးဂဲထုၪ့, ဒဲန့ၥၫခးနီၪဒဲမၩဎွ့ၩဂၪ့ခိၪလၧ ဒိၩ့ၥံၪလဂ့ၩ.",
			"22": "<sup>22</sup> အဂဲးဘဲၫယီၩ ယဝ့ၫဒၪယမိဂဲထုၪ့ထၫ့ ဒုၪဒၩအဝ့ၫၥံၪ, ဆၧၥုၭမုခမျၧးအယဟိဝၩစံၭဝ့ၫဒၪ, ဒဲယမိဒၪ့ထ့ၬ ဘၭဘလၧၫ့အမံၩ့, ဒဲဆၧအီၪလၩ့ထးဒဲ အဖိၪအလံၩ, ဒဲအဆၨၩအဆၬ, ယဟိဝၩစံၭဝ့ၫဒၪလီၫ.- ယမိအီၪက့ၪ",
			"23": "<sup>23</sup> ဝ့ၫလၧဆၧဂီဆူၪၥံၪအလး, ဒဲနီၪ့ၥံၪတၭ, ယမိဝ့ၬဝ့ၫလၧ နိၪဝ့ၬမၩဂၭဂီၩ့ဆၧလီၫ. ဆၧၥုၭမုခမျၧးအယဟိဝၩ စံၭဝ့ၫဒၪလီၫ.",
			"24": "<sup>24</sup> ဆၧၥုၭမုခမျၧးအယဟိဝၩဆိၪလၩ့အၥၭတၭ, စံၭ ဝ့ၫဒၪ,မွဲမၬဘဲၫယဆီၫ့မီၪ့ဆၧအၥိၭနီၪ, မၩယူၭအၥၭ",
			"25": "<sup>25</sup> ယူၭ,ဘဲၫယကိၪ့ဆၧအၥိၭနီၪမိအီၪဂုးအီၪခၧၫ့,- ယမိ မၩခါလၩ့ ၦအစံရအၫဖိၪလၧယခးဖၧၩ့တၭ, လၧယ ခိၪလီၩ့အလီၩ့ယမိယဲးထဲးအဝ့ၫၥံၪ, ထီးနီၪလဖၧၫ့အ နိၪယိၭဘီၩ့မိစဲၪ့ထၪ့ခွံၬလၧအဖၫ့ခိၪတၭ, အဆၧအွံၪ",
			"26": "<sup>26</sup> ဆၧယိၭမိစဲၪ့ထၪ့ခွံၬလၧအခိၬထံၭခိၪလီၫ.- အဝ့ၫနီၪမွဲ ဆၧကိၪ့လၧအကိၪ့ဝဲၩဝ့ၫ လၧဂၪ့ခိၪဎံၩ့လ့ၬတၭ, အ ယီၩမွဲဆၧအစူၪလၧအယၩ့ထၪ့အၥၭလၧၦကိၭဆၨၩ",
			"27": "<sup>27</sup> ဒ့ၭအဖၫ့ခိၪနီၪလီၫ.- အဂဲးဘဲၫယီၩဆၧၥုၭမုခမျၧးအ ယဟိဝၩကိၪ့ဝဲၩဝ့ၫတၭ, မွဲပလၫမိမၩပျီၩပျီၩဝ့ၫနးဂၩ လဲၪ.အဝ့ၫဒၪအစူၪယၩ့ထၪ့အၥၭတၭ, မွဲပလၫမိထုၭ ထဲၩ့ဝ့ၫလဂၩလဲၪ.",
			"28": "<sup>28</sup> ဆၧလၧအနံၪ့လၧစဎွၩအၫဟဇၭၥံၫဝ့ၫဒၪနီၪဆၧအ လူလၩ့မွဲအယီၩလီၫ.",
			"29": "<sup>29</sup> မွဲၦလၧအထးနၧၩအနိၪထးခါအကၠီၩ့နီၪ ထီးၥၭထိၬ လဂ့ၩ,ဖလံၡၫဖိၪထီးအလူၬ, နၧၩဧ့း အဂဲးဘဲၫယီၩ လၧအဆၨၩနီၪဂူအၧၩ့လဘီၩ့မိဂဲၫထၪ့တၭ, အၥၪနီၪ",
			"30": "<sup>30</sup> မွဲဂူမ့ၪလၧအယူၩဝ့ၫလဘီၩ့လီၫ.- ၦၡၪ့ဖိၪအဖိၪဝဲၡါ မိအၪ့ဆၧတၭ,ၦဘၪၡၪ့ဘၪယၬ မိမံၫနၩ့မုၬမုၬလီၫ. တၭယမိမၩၥံၫနဝံလၧဆၧၥၭဝံလၩ့ဒိၩတၭ, ဆၧအီၪ",
			"31": "<sup>31</sup> လၩ့ထးလၧနၧၩနီၪအဝ့ၫဒၪမိမၩၥံၫဝ့ၫလီၫ.- အိၩ့ယိၩ့, တရၫ့ဧ့ၬ ကိၭၡၭထၪ့း ဒိၩ့ဧ့ၬ နဖံၪထၪ့ခွံၬယူၭထီးအ လူၬ,ဖလံၡၫဧ့, အဂဲးဘဲၫယီၩ မ့ၪခူၪမိဂဲၫထၪ့လၧမု ဖၩတၭ,ၦလၩ့မုလၩ့ဖၭ လၧအၡၩၥုၭမုအကျၩနးဂၩ",
			"32": "<sup>32</sup> အ့ၬ.- ထီးနီၪလဖၧၫ့ဆၧမိစံၭဆၧၫ့ၦလဆၨၩအၥီၫ့ၥံၪ ဘဲၫၥ့ၪလဲၪ. ယဟိဝၩ အီၪက့ၪလၩ့ယူၭဇံအိၫ့အခၪ့ ထံၭတၭ,ၦဘၪၡၪ့ဘၪယၬလၧအၡၩခမျၧးအကျၩနီၪ မိစဲၪ့ဖလ့ၬအၥၭလၧအဖၧၩ့လီၫ."
		},
		"15": {
			"1": "<sup>1</sup> ဒိၩ့အါ လၧမိအၭအဖၧၩ့ဘၪဆၧမၩယူဝ့ၫလၧမုလ နၩ,ဆၧမၩဂၭဂီၩ့ဝ့ၫး ဒိၩ့ကၧၫလၧမိအၭအဖၧၩ့ဘၪ",
			"2": "<sup>2</sup> ဆၧမၩယူဝ့ၫလၧမုလနၩ, ဆၧမၩဂၭဂီၩ့ဝ့ၫလီၫ.- အ ဝ့ၫၥံၪလ့ၩထၪ့ဝ့ၫလၧဂံၪ့ၥံၪ လၧဒဲၫဘၫ့အလးထၪ့ထီၫ လဖၪလၧအမိဂၪ့ဝ့ၫအလးလီၫ. လၧနံဘိၫအလီၩ့,ဒဲ လၧမ့ၭဒဘၫအဖၧၩ့နီၪ, မိအၭဂၪ့ဝ့ၫ, ၦအခိၪဎွံၪကိၭ ဖျိၪ့ဒ့ၭမွဲအချၩ, ဒဲကယဲၦအခၪလၭဆီၪ့ ဘၪဆၧထံၬ",
			"3": "<sup>3</sup> ခွံၬဝ့ၫလီၫ.- လၧအဖၧၩ့ၥၭလဖၪအဖၧၩ့နီၪၦခဲးထူၬအ ယးဒံၩ့လၧရၧၬအဆၧယၬး လၧအဂံၪ့ခိၪအဖၫ့ခိၪ, ဒဲ လၧဖၧၩ့ၥၭမုအဖၧၩ့နီၪ ဂၪ့အိၩ့ယိၩ့ဝ့ၫကိၭဂၩဒ့ၭ, နုၬ",
			"4": "<sup>4</sup> လၩ့လၧဆၧဂၪ့ဝ့ၫအဖၧၩ့လီၫ.- တၭဟ့ၭၡဘၫ့ကိၭ ၡၭထၪ့ဒဲအံၫလအ့လၫနီၪး အဝ့ၫၥံၪအလူဂၧၫ့ထၪ့ဝ့ၫ ထီၩ့လၧယၫဟၭလီၫ. မၩအၥၭဘဲၫနီၪတၭ,မိအၭအ ၥုၭဖိၪမိကိၭၡၭထၪ့တၭး အၥၭမၧၫ့မိဘၪဆၧခိဆၧဝီၩ",
			"5": "<sup>5</sup> လီၫ.- ယၥၭကိၭၡၭထၪ့လၧမိအၭအဂးလီၫ. ၦလၧ အစဲၪ့လၧဆၧအကျၩနီၪ, ဘဲၫချီမိလၧအအီၪၥၧၫ့နံၪ့အ ၥိၭထီၩ့လၧဇိအၫလီၫ. အဂဲးဘဲၫယီၩၦလၧအထၪ့ ဘၭလုဟံၭနီၪလ့ၩထၪ့ဘၭဝ့ၫတၭ,ဂၪ့ဝ့ၫလီၫ. အဂဲး ဘဲၫယီၩလၧဟီရန့အံၫ့အဖၧၩ့ၥၭဖၧၩ့နီၪၦၡၩကိၭၡၭ",
			"6": "<sup>6</sup> ထၪ့ဆၧမၩဂၭဂီၩ့အလူလီၫ.- အဂဲးဘဲၫယီၩ နံၫ့ရံၫ့အ ထံၫလဖၪမိကဲၪထၪ့ဆၧအီၪယူဝ့ၫလီၫ. အဂဲးဘဲၫယီၩ နၪ့ဎဲၫ့ထၪ့ခွံၬယူၭ. နၪ့ၥံၪလူၬခွံၬဝ့ၫဆၧအၥံၫ့ဆ့ၬအီၪ",
			"7": "<sup>7</sup> လၧၩ့နးမံၩ့အ့ၬ.- မၩအၥၭဘဲၫနီၪတၭ, ဆၧအီၪလၩ့ ထးအၪလ့ၬ လၧၦမၩန့ဝ့ၫဒဲဆၧလၧအအီၪက့ၪကီၪ့ဝ့ၫ",
			"8": "<sup>8</sup> နီၪမိဆိၬန့ခၫ့ဂၬခွံၬဖံဆလီၫ့အထံၫချိၬနီၪလီၫ.- အဂဲး ဘဲၫယီၩဆၧကိၭၡၭထၪ့အီၪဝၬဖီၩ့ မိအၭအနဲၩ့ထံၭ လီၫ.အဆၧအိၩ့ယိၩ့နီၪ ဆၧနါဂၧၫ့ဝ့ၫ ထီၩ့လၧအ့ၭ ဂျၫအံၫ့,ဒဲအဆၧအိၩ့ယိၩ့နီၪ ထီၩ့လၧဘံအၧၫအံလံၫ့",
			"9": "<sup>9</sup> လီၫ.-အဂဲးဘဲၫယီၩဒဲၫမၫ့အထံၫလဖၪနီၪ, ဎွ့ၩဝ့ၫလၧ ဆၧၥွံၪလီၫ. အဂဲးဘဲၫယီၩ ယမိအီၪက့ၪဆၧအၪနဲၪ့ ဒံၭလၧဒဲၫမၫ့အလီၩ့, ယမိဒုၭဂဲၫဆၬလၥၧၫ့ၥံၪ လၧၦ လၧအဖီၩ့ဖျ့ၭလၧမိအၭ, ဒဲၦလၧအအီၪက့ၪလၩ့ထး လၧခးဖၧၩ့အလီၩ့နီၪလီၫ."
		},
		"16": {
			"1": "<sup>1</sup> ဖ့ၪယုၥိၪဖိၪလဖၪလၧၦပၧၩ့ထံၫၥံၪခးၥံၪနီၪ, လၧစံ လၫထီၩ့လၧၡါမုနၧၫ့ဖၫ လၧဇံအိၫ့အဖိၪမုၪအခိၪလီၩ့",
			"2": "<sup>2</sup> လဖျိၪ့နီၪဆံၭ.- အဂဲးဘဲၫယီၩမိမၩအၥၭဘဲၫထိၪလ့ၩ ဝံၩ့ဝၩ့လၧအဘၪဆၧနၫ့ထၪ့ခွံၬဝ့ၫ လၧအၥွံၫဖၧၩ့လ ဘံၪ့အၥိၭနီၪး မိအၭအဖိၪမုၪၥံၪ, လၧဖၧၩ့ၥၭခၫ့ဂၬ ဆၧလၧအၫနၫ့ချိၬအဖၧၩ့နီၪ မိမွဲဘဲၫနီၪၥိၭဆ့လီၫ.",
			"3": "<sup>3</sup> ကိၪ့ထၪ့လိၬဆၧ, မၩဆၧတီၩ, အီၪက့ၪနလၩၡုၪဘဲၫမု နၩအလၩၡုၪအၥိၭလၧမုမ့ၬထုၪ့အဖၧၩ့, အီၪက့ၪၥူၪ ၦဘၪဆၧနၫ့ထၪ့ခွံၬနီၪဆံၭ. ၦလၧအစဲၪ့ဝံၩ့ဝၩ့ဆၧနီၪ",
			"4": "<sup>4</sup> ဒုၭနဲၪအဝ့ၫဒၪလဂ့ၩ.- ယၡၩဘၪဆၧနၫ့ထၪ့ခွံၬလဖၪ နီၪဒုၭအီၪအဝ့ၫၥံၪ လၧနဖၧၩ့, မိအၭဧ့, ကဲၪထၪ့ဆၧ အီၪကဒုၩအလးလၧအဂး လၧၦမၩဂၭဂီၩ့ဆၧအမ့ၬ ယၫဆံၭ. အဂဲးဘဲၫယီၩ ၦအၪ့ဘျံၭ အၪ့ဘျၪနီၪလူၬ ယူၭ.ၦမၩဂၭဂီၩ့ဆၧနီၪအီၪထီယူၭ. ၦယဲးထဲးထံၫၥံၪ",
			"5": "<sup>5</sup> ခးၥံၪနီၪလူၬယူၭဝ့ၫယူၭ.- လးဆီၩ့ဆီလဖျိၪ့မိအီၪ ဂုးအီၪခၧၫ့လၧဆၧအခိးအတၩအဖၧၩ့တၭ, အဝ့ၫဒၪ မိဆၧၫ့နၩ့ဝ့ၫလၧအဖၫ့ခိၪ လၧဆၧမွဲဆၧတီၩအဖၧၩ့လၧ စဒၫဝံၭအတဲၩဖၧၩ့, မိစ့ၩရၫ့ဆၧ,ဒဲအၪ့ဎၬဆၧတီၩ, ဒဲ မၩဆၧတီၩဆၧလီၩ့ချဲၫ့ချဲၫ့လီၫ.",
			"6": "<sup>6</sup> ပနါဂၧၫ့လၧမိအၭအၥၭထၪ့ထီၫအဂဲးအကၠီၪ့,လၧ အအီၪက့ၪထၪ့ထီၫအၥၭအၪအၪလ့ၬ, လၧအမၩၥူၪ ဂဲၩအၥၭ, ဒဲလၧအအီၪက့ၪဖိၫလိၫအၥၭခဲၩထၪ့တၭ,",
			"7": "<sup>7</sup> ဆၧလၧအအီၪက့ၪအၥၭနီၪလမွဲဘၪဆၧလီၫ.- မၩအ ၥၭဘဲၫနီၪတၭ, မိအၭမိအိၩ့ယိၩ့ လၧမိအၭအကၠီၩ့, ၦ မိအိၩ့ယိၩ့ ကိၭဂၩဒ့ၭလီၫ. နၥံၪဂၪ့အုၩ ဂၪ့ထိၬလၧ ကၧၫဟၫရစ့ၭ အစဘံၭၥၪဘၪဆၧဖ့ၬခွံၬ ဆံၫ့ဆၫ့ပျၩ့",
			"8": "<sup>8</sup> အကၠီၩ့း မွဲမၬထိးဘၪဆၧနၭလ့ၬလီၫ.- အဂဲးဘဲၫယီၩ ဟ့ၭၡဘၫ့ အဂၪ့ခိၪအဝၩ့လဖၪဎဲၫ့ထၪ့ခွံၬယူၭ, စံဘမၫအစဘံၭမုလီၫ. ၦဆၨၩလဖၪ အကဆါၥံၪမၩခါ လၩ့ခွံၬအစဘံၭမုစိရ့ၭလီၫ. အဝ့ၫၥံၪချႃၭန့ယၫဇၧၫ, လ့ၩဝံၩ့ဝၩ့ဆၧလၧၡါမုနၧၫ့ဖၫအထဲၩ့ထၪ့ထီၫဝ့ၫ, ထီၩ့",
			"9": "<sup>9</sup> ဝ့ၫလၧပၪ့လဲၪနဲၩ့လီၫ.- မၩအၥၭဘဲၫနီၪတၭ, ယမိဂၪ့ လၧယၫဇၧၫအဆၧဂၪ့ လၧစံဘမၫအစဘံၭမုအကၠီၩ့း ယမိမၩဘၪစီၫနၧၩ လၧယမ့ၬထံၫဟ့ၭၡဘၫ့, ဒဲအံၫလ အ့လၫဧ့ၬအဂဲးဘဲၫယီၩ ဆၧကိၭၡၭထၪ့လၩ့ဘၪန",
			"10": "<sup>10</sup> ဆၧၥၪအလီၩ့, ဒဲနကူၭဘုၪအလီၩ့နီၪလီၫ.- တၭဆၧ မၩန့ထၪ့ခွံၬၥုၪ့ထိၬၥၭထိၬ, ဒဲဆၧၥုၪ့ဎွံၫၥၭယီၫ, လၧ အဆၧၥၪအလး, ဒဲလၧစဘံၭမုအလးဖၧၩ့နီၪ ၦမၩ လၧၩ့ထၭခိၪအ့ၬ. အလးလၧၦဘံၭ စဘံၭၥၪ အဖၧၩ့ နီၪ,ၦယဲးလၧၩ့ဝ့ၫအ့ၬ. ယဒုၭအီၪလၩ့မါဆၧကိၭၡၭ",
			"11": "<sup>11</sup> နီၪလီၫ.- မၩအၥၭဘဲၫနီၪတၭ, ယၥၭၥီၫထၪ့ဘဲၫနါ ဒံၩ့အၥိၭလၧမိအၭအကၠီၩ့တၭ, ဆၧအီၪလၧယဖၧၩ့",
			"12": "<sup>12</sup> လၧကၧၫဟၫရစ့ၭအကၠီၩ့လီၫ.- ထီးမိအၭနဲၪဖျီၪထၪ့ အၥၭ,ထီးအမၩပွံၭလၩ့အၥၭ လၧအလးထီၫအဖၫ့ ခိၪတၭ,ဆၧမိမၩအၥၭ လၧအမိလ့ၩနုၬလၧအလးဆံၫ့ ဎံၪအဖၧၩ့ ဘဲၫၥိၭအမိဘၩဆိၪဖၪဆၧလါနၫ့တၭ, န့ ဘၪဝ့ၫအ့ၬ.",
			"13": "<sup>13</sup> ဆၧချဲၩ့နီၪမွဲဆၧချဲၩ့လၧယဟိဝၩ ချဲၩ့ဝ့ၫလၧမိအၭ အဂဲးအကၠီၩ့လၧဖျိၩ့နီၪလီၫ.",
			"14": "<sup>14</sup> အ့ၪမွဲဘိၩ့နဲၪ့ယီၩ ယဟိဝၩချဲၩ့ဆၧတၭ, စံၭဝ့ၫဒၪ, လၧၥၧၫ့နံၪ့အထးဖၧၩ့, ဘဲၫၦအၪ့လံၩ့လၩ့အၥၭအနံၪ့ အၥိၭနီၪ, မိအၭအလၩအဖၩ့မိဘၪ ဆၧမၩကြၩ့ထမး ဝ့ၫ,ဒဲၦခမျၧးဖၭဒိၪထီးအလူၬတၭး ဆၧအီၪလၩ့ထး ၡၩခိၬဂၩနီၪအဂဲးမိဆါဝ့ၫလီၫ."
		},
		"17": {
			"1": "<sup>1</sup> ယိခွါ,ဒမၭစကၧၭ,မွဲလၧၩ့ဒိၩ့လဖျိၪ့အ့ၬ. တၭမိကဲၪ",
			"2": "<sup>2</sup> ထၪ့ဝ့ၫလၧဆၧလၩ့ဎီးအပိၩ့လီၫ.- ဆၧစဲၪ့ဒၪအရိအၧၫ အဒိၩ့လဖၪလီၫ. အဝ့ၫၥံၪမိကဲၪထၪ့လၧၥိၪအဒီၪ့လဖၪ အဂးတၭ, အဝ့ၫၥံၪမိခိၬလၩ့ဝ့ၫတၭ, ဆၧမၩၥၭမဲၪဝ့ၫ",
			"3": "<sup>3</sup> အီၪအ့ၬ.- ထိၬၥံၪမိအီၪလၧၩ့လၧအံဖြံၫ့ဆ့အ့ၬ. တၭ ဘၩ့ၥံၪမုးၥံၪလအီၪလၧၩ့ဘၪ လၧဒမၭစကၧၭဒဲခးအီၪ လၩ့ထးလၧစံရအၫနီၪအ့ၬ. အဝ့ၫၥံၪမိမၩအၥၭဘဲၫၦ အံၫစရ့လၭဖိၪအလၩအဖၩ့အၥိၭနီၪ, ဆၧၥုၭမုခမျၧး",
			"4": "<sup>4</sup> အယဟိဝၩစံၭဝ့ၫဒၪ.- မုလနံၩနီၪဆၧမိမၩအၥၭလၧ ယၫကူၭအလၩအဖၩ့မိလၩ့ဆါတၭ, အယၪအဘီၪ့နီၪ",
			"5": "<sup>5</sup> မိဎွ့လၩ့ဝ့ၫလီၫ.- တၭဆၧမိမၩအၥၭဘဲၫၦကူၭဘုၪအၪ့ ထုၫ့ကီၪ့ဘုၪ, ဒဲအစူၪဒူၪကူၭဘုၪဆၧၫ့ထုၪ့အဆဲၩလဖၪ အၥိၭနီၪတၭ, မိမၩအၥၭဘဲၫၦအၪ့ထုၫ့ကီၪ့ဘုၪဆဲၩ",
			"6": "<sup>6</sup> လၧခိၪလီၩ့ဆူၭ ရ့ဖအံၫ့အၥိၭနီၪလီၫ.- မွဲလါနၫ့ဘိၩ ဆၧမိအီၪလၩ့ထးလၧအဖၧၩ့, ဘဲၫဆၧတရူၩအလဲအိၫ့ အၥိၭ, အၥၪနံၫဖျိၪ့ၥၧၫ့ဖျိၪ့ လၧထဲၩ့အထီၫထုၬအခံၫ, လံဖျိၪ့ယဲဖျိၪ့လၧထဲၩ့ၥံၪလၧအၥၪထၪ့ အၪအလီၩ့နီၪ, ယဟိဝၩအံၫစရ့လၭအယွၩစံၭဝ့ၫဒၪ.",
			"7": "<sup>7</sup> ဆၧလၧမုလနံၩနီၪ, ၦၡၩမိယိလၧၦတဲၩ့လၩ့အဝ့ၫ အအီၪတၭ, အမ့ၬၥၪမိယိလၧအံၫစရ့လၭ အဆၧဆံၫ့",
			"8": "<sup>8</sup> ဎံၪလဂၩလီၫ.- လယိဘၪလၧဆၧလုအလးလဖၪ,ဆၧ လၧအမၩဝ့ၫလၧအစူၪနီၪ, ဆၧလၧအစူၪနိၩ့ၥံၪမၩဝ့ၫ လဖၪမွဲဂ့ၩလၧအၡ့ရိၭ ဒဲလၧဆၧဂၩ့လဖၪနီၪမွဲဂ့ၩယိ",
			"9": "<sup>9</sup> မ့ၬဝ့ၫဆ့အ့ၬ.- ဆၧလၧမုလနံၩနီၪအဒိၩ့အီၪလၧအခိၪ ဒၧၩ့လဖၪနီၪမိမၩအၥၭဘဲၫ ဆၧအီၪလၩ့ထးလၧဆၧၡိၬ ကျၩ, ဒဲထဲၩ့အထၪ့ထီၫထုၬလၧၦအီၪက့ၪထးဝ့ၫလၧၦ အံၫစရ့လၭဖိၪ အမ့ၬယၫအၥိၭနီၪတၭး ဆၧမိအီၪယူ",
			"10": "<sup>10</sup> ဝ့ၫလီၫ.- မွဲလၧနၥၭနၪ့ဆၧထိးထဲၩ့တၩ့ထဲၩ့နၧၩအယွၩ အကၠီၩ့, ဒဲနဂဲးနဘၭအလဲၫ့နီၪ နလနၪ့ထၪ့ထဲၩ့ဘၪဝ့ၫ တၭ,အခိးမွဲနမိၥုၪ့လၩ့ဆၧအထံၭဖိၪလၧအဂ့ၩ, ဒဲၥုၪ့",
			"11": "<sup>11</sup> လၩ့လခီၫဘၩ့မုးအထဲၩ့ၥံၪလီၫ.- ဆၧလၧမုလနံၩလၧ နၥုၪ့လၩ့ဆၧနီၪနမိဆ့ၭဖီၩ့ဝ့ၫတၭ, လၧဂီၩလခီၫနီၪနမိ ဒုၭဆိၬထၪ့ဖီၫထၪ့နဆၧချံၫလီၫ. ဆၧဘၪကူၭဝ့ၫနီၪဂၭ ဂီၩ့ခွံၬလၧဆၧခိဆၧဝီၩ, ဒဲဆၧၥုၪ့အုၭၥၭအုၭနၭမၬ အ မုလနံၩနီၪလီၫ.",
			"12": "<sup>12</sup> ခိၭနၪၦအၪဆၨၩအၥီၫဘီၪၬ ဘဲၫမၫဆမံၭအၥီၫအၥိၭ နီၪၥီၫထၪ့ဝ့ၫး ဒဲၦခမျၧးစဲၪ့ဆီၪ့အၥီၫဘဲၫထံၫအၪဆ့ၭ",
			"13": "<sup>13</sup> ဆီၪ့အၥီၫၥိၭနီၪၥီၫထၪ့ဝ့ၫလီၫ!- ဘဲၫထံၫအၪဆ့ၭဆီၪ့ အၥီၫၥိၭနီၪ ၦဆၨၩလဖၪၥီၫထၪ့ဝ့ၫလီၫ. အ့ၪမွဲဆၧမိ အၪ့ၥီၪ့ဝ့ၫတၭ, အဝ့ၫၥံၪမိစဲၪ့ဖျိၭခွံၬယဲၩ့လ့ၬနီၪး ဆၧမိ လီၩ့ဆီးနၫ့ထၪ့ခွံၬအဝ့ၫၥံၪ ဘဲၫခိၪလီၩ့ထိၩ့ချိၬအဖ့ၫ ဘၪဆၧလီၩ့နၫ့ထၪ့ခွံၬဝ့ၫ လၧလံၩအမ့ၬယၫအၥိၭ,ဘဲၫ ဆၧလၧအချံးအၥၭ လၧလံၩၥဝံၭအမ့ၬယၫအၥိၭနီၪ",
			"14": "<sup>14</sup> လီၫ.- လၧမုဂၪလၩ့အထီနီၪ, ယိခွါ,ဆၧမၩၥၭမဲၪနီၪ လီၫၬဆၧလချႃၭဖၩ့ထၪ့ဒံၭဘၪနီၪ, အဝ့ၫၥံၪအီၪလၧၩ့ အ့ၬၬၦလၧအအၪ့ဂူၬန့ပဆၧလဖၪအဂးမွဲအနီၪ, ဒဲၦ လၧအအၪ့ဂူၬဆီၪ့ ပဆၧလဖၪအဂးမွဲအနီၪလီၫ."
		},
		"18": {
			"1": "<sup>1</sup> ဂဲၫဘီၪ, ခးအီၪလၧအဒံၭလၧအၥီၫထၪ့ဧ့, ခးလၧအ",
			"2": "<sup>2</sup> အီၪလၧကုၡၫအထံၫမိၡါလဖၪဝါလခီၫ,- လၧအအၪ့ မၧၫ့လၩ့အၥီၫ့လဖၪလၧမၫဆမံၭ, ဒဲလၧထံၫၥံၪအဖၫ့ ခိၪဒဲလၧချံၫခီၫ့ဘီၩ့အဖၧၩ့အၥီၫ့လ့ၩဆၧဖျဲၪၥံၪဧ့, လ့ၩ လၧၦဆၨၩထုၭထၪ့အၥၭ ဒဲလီၩ့အၥၭ အအီၪလၧၦခ မျၧးလၧအမၩၥၭမဲၪ ဆၧလၧအခၪ့ထံၭခီးဘိၩ့နဲၪ့ယီၩ, ၦလဆၨၩလၧအဂဲးဆီၪ့အဘၭဆီၪ့တၭ, ယဲးလၩ့ဆၧ,",
			"3": "<sup>3</sup> ဒဲထံၫမိၡါလၧအအၪ့နၩ့ဖၭအခးအဆၧၫ့နီၪဆံၭ.- ၦဂၪ့ ခိၪဖိၪထီးအလူၬနၥံၪဝ့ၫဧ့း ၦအီၪဝ့ၫလၧဂၪ့ခိၪချိၫ့ထီး အလူၬနၥံၪဧ့, ထီးဆၧဘိၭထၪ့ ၥုၭဖိၪအလၫ့လၧခိၪ လီၩ့ခိၪတၭ, ယိနၥံၪဝ့ၫဘီၪၬ ထီးဆၧအူၪထၪ့ခွ့ၩနီၪ,",
			"4": "<sup>4</sup> နါဂၧၫ့နၥံၪဝ့ၫဘီၪၬ- အဂဲးဘဲၫယီၩ ယဟိဝၩစံၭယၧၩ ဘဲၫယီၩ, ယမိအီၪထီအီၪပွံၭတၭ,ယမိယိဆၧလၧယ အီၪအလး, ဘဲၫဆၧခိဆံၫ့ပျၩ့ လၧနၪ့ၥံၪမံၩ့ၥံၪအလီၩ့ အၥိၭ,ဘဲၫဆၩ့ထံၫအဆၧအုၪ့ လၧကူၭဘုၪအထီအ",
			"5": "<sup>5</sup> ဆၧခိအၥိၭနီၪလီၫ.- အဂဲးဘဲၫယီၩ ကူၭဘုၪအထီလ ချႃၭဘၪဒံၭဘၪတၭ, ထီးအဆိၭထၪ့ၡီၫ့ထၪ့တၭ,မိကဲၪ ထၪ့စဘံၭၥၪအဘိၩ့ဘၭ မိဖ့ၬထ့ၬဝ့ၫအထဲၩ့လၧဒီၩဖ့ၬ",
			"6": "<sup>6</sup> ခိၫဆၧ,အစူၪဖုၬနီၪမိခွံၬၡိၭဝ့ၫလီၫ.- တၭအဝ့ၫၥံၪမိ အီၪလၩ့ထးစီၪ့ဎး လၧထိၪၥံၪလၧခိၪလီၩ့ခိၪအဂး, ဒဲ ဆၧဖိၪဆၧဎါအမံၩ့ လၧဂၪ့ခိၪချိၫ့အဂးလီၫ. တၭထိၪ ၥံၪလံၪၥံၪမိအီၪလၧဆၧခိအထီလၧအလီၩ့တၭ, ဂၪ့ခိၪ အဆၧဖိၪဆၧဎါအမံၩ့လမံၩ့လါလါနီၪ မိအီၪလၧဆၧ ဂီးအထီလၧအလီၩ့လီၫ.",
			"7": "<sup>7</sup> ဆၧလၧမုလနံၩနီၪ ၦမိဂဲၫဆိၬဆၧဖ့ၪလၫ့လၧဆၧၥုၭ မုခမျၧးအယဟိဝၩ, လၧၦလဆၨၩ ဘၪထုၭထၪ့အ ၥၭ,ဒဲလီၩ့အၥၭ, လၧၦလဆၨၩ လၧအမၩၥၭမဲၪဆၧ လၧအခၪ့ထံၭခီးဘိၩ့နဲၪ့ယီၩ, ၦလဆၨၩလၧအဂဲးဆီၪ့ အဘၭဆီၪ့တၭယဲးလၩ့ဆၧတၭ,ထံၫမိၡါအၪ့နၩ့ဖၭ အခးအဆၧၫ့, လၧဆၧၥုၭမုခမျၧး အယဟိဝၩအမံၩ့ အလး, ခိၪလီၩ့ဇံအိၫ့လီၫ."
		},
		"19": {
			"1": "<sup>1</sup> ယိခွါ, ယဟိဝၩထူၬဆၧအုၪ့ဎွံၫတၭ, လ့ၩဝ့ၫထီၩ့ လၧအံဇံၭတၭ, အံဇံၭအဆၧဂၩ့ဆၧဖၪ့ဝၭဝ့ၫလၧအ မ့ၬယၫတၭ, အံဇံၭအၥၭနီၪဖံၪထၪ့ဝ့ၫလၧအဖၧၩ့လီၫ.",
			"2": "<sup>2</sup> တၭယမိထိၪဂဲၩၦအံဇံၭဖိၪထၫ့ဒုၪဒၩ ၦအံဇံၭဖိၪတၭ, အဝ့ၫၥံၪမိဒုၭလိၬအၥၭ, လဂၩဘၪလဂၩ ထၫ့ဒၩအ ထၧၫ့ဖုဝဲ,လဂၩဘၪလဂၩထၫ့ဒၩၦလၧအနဲၩ့ထံၭ, ဒိၩ့ လဖျိၪ့ထၫ့ဒၩဒိၩ့လဖျိၪ့, ဘၩ့မုးထၫ့ဒၩဘၩ့မုးလီၫ.",
			"3": "<sup>3</sup> တၭအံဇံၭအၥၭမိအီၪပျီၩလၧအဖၧၩ့တၭ, အဆၧကိၪ့ ထၪ့ဖၭလၩ့နီၪယမိအၪ့ယုလၩ့ခွံၬတၭ,အဝ့ၫၥံၪမိအၪ့ ဎၬဝ့ၫလၧဆၧဂၩ့ဆၧဖၪ့အအီၪ, ၦၥ့ၪဆၧအူၪဆၧပီၩ အအီၪ,ဒဲၦအီၪလၧဆၧနၪအအီၪ, ဒဲလၧဆၧယူၬၥံၪအ",
			"4": "<sup>4</sup> အီၪလီၫ.- ယမိဖ့ၪလၫ့အံဇံၭဖိၪၥံၪ လၧအကဆါကၪ လဂၩအစူၪဖၧၩ့တၭ, စဎွၩဆီၪ့လဂၩ မိပၧၩ့ဘၪဝ့ၫ",
			"5": "<sup>5</sup> ကဆါဆၧၥုၭမုခမျၧးအယဟိဝၩစံၭဝ့ၫဒၪ.- ထံၫမိလၩ့ ၥံၭခွံၬလၧပၪ့လဲၪဖၧၩ့တၭ, ထံၫမိၡါအထံၫမိလူၬဝ့ၫဒဲ",
			"6": "<sup>6</sup> လၩ့ၥံၭခွံၬလီၫ.- ထံၫမိၡါမိနၧၫ့အုၪ, အံဇံၭအထံၫကၠီၪ့ လဖၪမိအီၪပျီၩလၩ့ၥံၭခွံၬတၭ, ဖီးဒဲဎဲၪမိလၩ့ယံၭဎဲၫ့",
			"7": "<sup>7</sup> ထၪ့ခွံၬဝ့ၫလီၫ.- တၭဆံၬၥံၪနၩၥံၪလၧထံၫမိၡါအနဲၩ့, လၧထံၫထၪဒဲဂၪ့ခိၪအဆၧချံၫဎွံၪအၥၭလၧအဖၧၩ့, ထံၫ လၧထံၫနဲၩ့ထီးအလူၬနီၪမိလၩ့ၥံၭခွံၬ, ဘၪဆၧနၫ့ထၪ့",
			"8": "<sup>8</sup> ခွံၬတၭ,အီၪလၧၩ့အ့ၬး- ၦမၩယၪၥံၪမိၥၭအုၭတၭ, က ယဲၦလၧအအၪ့ခွ့ၫလၧထံၫမိၡါအဖၧၩ့ မိဂၪ့ဝ့ၫတၭ, ၦလၧအခွံၬၡၬလၧထံၫဖၫ့ခိၪနီၪ အဂဲးအဘၭမိလၩ့ဆါ",
			"9": "<sup>9</sup> ဝ့ၫလီၫ.- တၭၦလၧအမၩဆၧလၧအလူၪၥီၫကဘၩ့ဒဲ ၦလၧအထၭထၪ ဘၩ့ဘွၩနီၪ မိအီၪက့ၪမဲအမ့ၬလီၫ.",
			"10": "<sup>10</sup> တၭအဆၧခၪ့ထံၭလဖၪနီၪ မိလၩ့ဎီးခွံၬ, ကယဲၦဒိၭ အၪ့လံၩ့အၥၭအၥုၪ့ခိအၥၭဝီၩထီးအလူၬလီၫ.",
			"11": "<sup>11</sup> ဇိၫအၫ့အၦဒိၪဖၭဒိၪ, မွဲန့ၫၦအဂီၩ့လီၫ. ဖၫရိၫအၡၩ ကိၪ့လိၬအၥၭ အဆၧဒုၭကိၪ့လိၬနီၪ ကဲၪထၪ့ဘဲၫဆၧ ဖိၪဆၧဎါအၥိၭလီၫ. နၥံၪစံၭဖၫရိၫ, ယမွဲၦကိၪ့ဆၧၥ့ၪ အဖိၪခွၫ,စဎွၩလၧဖျိၩ့အဖိၪခွၫနီၪ , မိၥ့ၪဘဲၫၥ့ၪလဲၪ.",
			"12": "<sup>12</sup> အဝ့ၫၥံၪအီၪခီၫခီၫလဲၪ. နၡၩကိၪ့ဆၧၥ့ၪနီၪအီၪခီၫခီၫ လဲၪ.မွဲအလီၩဘၪနၧၩတၭ,မွဲအၥ့ၪယၫဆၧလၧဆၧၥုၭ မုခမျၧးအယဟိဝၩ ကိၪ့ထၪ့ထၫ့ဒၩ လၧအံဇံၭအဂဲး",
			"13": "<sup>13</sup> အကၠီၩ့နီၪဆံၭ.- ဇိၫအၫ့အၦဒိၪဖၭဒိၪနီၪကဲၪထၪ့ယူၭ ၦအဂီၩ့တၭး ဆၧအၪ့လီၫန့နီဖၭအခိၪလဖၪလီၫ. အ ဝ့ၫၥံၪအုၩ့လၩ့မၪၦအံဇံၭဖိၪ, အဒီၪ့လဖၪအနိၩ့လီၫ.",
			"14": "<sup>14</sup> ယဟိဝၩလူၫလၩ့ၥၭအၧၩ့လမံၩ့ လၧအဝ့ၫၥံၪအကျၩ တၭ,ၦဒုၭလၩ့မၪအံဇံၭ လၧအမၩဆၧထီးအလူၬအ ဖၧၩ့,ဘဲၫၦအီၩမၧၩ့အၥၭလ့ၩဆၧ ဒံၩ့ခံၫ့ဒၪ့ဎၩ့လၧအ ပၠိၭအဖၧၩ့အၥိၭနီၪလီၫ.",
			"15": "<sup>15</sup> တၭဆၧမၩလၧအံဇံၭ အခိၪဎွံၪမွဲဂ့ၩ, အမ့မွဲဂ့ၩ, ဆၧအထဲၩ့မွဲဂ့ၩ, ဖီးမွဲဂ့ၩ, မိမၩဘၪဝ့ၫနီၪအီၪအ့ၬ.",
			"16": "<sup>16</sup> ဆၧလၧမုလနံၩနီၪ အံဇံၭမိမၩအၥၭဘဲၫၦမုၪၥံၪအ ၥိၭလီၫ. တၭမိဝၭထိၬဒဲၥၭမဲၪၥၭဖျဲၩ့ဆၧလၧဆၧၥုၭမု ခမျၧးအယဟိဝၩအစူၪအမ့ၬယၫ လၧအမၩဂဲၩဝ့ၫလၧ",
			"17": "<sup>17</sup> အဖၫ့ခိၪလီၫ.- တၭယုဒၫအခးမိကဲၪထၪ့ဆၧၥၭမဲၪအ လးလၧအံဇံၭအဂးလီၫ. ကယဲၦလၧအနၪ့ထၪ့ထဲၩ့ဝ့ၫ နီၪ,မိၥၭမဲၪဒၪဝ့ၫလၧဆၧၥုၭမုခမျၧးအယဟိဝၩအကိၪ့ ဆၧလၧအကိၪ့ထၫ့ဒုၪဒၩဝ့ၫအကၠီၩ့နီၪလီၫ.",
			"18": "<sup>18</sup> ဆၧလၧမုလနံၩနီၪဒိၩ့ယဲဖျိၪ့လၧအချဲၫ့ကၫနအၫ့အ လၨမိအီၪလၧခးအံဇံၭအဖၧၩ့တၭ, မိဆိၪလၩ့အၥၭ လၧၥုၭမုခမျၧးအယဟိဝၩအမ့ၬယၫလီၫ. တၭဒိၩ့လ",
			"19": "<sup>19</sup> ဒိၩ့နီၪဆၧကိၭဝ့ၫလၧဆၧဂၭဂီၩ့အဒိၩ့လီၫ.- ဆၧလၧ မုလနံၩနီၪ ဆၧလုအလးလၧယဟိဝၩအဂး မိအီၪလၧ ခးအံဇံၭအၥၭကျၩနးဖျိၪ့, ဒဲအထုၪ့လထုၪ့လၧအနဲၩ့",
			"20": "<sup>20</sup> ထံၭလၧယဟိဝၩအဂးလီၫ.- တၭမိကဲၪထၪ့ဆၧမၩ နဲၪ့,ဒဲဆၧထိးအၥၭ, လၧဆၧၥုၭမုခမျၧးအယဟိဝၩ အဂးလၧအံဇံၭအဖၧၩ့တၭ, လၧၦမၩအၧၩ့ဆၧအ ကၠီၩ့ၦလဖၪမိကိၭထၪ့ယဟိဝၩတၭ, အဝ့ၫဒၪမိအၪ့ မၧၫ့လၩ့ဆၧထိးထဲၩ့တၩ့ထဲၩ့ဖၭဒိၪလဂၩတၭ, အဝ့ၫ",
			"21": "<sup>21</sup> ဒၪမိမၩဖီၩ့မၩဖျ့ၭအဝ့ၫၥံၪလီၫ.- လၧအံဇံၭအဖၧၩ့ နီၪ,ၦမိၥ့ၪယၫယဟိဝၩတၭ, လၧမုလနံၩနီၪၦအံဇံၭ ဖိၪၥံၪမိၥ့ၪယၫယဟိဝၩ ဒဲမိမၩဆၧလၧဆၧလု,ဒဲဆၧ မၩဘိၪ့တၭ, မွဲမၬမိဆိၪလၩ့အၥၭ လၧယဟိဝၩအ",
			"22": "<sup>22</sup> ဂး,ဒဲမိမၩတီၩအလူလီၫ.- တၭယဟိဝၩမိထးၦအံ ဇံၭဖိၪ,မိထးဝ့ၫတၭ, မိမၩဘျၪထဲၩ့ဝ့ၫတၭ, အဝ့ၫၥံၪ မိဂဲၫထဲၩ့လၧယဟိဝၩအအီၪတၭ, အဝ့ၫဒၪမိထိးဆၧ အၪ့ကံၩ့အၪ့ယၫ လၧအဝ့ၫၥံၪအဂးတၭ, မိမၩဘျၪ ထဲၩ့ဝ့ၫလီၫ.",
			"23": "<sup>23</sup> ဆၧလၧမုလနံၩနီၪဖၧၩ့ၥၭမုမိအီၪလၧအံဇံၭဖိးလၧ အစံရအၫတၭ, ၦအစံရအၫဖိၪမိလ့ၩနုၬလၧအံဇံၭ တၭ,ၦအံဇံၭဖိၪမိလ့ၩနုၬလၧအစံရအၫတၭ, ၦအံဇံၭ",
			"24": "<sup>24</sup> ဖိၪမိမၩဎုၬဆၧလၧၦအစံရအၫဖိၪလီၫ.- ဆၧလၧမုလ နံၩနီၪအံၫစရ့လၭ မိကဲၪထၪ့ခးၥၧၫ့ခးလခး လၧအံ ဇံၭဒဲအစံရအၫအၥိၭ, ဆၧဆိၪဂ့ၩ လၧထံၫဖိၪခးဖိၪ",
			"25": "<sup>25</sup> အၥၭကျၩး- တၭဆၧၥုၭမုခမျၧးအယဟိဝၩ မိဆိၪဂ့ၩ ဝ့ၫတၭ, စံၭဝ့ၫဒၪ, ယၡၩခမျၧးအံဇံၭဒဲအစံရအၫဆၧ မၩလၧယစူၪး ဒဲအံၫစရ့လၭ ယဆၧန့ၥၫနီၪမွဲအဘၪ ဆိၪဂ့ၩဝ့ၫဆံၭ."
		},
		"20": {
			"1": "<sup>1</sup> ဆၧလၧနံၪ့လၧစတၫတၩ့ ဂဲၫလၧအၭစဒီၭ(ထီးအစံ ရအၫအစဎွၩစၫဂၧၫ့အၪ့မၧၫ့လၩ့အဝ့ၫ) ဒဲဒုၭဆၧလၧ",
			"2": "<sup>2</sup> အၭစဒီၭတၭမၩန့ဝ့ၫဒၪနီၪး- ဆၧလၧအထီနီၪယဟိ ဝၩချဲၩ့ဆၧလၧစအၫမူၭအဖိၪခွၫ စအဲၫစ့ယၫအစူၪဖၧၩ့ တၭ,စံၭဝ့ၫဒၪ, လ့ၩဘဲၪ့လၩ့ခွံၬရၧၬဆၧယၬ လၧနယး ဒံၩ့လီၩ့,ဒဲဘဲၪ့လၩ့ခွံၬနခၪ့ဖံၭ လၧနခၪ့ဆံၭ. တၭမၩ",
			"3": "<sup>3</sup> ဝ့ၫဘဲၫနီၪစဲၪ့အီၪဘိၪ့, ဒဲအီၪဘိၪ့ခၪ့လီၫ.- တၭယဟိ ဝၩစံၭဝ့ၫဒၪ, ဘဲၫယခ့ၫယၡၩ စအဲၫစ့ယၫစဲၪ့အီၪဘိၪ့ ဒဲအီၪဘိၪ့ခၪ့ၥၧၫ့နံၪ့လၧဆၧနဲၪ့ ဒဲဆၧအဒီၩ့အထ့ၬလၧ",
			"4": "<sup>4</sup> အံဇံၭအဂဲး, ဒဲကုၡၫအဂဲးအၥိၭနီၪး- အစံရအၫအ စဎွၩမိမီၩ့ၦလၧအဖီၪ့န့ဝ့ၫလၧအံဇံၭ ဒဲၦလၧဆၧအၪ့ မၧၫ့ဎီးဝ့ၫလၧကုၡၫ, ၦအၥၭဘၪ့, ဒဲၦအၥၭၡါ, အီၪ ဘိၪ့,အီၪဘိၪ့ခၪ့, အခဲၫ့ခွးအီၪဘိၪ့အံဇံၭအဆၧမ့ၬမဲ",
			"5": "<sup>5</sup> ဘဲၫနီၪၥိၭဆ့လီၫ.- တၭအဝ့ၫၥံၪမိၥၭမဲၪဝ့ၫလၧကုၡၫ လၧအဒိၭနဲၩ့အၥၭ လၧအဖၧၩ့အကၠီၩ့, ဒဲလၧအံဇံၭ လၧအအီၪက့ၪဖိၫလိၫအၥၭ လၧအဝ့ၫဒၪအကၠီၩ့နီၪ",
			"6": "<sup>6</sup> လီၫ.- တၭဆၧလၧမုလနံၩနီၪ ၦမၫဆမံၭနဲၩ့ဖိၪမိစံၭ, ယိခွါ,ဆၧလၧပယိလါအဖၧၩ့ၥၭနီၪ, ဆၧလၧပစဲၪ့ ထီးအအီၪ လၧဆၧမၩဆၧၩ့ပၧၩအဂး လၧပမိဖီၩ့ဖျ့ၭ လၧအစံရအၫအစဎွၩအမ့ၬယၫမွဲဘဲၫနီၪတၭး ပမိဂၭ ဖျ့ၭပနၫ့ဆါဒၪပဝ့ၫဘဲၫၥ့ၪလဲၪ."
		},
		"21": {
			"1": "<sup>1</sup> ဘဲၫလံၩၥဝံၭလၧမုခံၫ့လခီၫ အူၪဆၧဆီၪ့အၥိၭနီၪ ဂဲၫထၪ့ဝ့ၫလၧၡါမုနၧၫ့ဖၫ လၧခးမၩၥၭမဲၪဆၧလဘံၪ့",
			"2": "<sup>2</sup> လီၫ.- ဆၧဒၪဆၧလၧယၫကၪလမံၩ့နီၪ, ဆၧဒုၭနဲၪဝ့ၫ လၧယၧၩလီၫ. ၦအၪ့လီၫန့ဆၧနီၪ အၪ့လီၫန့ဝ့ၫတၭ, ၦအၪ့ဂူၬဆီၪ့ဆၧနီၪ အၪ့ဂူၬဆီၪ့ဝ့ၫလီၫ. လ့ၩထၪ့ဘီၪ, အံလၫ့ဧ့ၬ ဝၩ့ထၬဆၧဘီၪ, မံဒအၫဧ့ၬ ယဒုၭအီၪလၩ့",
			"3": "<sup>3</sup> မါပံၭယူၭဆၧဂၪ့အုၩဂၪ့ထိၬထီးအလူၬလီၫ.- မၩအ ၥၭဘဲၫနီၪတၭ, ယယးဒံၩ့ဎွ့ၩလၧဆၧဆၫဆိၭက့ၭဘၪ ယၧၩဘဲၫဆၧဆိၭက့ၭလၧအဘၪၦမုၪ လၧအဂူၭဆၫ အၥိၭ,ယအီၪလကဲၪဘၪ လၧယနါဂၧၫ့ဆၧအကၠီၩ့,",
			"4": "<sup>4</sup> ယဝၭထိၬလၧယဒၪဆၧအကၠီၩ့လီၫ.- ယၥၭမၧၩ့,ဆၧ ၥၭမဲၪၥၭဖျဲၩ့မၩၥၭမဲၪၥၭဖျဲၩ့ယၧၩ, ဆၧအီၪက့ၪယဆၧ မုၬဆၧလၩအမုနၩနီၪလၧဆၧဝၭထိၬ လၧယဂးလီၫ.",
			"5": "<sup>5</sup> ဆၧတဲၩ့ဝဲၩယူၭစပွဲ ဒၩလၩ့ဆၧယူၭ အီၪခိၭယူၭ ဆၧလၧခိၭဆၧအလးဖၧၩ့တၭ, အဝ့ၫၥံၪအၪ့ဆၧ, အီၩ",
			"6": "<sup>6</sup> ဆၧလီၫ. ဂဲထုၪ့ၦဒိၪၥံၪဧ့,ဂုၪထၩ့ဖံၭနီၪဆံၭ.- အဂဲး ဘဲၫယီၩကဆါစံၭယၧၩဘဲၫယီၩ, လ့ၩဘီၪ, အီၪက့ၪၦ ခိၭဆၧတၭ,ဆၧလၧအဒၪဘၪဝ့ၫနီၪ, မွဲအလီၩဖျီၪထၪ့",
			"7": "<sup>7</sup> ဆံၭ.- အ့ၪဒၪဘၪၦထူၬကၥ့ၪနံၫဒုၩ, ၦထူၬကၥ့ၪယီၩ့ လဖၪ,ၦထူၬကလအူၭလဖၪတၭ, မွဲအခိၭနၪဝ့ၫလၧ",
			"8": "<sup>8</sup> ဆၧခိၭနၪလၩ့ထံးလၩ့ဆ့ၭဆံၭ.- တၭအဝ့ၫဒၪကိၭ ထၪ့ဝ့ၫဘဲၫဆၬလၥၧၫ့အၥိၭ, ယကဆါဧ့,ယဆၧၫ့ထုၪ့ ယဝ့ၫၥံၫ့နံၩချီၩ့လၧခိၭဆၧအလးဖၫ့ခိၪ လထံၪဎးဘီၩ့ ဎးတၭ,ယအီၪလၧယယိဆၧအလးၥၫ့နၩချီၩ့လီၫ.",
			"9": "<sup>9</sup> တၭယိခွါ, ဆၧယီၩဂဲၫၦထူၬကၥ့ၪနံၫဒုၩနံၫဒုၩလီၫ. တၭချဲၩ့ထၪ့ဒံၭဝ့ၫ, လၩ့ဎီးယူၭ, ဘၭဘလၧၫ့လၩ့ဎီး ယူၭၬတၭအယွၩၥံၪအဆၧဂၩ့ထီးအလူၬနီၪ ဆၧခွံၬ လၩ့ခါခွံၬလၧဂၪ့ခိၪလီၫ.",
			"10": "<sup>10</sup> ယဘုၪယဂူၫလၧအဘၪယဲးဝ့ၫ, ဒဲယယဲးဘုၪအလး ဧ့ၬ ဆၧလၧယနါဂၧၫ့ လၧဆၧၥုၭမုခမျၧးအယဟိဝၩ, အံၫစရ့လၭအယွၩနီၪယလီၩဘၪယူၭနၥံၪယူၭ.",
			"11": "<sup>11</sup> ဆၧကိၭထၪ့ယၧၩ လၧစံအၧၫ, ၦခိၭဆၧလဂၩဧ့ၬ မုနၩအဂဲးအကၠီၪ့နီၪမွဲဘဲၫၥ့ၪလဲၪ. ၦခိၭဆၧလဂၩဧ့ၬမု",
			"12": "<sup>12</sup> နၩအဂဲးအကၠီၪ့နီၪမွဲဘဲၫၥ့ၪလဲၪ.- တၭၦခိၭဆၧလဂၩ စံၭဝ့ၫဒၪ, မုဂီၩဂဲၫဝ့ၫဒဲမုနၩဆ့လီၫ. နၥံၪအ့ၪအၪ့စၪ့ တၭ,အၪ့စၪ့ဆံၭ. ထဲၩ့ထဲၩ့,ဂဲၫထဲၩ့ဆံၭ.",
			"13": "<sup>13</sup> ၦၡၩအဒီၪ့ၥံၪလၧအဖိၬဖၧၩ့ၥၭ လၧဒံၫဒၫနံၫ့ၥံၪဧ့, နၥံၪမိအီၪလၧမုနၩလခီၫ လၧၥံၪ့လဝၩ့အကျၩလၧအရ့",
			"14": "<sup>14</sup> ဘၠၫအဖၧၩ့လီၫ.- ၦခတ့မၫဖိၪဂဲၫန့ထံၫလၧၦၥၭဝံထံၫ အအီၪ, ၦလၧအစဲၪ့ဖျိၭနီၪအဝ့ၫၥံၪလ့ၩဆိၬဆိၫဝ့ၫလၧ",
			"15": "<sup>15</sup> အဆၧအၪ့လီၫ.- အဂဲးဘဲၫယီၩအဝ့ၫၥံၪစဲၪ့ဝ့ၫလၧနၭ အမ့ၬယၫ, လၧနၭထုၭထၪ့အၥၭအမ့ၬယၫ, ဒဲလၧဆၧ",
			"16": "<sup>16</sup> ဒုၭၥုၭအဆၧၡၪ့ဆၧနၭအမ့ၬယၫလီၫ.- အဂဲးဘဲၫယီၩ ကဆါစံၭယၧၩဘဲၫယီၩ, လၧလနံၪ့အထးဖၧၩ့ ဘဲၫၦ ဒိၭအၪ့လံၩ့အနံၪ့အၥိၭနီၪ, ကံဒၧၫအလၩအဖၩ့မိလူၬ",
			"17": "<sup>17</sup> ဝ့ၫထီးအလူၬလီၫ.- တၭၦခၭချံၪၥံၪလၧအအီၪလၩ့ထး လဖၪ,ၦကံဒၧၫဖိၪအၡၩဆီၪ့နီၪမိလၩ့ၡၩလီၫ. အဂဲး ဘဲၫယီၩယဟိဝၩအံၫစရ့လၭအယွၩစံၭဆၧနီၪလီၫ."
		},
		"22": {
			"1": "<sup>1</sup> လၧနလ့ၩထၪ့ဂံၪ့ခိၪထီးအလူၬအကၠီၩ့နီၪ, ဆၧနီၫလၫ",
			"2": "<sup>2</sup> ဘၪနၧၩလမံၩ့လဲၪ.- နဝ့ၫဒၪနဎွ့ၩလၧဆၧတုၩ့ထၪ့တုၩ့ လၩ့,ဒိၩ့လၧအဆၧၥီၫအၪမံၩ့လဖျိၪ့, ဒိၩ့လၧအၥၭထိၬ ဆၧလဖျိၪ့ဧ့ၬ နၡၩလၧအဘၪဆၧမၩၥံၫဝ့ၫလဖၪနီၪ, ဘၪဆၧမၩၥံၫဝ့ၫလၧနၭအ့ၬး မွဲအၥံၫဝ့ၫလၧနဒုၭဆၧ",
			"3": "<sup>3</sup> အဖၧၩ့ဆ့အ့ၬ.- နၦဒိၪၥံၪစဲၪ့ဝ့ၫလစီၪ့ဎးလၧချံၪၥံၪဖျါ ၥံၪအမ့ၬယၫ, ဘၪဆၧစၧၩ့ထၬဝ့ၫ, ကယဲၦလၧဆၧဒၪ န့ဝ့ၫလၧနဖၧၩ့နီၪဘၪဆၧစၧၩ့ထၬဝ့ၫစီၪ့ဎး, စဲၪ့ဖျိၭယူၭ",
			"4": "<sup>4</sup> လၧအယဲၩ့လီၫ.- မၩအၥၭဘဲၫနီၪတၭယစံၭ, ယိဖၬ ယၧၩဆံၭး ယမိဂၪ့နၭနၭလ့ၬတၭ, လၧယၡၩခမျၧး အဖိၪမုၪအဆၧအီၪယူအကၠီၩ့နီၪ ထီးအၪ့ဂူၬမၩမုၬ",
			"5": "<sup>5</sup> ထၪ့ထဲၩ့ယၧၩလဂ့ၩ.- အဂဲးဘဲၫယီၩဆၧခိဆၧဝီၩ,ဒဲ ဆၧယဲးထဲးလၩ့ဆၧ, ဒဲဆၧၥၭဂံၩ့ဂၩ့အမုလနံၩအီၪလၧ အကဆါ, ဆၧၥုၭမုခမျၧးအယဟိဝၩ လၧဆၧဒၪဆၧ လၧယၫအခိၪလီၩ့ဆူၭအဖၧၩ့နီၪလီၫ. မၩလၩ့ဎီးခွံၬ ဆၧအခိၪဒၧၩ့တၭ, ဆၧကိၭထၪ့လၧခိၪလီၩ့ၥံၪလီၫ.",
			"6": "<sup>6</sup> တၭအံလၫ့ဆိၬလၧၫ့ဖီၩ့အီၪလၧၦထူၬလဲၪ့ၥုၭ, ဒဲၦထူၬ",
			"7": "<sup>7</sup> ကၥ့ၪတၭ,ကၧၫနီၪထုၭထၪ့ထၩ့ဖံၭလီၫ.- တၭဆၧမၩ အၥၭလၧနခိၪလီၩ့ဆူၭ လၧအဘၪဆၧရွံန့ဝ့ၫနီၪ မိဎွ့ၩ ဝ့ၫလၧလဲၪ့ၥုၭၥံၪတၭ, ၦထူၬကၥ့ၪနီၪမိအီၪက့ၪလၩ့အ",
			"8": "<sup>8</sup> ၥၭ,ထီးတရၫ့ထံၭနီၪလီၫ.- ဆၧထုၭထၪ့ခွံၬဆၧချႃၬ ဘံၭယုဒၫတၭ, ဆၧလၧမုလနံၩနီၪ, နယိလၧမံၩ့လၬ",
			"9": "<sup>9</sup> ကျၩအဂံၪ့အစူၪဝဲၩလီၫ.- တၭဆၧလၩ့ဎီးအလးလၧ စဒၫဝံၭအဒိၩ့ဖၧၩ့နီၪ နၥံၪဒၪဘၪဝ့ၫလၧအအီၪအၪစီၪ့ လီၫ.တၭနၥံၪဒုၭအီၪကီၪ့ကမၫလၧလၬလခီၫလစီၪ့",
			"10": "<sup>10</sup> အထံၫၥံၪလီၫ.- ဂံၪ့လဖၪလၧယရုစလံၫ့အဖၧၩ့နၥံၪဝံ ထၪ့နၬထၪ့ဝ့ၫတၭ, နၥံၪရိလၩ့ခွံၬယူၭဂံၪ့ၥံၪဘဲၫၥိၭမိ",
			"11": "<sup>11</sup> မၩထဲၩ့ဆၧအခိၪဒၧၩ့လီၫ.- တၭနၥံၪမၩဆၧကၠီၪ့လ စီၪ့လၧခိၪဒၧၩ့နံၫဆၫ့အဘိၩ့ဆၧၩ့ လၧကမၫလးလံၩ အထံၫအဂးလီၫ. အ့ၪမွဲၦလၧအမၩထၪ့ဝ့ၫလဂၩနီၪန ၥံၪယိဝ့ၫအ့ၬ. ၦလၧအကိၪ့မၩဝ့ၫလၧဖျိၩ့နီၪနၥံၪယိမ့ၬ",
			"12": "<sup>12</sup> အဝ့ၫဒၪဆ့အ့ၬ.- တၭဆၧလၧမုလနံၩနီၪကဆါ,ဆၧၥုၭ မုခမျၧးအယဟိဝၩမၪလူၬဆၧဂၪ့ဆၧယၧၩ့, ဒဲဆၧၥုၪ့ အုၭၥၭအုၭ ဒဲဆၧခိၪချၩ, ဒဲဆၧခဲးထူၬယးဒံၩ့လၧရၧၬ",
			"13": "<sup>13</sup> ဆၧယၬလီၫ.- တၭယိခွါၬ ဆၧၥုၪ့ဎွံၫၥၭယီၫ,ဒဲဆၧၥုၪ့ ထိၬၥၭထိၬ လၧဆၧမၩၥံၫချီဖၫၥံၪ ဒဲဆၧဖ့ၬၥံၫၥိၪၥံၪ, အၪ့ဆၧယၪ ဒဲအီၩစဘံၭထံၫလီၫၬ မွဲပအၪ့ၡီၩ့ ဒဲအီၩ",
			"14": "<sup>14</sup> ၡီၩ့ဆံၭ.အဂဲးဘဲၫယီၩကဲဂီၩခိၬပမိၥံၫလီၫၬ- တၭဆၧ ၥုၭမုခမျၧးအယဟိဝၩ နဲၪဖျီၪထၪ့လၧယနါဖၧၩ့ဆၧ အၧၩ့ယီၩ ဆၧမၩဖီၩ့ဖျ့ၭဘၪ လၧနၥံၪလချႃၭ ၥံၫဒံၭ ဘၪလါလါအ့ၬး ကဆါ,ဆၧၥုၭမုခမျၧးအယဟိဝၩ, စံၭဝ့ၫဒၪ.",
			"15": "<sup>15</sup> ကဆါ,ဆၧၥုၭမုခမျၧးအယဟိဝၩစံၭဝ့ၫဘဲၫယီၩ, လ့ၩဘီၪ, လ့ၩနုၬလၧၦခိၭဆၧအစူၪလးခၪ့ခိၪနီၪ, စၡ့ ဘနၫ,လၧအအီၪလၧဂံၪ့အဖၫ့ခိၪလဂၩ အအီၪဆံၭ.",
			"16": "<sup>16</sup> (စံၭအဝ့ၫ,) နဆၧအီၪထီးယီၩမွဲဆၧနီၪလမံၩ့လဲၪ. ၦ အီၪလၧနၥိၭထီးယီၩ လၧနစိၭန့ဆၧၥွၪခိၪလဖၧၩ့လၧ နဂးအကၠီၩ့နီၪ, မွဲပလၫလဂၩလဲၪ. စိၭန့အၥွၪခိၪဖၧၩ့ လၧအလးထၪ့ထီၫၬ ဘုၪ့န့အအီၪအလးလၧလဲၫ့ဖၧၩ့",
			"17": "<sup>17</sup> လီၫၬ- ယိခွါ, ယဟိဝၩမိခွံၬၡိၭခွံၬနၧၩလၧဆၧခွံၬၡိၭ",
			"18": "<sup>18</sup> ဆီၪ့, ၦၡၩဧ့း မိချႃၬဘံၭနၧၩတၡါလီၫ.- ချံးတၭမိချံး နၧၩဘဲၫဆၧဖျိၪ့ဒိၪ့လဖျိၪ့အၥိၭ လၧခးဖၭလဲအဖၧၩ့နီၪ လီၫ.ထီးနီၪနမိၥံၫတၭ, ထီးနီၪနလဲၪ့ၥုၭၥံၪမိအီၪလၧ",
			"19": "<sup>19</sup> အလၩအဖၩ့, နကဆါအဂံၪ့အမ့ၬမဲလီၫ.- တၭယမိ နၫ့ထၪ့ခွံၬနၧၩ လၧနအီၪအလးနီၪ, ဒဲလၧနမၩဆၧအ",
			"20": "<sup>20</sup> လးနီၪအဝ့ၫဒၪမိထုၭလၩ့ခွံၬနၧၩလီၫ.- တၭလၧမုလ နံၩနီၪဆၧမိမၩအၥၭ လၧယမိကိၭန့ယခ့ၫယၡၩစဟံၫ",
			"21": "<sup>21</sup> လကဲအၫအဖိၪခွၫစအံၫလဲအကံၫ့း- ယမိဒုၭၥိၭအဝ့ၫ ဒၪလၧနဆဲၫ့တၭ, ယမိဒုၭဆီၪ့ထၪ့အဝ့ၫဒၪလၧနခၧၩ့ ယးနီၪ,ဒဲနစီၩ့နမၩ့ယမိဖ့ၪလၫ့ လၧအစူၪဖၧၩ့တၭ,အ ဝ့ၫဒၪမိကဲၪထၪ့ၦအီၪဝ့ၫ လၧယရုစလံၫ့အဖၧၩ့,ဒဲယုဒၫ",
			"22": "<sup>22</sup> အၡၩဂံၪ့ဖိၪအဖါလီၫ.- ယမိအီၪက့ၪစဒၫဝံၭအဂံၪ့အ နိၪဝံၬလၧအခိၬထံၭခိၪလီၫ. အဝ့ၫဒၪမိဝဲထၪ့ဆၧတၭ, ဆၧကၭဘံၭထၬ အီၪနးဂၩအ့ၬး မိကၭဘံၭထၬဆၧ",
			"23": "<sup>23</sup> တၭ,ဆၧဝဲထၪ့ဝ့ၫမိအီၪနးဂၩအ့ၬ.- တၭယမိမၩခၧၫ့ အဝ့ၫဒၪဘဲၫထၭစဲၩလဘီၩ့ လၧအလးခၧၫ့အၥိၭတၭ, မိကဲၪထၪ့လးဆီၩ့ဆီအီၪလၧအလၩအဖၩ့ လၧအဖါ",
			"24": "<sup>24</sup> အဂံၪ့အဂးလီၫ.- တၭၦလဖၪမိဘျၭထၪ့အဖါအဂံၪ့အ လၩအဖၩ့ထီးအလူၬလၧအလီၩ့, ဆၧဂဲၫထၪ့လၧဆၧ လၩ့ဆၨၩ, ကယဲလိၫ့ၥံၪ, ထွ့ၫၥံၪအဆံၭအဒိၪလဖၪ",
			"25": "<sup>25</sup> အဖျိၪ့ဒၪလ့ၬဖိးလၧပလၫ့ကိၭမံၩ့ဒ့ၭလီၫ.- ဆၧၥုၭမု ခမျၧးအယဟိဝၩစံၭဝ့ၫဒၪ, ဆၧလၧမုလနံၩနီၪထၭစဲၩ လဘီၩ့အီၪခၧၫ့ လၧအလးခၧၫ့မိဘၪဆၧထုၭခွံၬဝ့ၫဆၧ မိဖ့ၬခွံၬဝ့ၫနီၪ, မိလၩ့ထ့ၬတၭး ဆၧအဎၧၫ့လၧအအီၪ ဝ့ၫလၧအလီၩ့နီၪ မိဘၪဆၧဒၪ့ထ့ၬခွံၬဝ့ၫဒၪလီၫ. အဂဲး ဘဲၫယီၩယဟိဝၩချဲၩ့ဆၧလီၫ."
		},
		"23": {
			"1": "<sup>1</sup> တၫၡံၭအကဘၩ့ၥံၪဧ့, အိၩ့ယိၩ့ထၪ့နၥံၪဝ့ၫဆံၭ. အဂဲးဘဲၫယီၩဆၧအီၪယူဝ့ၫဒၪတၭး ဂံၪ့လအီၪဘၪနီၪ ဆၧလ့ၩနုၬအလးအီၪအ့ၬး လၧခးဆံၭထံၫ့နီၪဆၧဒုၭ",
			"2": "<sup>2</sup> နဲၪဖျီၪထၪ့ဆၧလီၫ.- ၦကျိၩ့ဖိၪၥံၪဧ့, အီၪလၩ့မါပံၭ ဘီၪးဇဲဒၧၫ့အၡၩဖနံၬဖိၪ ခၫ့ဂၬမၫဆမံၭတၭ, မၩဎွ့ၩ",
			"3": "<sup>3</sup> နၧၩ.- တၭလၧထံၫဖၭဒိၪအဖၧၩ့နီၪ ထံၫမိၡါစဲဟီၫအ ချံၫအီၪတၭ, ထံၫမိၡါအကူၭဆၧနီၪဂဲၫလၧအအီၪတၭ,",
			"4": "<sup>4</sup> မွဲဝ့ၫလၧၦဆၨၩၥံၪအဖၠၫဖၧၩ့လီၫ.- ဇဲဒၧၫ့ဧ့, မ့ၬမဲနဝ့ၫ ဆံၭ.အဂဲးဘဲၫယီၩမၫဆမံၭချဲၩ့ဆၧ, မၫဆမံၭအထိၬ လဖၪချဲၩ့ဆၧတၭ,စံၭဝ့ၫယဘၪဆၧဂူၭဆၫအ့ၬး တၭ ယဆီၫ့အီၪန့ဆၧအ့ၬး တၭယဒုၭဒိၪထၪ့ဖိၪၥၪခွၫအ့ၬး",
			"5": "<sup>5</sup> ယအၪ့လုန့ၦမုၪနၩ့ဆ့အ့ၬ.- ထီးဆၧပရၧၫ့ထီၩ့လၧ အံဇံၭအဂဲးအကၠီၪ့တၭ, ဘၪဝ့ၫလၧဆၧဆိၭက့ၭလၧ",
			"6": "<sup>6</sup> တဲအၫအပရၧၫ့အကၠီၩ့လီၫ.- ခၫ့ဂၬဖိးလၧတၫၡံၭးအိၩ့",
			"7": "<sup>7</sup> ယိၩ့ထၪ့ဘီၪ, ၦကျိၩ့ဖိၪၥံၪဧ့,- နၥံၪအဆၧၥၭထိၬလ မံၩ့နီၪမွဲအဝ့ၫယီၩဧၪ. အခၪ့ထံၭနီၪအီၪဝ့ၫလၧမုနံၩ လၧဖျိၩ့လံၩလံၩလီၫ. အခၪ့မိဆိၬခွံၬအနၫ့ဆါဒၪ",
			"8": "<sup>8</sup> ဝ့ၫလၧအယဲၩ့ဘဲၫၥိၭအမိအီၪဝ့ၫလီၫ.- တၭၦလၧအ ကိၪ့ထၪ့ထၫ့ဒၩတဲအၫ, ၥရဖူၩလၧအၡၩဖနံၬဖိၪ ၦဒိၪ ဖၭဒိၪၥံၪ,ဒဲအၡၩအၪ့ဆၫဆၧ, ဎွ့ၩဆၧမွဲၦလၧအဆၧ",
			"9": "<sup>9</sup> ဖၩ့အီၪနီၪမွဲပလၫလဂၩလဲၪ.- ဆၧၥုၭမုခမျၧးအယ ဟိဝၩကိၪ့ထၪ့ဝ့ၫဘဲၫၥိၭ အမိမၩစံၪစၪဆၧအဎံၫအ လၩထီးအလူၬအဆၧထၪ့ထီၫ, ဘဲၫၥိၭအမိမၩကြၩ့ ထမးကယဲၦလၧအလၩအဖၩ့အီၪ လၧဂၪ့ခိၪချိၫ့ထီး",
			"10": "<sup>10</sup> အလူၬလီၫ.- ခၫ့ဂၬနခးဘဲၫထံၫမိၡါအၥိၭ, တၫၡံၭအ",
			"11": "<sup>11</sup> ဖိၪမုၪဧ့,ခၧၩ့ယးအီၪလၧၩ့အ့ၬ.- အစူၪယၩ့ထၪ့အၥၭ လၧမၫဆမံၭအဖၫ့ခိၪလီၫ. အဝ့ၫမၩဝၭဘၩ့မုးလဖၪ လီၫ.ယဟိဝၩမၪလူၬဆၧ လၧကၫနအၫ့အဂဲးအကၠီၪ့",
			"12": "<sup>12</sup> ဘဲၫၥိၭၦမိမၩဂၭဂီၩ့အထိၬလဖၪလီၫ.- တၭစံၭဝ့ၫဒၪ, နမၩအၪထၪ့လၧၩ့ ဆၧၥုၪ့ဎွံၫၥၭယီၫအ့ၬ. ၦမုၪအဂီၩ့ ဇဲဒၧၫ့အဖိၪမုၪနၩ့ဧ့, ဂဲထုၪ့ဘီၪ, ခၫ့ဂၬဆၧလၧဆံၭထံၫ့",
			"13": "<sup>13</sup> ဆံၭ.ထီးနီၪဆၧအီၪပွံၭလၧနဂးအီၪဆ့အ့ၬ.- ယိခွါ, ခၫလဒံအၫဖိၪၥံၪအခးလီၫ. ထီးအစံရအၫအီၪက့ၪ လၩ့အခၫ့ထံၭလၧၦအီၪဝ့ၫလၧၡါမုနၧၫ့ဖၫအဂးနီၪ, ၦ လဆၨၩအီၪဒံၭအ့ၬ. အဝ့ၫၥံၪၥုၪ့ထၪ့ဝ့ၫအတၨၭခိၭ ဆၧ,ဒဲမၩကဲၪထၪ့အနီးလဖၪတၭ, အဝ့ၫဒၪအီၪက့ၪဝ့ၫ",
			"14": "<sup>14</sup> လၧဆၧလၩ့ဎီးလီၫ.- တၫၡံၭအကဘၩ့ၥံၪဧ့,,အိၩ့ယိၩ့ ထၪ့နၥံၪဝ့ၫဆံၭ, အဂဲးဘဲၫယီၩ နၥံၪအထိၬနီၪဂၭဂီၩ့ ယူၭ.",
			"15": "<sup>15</sup> တၭဆၧလၧမုလနံၩနီၪ ဆၧမိမၩအၥၭလၧဆၧမိၥၭ နၪ့တဲအၫအနံၪ့နွ့ၫဆံၫ ဘဲၫစဎွၩလဂၩအမုနံၩလဖၪအ ၥိၭနီၪလီၫ. လၧအနံၪ့နွ့ၫဆံၫအထုၬနီၪ ဆၧမိမၩအၥၭ လၧတဲအၫအဂး ဘဲၫမဲၩဎွဲၩမုၪအထၭခိၪအၥိၭလီၫ.",
			"16": "<sup>16</sup> ၦမဲၩဎွဲၩမုၪလၧအဘၪဆၧၥၭနၪ့ခွံၬဝ့ၫလဂၩဧ့, ဘဲၫၥိၭ ဆၧမိနၪ့ထၪ့ထဲၩ့နၧၩတၭ, မၩနနါဒံၩ့နးဖျိၪ့လ့ၩဎဲၪ့ဒိၩ့",
			"17": "<sup>17</sup> ဒံၩ့ထၭခိၪအၪယွ့အ့ၪဂ့ၩဆံၭ.- လၧအနံၪ့နွ့ၫဆံၫအ ထုၬနီၪဆၧမိမၩအၥၭလၧယဟိဝၩ မိဒုၭအီၪထၪ့တဲ အၫတၭ,တဲအၫမိထဲၩ့ထဲၩ့လၧအလံၩ့အလဲၫတၭ, မိ အီၪက့ၪအၥၭလၧအမိမၩဆၧလဲးဆၧဘျၪလၧဘၩ့ၥံၪ",
			"18": "<sup>18</sup> မုးၥံၪလၧဂၪ့ခိၪချိၫ့ထီးအလူၬလီၫ.- အဆၧဖနံၬ,ဒဲအ လံၩ့အလဲၫနီၪ, မိကဲၪထၪ့ဆၧဆံၫ့ဎံၪလၧယဟိဝၩအ ဂးလီၫ. ၦအီၪက့ၪကီၪ့ဘၪဝ့ၫအ့ၬး ၦအီၪက့ၪထၬဘၪ ဝ့ၫအ့ၬး အဂဲးဘဲၫယီၩ အဆၧဖနံၬနီၪမိအီၪလၧၦအ ဆၧၫ့နၩ့ဝ့ၫလၧယဟိဝၩအမ့ၬယၫအဂး, ဘဲၫၥိၭအဝ့ၫ ၥံၪမိဘျဲၩအၪ့, ဒဲလၧအဆၧကီၩ့ဆၧၥိၭအဂ့ၩအဂးလီၫ."
		},
		"24": {
			"1": "<sup>1</sup> ယိခွါ, ယဟိဝၩလူၫလၩ့ခွံၬခးနီၪတၭ,ဒုၭအီၪယူ ဝ့ၫဒဲအီၪက့ၪချႃၬလၩ့ဝ့ၫတၭ, မိမၩလၩ့ပြံၩလၩ့ပၩ ၦ",
			"2": "<sup>2</sup> ခးဖိၪလဖၪနီၪလီၫ.- တၭဆၧမိမၩအၥၭ ဘဲၫၦခမျၧး အၥိၭနီၪ, ၦလုဆၧမွဲဘဲၫနီၪၥိၭး ဘဲၫၦအခ့ၫအၡၩ အ ၥိၭနီၪ,အကဆါမွဲဘဲၫနီၪအၥိၭး ဘဲၫၦအခ့ၫအၡၩ အ မုၪအၥိၭနီၪ, အကဆါမုၪမွဲဘဲၫနီၪၥိၭး ဘဲၫၦဎွ့ၩဆၧ အၥိၭနီၪ,ၦအၪ့ဆၫဆၧမွဲဘဲၫနီၪၥိၭ ဘဲၫၦအၪ့လီးဆၧ အၥိၭနီၪ,ၦဒုၭအၪ့လီးဆၧမွဲဘဲၫနီၪအၥိၭ, ဘဲၫၦလၧ အမါအီၪဝ့ၫအၥိၭနီၪ အမါဆါမွဲဘဲၫနီၪအၥိၭလီၫ.",
			"3": "<sup>3</sup> ထံၫၥံၪခးၥံၪနီၪမိအီၪပျီၩဝ့ၫဆံၫ့ဆၫ့ပျၩ့တၭ, ဆၧမိ အၪ့ဂူၬန့အဆၧကျံၩ့နံၩ့လီၫ. အဂဲးဘဲၫယီၩယဟိဝၩ",
			"4": "<sup>4</sup> ချဲၩ့ဆၧချဲၩ့လထံၪနီၪလီၫ.- ဂၪ့ခိၪဖိၪၥုၪ့အုၭၥၭအုၭ, လၩ့ဘဲၩ,ခးၥဲၫလၩ့ဆါလၩ့ဘျၭ, လၩ့ဘဲၩၦဂၪ့ခိၪဖိၪ",
			"5": "<sup>5</sup> အထီၫထုၬလၩ့ဆါလၩ့ဘျၭဝ့ၫလီၫ.- တၭထံၫၥံၪခးၥံၪ နီၪစံၪစၪလၧၦအီၪဝ့ၫလၧအဖၧၩ့လဖၪအဖၫ့လၬလီၫ. အဂဲးဘဲၫယီၩ ၦလၨၪခၫ့ဖၬဆၧၥီၪ့ဆၧၥၫ့, အၪ့လဲၩ ခွံၬဆၧမၪလူၬၥံၪမၩဂၭဂီၩ့ ဆၧအုၩ့လၩ့အဆိၩအကၠၪ",
			"6": "<sup>6</sup> လီၫ.- မၩအၥၭဘဲၫနီၪတၭ, ဆၧဆိၪအၧၩ့အၪ့ခွံၬဂၪ့ခိၪ ဖံၭခိၪတၭ, ၦလၧအအီၪလၧအဖၧၩ့လဖၪနီၪ ထိးဆၧ",
			"7": "<sup>7</sup> ဒဲၩဘၭလီၫ.- မၩအၥၭဘဲၫနီၪတၭ, ဂၪ့ခိၪဖိၪလူၬခွံၬဝ့ၫ တၭ,ၦၡၩလၧအအီၪလၩ့ထးလဖၪနီၪမွဲ ၡၩခိၬလီၫ.",
			"8": "<sup>8</sup> စဘံၭထံၫအၥၫ့နီၪၥုၪ့အုၭၥၭအုၭတၭ, စဘံၭမုလၩ့ ဆါလၩ့ဘျၭလီၫ. ကယဲၦလၧအၥၭဎွံၫၥံၪဂၪ့အုၩဂၪ့ ထိၬထီးအလူၬလီၫ. တၭအဆၧၥၭထိၬနီၪအီၪထီဝ့ၫ, ၦလၧအၥုၪ့ဎွံၫၥၭယီၫအီၪလၩ့မါပံၭ, နါဒံၩ့အဆၧၥၭ",
			"9": "<sup>9</sup> ထိၬအီၪထီဝ့ၫလီၫ.- အီၩလၧၩ့စဘံၭထံၫအီၪလၧထၭ ခိၪအ့ၬ.ၥံၭထံၫဂၬထံၫခၪဝ့ၫလၧၦလၧအအီၩဝ့ၫအဂး",
			"10": "<sup>10</sup> လီၫ.- ဆၧအီၪပျီၩအဒိၩ့နီၪလၩ့ဎီးဝ့ၫလီၫ. ကယဲဂံၪ့",
			"11": "<sup>11</sup> ကၭဘံၭထၬအၥၭဘဲၫၥိၭ ၦထီးနုၬလဂ့ၩလီၫ.- ဆၧ ကိၭလၧစဘံၭထံၫအဂးနီၪ အီၪဝ့ၫလၧအဖၧၩ့ၥၭအ ဖၧၩ့,ကယဲဆၧၥၭထိၬနီၪ, လ့ၩဖီၩ့ခွံၬဝ့ၫလၧဂၪ့ခိၪအ ဆၧၥုၪ့ဎွံၫၥၭယီၫစဲၪ့ထၪ့ခွံၬဝ့ၫလီၫ.-",
			"12": "<sup>12</sup> ဆၧအီၪလၩ့ထး လၧဒိၩ့ဖၧၩ့နီၪအီၪယူဝ့ၫတၭ, တရၫ့နီၪဆၧဒိၪလၩ့ဎီး ဝ့ၫဒၪလီၫ.",
			"13": "<sup>13</sup> အဂဲးဘဲၫယီၩဆၧမိမၩအၥၭလၧဂၪ့ခိၪအၥၭကျၩ, လၧၦဆၨၩၥံၪအကျၩ ဘဲၫအလဲအိၫ့ဝၭဝ့ၫအၥိၭ, ဘဲၫ လၧဆၧအၪ့ထုၫ့ကီၪ့ဆၧဂီၩ့တၭ, ဆၧအီၪလၩ့ထ့ၬအ",
			"14": "<sup>14</sup> ၥိၭနီၪလီၫ.- အဝ့ၫၥံၪမိကိၭၡၭထၪ့အလူ, မိၥံၫကျံၩ ထၪ့ဆၧလၧယဟိဝၩအကယးကဖးအကၠီၩ့ မိကိၭၡၭ",
			"15": "<sup>15</sup> ထၪ့လၧမၫဆမံၭဖၧၩ့လီၫ.- မၩအၥၭဘဲၫနီၪတၭ, မၩ လၩဖၩ့ယဟိဝၩလၧဆၧဖၩ့လဖၪအကျၩ, ယဟိဝၩ အံၫစရ့လၭအယွၩအမံၩ့ လၧမၫဆမံၭအကျိၩ့ဖၧၩ့ၥံၪ",
			"16": "<sup>16</sup> ဆံၭ.- လၧဂၪ့ခိၪအထုၬနီၪပနါဂၧၫ့ ထၭခိၪအၥီၫဘဲၫ ယီၩ,စံၭထၪ့အၪ့အူၭၦတီၩၦလီၩ့ဆံၭ. အ့ၪမွဲယစံၭ ယဘၪဆၧအၡၪ့, ယဘၪဆၧအၡၪ့, ယဘၪဆၧအၡၪ့ လီၫ.ၦအၪ့လီၫန့ဆၧလဖၪနီၪ အၪ့လီၫန့ဆီၪ့, မွဲမၬ,",
			"17": "<sup>17</sup> ၦအၪ့လီၫန့ဆၧမၩဆီၪ့လ့ၬလီၫ.- မွဲဆၧကိၭဎီခွံၬ, ဒဲ",
			"18": "<sup>18</sup> ဆၧဖၧၩ့ၥံၪ,ဒဲဖျံၩခွၩ့နီၪဘၪနၧၩၦခးဖိၪဧ့,- တၭဆၧ မိမၩအၥၭလၧၦလၧအစဲၪ့ဝ့ၫ လၧဆၧကိၭဎီအၥီၫအမ့ၬ ယၫနီၪ,မိလၩ့ထ့ၬလၧဆၧဖၧၩ့ၥံၪအဖၧၩ့တၭ, ၦလၧ အဂဲၫထၪ့လၧဆၧဖၧၩ့ၥံၪအဖၧၩ့နီၪ, မိဘၪဖျံၩခွၩ့လီၫ. အဂဲးဘဲၫယီၩ ဆၧဖိးလၧထၭလခီၫအီၪဝဲထၪ့အၥၭ",
			"19": "<sup>19</sup> တၭ,ဂၪ့ခိၪအခၪ့ထံၭလဖၪၡိၩ့ၡိၬဝ့ၫဒၪလီၫ.- ထ့ဖၭ ယူၭ,ဂၪ့ခိၪထ့ဖၭလၩ့အၥၭယူၭး ခါလၩ့ယူၭး ဂၪ့ခိၪ",
			"20": "<sup>20</sup> ခါလၩ့ယူၭအၥၭယူၭ,- ဂၪ့ခိၪလ့ၩဆၧဒံၩ့ခံၫ့ဒၪ့ဎၩ့ ဘဲၫၦမၧၩ့ဆၧအၥိၭတၭ, ဝၭဝ့ၫဘဲၫဆူၭအၥိၭနီၪလီၫ. တၭအဆၧဒဲၩဘၭနီၪဎၧၫ့ဝ့ၫလၧအဖၫ့ခိၪတၭ, မိလၩ့ ထံၩဖါဝ့ၫတၭ, ဂဲထုၪ့နၧၩ့အ့ၬ.",
			"21": "<sup>21</sup> တၭလၧမုလနံၩနီၪဆၧမိမၩအၥၭ လၧယဟိဝၩမိ စ့ၩရၫ့ဆၧၥုၭမုထၪ့ထီၫအီၪလၧဆၧထၪ့ထီၫ, ဒဲဂၪ့ခိၪအ",
			"22": "<sup>22</sup> စဎွၩလဖၪလၧဂၪ့ခိၪချိၫ့လီၫ.- တၭဆၧမိဒုၭအီၪကီၪ့ အဝ့ၫၥံၪလၧဆၧအီၪကီၪ့နးစီၪ့ ဘဲၫၦထီၫ့ဖိၪလၧထီၫ့ ဖၧၩ့အၥိၭတၭ,မိဘၪဆၧကၭထံၬထၬ အလးခဲၫ့လၧ ထီၫ့ဖၧၩ့တၭ, အၪနံၩအၪၥၫ့အလးခဲၫ့နီၪဆၧမိဒၪဘၪ",
			"23": "<sup>23</sup> ဆၧလလၧၫ့လဎွ့ၩဘၪလီၫ.- ထီးနီၪလဖၧၫ့လၩမိအီၪ က့ၪမဲအမ့ၬတၭ, မုမိမ့ၬမဲလီၫး အဂဲးဘဲၫယီၩဆၧၥုၭမု ခမျၧးအယဟိဝၩနီၪမွဲစဎွၩလၧခိၪလီၩ့ဇံအိၫ့အလီၩ့ လၧယရုစလံၫ့အဖၧၩ့တၭ, ဆၧလၩဖၩ့အီၪဝ့ၫလၧၦ ၥုၪ့က့ၭၥၭၡါအမ့ၬယၫလီၫ."
		},
		"25": {
			"1": "<sup>1</sup> ယဟိဝၩဧ့, နမွဲယယွၩလီၫ.ယမိအီၪက့ၪထၪ့ထီၫ နၧၩ,ယမိစံၭထၪ့အၪ့အူၭနမံၩ့လီၫ. အဂဲးဘဲၫယီၩ န မၩဆၧလၩ့လၭး ဆၧကိၪ့ထၪ့ဖၭလၩ့လၧဖျိၩ့လံၩလံၩ,",
			"2": "<sup>2</sup> မွဲဆၧအလူတီၩ, ဆၧမွဲဆၧတီၩလီၫ.- အဂဲးဘဲၫယီၩ နအီၪက့ၪဒိၩ့လဖျိၪ့လၧဆၧပိၩ့, ဒိၩ့အီၪလၧအခိၪဒၧၩ့ လဒိၩ့လၩ့ဎီး, ၦလခီၫဘၩ့မုးဖိၪအနီးလမွဲလၧၩ့ဘၪ ဒိၩ့လဖျိၪ့လီၫ. လၩ့ဆိၩလၩ့ကၠၪဆၧမိမၩထၪ့ထဲၩ့ဝ့ၫ",
			"3": "<sup>3</sup> အ့ၬ.-မၩအၥၭဘဲၫနီၪတၭ, ၦအဆီၪ့လဆၨၩမိစံၭထၪ့ အၪ့အူၭနၧၩ, ၦအဆၨၩလၧအဒုၭၥၭမဲၪဆၧအဒိၩ့ဖိၪ",
			"4": "<sup>4</sup> နီၪမိၥၭမဲၪနၧၩလီၫ.- အဂဲးဘဲၫယီၩ နမွဲယူၭထိၬလၧၦ ၡၪ့ဖိၪယၬဖိၪအဂး ထိၬလၧၦဘၪနၭဘၪၡၪ့အဂးလၧ အဘၪဆၧကၪအဘိၩ့ဘၭ, ဆၧဖလ့ၬအလးလၧလံၩမု, ဆၧလၩၡုၪ လၧဆၧခိအကၠီၩ့း လၧပမၩၥၭမဲၪဆၧၥံၪ အအူၪၡိၫဆၧမၩအၥၭ ဘဲၫလံၩမုဘၪဆၧဒီၪ့အၥိၭနီၪ",
			"5": "<sup>5</sup> အဘိၩ့ဘၭလီၫ.- ဘဲၫဆၧခိလၧအလးဎဲၫ့အၥိၭ, ၦလ ခီၫဘၩ့မုးဖိၪ အၥီၫ့နီၪနမိမၩလၩ့ဆါလီၫ. ဘဲၫဆၧခိ လၧဆၧအုၪ့အလၩၡုၪအဖၫ့လၬအၥိၭ, ၦအဆီၪ့အ ဆၧၥံၫကျံၩနီၪ လၩ့မါဝ့ၫဘဲၫနီၪၥိၭလီၫ.",
			"6": "<sup>6</sup> တၭဆၧၥုၭမုခမျၧးအယဟိဝၩ မိမၩဘိၪ့လၧဆၧ အၪ့ဘီၪ့ၥိၪ, ဆၧဘိၪ့အီၩစဘံၭထံၫအီၪလၧစဘံၭၥၪ အဖၧၩ့,ဆၧဘီၪ့ၥိၪလၧအအွံၪ, စဘံၭထံၫအီၪလၧစဘံၭ ၥၪလၧအဖၧၩ့,လၧအဎံၪဝ့ၫလၧၦကိၭဆၨၩဒ့ၭအဂး",
			"7": "<sup>7</sup> လၧခိၪလီၩ့ယီၩအလီၩ့လီၫ.- တၭလၧခိၪလီၩ့အလီၩ့ ယီၩမွဲအမိမၩဂၭဂီၩ့ဆၧမၩဘံၭမ့ၬ လၧအအီၪလၧၦ ကိၭဆၨၩဒ့ၭအဖၫ့ခိၪ, ဒဲဖၬဘဲၩ့လဘံၪ့လၧအချႃၬဘံၭ",
			"8": "<sup>8</sup> ၦကိၭဆၨၩဒ့ၭလီၫ.- ဆၧၥံၫလၩ့ဘၧၩ့ယူၭလၩ့ဆိၩလၩ့ ကၠၪယူၭတၭ, ကဆါယဟိဝၩမိထူၭခွံၬမ့ၬထံၫလၧ ကယဲၦမ့ၬအလီၩ့ကိၭဂၩဒ့ၭတၭ, မိမၩန့ထၪ့ခွံၬအၡၩ ခမျၧးအဆၧဒုၪဒွ့ၪလၧဂၪ့ခိၪထၧၫ့ဖျိၪ့ယၫလီၫ. အဂဲး",
			"9": "<sup>9</sup> ဘဲၫယီၩယဟိဝၩချဲၩ့ဆၧလီၫ.- တၭၦမိစံၭလၧမုလနံၩ နီၪ,ယိခွါ, အဝ့ၫဒၪယီၩမွဲပယွၩလီၫ. ပယိလါယူၭအ ဖၧၩ့ၥၭတၭ,မိထိးထဲၩ့တၩ့ထဲၩ့ပၧၩလီၫ. အဝ့ၫဒၪယီၩ မွဲယဟိဝၩလီၫ. ပယိလါယူၭအဖၧၩ့ၥၭလီၫ. ပမိၥုၪ့ ဎွံၫၥၭယီၫတၭ, ပမိၥၭထိၬလၧအဆၧထိးထဲၩ့တၩ့ထဲၩ့ အဖၧၩ့လီၫ.",
			"10": "<sup>10</sup> အဂဲးဘဲၫယီၩ ယဟိဝၩအစူၪမိအီၪပွံၭလၧခိၪလီၩ့ ယီၩအလီၩ့တၭ,မိအၭမိဘၪဆၧယဲးထဲးဝ့ၫလၧအလး ဖၧၩ့,ဘဲၫလီခၫ့ဘၪဆၧယဲးထဲးဝ့ၫ လၧဆၧအ့ၪပိၩ့အ",
			"11": "<sup>11</sup> ထံၫကျၩအၥိၭနီၪလီၫ.- မွဲအယၩ့ထၪ့အစူၪလၧအကျၩ, ဘဲၫၦယါထံၫယၩ့ထၪ့အစူၪ ဘဲၫၥိၭအမိယါထံၫလီၫ. တၭအဝ့ၫမိဆၪ့လၩ့ထၬ အဆၧထၪ့ထီၫ, ဒဲအမၩဆၧ",
			"12": "<sup>12</sup> ဆီၪ့လၧအစူၪနီၪလီၫ.- တၭနဒိၩ့ခိၪဒၧၩ့ အထိၬထၪ့ ထီၫ,အထိၬလဖျိၪ့နီၪ အဝ့ၫဒၪမိရိလၩ့ခွံၬဆၪ့လၩ့ဝ့ၫ, မၩလၩ့ဎီးထီၩ့လၩ့လၧဂၪ့ခိၪ, မၩလၩ့ဒၩလၧဂၪ့ခိၪမုၬ အကျၩလီၫ."
		},
		"26": {
			"1": "<sup>1</sup> လၧမုလနံၩနီၪ ပမိၥံၫကျံၩထၪ့ဆၧၥံၫကျံၩယီၩလၧ ခးယုဒၫအဖၧၩ့, ၦမိအီၪလၧဒိၩ့ဂုးခၧၫ့လဖျိၪ့လီၫ. ယွၩ အီၪက့ၪဆၧထိးထဲၩ့တၩ့ထဲၩ့ လၧအခိၪဒၧၩ့,ဒဲအခိၪ",
			"2": "<sup>2</sup> ဒၧၩ့လၧခီၫ့လီၫ.- ဝဲထၪ့တရၫ့ၥံၪဘီၪ, မွဲဘဲၫၥိၭၦတီၩ လဆၨၩလၧအထီးန့ဆၧမွဲဆၧတီၩနီၪ, မိလ့ၩနုၬဝ့ၫဒၪ",
			"3": "<sup>3</sup> လီၫ.- ၦအၥၭလၧအဒိၭနဲၩ့အၥၭလၧနၧၩနီၪ, နမိခိၭ ထၬအဝ့ၫဒၪလၧ ဆၧမုၬလၩလၧၫ့လၧၫ့ဎွ့ၩဎွ့ၩအဖၧၩ့း",
			"4": "<sup>4</sup> အဂဲးဘဲၫယီၩ မွဲအဒိၭနဲၩ့အၥၭလၧနၧၩလီၫ.- ဒိၭနဲၩ့ နၥံၪအၥၭလၧယဟိဝၩလၩ့ဆိၩလၩ့ကၠၪဆံၭ. အဂဲး ဘဲၫယီၩ လၧကဆါယဟိဝၩအဖၧၩ့နီၪ လဲၫ့အဆိၩအ",
			"5": "<sup>5</sup> ကၠၪအီၪဝ့ၫလဖျိၪ့လီၫ.- အဂဲးဘဲၫယီၩမွဲအဆၪ့လၩ့ၦ အီၪဝ့ၫလၧအလးထၪ့ထီၫ, ဒိၩ့အီၪထၪ့ထီၫလဖျိၪ့နီၪ, အဝ့ၫဒၪအီၪက့ၪလၩ့ဖၨၪဝ့ၫတၭ, မိအီၪက့ၪလၩ့ဖၨၪ ဝ့ၫဎၩ့လၧဂၪ့ခိၪတၭ, မိဆၪ့လၩ့ဝ့ၫထီၩ့လၧဂၪ့ခိၪအ",
			"6": "<sup>6</sup> မုၬလီၫ.- ၦအခၪ့မိယဲးလၩ့ဝ့ၫ, ၦဘၪၡၪ့ဘၪနၭအခၪ့,",
			"7": "<sup>7</sup> ၦၡၪ့ဖိၪအခၪ့လီၫ.- ၦတီၩအဖၧၩ့ၥၭနီၪလီၩ့ဝ့ၫဒၪလီၫ. နဝ့ၫဒၪလၧၫ့ဎွ့ၩလၧဆၧတီၩဆၧလီၩ့လဂၩဧ့, နမၩဎၩ့",
			"8": "<sup>8</sup> ၦတီၩအဖၧၩ့ၥၭလီၫ.- မွဲမၬ, လၧနစ့ၩရၫ့ဆၧအဖၧၩ့ ၥၭနီၪပယိလါယူၭနဖၧၩ့ၥၭလီၫ. ယဟိဝၩဧ့, ပၥၭဆိၫ့",
			"9": "<sup>9</sup> န့နမံၩ့,ဒဲဆၧနၪ့ထၪ့ထဲၩ့နၧၩလီၫ.- ယဆိၫ့န့ယူၭနၧၩ လၧယၥၭလၧမုနၩလခီၫ, မွဲမၬ,ယမိအၪ့ဎၬနၧၩလၧ ယၥၭလၧယဖၧၩ့ဂီၩဂီၩလီၫ. အဂဲးဘဲၫယီၩထီးနဆၧ စ့ၩရၫ့အီၪလၧဂၪ့ခိၪချိၫ့တၭ, ၦဂၪ့ခိၪဖိၪၥံၪမိမၩလိၪ",
			"10": "<sup>10</sup> ဆၧတီၩဆၧလီၩ့လီၫ.- ၦလတီၩလလီၩ့ဘၪနီၪဘၪခိး ဘၪတၩလါနၫ့ဘိၩ, မၩလိၪဆၧတီၩဆၧလီၩ့အ့ၬး လၧ ဆၧတီၩဆၧလီၩ့အခးဖၧၩ့နီၪ မွဲအမၩဆၧကဲၪ့ကီၪ့",
			"11": "<sup>11</sup> တၭ,ဒၪဘၪယဟိဝၩအကယးအကဖးအ့ၬ.- ယဟိ ဝၩဧ့,နစူၪအီၪထၪ့ထီၫတၭ, အဝ့ၫၥံၪဒၪဘၪနီၪအၥၭ အီၪအ့ၬ.မွဲလါနၫ့မိဒၪဘၪဝ့ၫတၭ, အမ့ၬမိမဲ,နၥၭဆီၪ့ လၧနၡၩခမျၧးအဂး,မွဲမၬ, မ့ၪမိအၪ့ခွံၬနဒုၪနဒၩလီၫ.",
			"12": "<sup>12</sup> ယဟိဝၩဧ့, နမိဖ့ၪလၫ့ပၧၩ လၧဆၧဘၪလိၬအိၭလိၬ လီၫ.အဂဲးဘဲၫယီၩ ကယဲၦမၩဆၧနီၪဒၪလ့ၬနမၩလၧ",
			"13": "<sup>13</sup> ပဂးလီၫ.- ယဟိဝၩပယွၩဧ့, ကဆါအဂူၫဂၩလဖၪ ပၧၩ့ဘၪယူၭပၧၩလီၫ. နဝ့ၫဒၪနမံၩ့ဒၪလ့ၬ ပမိဒုၭနၪ့",
			"14": "<sup>14</sup> ထၪ့ထဲၩ့ပဝ့ၫဒၪလီၫ.- အဝ့ၫၥံၪၥံၫယူၭတၭ,မိမၧၫ့အ့ၬ, မွဲၦၥံၫယူၭတၭ, မိဂဲထုၪ့ထဲၩ့အ့ၬ. မၩအၥၭဘဲၫနီၪ တၭ,နစ့ၩရၫ့ယူၭ, ဒဲမၩဂၭဂီၩ့ယူၭအဝ့ၫၥံၪတၭ, မွဲန",
			"15": "<sup>15</sup> မၩဂၭဂီၩ့ယူၭ ကယဲဆၧဒုၭနၪ့ထၪ့အဝ့ၫၥံၪယူၭး- န မၩအၪထၪ့ယူၭၦလဆၨၩယူၭ, ယဟိဝၩဧ့,နမၩအၪ ထၪ့ယူၭ, ၦလဆၨၩယူၭ, နမၩလၩဖၩ့ယူၭနၥၭယူၭ, နအီၪက့ၩယဲၩ့ထၪ့ယူၭထံၫနိၪ့ခးနိၪ့ထီးအလူၬယူၭ.",
			"16": "<sup>16</sup> ယဟိဝၩဧ့, လၧအဘၪဆၧခိဆၧဝီၩနီၪအဝ့ၫၥံၪဂဲၫ လၧနအီၪလီၫ. လၧနဆၧအၪ့ၥီၪ့အီၪဝ့ၫလၧအလီၩ့အ",
			"17": "<sup>17</sup> ဘိၩ့အဘၭတၭ,အၪ့ကံၩ့ဘၩဆိၪဖၪလီၫ.- ဘဲၫၦမုၪ ဒၧၩ့ဆၧအမုအလၩဘၪယူၭ လၧအမိဆီၫ့အီၪန့ဆၧ, အဂူၭဆၫတၭ, လၧအဘၪဆၧဆိၭက့ၭကိၭၡၭထၪ့အ ၥိၭနီၪ,ပအီၪယူၭပဝ့ၫလၧနမ့ၬယၫဘဲၫနီၪၥိၭ, ယဟိ",
			"18": "<sup>18</sup> ဝၩဧ့,- ပဒၧၩ့ထၪ့ယူၭ, ပဘၪဆၧဂူၭဆၫယူၭ, ဆၧမၩ အၥၭဘဲၫပဆီၫ့အီၪန့လံၩအၥိၭနီၪလီၫ. ပလထိးထဲၩ့ တၩ့ထဲၩ့ဘၪထံၫၥံၪခးၥံၪး ပလမၩလၩ့ထံၩဖါဘၪၦ",
			"19": "<sup>19</sup> ဂၪ့ခိၪဖိၪၥံၪဆ့လီၫ.- နၡၩအၥံၫနီၪ, မိမၧၫ့ထၪ့ထဲၩ့း ယၡၩအစွၪမိဂဲထုၪ့, နၪ့ထၪ့ၥံၫကျံၩဆၧ, ၦလၧအအီၪ လၧဂၪ့ခိၪမုၬအကျၩၥံၪဧ့, အဂဲးဘဲၫယီၩဘဲၫဆၩ့ထံၫ ဒုၭမဲၪထၪ့နၪ့ၥံၪမံၩ့ၥံၪအၥိၭနီၪ နဆၩ့ထံၫမိဒုၭဂဲထုၪ့ ဂၪ့ခိၪအၡၩၥံၫလဖၪနီၪလီၫ.",
			"20": "<sup>20</sup> ဂဲၫဘီၪ, ယၡၩခမျၧးၥံၪဧ့, လ့ၩနုၬလၧနဒူၭဖၧၩ့တၭ, ကၭဘံၭထၬတရၫ့လၧနလးခဲၫ့ဆံၭ. အီၪက့ၪၥူၪနၥၭ",
			"21": "<sup>21</sup> နးဆိဖိၪထီးဆၧၥၭခဲၩထၪ့ လ့ၩဖီၩ့ခွံၬနီၪဆံၭ.- အ ဂဲးဘဲၫယီၩ,ယိခွါ, ယဟိဝၩ ဂဲၫစဲၪ့ထၪ့ခွံၬဝ့ၫလၧအ လးဖၧၩ့ဘဲၫၥိၭအမိစ့ၩရၫ့ ၦဂၪ့ခိၪဖိၪအဆၧဒဲၩဘၭ လၧအလီၩ့တၭ, ဂၪ့ခိၪမိနဲၪဖျီၪထၪ့အၥွံၪတၭ, ကၭဘံၭ လၧၩ့အၡၩလၧအဘၪဆၧမၩၥံၫဝ့ၫနီၪအ့ၬ."
		},
		"27": {
			"1": "<sup>1</sup> ဆၧလၧမုလနံၩနီၪမၪ, ဂူလ့ၩဆၧချဲၫ့လဘီၩ့မၪ, ဂူ ချၩ့အၥၭလဘီၩ့နီၪ, ယဟိဝၩမိစ့ၩရၫ့လၧအနၭအနီၩ့ အဒိၪအဆီၪ့နးဘံၪ့တၭး မိမၩၥံၫၡီၩ့လၧအအီၪလၧ မၫဆမံၭဖၧၩ့နီၪလီၫ.",
			"2": "<sup>2</sup> ဆၧလၧမုလနံၩနီၪ ၥံၫကျံၩထၪ့ စဘံၭမုအလးနီၪ",
			"3": "<sup>3</sup> ဆံၭ.- ယဝ့ၫဒၪယဟိဝၩယီၩယခိၭဆၧနီၪတၭ, ယမၩ ဘၪစီၪဝ့ၫကိၭအစီၪ့ဒ့ၭ ဘဲၫၥိၭထီးမၩအၧၩ့ဝ့ၫလဂ့ၩ",
			"4": "<sup>4</sup> တၭ,ယမိခိၭဝ့ၫမုဆၫဆၫမုနၩနၩနီၪဆ့လီၫ.- ယၥၭ ထၪ့လၧၩ့အဝ့ၫဒၪအ့ၬး မွဲဆၧဆူၪဆၧမဲၪနီၪအီၪက့ၪအ ၥၭလၧအမိဒုၭဆၧဆံၭ. တၭယမိစဲၪ့ခၫ့ဂၬ အဝ့ၫၥံၪ",
			"5": "<sup>5</sup> တၭ,ဒုၭအၪ့ဝ့ၫလၧမ့ၪစီၪ့ဎးလီၫ.- အ့ၪလမွဲဘၪဘဲၫ နီၪတၭ,မွဲအမၩန့ယဂဲးဆီၪ့ဘၭဆီၪ့ဆံၭး မွဲအမၩဆၧ ဘၪလိၬအိၭလိၬလၧယၧၩဆံၭး အဝ့ၫဒၪမိမၩဆၧဘၪ လိၬအိၭလိၬလၧယၧၩလီၫ.",
			"6": "<sup>6</sup> မုနံၩလၧအမိဂဲၫနီၪ, စယၫကူၭအဝံမိဆဲၩလၩ့,အံၫ စရ့လၭမိထိထၪ့ဖီၫထၪ့တၭ, မၩဎွ့ၩဂၪ့ခိၪလၧဆၧၥၪ",
			"7": "<sup>7</sup> လီၫ.- ဘဲၫၦၡၩဖ့ၬအဝ့ၫဒၪအၥိၭနီၪ, မွဲအဖ့ၬဆၧဆ့ ဧၪ.ဘဲၫအၡၩဘၪဆၧမၩၥံၫဝ့ၫအၥိၭနီၪ, မွဲအဘၪၥံၫ",
			"8": "<sup>8</sup> ဝ့ၫဘဲၫနီၪၥိၭဆ့ဧၪ.- နဂဲးလိၬလၧအဝ့ၫဒၪလၧနကွဲၪဖျါ ခွံၬဝ့ၫအကၠီၩ့နီၪ, နမၩဆၧလၧအဘၪလီၫ. လၧလံၩမု ထၪ့အနံၩနီၪဒုၭစဲၪ့ထၪ့ခွံၬဝ့ၫ လၧအလံၩဆီၪ့နီၪလီၫ.",
			"9": "<sup>9</sup> မၩအၥၭဘဲၫနီၪတၭ, ထီးအအီၪက့ၪဆၧလုလးအလိး ထီးအလူၬ ဘဲၫလိးထုၪ့လဖၪ လၧအလၩ့ဘျ့ၭအၥိၭ တၭ,စယၫကူၭအဆၧဒဲၩဘၭမိဖီၩ့ဖျ့ၭ လၧဆၧနီၪအ ကၠီၩ့တၭ, ဆၧနီၪမွဲဆၧၥၪထီးအလူၬ လၧအမိကွဲၪဖျါ အဆၧမၪလီၫ. တၭအၡ့ရိၭ, ဒဲဆၧဂၩ့ဆၧဖၪ့လဖၪနီၪ",
			"10": "<sup>10</sup> ဂဲထုၪ့လၧၩ့အ့ၬ.- မွဲလါနၫ့ဘိၩဒိၩ့အီၪလၧအခိၪဒၧၩ့ လဖျိၪ့မိအီၪယူ, ဆၧအီၪအလးလၩ့ဎီးတၭ, ဘၪဆၧ ခွံၬၡိၭဝ့ၫ, ကဲၪဘဲၫၡါမုနၧၫ့ဖၫအၥိၭနီၪလီၫ. ထီးနီၪ ချီဖိၪမိအၪ့ဆၧတၭ, မိခိၬလၩ့ထီးနီၪတၭ,အၪ့ခွံၬအ",
			"11": "<sup>11</sup> ထဲၩ့အဖၫ့လီၫ.- ထီးအထဲၩ့အဖၫ့ဎဲၫ့ထၪ့ခွံၬတၭ,ဆၧ မိမၩခါခွံၬဝ့ၫ, ၦမုၪၥံၪမိဂဲၫဆူၭခဲၩဝ့ၫလၧမ့ၪလီၫ. အ ဂဲးဘဲၫယီၩမွဲၦလဆၨၩလၧအနၪဆၧလၥ့ၪဘၪ, အခိး မွဲၦလၧအတဲၩ့ဝ့ၫလဂၩနီၪ လယၫ့ၥၭဘၪဝ့ၫတၭ, ၦ လၧအမၩကဲၪထၪ့ဝ့ၫလဂၩနီၪ မိမၩဘိၭမၩဆၧၩ့ဝ့ၫ အ့ၬ.",
			"12": "<sup>12</sup> တၭလၧမုလနံၩနီၪ ဆၧမိမၩအၥၭလၧယဟိဝၩမိ ဒိၪလၩ့ခွံၬဆၧလၧထံၫမိၡါအထံၫချိၬ ဖိးလၧအံဇံၭအ ထံၫမိၡါတၭ,နၥံၪမိဘၪဆၧအၪ့ထုၫ့ကီၪ့နၥံၪလဂၩ ဒဲလ",
			"13": "<sup>13</sup> ဂၩလီၫ.ၦအံၫစရ့လၭဖိၪၥံၪဧ့,- လၧမုလနံၩနီၪဆၧမိ မၩအၥၭလၧဆၧမိအူၪထၪ့ခွ့ၩဖၭဒိၪနးဖျိၪ့တၭ, ၦလၧ အလၩ့မါလၧခးအစံရအၫနီၪ မိဂဲၫဝ့ၫ, ဒဲၦလၧအစဲၪ့ ဝံၩ့ဝၩ့လၧအံဇံၭအဖၧၩ့နီၪတၭ, မိဘိၪ့ထၪ့ဘၩထၪ့ယ ဟိဝၩလၧခိၪလီၩ့ဆံၫ့ဎံၪအလီၩ့ လၧယရုစလံၫ့အဖၧၩ့ နီၪလီၫ."
		},
		"28": {
			"1": "<sup>1</sup> အံဖြံၫ့အၡၩအီၩမၧၩ့ၥံၭထံၫဂၬထံၫလဖၪ အၥရဖူၩ ထၪ့ထီၫ, ဒဲအဖီၫလၧအလၩ့ယံၭ အဆၧဎံၫဆၧလၩ, အကယၧၩ့ကယီၫ လၧအအီၪဝ့ၫလၧၦဘၪဆၧဖ့ၬဝ့ၫ လၧစဘံၭထံၫအခိၪလီၩ့ဆူၭဘီၪ့ၥိၪအခိၪဎွံၪနီၪ ဘၪအ",
			"2": "<sup>2</sup> ၡၪ့လီၫ.- ယိခွါ, ဆၧအဒိၪအဆီၪ့လဂၩအီၪလၧယဟိ ဝၩ, မၩအၥၭဘဲၫလံၩမုအီၪလၧမုၥၪအၥိၭ, မၩအၥၭ ဘဲၫလဖုၬလၧအမၩဂၭဂီၩ့ ဆၧအၥိၭ, မၩအၥၭဘဲၫ ထံၫဂဲၫဆီၪ့ လုၬဘံၭဆၧအၥိၭနီၪ မၩလၩ့ထံၩဖါဝ့ၫ",
			"3": "<sup>3</sup> လၧဂၪ့ခိၪအလီၩ့လၧအစူၪလီၫ.- အံဖြံၫ့အၡၩအီၩ မၧၩ့ၥံၭထံၫဂၬထံၫလဖၪ အၥရဖူၩထၪ့ထီၫနီၪ မိဘၪ",
			"4": "<sup>4</sup> ဆၧယဲးထဲးလၩ့ဝ့ၫ လၧၦအခၪ့ဖၫ့လၬလီၫ.- တၭအ ဎံၫအလၩ အလၩအဖၩ့ အဖူၩအဖီၫ လၧအလၩ့ယံၭ လၧအအီၪလၧခိၪလီၩ့ဆူၭဘီၪ့ၥိၪအခိၪဎွံၪနီၪ မိမၩအ ၥၭဘဲၫချိၪ့ဒိၩ့ၥၪ လၧအမံၫ့ဆိၫလဖျိၪ့လၧၦလၧအဒၪ ဘၪဝ့ၫနီၪ,ဒၪဝ့ၫတၭ, အီၪဝ့ၫလၧအစူၪဖၧၩ့အဘိၩ့ ဘၭနီၪအၪ့ယုလၩ့ခွံၬဝ့ၫအၥိၭနီၪလီၫ.",
			"5": "<sup>5</sup> ဆၧလၧမုလနံၩနီၪဆၧၥုၭမုခမျၧးအယဟိဝၩ မိကဲၪ ထၪ့ဆၧလၩဖၩ့အၥရဖူၩ, ဒဲဆၧဎံၫလၩ အခိၪခွၩ့အ လၩအဖၩ့ လၧအၡၩခမျၧးလၧအအီၪလၩ့ထးလဖၪ",
			"6": "<sup>6</sup> အဂး,- ဒဲဆၧစ့ၩရၫ့အၥၭ လၧၦလၧအဆၧၫ့နၩ့စ့ၩရၫ့ ဆၧအဂး, ဒဲဆၧအဂဲးအဘၭ လၧၦလဖၪလၧအဘိၭ ကၠၪစိၩဆၧဒုၭၥုၭ လၧတရၫ့အဂးနီၪလီၫ.",
			"7": "<sup>7</sup> မွဲလါနၫ့အဝ့ၫၥံၪလၩ့မၪဆ့ လၧစဘံၭထံၫအကၠီၩ့ တၭ,ဂၭဖျိၭဖၧၩ့ၥၭလၧၥံၭထံၫဂၬထံၫအကၠီၩ့လီၫ. ၦ လုဆၧဒဲမီၪလၩ့မၪဆၧလၧၥံၭထံၫဂၬထံၫအကၠီၩ့, ဘၪ ဆၧအၪ့ယုလၩ့ခွံၬဝ့ၫ လၧစဘံၭထံၫ, ဂၭဖျိၭဖၧၩ့ၥၭ လၧၥံၭထံၫဂၬထံၫအကၠီၩ့, မၩမၪဆၧလၧဆၧဒၪဆၧ လၧယၫလခီၫအဖၧၩ့ ၥၭဂံၩ့ဂၩ့လၧဆၧစ့ၩရၫ့အဖၧၩ့",
			"8": "<sup>8</sup> လီၫ.- အဂဲးဘဲၫယီၩစပွဲၥံၪထီးအလူၬ ဎွ့ၩလၧဆၧပၠိၭ",
			"9": "<sup>9</sup> ဆၧၥၭလိၪ, ဆၧအလးဆံၫ့အီၪနးစီၪ့အ့ၬ.- မွဲအမိၥီၪ့ လိၪဆၧၥ့ၪယၫလၧပလၫလဂၩလဲၪ. တၭမွဲအမိဒုၭ နၪၥ့ၪပလၫ လၧအဆၧၥီၪ့ဆၧၥၫ့လဂၩလဲၪ. မွဲၦလၧ အလၩ့ၡၪလၧဆၧနူထံၫ, ဒဲလၩ့ဖၭလၧအမိအနူလဖၪ",
			"10": "<sup>10</sup> လီၫ.- အဂဲးဘဲၫယီၩမွဲဆၧၥီၪ့လၧဆၧၥီၪ့အဖၫ့ခိၪ, ဆၧ ၥီၪ့လၧဆၧၥီၪ့အဖၫ့ခိၪး လမံၩ့ဘၪလမံၩ့, လမံၩ့ဘၪ",
			"11": "<sup>11</sup> လမံၩ့,လၧအံၩလဆံၭ, လၧအိၩလဆံၭ.- အဂဲးဘဲၫ ယီၩအဝ့ၫဒၪမိချဲၩ့ဆၧလၧၦလဆၨၩယီၩ လၧဆၧချဲၩ့",
			"12": "<sup>12</sup> ဘုၭထၬ, ဒဲလၧဆၧချဲၩ့လမံၩ့ဒၪလီၫ.- အဝ့ၫဒၪစံၭအဝ့ၫ ၥံၪ, အယီၩမွဲဆၧအီၪပွံၭဒုၭအီၪပွံၭ ၦလၧဆၧပွံၭအ ၥၭဆံၭ. အယီၩမွဲဆၧလၧအမၩမုၬထၪ့ဆၧ, မွဲလါနၫ့",
			"13": "<sup>13</sup> ဘိၩအဝ့ၫၥံၪခိၭနၪဝ့ၫအၥၭအီၪအ့ၬ.- တၭယဟိဝၩ အလူနီၪကဲၪထၪ့လၧအဝ့ၫၥံၪအဂး ဆၧၥီၪ့လၧဆၧၥီၪ့ အဖၫ့ခိၪ ဆၧၥီၪ့လၧဆၧၥီၪ့အဖၫ့ခိၪး လမံၩ့ဘၪလမံၩ့, လမံၩ့ဘၪလမံၩ့, လၧအံၩလဆံၭ, လၧအိၩလဆံၭး ဘဲၫၥိၭအဝ့ၫၥံၪမိလ့ၩဆၧဂၧၩ့ထဲၩ့အၥၭလၩ့ထံၩဖါ, ဒဲခါလၩ့ခွံၬ, ဒဲဘၪဖျံၩခွၩ့တၭ,ဘၪဆၧဖီၪ့န့ဝ့ၫဒၪလီၫ.",
			"14": "<sup>14</sup> မၩအၥၭဘဲၫနီၪတၭ, ခိၭနၪယဟိဝၩအလူ,ၦလၧအမၩ ကြၩ့ထမးၦလၧအပၧၩ့ၦလဆၨၩယီၩ လၧယရုစလံၫ့",
			"15": "<sup>15</sup> အဖၧၩ့ၥံၪဧ့,- မွဲနၥံၪစံၭ, ပမၩယူၭဆၧအုၩ့လၩ့လၧ ဆၧၥံၫတၭ,ပမၩဆၧအိၭလိၬလၧဖျႃဖၧၩ့တၭ, ထီးဆၧ အၧၩ့လုၬဘံၭခၫ့ဂၬခွံၬဆၧတၭ, ဂဲၫဘၪပၧၩအ့ၬ. အဂဲး ဘဲၫယီၩပအီၪက့ၪဆၧဘျံၭဆၧဘျၪ လၧဆၧဖလ့ၬအ လးတၭ, ပအီၪက့ၪၥူၪပၥၭ လၧအၪ့လီၫဆၧအဖၧၩ့",
			"16": "<sup>16</sup> လီၫ.- မၩအၥၭဘဲၫနီၪတၭ, ကဆါယဟိဝၩစံၭဝ့ၫဘဲၫ ယီၩ,ယိခွါ, ယအီၪက့ၪလၩ့လိးလဖျိၪ့, လိးလၧအဘၪ ဆၧမၩခွါဝ့ၫလဖျိၪ့, လိးနိၪ့လၧအဎွ့ၩဒိၪလဖျိၪ့, ဆၧ အခၪ့ထံၭအီၪဂုးအီၪခၧၫ့ လၧဇံအိၫ့အဖၧၩ့လီၫ. ၦလၧ",
			"17": "<sup>17</sup> အနဲၩဆၧနီၪမိစဲၪ့လၧဆၧၥၭမဲၪအကၠီၩ့အ့ၬ.- တၭယမိ အီၪက့ၪဆၧစ့ၩရၫ့ လၧပနီၫ့လဘီၩ့အဂး, ဒဲဆၧတီၩ လၧဆၧအဖျိၪ့လၩ့ဆဲၩအဂးတၭ, မုၥၪမိဝ့ၬခွံၬဆၧဘျံၭ ဆၧဘျၪအဆၧဖလ့ၬအလး, ထံၫမိလုၬဘံၭဆၧအီၪၥူၪ",
			"18": "<sup>18</sup> အလးနီၪလီၫ.- နၥံၪအဆၧအုၩ့လၩ့လၧဆၧၥံၫနီၪမိ ထီၩ့လၧဆၧဂၭဂီၩ့တၭ, နၥံၪအဆၧမၩအိၭလိၬလၧဖျႃ ဖၧၩ့နီၪအီၪဂုးအီၪခၧၫ့အ့ၬး ထီးဆၧအၧၩ့လုၬဘံၭခၫ့ ဂၬဆၧတၭ, နၥံၪမိကဲၪထၪ့ဆၧလၧအမိယဲးထဲးဝ့ၫအ",
			"19": "<sup>19</sup> ဂးလီၫ.- ထီးအခၫ့ဂၬဆၧတၭ, မိထုၭထၪ့ခွံၬနၥံၪလီၫ. လဂီၩဘၪလဂီၩမိခၫ့ဂၬဆၧ, လၧမုဆၫလခီၫဒဲလၧမု နၩလခီၫလီၫ. ဆၧနၪၥ့ၪအပရၧၫ့နီၪမွဲန့ၫဆၧခိဆၧဝီၩ",
			"20": "<sup>20</sup> လီၫ.- အဂဲးဘဲၫယီၩဆၧအလးမံၫလၧပမိစီၪ့လၩ့ပၥၭ လၧအဖၫ့ခိၪနီၪဖၨၪလၨၪတၭ, ဖၬဘဲၩ့လၧပမိမံၫလုၬ",
			"21": "<sup>21</sup> ဝ့ၫလၧပလီၩ့အံၪ့လၨၪလီၫ.- အဂဲးဘဲၫယီၩဘဲၫခိၪလီၩ့ ပ့ၫရဇံၫ့အၥိၭနီၪ ယဟိဝၩမိဂဲထုၪ့ ဘဲၫလၧဂံဘအၧၫ့ အခိၪလီၩ့ဆူၭဖၧၩ့အၥိၭနီၪအၥၭမိထၪ့း ဘဲၫၥိၭအမိ မၩအဆၧမၩလၩ့မဲၩဒၪဆၧတၭ, ဘဲၫၥိၭအမိမၩအဆၧ",
			"22": "<sup>22</sup> မၩ,အဆၧမၩလၩ့မဲၩလီၫ.- တၭဘိၩ့နဲၪ့ယီၩ, ဒုၪဒွ့ၪ ဆၧလဂ့ၩ, နၥံၪအဖျံၩစၧၩ့ထၬဆၧနီၪမိဆီၪ့ထၪ့ဘၪ ခိၬလီၫ.အဂဲးဘဲၫယီၩ ဆၧမၪလူၬလၧဆၧဘၪမၩဂၭ ဂီၩ့ဂၪ့ခိၪထၧၫ့ဖျိၪ့ယၫနီၪ, ယနါဂၧၫ့လၧကဆါဆၧၥုၭ မုခမျၧးအယဟိဝၩအအီၪလီၫ.",
			"23": "<sup>23</sup> ဒိၭနၥံၪအနါတၭ ခိၭနၪယလူး ခိၭနၪတၭထီးန့",
			"24": "<sup>24</sup> ယဆၧချဲၩ့ဆံၭ.- ၦထဲၫဆၧနီၪး မွဲအထဲၫဆၧကိၭနံၩ ဒ့ၭဘဲၫၥိၭအမိဎွံၪဆၧဧၪ. မွဲအအိၭထၪ့ဒဲမၩဎၩ့အဂၪ့",
			"25": "<sup>25</sup> ခိၪလထံၪဎးလဘီၩ့ဎးဆ့ဧၪ.- ထီးအမၩဎၩ့အဖၫ့ခိၪ ဂီၩ့တၭ, ဎွံၪမၬဆံၥၧၫ့, မၩပြံၩပၩမၬဆံတၭ, အီၪက့ၪ ဘုၪကၠိၩ့လကၠီၪ့လကၠီၪ့အဖၧၩ့, ဒဲဘုၪမုယီၩ လၧအလး",
			"26": "<sup>26</sup> ဒၪဝ့ၫ, ဒဲဘုၪကူၭစမ့ၭလၧအနဲၩ့နီၪမွဲအ့ၬဧၪ.- တၭဆၧ ၥီၪ့လိၪဝ့ၫ လၧဆၧစ့ၩရၫ့အယွၩၥီၪ့ထဲၩ့ၥၫ့ထဲၩ့ဝ့ၫဒၪ",
			"27": "<sup>27</sup> လီၫ.- အဂဲးဘဲၫယီၩ ၦဘၪယဲးမၬဆံၥၧၫ့ လၧစဲၭ ပျၧၩ့ဘုၪ,ဒဲထုၭလဲၪ့အပၪ လၧမၬဆံအဖၫ့ခိၪနီၪမွဲအ့ၬ. အဂဲးဘဲၫယီၩ ၦဘၪထး မၬဆံၥၧၫ့လၧနိၪထး ဒဲ",
			"28": "<sup>28</sup> မၬဆံလၧနိၪထိၭဘီၩ့နီၪလီၫ.- ဘုၪၥံၪဂူၫၥံၪနီၪပဘၪ မၩလၩ့ဘျ့ၭဝ့ၫလၧကိၪအဂးလီၫ. အဂဲးဘဲၫယီၩ မိ ပျၧၩ့ဝ့ၫလထံၪဎးအ့ၬ. တၭထုၭအလဲၪ့ပၪလၧအဖၫ့ခိၪ,",
			"29": "<sup>29</sup> ဒဲအကၥ့ၪနီၪ မၩလၩ့ဘျ့ၭဝ့ၫဒၪ ဆ့အ့ၬ.- ဆၧနီၪဂဲၫ ထၪ့လၧဆၧၥုၭမုခမျၧးအယဟိဝၩအအီၪလီၫ. အဆၧ ကိၪ့ထၪ့ဖၭလၩ့နီၪလၩ့လၭဝ့ၫ, အဆၧကိၪ့ဆၧၥ့ၪနီၪ ဒိၪဝ့ၫလီၫ."
		},
		"29": {
			"1": "<sup>1</sup> အၫရအ့လၭ, အၫရအ့လၭ, ဒိၩ့ထီးစဒၫဝံၭၥုၪ့အ တဲၩဝၬဖီၩ့ဝ့ၫနီၪ ဘၪအၡၪ့တၭ, အီၪက့ၪကီၪ့နၥံၪဝ့ၫ လနံၪ့ဘၪလနံၪ့နီၪဆံၭး မွဲဆၧမၩဘိၪ့လဖၪလ့ၩဝံၩ့ဝၩ့",
			"2": "<sup>2</sup> ဆၧၫ့ထဲၩ့အလးနီၪဖီၩၬ- ယမိမၩၡၪ့မၩနၭအၫရအ့ လၭတၭ,ဆၧၥုၪ့အုၭၥၭအုၭ, ဒဲဆၧၥုၪ့ခိၥၭဝီၩမိအီၪ တၭ,အဝ့ၫဒၪမိအီၪလၧယဂး ဘဲၫအၫရအ့လၭအၥိၭ",
			"3": "<sup>3</sup> နီၪလီၫ.- ယမိၥုၪ့တဲၩဝၩ့ထၬနၧၩတၭ, ယမိဒုၭဆၧထၫ့ ဒုၪထၫ့ဒၩနၧၩလၧခိၪဒၧၩ့ဂၪ့ခိၪတၭး ယမိမၩထၪ့ထိၬ",
			"4": "<sup>4</sup> ၥံၪထၫ့ဒုၪဒၩနၧၩလီၫ.- နဘၪဆၧဆၪ့လၩ့နၧၩတၭ, နမိချဲၩ့ဆၧလၧဂၪ့ခိၪအဖၧၩ့တၭ, နလူမိအီၪလၧဆၧ ဖၫ့လၬလၧဂၪ့ခိၪမုၬအကျၩတၭ, နလူမိမၩအၥၭဘဲၫ ၦလၧအယူၬအီၪဝ့ၫအလူအၥိၭနီၪ, နမိချဲၩ့ဆၧဘံၪၥွံၫ လၧဂၪ့ခိၪအဖၧၩ့ ဒဲလၧဂၪ့ခိၪမုၬအကျၩလီၫ.",
			"5": "<sup>5</sup> နၡၩလခီၫဘၩ့မုးဖိၪခမျၧးနီၪ မိမၩအၥၭဘဲၫဂၪ့ခိၪ မုၬလွံၩပွံၪအၥိၭတၭ, ၦၡၩမၩၥၭမဲၪၥၭဖျဲၩ့ဆၧနီၪမိ မၩအၥၭဘဲၫဖ့ၫလၧအဒံၩခွံၬဝ့ၫအၥိၭနီၪလီၫ. မွဲမၬ, မိ",
			"6": "<sup>6</sup> မၩၡုၭအၥၭလၧဆၧလဆိဖျါကလၬလီၫ.- လၧဆၧၥုၭ မုခမျၧးအယဟိဝၩအနၫ့ဆါနီၪဆၧစ့ၩရၫ့လၧလၫ့ဎွံၩ့, ဒဲဂၪ့ခိၪဝၭ, ဒဲဆၧအၥီၫဖၭဒိၪ, ဒဲလံၩမု, ဒဲလံၩလဖုၬ,",
			"7": "<sup>7</sup> ဒဲမ့ၪလၪလၧအအၪ့ဆၧမိဘၪနၧၩလီၫ.- ၦဆၨၩထီးအ လူၬအခမျၧးလၧအဒုၭၥုၭလၧအၫရအ့လၭ, ကယဲၦ ၡၩဒၪလ့ၬ လၧအဒုၭၥုၭထၫ့ဒုၪဒၩအဝ့ၫ, ဒဲအဒိၩ့ခိၪ ဒၧၩ့,ဒဲမၩခိမၩဝီၩဝ့ၫနီၪ, မိမၩအၥၭဘဲၫမံၫမးဒၪဆၧ",
			"8": "<sup>8</sup> လၧယၫမုနၩလခီၫအၥိၭနီၪလီၫ.- ဆၧမိမၩအၥၭဘဲၫ ၦၥၭဝံဆၧနီၪမံၫမးဆၧအၥိၭတၭ, ယိခွါၬ အၪ့ဘၪဝ့ၫ လါနၫ့နီၪ, နၪ့ထၪ့အၥၭတၭ, အၥၭအီၪပျီၩဝ့ၫလီၫၬ တၭ မၩအၥၭဘဲၫၦၥၭဝံအၥၭလၧထံၫနီၪ မံၫမးဆၧအၥိၭ တၭ,ယိခွါၬ အီၩဘၪဝ့ၫလါနၫ့နီၪနၪ့ထၪ့အၥၭတၭ, ယိခွါၬအၥၭလၩ့ဘဲၩဝ့ၫတၭ, အၥၭဆိၫ့န့ဆၧလီၫ. ၦဆၨၩထီးအလူၬ အခမျၧးလၧအဒုၭၥုၭ လၧခိၪလီၩ့ ဇံအိၫ့မိမွဲဘဲၫနီၪၥိၭလီၫ.",
			"9": "<sup>9</sup> အီၪထီနၥံၪဝ့ၫတၭ, ထီၫမံၫထီၫမၪနၥံၪဝ့ၫဆံၭ.မၩ ဘျီၪနၥံၪအမ့ၬတၭ,အီၪမ့ၬဘျီၪဆံၭ. အဝ့ၫၥံၪအီၩမၧၩ့ အၥၭလါနၫ့ဘိၩ, မွဲလၧစဘံၭထံၫအ့ၬး လ့ၩဆၧဒံၩ့ခံၫ့ ဒၪ့ဎၩ့လါနၫ့ဘိၩ, မွဲလၧၥံၭထံၫဂၬထံၫအကၠီၩ့အ့ၬ.",
			"10": "<sup>10</sup> အဂဲးဘဲၫယီၩ ယဟိဝၩလူၫလၩ့ဆၧမံၫမၪအၥၭလၧ နၥံၪအလီၩ့, ဒဲမၩဘံၭနၥံၪအမ့ၬ, မီၪလဖၪ,ဒဲနၥံၪအခိၪ",
			"11": "<sup>11</sup> လဖၪၦဒၪဆၧနီၪချႃၬဘံၭဝ့ၫလီၫ.- တၭဆၧဒၪဘၪလၧ ယၫလခီၫထီးအလူၬနီၪ အီၪလၧနၥံၪအဂးမၩအၥၭဘဲၫ ဆၧကွ့ၭအၥၭလၧအဘၪဆၧစဲၩနဲၪ့ထၬအၥိၭ, လၧၦ ဖ့ၪလၫ့ၦလဂၩလၧအဖီလံၬၥ့ၪတၭ, စံၭဝ့ၫ, ဖီလါဆၧ ယီၩဆံၭ. တၭအဝ့ၫဒၪစံၭဆၧၫ့ဝ့ၫ, ယဖီၥ့ၪအ့ၬး အ",
			"12": "<sup>12</sup> ဂဲးဘဲၫယီၩဘၪဆၧစဲၩနဲၪ့ထၬဝ့ၫလီၫ.- ၦဖ့ၪလၫ့ဆၧ ကွ့ၭအၥၭနီၪလၧၦလၧအဖီလံၬလၥ့ၪဘၪတၭ, စံၭဝ့ၫ, ဖီလါဆၧယီၩဆံၭ. တၭအဝ့ၫဒၪစံၭ, ယဖီလံၬၥ့ၪအ့ၬ.",
			"13": "<sup>13</sup> အခိးမွဲဘဲၫနီၪတၭ, ကဆါစံၭဝ့ၫဒၪ, ၦခမျၧးယီၩၥုၭ ဘူၭအၥၭလၧယအီၪလၧအနိၭ, ဒဲမၩလၩဖၩ့ယၧၩ လၧအနိၭဖျံၩလါနၫ့, အီၪက့ၪအၥၭယဲၩ့လၧယၧၩ တၭ,အဆၧၥၭမဲၪယၧၩနီၪ ကဲၪထၪ့လၧၦၡၩအဆၧၥီၪ့",
			"14": "<sup>14</sup> ဆၧၥၫ့လီၫ.- မၩအၥၭဘဲၫနီၪတၭ, ယိခွါ, ယမိမၩဒံၭ ဆၧလၩ့လၭ လၧၦခမျၧးယီၩအကျၩ, ဆၧမၩလၩ့မဲၩ ဒၪဆၧ, ဒဲဆၧထီၫမံၫထီၫမၪလမံၩ့နီၪး အဂဲးဘဲၫယီၩ ၦကိၪ့ၥ့ၪအဆၧကိၪ့ဘၪကိၪ့ၥ့ၪနီၪ မိဘၪဆၧမၩဂၭဂီၩ့ ဒဲၦကိၪ့ဆၧဘၪလဖၪအၥၭကိၪ့ၥ့ၪနီၪ မိလၩ့မါလီၫ.",
			"15": "<sup>15</sup> ၦလၧအလ့ၩအၪ့ဎၬဆၧယိၬ ဘဲၫၥိၭအမိအီၪက့ၪၥူၪ ခွံၬအဆၧကိၪ့ထၪ့ဖၭလၩ့ လၧယဟိဝၩအမ့ၬယၫတၭ, အဆၧမၩနီၪအီၪဝ့ၫလၧဆၧခံၭကျၩတၭ, စံၭဝ့ၫ,မွဲပလၫ ဒၪဘၪပၧၩလဂၩလဲၪ, ဒဲမွဲပလၫၥ့ၪယၫပၧၩလဂၩလဲၪ",
			"16": "<sup>16</sup> နီၪ,ဘၪအၡၪ့လီၫ.- နၥံၪအၥၭကၪမၬကလဲၪၬ ၦတဲၩ့ ဖၧၩ့ဂၪ့ခိၪနီၪမွဲဆၧအီၪက့ၪဝ့ၫဘဲၫကဖံၬအၥိၭနီၪဆ့ဧၪ. အဂဲးဘဲၫယီၩ ဆၧဘၪတဲၩ့ဝ့ၫနီၪမိစံၭ, လၧၦလၧအ တဲၩ့ဝ့ၫအဂဲး, မွဲလတဲၩ့ဘၪယၧၩနီၪဆ့ဧၪး တၭဆၧ လၧအဘၪဆၧတဲၩ့ဝ့ၫလမံၩ့နီၪမိစံၭ လၧၦလၧအတဲၩ့ ဝ့ၫအဂဲးနီၪ, မွဲအဆၧနၪၥ့ၪလအီၪဘၪနီၪဆ့ဧၪ.",
			"17": "<sup>17</sup> နးဆိဖီၩ့ခွံၬတၭ, လ့ၭဘနၧၫ့မိကဲၪထၪ့ဂၪ့ခိၪအဝၩ့ လၧအၥၪထၪ့ဆၧတၭ, ဂၪ့ခိၪအဝၩ့လၧအၥၪထၪ့ဆၧ",
			"18": "<sup>18</sup> နီၪမိကဲၪထၪ့မံၩ့လၬကျၩနီၪ,မွဲအ့ၬဧၪ.- ဆၧလၧမုလ နံၩနီၪၦနါအၧၩ့နီၪမိနါဂၧၫ့လံၬအလူတၭ, ၦအမ့ၬဘျီၪ မိဒၪဆၧလၧဆၧခံၭကျၩ, ဒဲလၧဆၧခံၭၥၧၫ့အကျၩလီၫ.",
			"19": "<sup>19</sup> ၦအၥၭဆၧၩ့နီၪဒံၩ့ယံၬဒံၩ့ၥၭထိၬ လၧယဟိဝၩအဖၧၩ့ တၭ,ၦၡၪ့ဖိၪယၬဖိၪလၧၦၡၩအကျၩနီၪ, မိၥုၪ့ဎွံၫၥၭ ယီၫလၧအံၫစရ့လၭအဆၧဆံၫ့ဎံၪလဂၩအဖၧၩ့လီၫ.",
			"20": "<sup>20</sup> အဂဲးဘဲၫယီၩ ၦမၩန့ဆီၪ့ဆၧနီၪလူၬယူၭ, ဒဲၦဒုၪဒွ့ၪ ဆၧအီၪလၧၩ့အ့ၬတၭ, ၦယိဂူၪဆၧမၩလတီၩဘၪနီၪ",
			"21": "<sup>21</sup> ဘၪဆၧဒၪ့ထ့ၬခွံၬဝ့ၫလီၫ.- အီၪက့ၪၦလၧၦမၩမၪဆၧ ဖိၪလၧဆၧချဲၩ့လထံၪအကၠီၩ့တၭ,အီၪက့ၪဖျံၩခွၩ့လၧ ၦလၧအချဲၩ့ခွးလၧတရၫ့ဖၧၩ့အဂးတၭ, ဘိၭကၠၪခွံၬၦ",
			"22": "<sup>22</sup> တီၩၦလီၩ့လၧအၪ့လီၫဆၧအကၠီၩ့လီၫ.- မၩအၥၭဘဲၫ နီၪတၭ, ယဟိဝၩၦလၧအဎွ့ၩန့ထဲၩ့ စအၫဘြဟၫ့လ ဂၩနီၪ, စံၭလၧစယၫကူၭအၡၩဂံၪ့ဖိၪအဂဲးအကၠီၪ့ဘဲၫ ယီၩ,မွဲစယၫကူၭအမ့ၬမဲဘိၩ့နဲၪ့ယီၩအ့ၬ. တၭမွဲအ",
			"23": "<sup>23</sup> မ့ၬမိလၩ့မိၫလၩ့ဘွၩ ဘိၩ့နဲၪ့ယီၩဆ့အ့ၬ.- အဂဲးဘဲၫ ယီၩ ထီးအဒၪဘၪအဖိၪ, ဆၧမၩလၧယစူၪ, လၧအကျၩ တၭ,အဝ့ၫၥံၪမိအီၪက့ၪဆံၫ့ဎံၪယမံၩ့တၭ, အီၪက့ၪ ဆံၫ့ဎံၪစယၫကူၭအဆၧဆံၫ့ဎံၪတၭ, မိၥၭမဲၪအံၫစရ့",
			"24": "<sup>24</sup> လၭအယွၩနီၪလီၫ.- တၭၦလၧအၥၭဂၭဖျိၭယူၭဆၧ နီၪမိၥ့ၪယၫဆၧကိၪ့ၥ့ၪတၭ, ၦလၧအၥူၭဝံၥူၭလၩယူၭ မိမၩလိၪဆၧၥီၪ့ဆၧၥၫ့လီၫ."
		},
		"30": {
			"1": "<sup>1</sup> ဖိၪလဖၪလၧအပိၩ့ထၪ့ဆၧနီၪ ဘၪအၡၪ့လီၫ. ယဟိ ဝၩစံၭဝ့ၫဒၪ, ၦလၧအကိၪ့ထၪ့ဆၧလါနၫ့တၭ, ဂဲၫလၧ ယၧၩအ့ၬ. တၭချႃၬဘံၭဆၧ လၧဆၧချႃၬဘံၭလမံၩ့ လါနၫ့တၭ,လမွဲဘၪလၧယၥၭ, ဘဲၫၥိၭအမိအီၪက့ၪ",
			"2": "<sup>2</sup> ဆၧဒဲၩဘၭလၧဆၧဒဲၩဘၭအဖၫ့ခိၪလီၫ.- ၦလၧအ လ့ၩလၩ့လၧအံဇံၭအဖၧၩ့လါနၫ့တၭ, လအၪ့ကံၩ့ဘၪ ဆၧလၧယနိၭ, ဘဲၫၥိၭအမိအီၪကဒုၩလၧဖၫရိၫအဂဲး အဘၭအဖၧၩ့တၭ, ဒိၭနဲၩ့အၥၭလၧအံဇံၭအလၩဒုၩ",
			"3": "<sup>3</sup> အဖၧၩ့လီၫ.- မၩအၥၭဘဲၫနီၪတၭ,ဖၫရိၫအဂဲးအဘၭ နီၪမိကဲၪထၪ့ဆၧမ့ၬမဲ လၧနၥံၪအဂးတၭ, ဆၧဒိၭနဲၩ့ နၥံၪအၥၭလၧအံဇံၭ အလၩဒုၩနီၪမိဒုၭမဲနၥံၪအမ့ၬ",
			"4": "<sup>4</sup> လီၫ.- အဂဲးဘဲၫယီၩအၦဒိၪလဖၪအီၪဝ့ၫလၧဇိအၫ့အ",
			"5": "<sup>5</sup> ဖၧၩ့တၭ,အၥီၫ့လဖၪထီၩ့ဝ့ၫလၧဟၫနံၭလီၫ.- အဝ့ၫၥံၪ ထီးအလူၬအီၪက့ၪမဲအမ့ၬ လၧၦလဆၨၩလၧအလန့ ကၩဘၪလၧအဂးနီၪ, ၦလဆၨၩလၧအလမွဲဘၪလၧ ဆၧမၩဆၧၩ့အဂး လမွဲဘၪလၧဆၧအခိးအတၩအ ဂး,အ့ၪမွဲလၧဆၧမ့ၬမဲအဂး ဒဲလၧဆၧဒုၪဒွ့ၪအလး",
			"6": "<sup>6</sup> အဂးဆ့လီၫ.- ဆၧဖိၪဆၧဎါအီၪလၧအဆၧဖဒၨၭလ ဖၪလ့ၩလၩ့လၧမုခံၫ့နီၪ, လၧဆၧခိဆၧဝီၩဒဲဆၧၡၪ့ဆၧ နၭအခးဖၧၩ့, ထီးဆၬလၥၧၫ့ဘၪ့, ဒဲဆၬလၥၧၫ့ၡါ,ဒဲဂူ ပွ့ၭ,ဒဲဂူမ့ၪ, လၧအယူၩနီၪအီၪဝ့ၫလီၫ. အဝ့ၫၥံၪဆိၬ အစူၪလးအခၪ့ခိၪ လၧကၥ့ၪယီၩ့ဖိၪ အခိၬထံၭခိၪအ ဖၫ့ခိၪဒဲအဆၧအီၪက့ၪကီၪ့ၥံၪနီၪ လၧကလအူၭအချိၫ့ ခိၪ,လၧၦလဆၨၩ လၧအလန့ကၩဘၪဆၧလၧအဂး",
			"7": "<sup>7</sup> လီၫ.- အဂဲးဘဲၫယီၩ ၦအံဇံၭဖိၪမိမၩဆၧၩ့ဆၧပျီၩပျီၩ တၭးလန့ကၩဘၪဆၧနးမံၩ့လီၫ. မၩအၥၭဘဲၫနီၪ တၭ,ယကိၭထၪ့လၧဆၧယီၩအဂဲးလၧအဝ့ၫၥံၪဆၧၫ့ နၩ့အီၪဒၪဆၧနီၪမွဲအဂဲးအဘၭလီၫ.",
			"8": "<sup>8</sup> ဘိၩ့နဲၪ့ယီၩလ့ၩဘီၪ, ကွ့ၭဆၧလၧအဝ့ၫၥံၪအမ့ၬယၫ လၧဆၧကွ့ၭအလးအလီၩ့လမံၩ့, ဒဲကွ့ၭလၧလံၬဖၧၩ့ တၭ,မွဲအအီၪလၧအနံၩအၥၫ့လၧယၫအဂး, လၧအ",
			"9": "<sup>9</sup> ဆိၩအကၠၪလၩ့ဆိၩလၩ့ကၠၪအဂးနီၪဆံၭ.- အဂဲးဘဲၫ ယီၩအဝ့ၫၥံၪမွဲၦပိၩ့ထၪ့ဆၧဖိၪလဆၨၩ, ဖိၪၥၪလၧအ ချဲၩ့ဘျံၭချဲၩ့ဘျၪဆၧ, ဖိၪၥၪလၧအမိခိၭနၪ ယဟိဝၩ",
			"10": "<sup>10</sup> အလူအထၫတၭ,အၥၭအီၪအ့ၬ.- ၦလၧအစံၭ, ၦလၧ အဒၪဆၧလၧယၫလခီၫ, နၥံၪဒၪဘၪဆၧအ့ၬ. ၦလၧ အယိဆၧလဖၪ, နၥံၪယိဘၪဆၧအတီၩလၧပဂးအ့ၬ. ချဲၩ့ဆၧလၧပၧၩလၧဆၧချဲၩ့မုၬ, ယိအၪ့လီၫဆၧဆံၭ.",
			"11": "<sup>11</sup> စဲၪ့ထၪ့ခွံၬလၧဖၧၩ့ၥၭမုကၠၪပဲၩခွံၬဖၧၩ့ၥၭဖိၪ, ဘဲၫၥိၭ အံၫစရ့လၭအဆၧဆံၫ့ဎံၪလဂၩ ထီးအီၪလၧပမ့ၬယၫ လဂ့ၩနီၪဆံၭ.",
			"12": "<sup>12</sup> အခိးမွဲဘဲၫနီၪတၭ, အံၫစရ့လၭအဆၧဆံၫ့ဎံၪလ ဂၩစံၭဘဲၫယီၩ, မွဲနၥံၪခွံၬၡိၭခွံၬဆၧချဲၩ့ယီၩတၭ, ဒိၭ နဲၩ့နၥံၪအၥၭလၧဆၧမၩအၧၩ့ ဒဲဆၧအနါကဲၪ့အကၠီၩ့,",
			"13": "<sup>13</sup> ဒဲနၥံၪဒိၭနဲၩ့နၥံၪအၥၭ လၧအဝ့ၫဒၪအလီၩ့း- မၩအ ၥၭဘဲၫနီၪတၭ, ဆၧမၩမၪဆၧယီၩမိမၩအၥၭဘဲၫဆၧ လၧအမိဘုၪ့ဖိးကၪယူၭ, ဒဲမိလၩ့ဎီးကၪယူၭ, လၧအ ဖိၫထၪ့လၧဆၧအဒီၪ့ထီၫအလီၩ့ လၧအမိလၩ့ဎီးဘၪ ၡုၭဖျါကလၬအၥိၭနီၪလီၫ.",
			"14": "<sup>14</sup> မိခါလၩ့ဎီးဝ့ၫဘဲၫၦတဲၩ့ဖၧၩ့ အဖၧၩ့ထ့ဖၭဝ့ၫအၥိၭ တၭ,ဆၧလီၫ့ကီၩ့ဝ့ၫအ့ၬ, ထီးဖၧၩ့ကဲၩ့လၧၦမိအၪ့မၩ န့ထၪ့မ့ၪအၧၩ့ လၧဖံၫ့ချၪအဂးမွဲဂ့ၩ, အၪ့ဒုၪ့ထၪ့ထံၫ လၧကမၫၥံၪအဖၧၩ့အဂးမွဲဂ့ၩ, လၧအကဲၩ့အခီၫအ ကျၩၦဒၪန့ဝ့ၫအ့ၬ.",
			"15": "<sup>15</sup> အဂဲးဘဲၫယီၩကဆါယဟိဝၩ အံၫစရ့လၭအၡၩ ဆံၫ့ဎံၪလဂၩနီၪစံၭဘဲၫယီၩ, လၧနၥံၪကၠၪလီၩ့ထဲၩ့နၥံၪ အၥၭတၭ, အီၪပွံၭနီၪနၥံၪမိထီၩ့ လၧဆၧထိးထဲၩ့တၩ့ ထဲၩ့,လၧဆၧအီၪဂုးဖုးဝ့ၫ, ဒဲဒိၭနဲၩ့နၥံၪအၥၭနီၪ, န",
			"16": "<sup>16</sup> ၥံၪအဂဲးအဘၭမိအီၪတၭ, နၥံၪအၥၭအီၪအ့ၬ.- အ့ၪ မွဲနၥံၪစံၭ, မွဲအ့ၬး အဂဲးဘဲၫယီၩပမိစဲၪ့ဖျိၭလၧပထူၬ ကၥ့ၪလီၫ. မၩအၥၭဘဲၫနီၪတၭ, မွဲမၬ နၥံၪမိစဲၪ့ဖျိၭ လီၫ.တၭပမိထူၬ ဆၧလ့ၩချဲၫ့လီၫ. မၩအၥၭဘဲၫနီၪ တၭ,ၦလၧအလီၩ့ဆီးနၥံၪလဖၪမိလ့ၩဆၧချဲၫ့လီၫ.",
			"17": "<sup>17</sup> ၦလထီၫ့မိစဲၪ့လၧၦလဂၩအၪ့ၥီၪ့ဆၧအကၠီၩ့တၭ, လၧ ၦယဲဂၩအၪ့ၥီၪ့ဆၧအမ့ၬယၫနီၪ နၥံၪမိစဲၪ့ဖျိၭထီးနၥံၪ အီၪလၩ့ထးဘဲၫထုၪ့လထုၪ့ မၩနဲၪ့ဆၧလၧခိၪလီၩ့ဒၩ့ ခိၪအၥိၭနီၪ, ဘဲၫၥုၭဖိၪအလၫ့လၧဆၧစီၩ့ခိၪအၥိၭနီၪ လီၫ.",
			"18": "<sup>18</sup> မၩအၥၭဘဲၫနီၪတၭ, ယဟိဝၩမိအီၪခိၭဘဲၫၥိၭအ မိယၫ့ၥၭနၥံၪတၭ, မၩအၥၭဘဲၫနီၪတၭ, မွဲအမိဂဲထုၪ့ ဘဲၫၥိၭအမိယၫ့ၥုၪ့ယၫ့ၥၭနၥံၪလီၫ. အဂဲးဘဲၫယီၩယ ဟိဝၩမွဲဆၧစ့ၩရၫ့အယွၩလီၫ. ၦလၧအယိလါအဖၧၩ့",
			"19": "<sup>19</sup> ၥၭနီၪဘၪဆိၪဂ့ၩထီးအလူၬလီၫ.- အဂဲးဘဲၫယီၩ ၦ ခမျၧးမိအီၪဝ့ၫ လၧဇံအိၫ့လၧယရုစလံၫ့အဖၧၩ့လီၫ. နမ့ၬထံၫလၩ့လၧၩ့အ့ၬ. လၧနအၪ့ကံၩ့ဆၧအၥီၫအကၠီၩ့ နီၪ,အဝ့ၫဒၪမိယၫ့ၥုၪ့ယၫ့ၥၭနၧၩတၭး ထီးအ့ၪနါဂၧၫ့",
			"20": "<sup>20</sup> ဝ့ၫတၭ,မိစံၭဆၧၫ့ဆၧလီၫ.- ယဟိဝၩမိဖ့ၪလၫ့နၥံၪ လၧဆၧၡၪ့ဆၧနၭအကိၪ, ဒဲဆၧမၩအၧၩ့မၩၥၫ့အထံၫ လါနၫ့နီၪး နဆရၫလဖၪအီၪက့ၪၥူၪလၧၩ့အၥၭအ့ၬး",
			"21": "<sup>21</sup> အ့ၪမွဲနမ့ၬၥၪမိဒၪဘၪနဆရၫလဖၪလီၫ.- ထီးနၥံၪအ့ၪ ကၠၪလၧစူၪထွ့ၪမွဲဂ့ၩ, စူၪစ့ၪမွဲဂ့ၩနီၪ, နနါၥံၪမိနါဂၧၫ့ ဆၧချဲၩ့လၧနလးခဲၫ့တၭ, စံၭဝ့ၫ, အယီၩမွဲဖၧၩ့ၥၭတၭ,",
			"22": "<sup>22</sup> ဖိၬနၥံၪဝ့ၫဘီၪ.- နၥံၪမိအီၪက့ၪနဆၧဂၩ့စ့ၩလဆံၫ့ဘၪ လၧအဆၧချႃၬဘံၭဝ့ၫ, ဒဲဆၧဂၩ့ထီၫ့ၥိၫ့အၥၭအဆၧ ချႃၬထၬတၭ, နမိမၩလၩ့ပြံၩလၩ့ပၩ အဝ့ၫၥံၪဘဲၫဆၧ ၥၭလိၪအၥိၭနီၪလီၫ. နမိစံၭအဝ့ၫဒၪ,စဲၪ့ထၪ့ခွံၬဘီၪ.",
			"23": "<sup>23</sup> ထီးနီၪလဖၧၫ့ အဝ့ၫဒၪမိဖ့ၪလၫ့ဆၧဆၧၩ့လၧနဆၧချံၫ လၧနမိဎွံၪဝ့ၫလၧဂၪ့ခိၪအဂးတၭ, ဆၧအၪ့လၧဂၪ့ခိၪ ဖ့ၪလၫ့ဝ့ၫနီၪမိဘီၪ့ဝ့ၫၥိၪဝ့ၫဒဲအၪဝ့ၫဆ့လီၫ. ဆၧလၧမု လနံၩနီၪ နဆၧဖိၪဆၧဎါမိအၪ့ဆၧလၧအၪ့အဆၪအ",
			"24": "<sup>24</sup> လးဖၭလဲအဖၧၩ့လီၫ.- ချီဖၫၥံၪဆ့ဒဲကၥ့ၪယီၩ့ဖိၪလၧ အမၩဂၪ့ခိၪလဖၪ မိအၪ့ဆၧအၪ့လဲၩဎုၬ လၧထံၫလၪ",
			"25": "<sup>25</sup> လၧၦဎၬဝ့ၫလၧချဲၩဒဲဂုဝ့ၫလၧချဲၩဘၧၩ့လီၫ.- လၧဆၧ မၩဝ့ၫဖၭဒိၪ အမုနံၩနီၪ, ထီးထိၬၥံၪ လၩ့ဎီးဝ့ၫတၭ, ထံၫချိၬထံၫဖိၪချိၬလဖၪ မိအီၪဝ့ၫလၧကယဲခိၪလီၩ့ထီၫ အလီၩ့, ဒဲလၧကယဲဆၧစီၩ့ခိၪထီၫအလီၩ့ကိၭဖျိၪ့ဒ့ၭ",
			"26": "<sup>26</sup> လီၫ.- မုလနံၩလၧယဟိဝၩမိဘီၪ့ထၪ့အၡၩလဆၨၩ အဘုၪ့ဖိးယူၭအလး, ဒဲမိမၩဘျၪထဲၩ့အဘၪထးအလး နီၪ,လၩအဆၧဖၩ့မိမၩအၥၭ ဘဲၫမုမ့ၬအဆၧဖၩ့အၥိၭ နီၪတၭ, မုမ့ၬအဆၧဖၩ့မိအၪထၪ့နွ့ၫစၩ, ဘဲၫမုနွ့ၫနံၩ အဆၧဖၩ့အၥိၭနီၪလီၫ.",
			"27": "<sup>27</sup> ယိခွါ, ယဟိဝၩအမံၩ့ဂဲၫလၧအယဲၩ့,အၥၭထၪ့ခဲၩ ထၪ့, မ့ၪခူၪတၪ့ဝ့ၫဒၪလီၫ. အနိၭဖျံၩဎွ့ၩလၧအၥၭ ထၪ့,အဖျ့ၩမၩအၥၭ ဘဲၫမ့ၪလၧအအၪ့ခွံၬဆၧအၥိၭ",
			"28": "<sup>28</sup> နီၪလီၫ.- တၭအၥၪၡိၪမၩအၥၭဘဲၫထံၫချိၬဆီၪ့လၧအ လုၬဘံၭအနဲၩ့ထံၭအၥိၭနီၪ, မိထၪ့ထီၫထီၩ့လၧၦအ ခိၬ,ဘဲၫၥိၭ အမိဂံၩဂု ၦဆၨၩလဖၪ လၧဆၧဘျံၭဆၧ ဘျၪအချဲၩဘၧၩ့တၭး နိၭအဖျံၩလၧၦခမျၧးအနိၭဖၧၩ့",
			"29": "<sup>29</sup> နီၪၥိၫ့မၪဆၧလီၫ.- ဆၧၥံၫကျံၩမိအီၪလၧနၥံၪဘဲၫမုလ နၩလၧဆၧအီၪက့ၪဆံၫ့ဎံၪ ဆၧမၩဘိၪ့အၥိၭနီၪတၭ, ဆၧၥုၪ့ထိၬၥၭထိၬ မၩအၥၭဘဲၫၦလ့ၩဆၧ လၧပံၩၥံၪ ခဲၫၥံၪအၥီၫ, ဘဲၫၥိၭအမိလ့ၩထၪ့ဘၭ ယဟိဝၩအခိၪ",
			"30": "<sup>30</sup> လီၩ့,လၧအံၫစရ့လၭအလဲၫ့အအီၪအၥိၭနီၪလီၫ.- ယ ဟိဝၩမိဒုၭနါဂၧၫ့အလူအကယးကဖးတၭ, မိဒုၭဒၪ ဘၪအစူၪဂဲၫလၩ့အီၪလၧၥၭထၪ့ခဲၩထၪ့, ဒဲမ့ၪလၪလၧ အအၪ့ဆၧတၭ,ဎွံၪဝ့ၫလၧဆၧလဖုၬ ဒဲမုၥၪအလိးလီၫ.",
			"31": "<sup>31</sup> အဂဲးဘဲၫယီၩၦအစံရအၫဖိၪ မိခါလၩ့ဝ့ၫလၧယဟိဝၩ အလူအကၠီၩ့နီၪ, မိဘၪဆၧထးဝ့ၫလၧနိၪထးလီၫ.",
			"32": "<sup>32</sup> တၭကယဲဆၧအလးထီးယဟိဝၩမိဒုၭခၫ့ဂၬနီၪနိၪ ထးလၧအဎၧၫ့လဘီၩ့ လၧအမိအီၪက့ၪလၧအဖၫ့ခိၪ နီၪမိအီၪလၧဒိၩ့ၥံၪထၬၥံၪ, ဒဲနါဒံၩ့ၥၫ့ထီးၥံၪ, ဒဲဆၧဒုၭ ၥုၭလိၬအၥၭ ဆီၪ့ဆီၪ့လ့ၬနီၪ ဒုၭၥုၭလိၬအၥၭလၧအ",
			"33": "<sup>33</sup> ဖၧၩ့လီၫ.- အဂဲးဘဲၫယီၩလၧဖျိၩ့လံၩလံၩနီၪ ထိဖ့ၭ တဲၩ့ဝဲၩယူၭအၥၭတၭ, မွဲမၬ, လၧစဎွၩအဂးနီၪတဲၩ့ ဝဲၩလၩ့အၥၭလီၫ. ဆၧမၩဝ့ၫယိၬဒံၭတၭ, မၩလဲထၪ့ ဝ့ၫ,မ့ၪအၧၩ့ဒဲၥံၪ့မုအီၪအၪယူၭလၧအဖၧၩ့ယူၭ. ယ ဟိဝၩအၥၪၡိၪ မၩအၥၭဘဲၫ ကးအကၠီၪ့ၥိၭနီၪ, ဆူၭ ခဲၩထၪ့ဝ့ၫဒၪလီၫ."
		},
		"31": {
			"1": "<sup>1</sup> ၦလၧအလ့ၩလၩ့လၧအံဇံၭအဖၧၩ့လၧဆၧမၩဆၧၩ့ အဂးနီၪဘၪအၡၪ့လီၫ. ဒိၭနဲၩ့အၥၭလၧကၥ့ၪတၭ, ဒိၭနဲၩ့အၥၭလၧလဲၪ့ၥုၭၥံၪ လၧအအီၪအၪအကၠီၩ့, ဒဲ လၧၦထူၬကၥ့ၪလၧအဂဲးဆီၪ့အဘၭဆီၪ့အကၠီၩ့တၭ, ယိထၪ့လၧအံၫစရ့လၭ အဆၧဆံၫ့ဎံၪလဂၩအ့ၬ. တၭ",
			"2": "<sup>2</sup> အၪ့ဎၬယဟိဝၩဆ့အ့ၬ.- မွဲလါနၫ့တၭ,အဝ့ၫဒၪကိၪ့ ဆၧၥ့ၪဆ့တၭ,ဒုၭဂဲၫထၪ့ဆၧအၧၩ့တၭ, ၥုၭအလူအ့ၬ. မွဲအဂဲထုၪ့ထၫ့ဒုၪဒၩ ၦမၩအၧၩ့အဂံၪ့ဖိၪတၭ, ထၫ့ဒုၪ",
			"3": "<sup>3</sup> ဒၩၦမၩလတီၩဘၪအဆၧမၩဆၧၩ့လီၫ.- ယိခွါ, အံဇံၭ ဖိၪၥံၪမွဲၦၡၩတၭ, မွဲယွၩအ့ၬး အဝ့ၫၥံၪအကၥ့ၪနီၪမွဲ ဆၧယၪဆ့တၭ, မွဲၥၭအ့ၬ. ထီးယဟိဝၩအ့ၪယၩ့ထၪ့ အစူၪတၭ, ၦမၩဆၧၩ့ဆၧနီၪမိဘၪထၧၩ့တၭ, ၦလၧ အဒိၭဆၧမၩဆၧၩ့ဝ့ၫနီၪ မိလၩ့ထံၩဖါတၭ, မိလူၬဝ့ၫ ထီးအလူၬစီၪ့ဎးလီၫ.",
			"4": "<sup>4</sup> အဂဲးဘဲၫယီၩယဟိဝၩစံၭယၧၩဘဲၫယီၩ ဘဲၫဆၬ လၥၧၫ့ဒဲဆၬလၥၧၫ့ဖိၪယုၩ့ ဆၧလၧအအၪ့ဂူၬန့ဆၧအ ဖၫ့ခိၪ,လၧၦယူၬၥိၪခမျၧး ဂဲၫထၫ့ဒုၪဒၩအဝ့ၫဒၪတၭ, ဆၬလၥၧၫ့လၥၭမဲၪဘၪအဝ့ၫၥံၪအလူ, လဆၪ့လၩ့ဘၪ အၥၭလၧအၥီၫအကၠီၩ့အၥိၭနီၪ, ဆၧၥုၭမုခမျၧးအယ ဟိဝၩမိဂဲၫလၩ့ဒုၭဆၧလၧခိၪလီၩ့ဇံအိၫ့အလီၩ့, ဒဲလၧ",
			"5": "<sup>5</sup> အစီၩ့ခိၪအလီၩ့ဘဲၫနီၪၥိၭဆ့လီၫ.- ဘဲၫထိၪၥံၪယူၩဝ့ၫ အၥိၭနီၪ ယဟိဝၩချႃၬဘံၭ ယရုစလံၫ့, ချႃၬဘံၭဝ့ၫ တၭ,မၩဖီၩ့မၩဖျ့ၭဝ့ၫ, လ့ၩဖၬတၭ, ထိးထဲၩ့တၩ့ထဲၩ့ ဝ့ၫလီၫ.",
			"6": "<sup>6</sup> အံၫစရ့လၭဖိၪၥံၪဧ့, ဂဲၫထဲၩ့ကဒၩထဲၩ့နၥံၪဝ့ၫ လၧ",
			"7": "<sup>7</sup> ၦလၧနၥံၪပိၩ့ထၪ့ဝ့ၫလဂၩအအီၪနီၪဆံၭ.- အဂဲးဘဲၫ ယီၩလၧမုလနံၩနီၪၦခွံၬၡိၭခွံၬအဆၧဂၩ့စ့ၩ, ဒဲအဆၧ ဂၩ့ထီၫ့,လၧအမွဲဆၧဒဲၩဘၭလၧနၥံၪအစူၪမၩလၧနၥံၪ",
			"8": "<sup>8</sup> အဂးဆုၬဆုၬလီၫ.- ထီးနီၪလဖၧၫ့အစံရအၫမိလၩ့ထံၩ ဖါလၧဆၧလမွဲဘၪ ၦၡၩဆီၪ့အနၭ, ဒဲဆၧလမွဲဘၪၦ ၡၩဆီၪ့အနၭမိအၪ့ခွံၬဝ့ၫဒၪတၭ, မိစဲၪ့ဆၧလၧနၭအမ့ၬ ယၫတၭ,အၡၩဖိၪၥၪခွၫလဖၪနီၪ မိဘၪအီၪလၧဖ့ၪ",
			"9": "<sup>9</sup> လၫ့ခီၫ့အဂးလီၫ.- အဝ့ၫဒၪလ့ၩဖီၩ့ခွံၬ ဆၧဖလ့ၬအ လးလၧဆၧၥၭမဲၪၥၭဖျဲၩ့အကၠီၩ့တၭ, အၦဒိၪဖၭဒိၪလ ဖၪမိၥၭမဲၪၥုၭဖိၪအလၫ့နီၪ, ယဟိဝၩလၧအမ့ၪအၧၩ့ အီၪဝ့ၫလၧဇံအိၫ့ ဒဲအဖံၫ့ချၪလၧ ယရုစလံၫ့အဖၧၩ့လ ဂၩစံၭဝ့ၫဒၪလီၫ."
		},
		"32": {
			"1": "<sup>1</sup> ယိခွါ,စဎွၩလၧအမိပၧၩ့ဆၧလၧဆၧတီၩဆၧလီၩ့ အဖၧၩ့မိအီၪနးဂၩး ဒဲၦဒိၪလဖၪမိစ့ၩရၫ့လၧဆၧတီၩ",
			"2": "<sup>2</sup> အဂးလီၫ.- တၭၦလဂၩနီၪ မိမၩအၥၭဘဲၫဆၧအီၪက ဒုၩအလးလၧလံၩအမ့ၬယၫ, ဒဲဆၧအီၪလၧလဖုၬအ မ့ၬယၫအၥိၭနီၪ, ဘဲၫထံၫချိၬလၧဆၧဎဲၫ့ထၬအလးအ ၥိၭ,ဘဲၫလဲၫ့ဖၭဒိၪအလၩၡုၪ လၧဆၧပွံၭအၥၭအခး",
			"3": "<sup>3</sup> ဖၧၩ့အၥိၭနီၪလီၫ.- ၦလၧအဒၪဆၧလဖၪ အမ့ၬလခံၭ ဘၪတၭ, ၦလၧအနါဂၧၫ့ဆၧလဖၪ အနါမိနါဂၧၫ့ဆၧ",
			"4": "<sup>4</sup> လီၫ.- ၦလၧအလထီးလၩ့ဘၪအၥၭလဖၪ မိနၪၥ့ၪလၧ ဆၧၥ့ၪယၫအဂဲးတၭ, ၦလၧအချဲၩ့ဆၧဘုၭထၬလဖၪ",
			"5": "<sup>5</sup> အဖျ့ၩချဲၩ့ဆၧမိကျၩလီၫ.- ၦအကၪနီၪၦကိၭလၧၩ့ဝ့ၫ လၧအယီၫအ့ၬ. တၭၦအန့ၬနီၪ ၦစံၭလၧၩ့လၧအမွဲၦ",
			"6": "<sup>6</sup> ဖ့ၪဆၧယီၫနီၪဆ့အ့ၬ.- အဂဲးဘဲၫယီၩၦအကၪနီၪမိချဲၩ့ ဆၧအၧၩ့တၭ, အၥၭမိမၩအၧၩ့ဘဲၫၥိၭ အမိမၩဆၧက ဘျံၭကဘျၪ, ဒဲချဲၩ့မၪဘၪယဟိဝၩ, ဒဲဒုၭအီၪပျီၩၦဆၧ ၥၭဝံအၥၭနီၪအၥၭ, ဒဲဒုၭလူၬၦဆၧၥၭဝံအၥၭလၧထံၫ",
			"7": "<sup>7</sup> အဆၧအီၩလီၫ.- ၦအန့ၬအစူၪဝဲၩနီၪ မွဲဆၧအအၧၩ့ လီၫ.ကိၪ့ဝ့ၫလၧဆၧကိၪ့ဘဲၫၥိၭ အမိမၩဂၭဂီၩ့ ၦလၧ အဘၪနၭဘၪၡၪ့လၧဆၧချဲၩ့ဘျံၭချဲၩ့ဘျၪ, ဒဲၦၡၪ့ဖိၪ",
			"8": "<sup>8</sup> ယၬဖိၪလၧအချဲၩ့ဆၧတီၩနီၪလီၫ.- အ့ၪမွဲၦလၧအၥၭ ယီၫလဖၪနီၪ, ကိၪ့ထၪ့ဆၧအယီၫလဖၪတၭ, ဆၧၫ့ထုၪ့ ဝ့ၫလၧဆၧအယီၫလဖၪအကၠီၩ့နီၪဆ့လီၫ.",
			"9": "<sup>9</sup> ၦမုၪလၧအအီၪဒၪဆၧၥံၪဧ့ၬ ဂဲထုၪ့တၭခိၭနၪယလူ ဆံၭ. ၦမုၪလၧအလထီးလၩ့ဘၪအၥၭၥံၪဧ့ၬ ခိၭနၪ",
			"10": "<sup>10</sup> ယဆၧချဲၩ့ဆံၭ.- နံၩလဖၪလၧလနံၪ့အမ့ၬယၫနီၪနၥံၪ မိဝၭထိၬ, ၦလၧအဒိၭနဲၩ့အၥၭလၧဆၧလမံၩ့မံၩ့ၥံၪဧ့, အဂဲးဘဲၫယီၩ ဆၧကူၭဝ့ၫနီၪဆၧလအီၪဘၪ, ဆၧအီၪ",
			"11": "<sup>11</sup> က့ၪကီၪ့အထီလဂဲၫဘၪ,- ၦမုၪလၧအအီၪဒၪဆၧၥံၪဧ့, ဝၭထိၬဝၭတ့ၭး ၦလၧအလထီးလၩ့ဘၪအၥၭၥံၪဧ့, ဘဲၪ့လၩ့ခွံၬဆဲၫ့, အီၪဘိၪ့တၭ, ခဲးထူၬနၥံၪအယးဒံၩ့",
			"12": "<sup>12</sup> ဆံၭ.- လၧၦဒဲၩလၩ့အၥၭနၫၡါ လၧဂၪ့ခိၪလဝၩ့မုၬအ ကၠီၩ့,လၧစဘံၭမုလၧအၥၪထၪ့ ဆၧမုၬအကၠီၩ့လီၫ.",
			"13": "<sup>13</sup> လၧယၡၩခမျၧးအခးဖၧၩ့နီၪ ဆၧဆူၪဆၧမဲၪမိမဲၪထၪ့ လီၫ.မွဲမၬ, လၧကယဲဆၧၥုၪ့ဎွံၫၥၭယီၫ အဂံၪ့အဖၫ့",
			"14": "<sup>14</sup> ခိၪ,လၧဆၧၥၭထိၬဒိၩ့နီၪလီၫ.- အဂဲးဘဲၫယီၩဆၧစဲၪ့ ဒၪယူၭနီးဖၧၩ့ယူၭ, ဒိၩ့အၡၩခမျၧးၥံၪနီၪၦမိစဲၪ့ဒၪဝ့ၫ ဒုၭအီၪလၩ့ထးဝ့ၫ, ဆၧစီၩ့ခိၪ, ဒဲတၨၭခိၭဆၧမိကဲၪ ထၪ့ဆၧအိၩဖၧၩ့လၩ့ဆိၩလၩ့ကၠၪ, ဒဲကၥ့ၪယီၩ့မံၩ့မုၬ လၩအလး, ၥိၪလဖၪအၪ့အဆၪအလးလီၫ.",
			"15": "<sup>15</sup> ထီၩ့လၩ့လၧဆၧလူၫလၩ့ဂါလၩ့ၥၭမုဆံၫ့ဎံၪလၧ ဆၧထၪ့ထီၫလၧပလီၩ့တၭ, ၡါမုနၧၫ့ဖၫကဲၪထၪ့ဂၪ့ခိၪ အဝၩ့လၧအၥၪထၪ့ဆၧတၭ, ဆၧအီၪက့ၪဂၪ့ခိၪအဝၩ့",
			"16": "<sup>16</sup> လၧအၥၪထၪ့ဆၧနီၪလၧၡါမုနၧၫ့ဖၫလီၫ.- ဆၧစ့ၩရၫ့ တီၩမိအီၪလၧၡါမုနၧၫ့ဖၫတၭ, ဆၧတီၩဆၧလီၩ့မိအီၪ",
			"17": "<sup>17</sup> လၧဂၪ့ခိၪအဝၩ့ လၧအၥၪထၪ့ဆၧအဖၧၩ့လီၫ.- ဆၧ တီၩဆၧလီၩ့အမၩဆၧနီၪ မိမွဲဆၧမုၬဆၧဎၩ့တၭ,ဆၧ တီၩဆၧလီၩ့အမၩဆၧဖံၭဆၧနီၪ မိမွဲဆၧအီၪပွံၭဒဲဆၧ",
			"18": "<sup>18</sup> ဒိၭနဲၩ့အၥၭအလးလၩ့ဆိၩလၩ့ကၠၪလီၫ.- တၭယၡၩ လဆၨၩမိအီၪအလးမုၬလၩ့ထံး, လၧအအီၪပွံၭအ",
			"19": "<sup>19</sup> လးဂုးဖုးအဖၧၩ့နီၪလီၫ.- တၭဆၧမိဂဲၫဆၧၩ့လၧမုၥၪ လၩ့ထီးၥံၪ့လၧမံၩ့လၬကျၩမိခါလၩ့လီၫ. တၭဒိၩ့နီၪ မိဘၪဆၧဆၪ့လၩ့ထီးအထီၩ့လၩ့ လၧဂၪ့ခိၪနီၪလီၫ.",
			"20": "<sup>20</sup> ၦလၧအဎွံၪဆၧလၧထံၫ ထီးအလူၬအနဲၩ့ထံၭနီၪလၧ အအၪ့မၧၫ့လၩ့ချီဖၫ, ဒဲကၥ့ၪယီၩ့အခၪ့လဖၪနီၪ ဘၪ ဆိၪဂ့ၩဝ့ၫလီၫ."
		},
		"33": {
			"1": "<sup>1</sup> နဝ့ၫဒၪလၧအအၪ့ဂူၬန့ဆၧတၭ, ၦလအၪ့ဂူၬန့ဘၪ နဆၧး အၪ့လီၫဆၧတၭ, ၦလအၪ့လီၫန့ဘၪနၧၩလဂၩ ဧ့,နဘၪအၡၪ့လီၫ. ထီးနလအၪ့ဂူၬန့လၧၩ့ဘၪဆၧ တၭ,ဆၧမိအၪ့ဂူၬန့နဆၧး တၭထီးနအၪ့လီၫဆၧဂီၩ့ နီၪၦမိအၪ့လီၫန့နၧၩလီၫ.",
			"2": "<sup>2</sup> ယဟိဝၩဧ့,ယၫ့ၥၭပၧၩဆံၭ, ပယိလါနဖၧၩ့ၥၭလီၫ. ကဲၪထၪ့အဝ့ၫၥံၪအစူၪဒူၪလၧမုဂီၩ, ဆၧထိးထဲၩ့တၩ့",
			"3": "<sup>3</sup> ထဲၩ့ပၧၩလၧဆၧခိဆၧဝီၩအထီနီၪဆံၭ.- လၧဆၧတုၩ့ ထၪ့တုၩ့လၩ့အၥီၫအကၠီၩ့နီၪ, ၦခမျၧးစဲၪ့ဖျိၭ ထီးနဂဲ",
			"4": "<sup>4</sup> ထုၪ့နီၪၦဆၨၩလဖၪလၩ့ပြံၩလၩ့ပၩလီၫ.- တၭနၥံၪ အၪ့ဂူၬန့ဆၧနီၪ မိကဲၪဘဲၫထွ့အီၪက့ၪကီၪ့ဆၧအၥိၭ, ဘဲၫထွ့စဲၪ့အၥိၭနီၪ ၦလဂၩဂၩဂဲၫစဲၪ့ လၧအအီၪနီၪ",
			"5": "<sup>5</sup> လီၫ.- ယဟိဝၩဘၪဆၧအီၪက့ၪထၪ့ထီၫဝ့ၫနီၪ,အဂဲး ဘဲၫယီၩအီၪဝ့ၫလၧဆၧအလးထၪ့ထီၫလီၫ. အဝ့ၫဒၪ မၩဎွ့ၩယူၭ ဇံအိၫ့လၧဆၧစ့ၩရၫ့ ဒဲဆၧတီၩဆၧလီၩ့",
			"6": "<sup>6</sup> လီၫ.- တၭမွဲအကဲၪထၪ့နဆၧၫ့နထီလဖၪအဆၧဒိၭနဲၩ့ အၥၭအလး, ဒဲဆၧထိးထဲၩ့တၩ့ထဲၩ့အဂဲးအဘၭ, ဆၧ ကိၪ့ၥ့ၪ, ဒဲဆၧၥ့ၪယၫးဆၧၥၭမဲၪယဟိဝၩနီၪမွဲဆၧလူ ဒိၪဎွ့ၩဒိၪလီၫ.",
			"7": "<sup>7</sup> ယိခွါ,အၡၩအဆီၪ့လဖၪကိၭထၪ့လၧခီၫ့, ဆၧဘၪ လိၬအိၭလိၬအၥီၫ့လဖၪအမ့ၬထံၫလၩ့နၭနၭလ့ၬလီၫ.",
			"8": "<sup>8</sup> ဖၧၩ့ၥၭမုအီၪယူဝ့ၫ, ၦဖိၬဖၧၩ့ၥၭအီၪလၧၩ့အ့ၬ. အဝ့ၫ ဒၪမၩဂၭဂီၩ့ဆၧအုၩ့လၩ့မၩကြၩ့ထမးဒိၩ့လဖၪ, ယူၭ",
			"9": "<sup>9</sup> ယၪ့ၦနးဂၩအ့ၬ.- ထံၫၥံၪခးၥံၪနီၪ အၥုၪ့အုၭအၥၭ အုၭ,အၥၭလၩ့ဘဲၩဝ့ၫး လ့ၭဘနၧၫ့အမံၩ့လၬကျၩအ မ့ၬမဲလၩ့ယံၭခွံၬ, ၡၫရၧၫ့ မၩအၥၭဘဲၫၡါမုနၧၫ့ဖၫအ ၥိၭနီၪတၭ,ဘၫၡၫ့အခိၪလီၩ့ ဒဲကၫမလၭအခိၪလီၩ့ဝၭ ထိၬဝ့ၫလီၫ.",
			"10": "<sup>10</sup> ဘိၩ့နဲၪ့ယီၩယမိဂဲထုၪ့,ယဟိဝၩစံၭဝ့ၫဒၪး ဘိၩ့ နဲၪ့ယီၩယမိဒိၭ ဆၧအီၪက့ၪထၪ့ထီၫယၧၩ ဘိၩ့နဲၪ့ယီၩ",
			"11": "<sup>11</sup> ယမိအီၪက့ၪထၪ့ထီၫယၥၭလီၫ.- နၥံၪမိဒၧၩ့ထၪ့န့ ဖ့ၫးနၥံၪမိအီၪဖျဲၪန့န့ၫ လီထိၭနၫတၭး နၥံၪအၥၪ",
			"12": "<sup>12</sup> ဘဲၫမ့ၪအၥိၭနီၪမိအၪ့ခွံၬနၥံၪလီၫ.- ၦဆၨၩလဖၪမိ ကဲၪထၪ့ဘၧၩ့လိးလၧမ့ၪအၪ့ဝ့ၫး ဒဲဆၧဆူၪဒၪ့ထ့ၬအၥၭ",
			"13": "<sup>13</sup> မ့ၪမိအၪ့ခွံၬဝ့ၫလီၫ.- ၦလၧအအီၪ လၧအယဲၩ့ၥံၪဧ့, ဆၧလၧယမၩနီၪခိၭနၪနၥံၪဝ့ၫဆံၭး ဒဲၦလၧအဂဲၫအီၪ",
			"14": "<sup>14</sup> ဘူၭၥံၪဧ့,ၥ့ၪယၫယစီၩ့ယမၩ့ဆံၭး- ၦဆၧဒဲၩဘၭဖိၪ ၥၭမဲၪဆၧလၧဇံအိၫ့အဖၧၩ့, ဆၧဝၭထိၬဝၭတ့ၭဖီၪ့န့ၦ အၧၩ့လီၫ. မွဲပလၫလၧပကျၩအီၪဝ့ၫလၧမ့ၪအၪ့ဆၧအ ဖၧၩ့နီၪမိၥ့ၪလဂၩလဲၪ. မွဲပလၫလၧပကျၩအီၪဝ့ၫလၧ မ့ၪအၪ့ဆၧအဆိၩဆိၩအကၠၪကၠၪ အဖၧၩ့နီၪမိၥ့ၪလဂၩ လဲၪ.",
			"15": "<sup>15</sup> ၦလၧအလ့ၩဆၧလၧဆၧတီၩဆၧလီၩ့အဖၧၩ့, ၦလၧ အချဲၩ့ဆၧတီၩတီၩလီၩ့လီၩ့, ၦလၧအခွံၬၡိၭဆၧအၪ့ ဘျံၭအၪ့ဘျၪ, ၦလၧအတရူၩလၩ့ခွံၬအစူၪဘဲၫၥိၭအ ထီးမၩန့လၬဆီၪ့လဂ့ၩး လၧအၥံၭဘံၭအနါဖၧၩ့ဘဲၫ ၥိၭအထီးနါဂၧၫ့ဆၧမၩၥံၫၦၡၩအၥၭအဂဲး, ဒဲလၧအ",
			"16": "<sup>16</sup> ဘံၪ့အမ့ၬဘဲၫၥိၭအထီးယိဆၧအၧၩ့လဂ့ၩနီၪ,- အဝ့ၫ ဒၪမိအီၪလၧဆၧအလးထၪ့ထီၫ, လိးၥံၪလဲၫ့ၥံၪအထိၬ မိကဲၪထၪ့အဒိၭနဲၩ့အၥၭအလးလီၫ. ဆၧမိဖ့ၪလၫ့ဝ့ၫ အကိၪ,ဒဲအထံၫမိအီၪဂုးခၧၫ့ဝ့ၫဒၪလီၫ.",
			"17": "<sup>17</sup> နမ့ၬၥၪမိဒၪ ဘၪစဎွၩအီၪလၧအဎံၫအလၩ,",
			"18": "<sup>18</sup> မိဒၪဘၪဝ့ၫလၧထံၫ ယဲၩ့ခးယဲၩ့လီၫ.- နၥၭမိဆီၫ့မီၪ့ လၧဆၧၥၭမဲၪၥၭဖျဲၩ့ အဂဲးလီၫ. ၦကွ့ၭလံၬနီၪအီၪ ခီၫခီၫလဲၪး ၦခံၫ့ဆၧမွဲအအီၪခီၫခီၫလဲၪး ၦလၧအဝံ",
			"19": "<sup>19</sup> ထၪ့နၬထၪ့တၨၭထီၫလဖၪနီၪ မွဲအအီၪခီၫခီၫလဲၪ.- ၦ ဆီၪ့လဆၨၩနီၪ, ၦလဆၨၩ လၧအဆၧချဲၩ့ယိၬနဲၪ့ဒံၭ လၧနနါဂၧၫ့ၥ့ၪး ၦလဆၨၩလၧအချဲၩ့ဆၧကၪကၪဂဲၩဂဲၩ ထီးၦနၪလၥ့ၪဘၪနီၪနၥံၪဒၪဘၪအ့ၬ.",
			"20": "<sup>20</sup> ယိဇံအိၫ့ပမၩဘိၪ့ အဒိၩ့လဖျိၪ့ဆံၭ. နမ့ၬၥၪမိဒၪ ဘၪယရုစလံၫ့ လၧဆၧအီၪဝ့ၫလၧအလးဂုးဖုး, တဲၩ လၧၦလၥုၪ့ဘၪအလးတၭ, အဆိၩအကၠၪနီၪပလထုၭ ထၪ့ဘၪအတၧၩ့, ဒဲအဖျံၩနီၪမိဘၪထ့ၬခွံၬ နးဘီၩ့ဆ့",
			"21": "<sup>21</sup> အ့ၬ.-အ့ၪမွဲထီးနီၪယဟိဝၩမိကဲၪထၪ့ဆၧကယးကဖး လၧပဂး, ထံၫမိၡါအလး,ဒဲထံၫဖၭလဲလဖၪ,ထီးနီၪက ဘၩ့အီၪလၧတငၨၭၥံၪလလ့ၩဘၪ, ဒဲကဘၩ့အဎံၫအ",
			"22": "<sup>22</sup> လၩလခၫ့ဂၬဘၪ,- အဂဲးဘဲၫယီၩယဟိဝၩၦစ့ၩရၫ့ခွး လၧပဂး, ယဟိဝၩအီၪက့ၪလၩ့ဆၧၥီၪ့ဆၧၥၫ့လၧပဂး, ယဟိဝၩပစဎွၩ, အဝ့ၫဒၪမိထိးထဲၩ့တၩ့ထဲၩ့ပၧၩလီၫ.",
			"23": "<sup>23</sup> နဖျံၩလၩ့ပၠၪတၭ, လစၧၩ့ထၬန့ဘၪယါထုၪ့ထီးအ ခၧၫ့တၭ,ပၠၪလၩ့ယါလၪလၥ့ၪဘၪနီၪလီၫ. ထီးနီၪလ ဖၧၫ့ၦနၩ့ဖၭဆၧအၪ့ဂူၬန့အၪလ့ၬ, ၦလၧအစူၪဂၭဂီၩ့ အခၪ့ဂၭဂီၩ့လဖၪမၩန့ဆၧအၪ့ဂူၬန့လီၫ.",
			"24": "<sup>24</sup> တၭၦအီၪဝ့ၫလဖၪနီၪ, စံၭလၧယမၩလကဲၪဘၪနီၪ အ့ၬ.အီၪဝ့ၫလၧအဖၧၩ့လဖၪနီၪ အဆၧဒဲၩဘၭဘၪဆၧ ဖျါခွံၬယူၭလီၫ."
		},
		"34": {
			"1": "<sup>1</sup> ၦအဆၨၩၥံၪဧ့,ဘဲၫၥိၭနၥံၪမိနါဂၧၫ့ဆၧနီၪ, ၥုၭဘူၭ နၥံၪအၥၭဆံၭ. တၭၦခမျၧးၥံၪဧ့,ခိၭနၪဆံၭ. မွဲဂၪ့ခိၪ ဒဲဆၧအီၪလၧအဖၧၩ့, ဂၪ့ခိၪ, ဒဲဆၧကဲၪထၪ့လၧအဖၧၩ့",
			"2": "<sup>2</sup> နီၪခိၭနၪဆၧဆံၭ.- အဂဲးဘဲၫယီၩ ယဟိဝၩၥၭထၪ့ ၦကိၭဆၨၩဒ့ၭ, ဒဲၥၭခဲၩထၪ့ဘၪ အၥုၭမုခမျၧးကိၭစီၪ့ ဒ့ၭတၭ,အီၪက့ၪဝ့ၫလၧဆၧဂၭဂီၩ့အဂး, ဒဲဖ့ၪလၫ့ခွံၬ ဝ့ၫလၧဆၧၥံၫအဂးလီၫ.",
			"3": "<sup>3</sup> တၭအဝ့ၫၥံၪအၡၩ ဘၪဆၧကျီၪ့ၥံၫဝ့ၫနီၪ ဆၧမိခွံၬ ၡိၭခွံၬဝ့ၫလီၫ. အစွၪမိနၧၫ့အုၪထၪ့တၭ, ခိၪလီၩ့ထိၩ့",
			"4": "<sup>4</sup> ချိၬမိဖံၪထၪ့ဝ့ၫ လၧအၥွံၪလီၫ.- မူၭခိၪအၥုၭမုခမျၧး ထီးအလူၬနီၪမိလူၬခွံၬတၭ, မူၭခိၪမိထူၫထၪ့အၥၭဘဲၫ လံၬထူၫထၪ့ဝ့ၫအၥိၭနီၪတၭ, အၥုၭမုခမျၧးထီးအလူၬ မိလၩ့ထ့ၬ, ဘဲၫလၪလၩ့ဎွံၪလၧစဘံၭမုအၥိၭ, ဒဲဘဲၫချိၪ့",
			"5": "<sup>5</sup> ဒိၩ့ၥၪလၩ့ဘၩ့လၧၥံၪ့ချိၪ့ဒိၩ့အလီၩ့အၥိၭနီၪလီၫ.- အ ဂဲးဘဲၫယီၩယနၭမိစုၪလၩ့အၥၭလၧမူၭခိၪ, ယိခွါ,မိဂဲၫ လၩ့ဘၪခးအံဒၧၫ့, ဒဲလၧၦလၧအဘၪယဆၧဆိၪအၧၩ့",
			"6": "<sup>6</sup> လၧဆၧစ့ၩရၫ့အကၠီၩ့လီၫ.- ယဟိဝၩအီၪလၧအနၭ လဘံၪ့ဎွ့ၩလၧဆၧၥွံၪ, ဘျဲၩအၪ့လၧဆၧၥိၪ, ဒဲၥိၪဖိၪ, ဒဲဘ့ၪအၥွံၪ,ဒဲၥိၪဖၫအလ့အၥိၪနီၪလီၫ. အဂဲးဘဲၫယီၩ ယဟိဝၩ အီၪလၧဆၧလုဖၭဒိၪ လၧဘီၭဇရၫအဖၧၩ့း",
			"7": "<sup>7</sup> ဒဲဆၧမၩၥံၫဖၭဒိၪ လၧခးအံဒၧၫ့အဖၧၩ့နီၪလီၫ.- ဆၧ ဒိၪၥံၪမိလၩ့ထံၩဖါလၧအၥိၭ, ဒဲချီဖၫ, ဒဲချီဖၫၡါတၭ, အခးနီၪမိဘၪစုၪဘိၪ့လၩ့ဝ့ၫ လၧဆၧၥွံၪအဖၧၩ့တၭ,",
			"8": "<sup>8</sup> အဂၪ့ခိၪအမုၬနီၪ မိဘီၪ့ထၪ့လၧဆၧၥိၪလီၫ.- အဂဲး ဘဲၫယီၩဆၧမၩဆၧၫ့ဆၧအၧၩ့ အမုလနံၩအီၪလၧယ ဟိဝၩ,ဆၧဖ့ၪထဲၩ့ဆၧအနံၪ့ လၧဇံအိၫ့အခွးအဂး",
			"9": "<sup>9</sup> လီၫ.- တၭထံၫချိၬလဖၪမိကဲၪထၪ့ကျဲၩ့တံၭ,ဒဲအဂၪ့ခိၪ မုၬနီၪ,လၧကးတၭ, အဂၪ့ခိၪမိကဲၪထၪ့ကျဲၩ့တံၭလၧ",
			"10": "<sup>10</sup> မ့ၪအၪ့ဝ့ၫလီၫ.- လၧမုဆၫမွဲဂ့ၩ,လၧမုနၩမွဲဂ့ၩ,လၩ့ဖံၬ ဘၪအ့ၬ.အမ့ၪခူၪမိထၪ့ဝ့ၫလၩ့ဆိၩလၩ့ကၠၪလီၫ. လ ဆိၩဘၪလဆိၩ, လကၠၪဘၪလကၠၪ,မိအီၪယူလၩ့ဆိၩ",
			"11": "<sup>11</sup> လၩ့ကၠၪၦခၫ့ဂၬဘၪဝ့ၫအ့ၬ.- ထိၪစၭကဝၭ, ဒဲဆၧဂိၬ ဆူၪမိန့ၥၫဝ့ၫတၭ, ထိၪဖၭဒိၪ ဒဲကျၭမိအီၪလၧအဖၧၩ့ လီၫ.တၭဆၧမိဆုးထၪ့ဖျံၩအီၪပျီၩလဘီၩ့ လၧအဖၫ့",
			"12": "<sup>12</sup> ခိၪ,ဒဲလိးအီၪယူနီၪလီၫ.- အဝ့ၫၥံၪကိၭလါနၫ့ၦဒိၪၥံၪ တၭ,အဘၩ့အမုးလအီၪဘၪထီးနီၪ, အၦဒိၪဖၭဒိၪ လဖၪအီၪလၧၩ့နးဂၩအ့ၬ.",
			"13": "<sup>13</sup> ဆၧဆူၪအၪမံၩ့မိမဲၪထၪ့လၧအနီးဖၧၩ့, ဒဲလၧအ ထိၬဖၧၩ့နီၪလီၫ. တၭမိကဲၪထၪ့ထွံၪဂၪ့ခိၪအဖၧၩ့ဒဲထိၪ",
			"14": "<sup>14</sup> ကလအူၭအအီၪအလးနီၪလီၫ.- ဆၧမံၩ့လၬမိဘၪခီၩ့ လၧထွံၪမံၩ့ဖိၪ,ဒဲဆၧထီၫဆီၪ့ကိၭလိၬအၥၭလၧအၥိၭ လီၫ.ထီးနီၪလံၬနၪ အီၪပွံၭတၭ, ဒၪန့ဆၧအီၪပွံၭအ",
			"15": "<sup>15</sup> လးလၧအဂးလီၫ.- ထီးနီၪဂူဖျါမိမၩအၥွံၫဒံၪဝ့ၫလီၫ. အဒံၪဖၭထၪ့ဂီၩ့တၭ, မိဒုၭအီၪကီၪ့အဖိၪလၧအလၩ ၡုၪဖၧၩ့လီၫ. တၭထီးနီၪလၫ့ကထၬမိအီၪကိၩ့အီၪကီၪ့",
			"16": "<sup>16</sup> လဘံၪ့ဒဲအၥိၭ, လဘံၪ့ဒဲအၥိၭလီၫ.- အၪ့ဎၬဆၧလၧ ယဟိဝၩအလံၬဖၧၩ့တၭ, ဖီထၪ့ဘီၪး ဆၧလၩ့မါဘၪ နးဘံၪ့အ့ၬ. ဆၧလၧအၥိၭလအီၪဘၪမိအီၪနးမံၩ့အ့ၬ. အဂဲးဘဲၫယီၩယနိၭမၪလူၬဆၧနီၪ, ဒဲယၥၭနီၪဒုၭအီၪ",
			"17": "<sup>17</sup> ကီၪ့ဝ့ၫလီၫ.- အဝ့ၫဒၪဖၭဆၧလၧအဝ့ၫၥံၪအဂးဆ့တၭ, အစူၪအၪ့နၩ့ဖၭအဆၧၫ့လၧဖျံၩလၧအဂးလီၫ. မိန့ၥၫ ဝ့ၫလၩ့ဆိၩလၩ့ကၠၪ, မိအီၪဝ့ၫထီးနီၪလဆိၩဘၪလဆိၩ လီၫ."
		},
		"35": {
			"1": "<sup>1</sup> ၡါမုနၧၫ့ဖၫဒဲပွ့ၪခိၪပွ့ၪနါနီၪ မိၥၭထိၬလၧဆၧနီၪလ ဖၪအကၠီၩ့တၭ, မံၩ့လၬကျၩမိၥုၪ့ဎွံၫၥၭယီၫတၭ, မိဖီၫ",
			"2": "<sup>2</sup> ထၪ့ဘဲၫဖီၫဆၧဆူၪအၥိၭနီၪလီၫ.- ဖီၫထၪ့တၭ, မိဖီၫ ထၪ့ဒဲၥုၪ့ဎွံၫၥၭယီၫ, ဒဲဆၧၥုၪ့ထိၬၥၭထိၬ လၧဆၧမုၬ လၩဒဲဆၧကိၭၡၭထၪ့အဖၧၩ့လီၫ. ဆၧမိဖ့ၪလၫ့ဝ့ၫလၧ လ့ၭဘနၧၫ့အလၩအဖၩ့, ကၫမလၭ,ဒဲၡၫရၧၫ့အဎံၫအ လၩလီၫ. ၦၡၩမိဒၪဘၪယဟိဝၩအလၩအဖၩ့ပယွၩ",
			"3": "<sup>3</sup> အကယးအကဖးလီၫ.- ဒုၭဆီၪ့ထၪ့စူၪလၧအလၩ့ဆါ တၭ,ဒုၭခၧၫ့ထၪ့ခၪ့လုးခိၪလၧအဝၭဝ့ၫနီၪဆံၭ.",
			"4": "<sup>4</sup> စံၭၦလၧအၥၭမဲၪဆၧ, အီၪလၧအဂဲးဆီၪ့ဆံၭးၥၭမဲၪ ဆၧလဂ့ၩ. ယိခွါ, နၥံၪအယွၩ,ဆၧမၩဆၧၫ့ဆၧအၧၩ့, ဂဲၫဝ့ၫ,ယွၩမိဖ့ၪထဲၩ့ဆၧလီၫ. အဝ့ၫဒၪဂဲၫဝ့ၫတၭမိမၩ ဖီၩ့မၩဖျ့ၭနၥံၪလီၫ.",
			"5": "<sup>5</sup> ထီးနီၪလဖၧၫ့ၦမ့ၬဘျီၪအမ့ၬၥၪ မိဘၪဆၧဝဲထၪ့တၭ, ၦနါအၧၩ့အနါမိဒိၭထုၭထၪ့ခွံၬ ဆၧဆွံၫဘံၭ လၧအ",
			"6": "<sup>6</sup> ဖၧၩ့လီၫ.- ထီးနီၪလဖၧၫ့ၦအခၪ့ဂၭဂီၩ့ မိစဲၪ့ထၪ့ဘဲၫခံၫ ဘၩ့အၥိၭတၭ, ၦအုၭအၭအဖျ့ၩ မိကိၭၡၭထၪ့လီၫ. အဂဲးဘဲၫယီၩ ထံၫဖျိၭထၪ့လၧၡါမုနၧၫ့ဖၫ ဒဲထံၫချိၬလ",
			"7": "<sup>7</sup> ဖၪလၧမံၩ့လၬကျၩနီၪလီၫ.- ဆၩ့လူလၩ့မိကဲၪထၪ့က မၫ,ဒဲဂၪ့ခိၪဎဲၫ့ထၬနီၪ မိကဲၪထၪ့ထံၫထၪ့ဖျိၭဖၧၩ့, ထွံၪ ဂၪ့ခိၪမံၫအလးအီၪလၧအလးဖၧၩ့, နၪ့ဒဲဖီးပိၩအလး",
			"8": "<sup>8</sup> လီၫ.- ဖၧၩ့ၥၭမုဒဲဖၧၩ့ၥၭဖိၪမိအီၪထီးနီၪတၭ, ဆၧကိၭ ဝ့ၫလၧဖၧၩ့ၥၭဆံၫ့ဎံၪတၭ, ဆၧလဆံၫ့ဘၪဖိၬဝ့ၫအ့ၬး မွဲအမိအီၪန့ၫလၧအဝ့ၫၥံၪအဂးတၭ, အဝ့ၫဒၪဖိၬဖၧၩ့ ၥၭနီၪ,ဒဲၦလၧအလမၩလိၪဘၪဆၧဂၭဖျိၭဖၧၩ့ၥၭနီၪ",
			"9": "<sup>9</sup> အ့ၬ.- တၭဆၬလၥၧၫ့အီၪထီးနီၪနးဒုၩအ့ၬ, ဆၧဖိၪဆၧ ဎါအၥၭဒူၩလဖိၬဘၪဝ့ၫတၭ,အီၪထီးနီၪဆ့အ့ၬ. အ့ၪ မွဲၦၡၩဒိၭဆၧဎွ့ၩန့ထဲၩ့အၥၭလဖၪ မိဖိၬဝ့ၫဒၪလီၫ.",
			"10": "<sup>10</sup> တၭၦလၧယဟိဝၩ ဎွ့ၩန့ထဲၩ့ဝ့ၫလဖၪနီၪ, မိဂဲၫထဲၩ့ ထီၩ့လၧဇံအိၫ့အီၪလၧဆၧကိၭၡၭထၪ့, ဒဲဆၧၥုၪ့ထိၬ ၥၭထိၬအဆိၩအကၠၪ လၧအခိၪဎွံၪအဖၫ့ခိၪလီၫ. ဆၧ ၥုၪ့ဎွံၫၥၭယီၫ, ဒဲဆၧၥုၪ့ထိၬၥၭထိၬမိချႃၭန့ဝ့ၫတၭ, ဆၧ ၥုၪ့အုၭၥၭအုၭဒဲဆၧဂၪ့အုၩဂၪ့ထိၬ မိစဲၪ့ထၪ့ခွံၬဝ့ၫဒၪ လီၫ."
		},
		"36": {
			"1": "<sup>1</sup> တၭလၧစဎွၩဟ့ၭဇကဲအၫအနံၪ့ လဆံၫလံနံၪ့လနံၪ့ အဖၧၩ့နီၪ, ဆၧမၩအၥၭလၧအစံရအၫအစဎွၩစနၭက ရ့ၭဂဲၫထၪ့ထၫ့ဒုၪဒၩယုဒၫအဒိၩ့လဖၪ လၧအအီၪလၧ အခိၪဒၧၩ့ထီးအလူၬတၭ,မၩန့ဝ့ၫလီၫ.",
			"2": "<sup>2</sup> တၭစရၭဘၡၫက့ၫအီၪလၧၥုၭမုလဒီၪ့ဖၭဒိၪ လၧလၫ ခံၭနီၪအစံရအၫအစဎွၩ အၪ့မၧၫ့လၩ့အဝ့ၫဘဲၫၥိၭအမိ လ့ၩထီၩ့လၧဒိၩ့ယရုစလံၫ့ လၧစဎွၩဟ့ၭဇကဲအၫအ အီၪတၭ, ဆၧၫ့ထုၪ့ဝ့ၫထီးကမၫ လၧထၭလခီၫလစီၪ့ အထံၫကၠီၪ့ထီးၦစုၪလၩ့ ဆၧကဲၩ့ယၬ အဂၪ့ခိၪအဝၩ့",
			"3": "<sup>3</sup> အဖၧၩ့ၥၭမုလီၫ.- တၭစဟံၫလကဲအၫအဖိၪခွၫစအံၫ လဲအကံၫ့လၧအအီၪလၧဂံၪ့အဖၫ့ခိၪ, ဒဲၦကွ့ၭလံၬစၡ့ၭ ဘနၫ, ဒဲၦကွ့ၭနဲၪ့ဆၧစအၫစၭ အဖိၪခွၫစယိအၫနီၪဂဲၫ",
			"4": "<sup>4</sup> ထၪ့လၧအအီၪလီၫ.- တၭစရၭဘၡၫက့ၫစံၭအဝ့ၫၥံၪ, လီၩဘၪစဟ့ၭဇကဲအၫ, ဆၧဒိၪစဎွၩအစံရအၫအစဎွၩ စံၭဘဲၫယီၩ, ဆၧဒိၭနဲၩ့အၥၭအီၪလၧနၧၩနဒိၭနဲၩ့နၥၭ",
			"5": "<sup>5</sup> လၧအဖၧၩ့နီၪ, မွဲဆၧနီၪလမံၩ့လဲၪ.- (ယစံၭမွဲန့ၫဆၧ ချဲၩ့ပျီၩပျီၩ,) ယအီၪလၧဆၧကိၪ့ဆၧဖၭ, ဒဲဆၧအဂဲး အဘၭ,လၧဒုၭၥုၭအဂးနီၪလီၫ. ဘိၩ့နဲၪ့ယီၩ နဒိၭ နဲၩ့နၥၭလၧပလၫလဂၩ လၧနပိၩ့ထၪ့ယၧၩအကၠီၩ့နီၪ",
			"6": "<sup>6</sup> လဲၪ.- ယိခွါ,နဒိၭနဲၩ့နၥၭလၧနိၪထိၭဘီၩ့ယီၩ, ဖီး လၧအခါခွံၬဝ့ၫလဘီၩ့, လၧအံဇံၭလၧၦအ့ၪဒိၭနဲၩ့အ ၥၭလၧအဝ့ၫတၭ, မိနုၬလၧအစူၪဖၧၩ့,ဒဲဆ့ၭဖိးဝ့ၫလီၫ. အံဇံၭအစဎွၩဖၫရိၫမၩအၥၭဘဲၫနီၪ, လၧကယဲၦလၧ",
			"7": "<sup>7</sup> အဒိၭနဲၩ့အၥၭလၧအဖၧၩ့နီၪဆ့လီၫ.- နအ့ၪစံၭယၧၩ, ပဒိၭနဲၩ့ပၥၭလၧယဟိဝၩပယွၩတၭ, အဝ့ၫဒၪမွဲၦလၧ စဟ့ၭဇကဲအၫမၩန့ထၪ့ခွံၬအလးထၪ့ထီၫလဖၪ, ဒဲအ ဆၧလုလးလဖၪတၭ,စံၭယုဒၫ, ဒဲယရုစလံၫ့, နၥံၪမိ ဘၪဘိၪ့ဆၧဘၩဆၧ လၧဆၧလုလးယီၩအမ့ၬယၫနီၪ,",
			"8": "<sup>8</sup> မွဲအ့ၬဧၪ.- တၭဘိၩ့နဲၪ့ယီၩ အုၩ့လၩ့လါဆၧလၧယ ကဆါအစံရအၫအစဎွၩနီၪဆံၭ. တၭနဝ့ၫလခီၫနအီၪ က့ၪၦထူၬကၥ့ၪလၧအလီၩ့အ့ၪၥ့ၪတၭ, ယမိဖ့ၪလၫ့",
			"9": "<sup>9</sup> နၧၩလၧကၥ့ၪနံၫထီၫ့လီၫ.- မၩအၥၭဘဲၫနီၪတၭ, နမိ ဘိၭကၠၪကဒၩယကဆါ အၦဒိၪလၧအဆံၭထုၬအကျၩ လဂၩနီၪဘဲၫၥ့ၪလဲၪ. တၭနဒိၭနဲၩ့နၥၭ လၧအံဇံၭလၧ",
			"10": "<sup>10</sup> လဲၪ့ၥုၭအဂဲး,ဒဲလၧကၥ့ၪအဂဲးနီၪလီၫ.- တၭဘိၩ့နဲၪ့ ယီၩယဟိဝၩအ့ၪလဖ့ၪလၫ့ဘၪတၭ, ယဂဲၫထၫ့ဒုၪဒၩ ခးလဘံၪ့ယီၩ ဘဲၫၥိၭယမိမၩဂၭဂီၩ့ဝ့ၫဆ့ဧၪ. ယဟိ ဝၩစံၭယၧၩ,လ့ၩထၪ့လၧခးလဘံၪ့ယီၩတၭ, မၩဂၭ ဂီၩ့ဝ့ၫဆံၭ.",
			"11": "<sup>11</sup> ထီးနီၪလဖၧၫ့စအံၫလဲအကံၫ့, ဒဲစၡ့ၭဘနၧၫ,ဒဲစယိ အၭလဖၪစံၭစရၭဘၡၫက့ၫနီၪ, ချဲၩ့လါလၧအၫရၫ့ဖိၪ အဆၧချဲၩ့လၧနခ့ၫနၡၩဆံၭ. အဂဲးဘဲၫယီၩ ပနၪၥ့ၪ လီၫ.တၭချဲၩ့ဆၧလၧယုဒၫအဆၧချဲၩ့ ဒဲလၧၦခမျၧး အနါဖၧၩ့လၧအအီၪ လၧခိၪဒၧၩ့အဖၫ့ခိၪနီၪ လဂ့ၩ.",
			"12": "<sup>12</sup> တၭစရၭဘၡၫက့ၫစံၭဝ့ၫဒၪ, ယကဆါအၪ့မၧၫ့လၩ့ယ ချဲၩ့ဆၧချဲၩ့ယီၩ လၧနကဆါ ဒဲနနၫ့ဆါဒၪဝ့ၫဆ့ဧၪ.မွဲ (အအၪ့မၧၫ့ယဂဲၫ) လၧၦဆၧၫ့နၩ့လၧခိၪဒၧၩ့အဖၫ့ခိၪ ဘဲၫၥိၭအဝ့ၫၥံၪ မိအၪ့အအ့ၪဒၪဝ့ၫ, ဒဲအီၩအဆံၪထံၫ ဒၪဝ့ၫလဖၪလၧနၥံၪအၥိၭမွဲအ့ၬဧၪ.",
			"13": "<sup>13</sup> ထီးနီၪလဖၧၫ့စရၭဘၡၫက့ၫဆၧၫ့ထုၪ့တၭ, ကိၭထၪ့ လၧအလူဖၭဒိၪလၧယုဒၫဖိၪၥံၪအဆၧချဲၩ့နီၪတၭ, စံၭ ဝ့ၫ,ခိၭနၪစဎွၩဖၭဒိၪ, အစံရအၫအစဎွၩအလူနီၪဆံၭ.",
			"14": "<sup>14</sup> စဎွၩစံၭဘဲၫယီၩ, မွဲနၥံၪထီးဒိၭန့ဆၧအၪ့လီၫန့နၥံၪ လၧစဟ့ၭဇကဲအၫနီၪလဂ့ၩး အဂဲးဘဲၫယီၩမွဲအမၩ",
			"15": "<sup>15</sup> ဖီၩ့မၩဖျ့ၭနၥံၪၥ့ၪအ့ၬ.- တၭစဟ့ၭဇကဲအၫစံၭနၥံၪ, ယဟိဝၩမိမၩဖီၩ့မၩဖျ့ၭပၧၩတၡါ, ဒိၩ့လဖျိၪ့ယီၩဆၧ လဖ့ၪလၫ့ခွံၬဘၪ လၧအစံရအၫအစဎွၩအစူၪဖၧၩ့နီၪ တၭ,မွဲအထီးဒုၭဒိၭနဲၩ့နၥံၪအၥၭ လၧယဟိဝၩလ",
			"16": "<sup>16</sup> ဂ့ၩ.- ထီးခိၭနၪစဟ့ၭဇကဲအၫအလူလဂ့ၩး အဂဲးဘဲၫ ယီၩ,အစံရအၫအစဎွၩစံၭဘဲၫယီၩ, မၩယၧၩလၧဆၧ ဆိၪဂ့ၩတၭ, ဂဲၫထၪ့လၧယအီၪတၭ, အၪ့လဂၩလၧအ စဘံၭမုဒၪဝ့ၫ, လဂၩလၧအချိၪ့ဒိၩ့ဒၪဝ့ၫတၭ, အီၩလ ဂၩလၧအထံၫဖၧၩ့ဒၪဝ့ၫ, လဂၩလၧအထံၫဖၧၩ့ဒၪဝ့ၫ",
			"17": "<sup>17</sup> ဘီၪ.- တၭယဂဲၫဆိၬထၪ့နၥံၪ လၧခးလဘံၪ့မၩအၥၭ ဘဲၫနၥံၪအခးဒၪနၥံၪဝ့ၫအၥိၭ, ခးလဘံၪ့အီၪလၧဘုၪ ကၠိၩ့,ဒဲစဘံၭထံၫ,ခးလဘံၪ့အီၪလၧကိၪ, ဒဲစဘံၭမုအ",
			"18": "<sup>18</sup> လးလဖၪနီၪလီၫ.- စဟ့ၭဇကဲအၫစံၭ, ယဟိဝၩမိမၩ ဖီၩ့မၩဖျ့ၭပၧၩတၭ, မွဲအထီးအၪ့လွ့ၫန့နၥံၪလဂ့ၩ. ၦ ဆၨၩလဖၪအကဆါၥံၪမၩဖီၩ့မၩဖျ့ၭ အထံၫအခးဆုၬ",
			"19": "<sup>19</sup> ဆုၬလၧအစံရအၫအစဎွၩ အစူၪဖၧၩ့နီၪဆ့ဧၪ.- ဟၫ မၭဒဲအၫဖၭအကဆါလဖၪနီၪ, မွဲအအီၪခီၫခီၫလဲၪ. စ့ၭဖၫဝံၫ့အကဆါလဖၪမွဲအအီၪခီၫခီၫလဲၪ.မွဲအဝ့ၫၥံၪ",
			"20": "<sup>20</sup> မၩဖီၩ့မၩဖျ့ၭစမ့ရအၫလၧယစူၪဖၧၩ့နီၪဆ့ဧၪ.- လၧခး လဖၪနီၪအယွၩထီးအလူၬအကျၩနီၪ, မွဲယွၩပလၫမၩ ဖီၩ့မၩဖျ့ၭယူၭ အထံၫအခးလၧယစူၪဖၧၩ့လဂၩလဲၪ. မွဲယဟိဝၩမိမၩဖီၩ့မၩဖျ့ၭ ယရုစလံၫ့ လၧယစူၪဖၧၩ့ မိၥ့ၪဘဲၫၥ့ၪလဲၪ.",
			"21": "<sup>21</sup> အဝ့ၫၥံၪအီၪလၩ့မါပံၭတၭ, ချဲၩ့ဆၧၫ့ဘၪနးထံၪအ့ၬ. အဂဲးဘဲၫယီၩစဎွၩမၪလူၬဆၧတၭ,စံၭဝ့ၫဒၪ, ထီးစံၭ ဆၧၫ့ဝ့ၫနးထံၪလဂ့ၩ.",
			"22": "<sup>22</sup> တၭစဟံၫလကဲအၫအဖိၪခွၫ စအံၫလဲအကံၫ့လၧအ ပၧၩ့ဂံၪ့,ဒဲၦကွ့ၭလံၬစၡ့ၭဘနၫ, ဒဲၦကွ့ၭနဲၪ့ဆၧစအၫ စၭအဖိၪခွၫစယိအၫလဖၪနီၪထဲၩ့ထဲၩ့ လၧစဟ့ၭဇကဲ အၫအအီၪ, လၧအဆဲၫ့ယၬဝ့ၫတၭ, လီၩဘၪဝ့ၫလၧ စရၭဘၡၫက့ၫအဆၧချဲၩ့လဖၪနီၪလီၫ."
		},
		"37": {
			"1": "<sup>1</sup> ထီးစဎွၩဟ့ၭဇကဲအၫနါဂၧၫ့ဆၧနီၪတၭ, ဆၧမၩ အၥၭလၧအၡၫ့အဆဲၫ့တၭ,လုၬဝ့ၫလၧရၧၬအဆၧယၬ တၭ,လ့ၩနုၬလၧယဟိဝၩအဂံၪ့ဖၧၩ့လီၫ.",
			"2": "<sup>2</sup> တၭအဝ့ၫဒၪအၪ့မၧၫ့စအံၫလဲအကံၫ့ လၧအပၧၩ့ဘၪ ဂံၪ့, ဒဲၦကွ့ၭလံၬစၡ့ၭဘနၫ, ဒဲၦလုဆၧၥံၪအၦၥုၪ့က့ၭ ၥၭၡါလုၬရၧၬ အဆၧယၬ လ့ၩလၧစအၫမူၭ အဖိၪခွၫ",
			"3": "<sup>3</sup> စအဲၫစ့ယၫအအီၪလီၫ.- တၭအဝ့ၫၥံၪစံၭဝ့ၫစဟ့ၭဇကဲ အၫ,စံၭဘဲၫယီၩ, ဆၧလၧမုဆၫလနံၩယီၩမွဲဆၧခိဆၧ ဝီၩ,ဒဲဆၧအၪ့ၥီၪ့ဒဲဆၧမၩဒုၪဒွ့ၪအနံၩလီၫ. အဂဲးဘဲၫ ယီၩဖိၪၥၪအီၪဖျဲၪအခံၫ့အခၫထီၩ့တၭ, ၦလၧအမိအီၪ",
			"4": "<sup>4</sup> ဖျဲၪနီၪအဂဲးအဘၭအီၪအ့ၬ.- ဘၪလဘၪယဟိဝၩနယွၩ မိနါဂၧၫ့စရၭဘၡၫက့ၫအဆၧချဲၩ့ လၧအကဆါအစံရ အၫအစဎွၩအၪ့မၧၫ့လၩ့ ဘဲၫၥိၭအမိဒုၪဒွ့ၪယွၩ လၧ အမၧၫ့ဝ့ၫနီၪတၭ, မိချဲၩ့ဆၧၫ့ဆၧချဲၩ့လဖၪလၧ ယဟိ ဝၩနယွၩနါဂၧၫ့ဝ့ၫလီၫ. အခိးမွဲဘၩဆိၪဖၪန့လါဆၧ",
			"5": "<sup>5</sup> လၧၦအီၪလၩ့ထးဒံၭလဖၪအဂးဆံၭ.- တၭစဎွၩဟ့ၭ ဇကဲအၫအခ့ၫအၡၩနီၪလ့ၩလၧစအဲၫစ့ယၫအအီၪလီၫ.",
			"6": "<sup>6</sup> တၭစအဲၫစ့ယၫစံၭဝ့ၫ, နၥံၪမိဘၪစံၭနၥံၪအကဆါ ဘဲၫယီၩ, ယဟိဝၩစံၭဘဲၫယီၩ, ဆၧချဲၩ့လၧယနါဂၧၫ့ လၧအစံရအၫ အစဎွၩ ဒုၪဒွ့ၪယၧၩနီၪ ထီးၥၭမဲၪလ",
			"7": "<sup>7</sup> ဂ့ၩ,- ယိခွါ, ယအီၪက့ၪၥၭလမံၩ့လၧအဖၧၩ့တၭ,မိနါ ဂၧၫ့ဆၧအပရၧၫ့တၭ, မိထဲၩ့ကဒၩထဲၩ့လၧအခးဒၪဝ့ၫ တၭ,ယမိဒုၭလၩ့ထံၩဖါဝ့ၫ လၧနၭလၧအခးဒၪဝ့ၫအ ဖၧၩ့နီၪလီၫ.",
			"8": "<sup>8</sup> စရၭဘၡၫက့ၫနီၪ ထဲၩ့ထဲၩ့ဝ့ၫတၭ, ဒၪန့အစံရအၫ အစဎွၩဒုၭဆၧထၫ့ဒုၪဒၩလံဘနၫလီၫ. အဂဲးဘဲၫယီၩ",
			"9": "<sup>9</sup> နါဂၧၫ့ဝ့ၫလၧအစဲၪ့ထၪ့ခွံၬလၧလၫခံၭနီၪလီၫ.- တၭအ ဝ့ၫဒၪနါဂၧၫ့ဆၧစံၭ လၧကုၡၫအစဎွၩ တၧၫဟၫကၫ အဂဲးနီၪ,မွဲအဂဲၫထၪ့ဝ့ၫလၧအမိဒုၭဆၧလၧနၧၩလီၫ. တၭထီးအနါဂၧၫ့ဝ့ၫတၭ, မွဲအအၪ့မၧၫ့အၥီၫ့လဖၪလၧ",
			"10": "<sup>10</sup> စဟ့ၭဇကဲအၫအအီၪတၭ,စံၭဝ့ၫ,- နၥံၪမိဘၪစံၭယုဒၫ အစဎွၩဟ့ၭဇကဲအၫဘဲၫယီၩ, နယွၩလၧနဒိၭနဲၩ့နၥၭ လၧအစူၪဖၧၩ့စံၭနၧၩ, ဆၧမိဖ့ၪလၫ့ယရုစလံၫ့လၧအ စံရအၫအစဎွၩအစူၪဖၧၩ့အ့ၬး တၭမွဲအထီးအၪ့လီၫန့",
			"11": "<sup>11</sup> နၧၩလဂ့ၩ.- ယိခွါ,ဆၧလၧအစံရအၫအစဎွၩလဖၪ မၩဝ့ၫလၧခးၥံၪထီးအလူၬ, လၧအမၩဂၭဂီၩ့လူၬထူၬ",
			"12": "<sup>12</sup> ဆံၫ့ဘၩ့နနါဂၧၫ့ယူၭတၭ, နမိဖီၩ့ဖျ့ၭ နဝ့ၫဆ့ဧၪ.- ၦ ဆၨၩလဖၪလၧယဖါၥံၪမၩဂၭဂီၩ့, ဂိဇၫ့,ဒဲဟၫရၫ့, ဒဲရံ ဇၭဒဲၦအံဒံၫ့ဖိၪ လၧအအီၪလၧတလၭစၫ အဖၧၩ့နီၪ,",
			"13": "<sup>13</sup> အဝ့ၫၥံၪအယွၩလဖၪမၩဖီၩ့မၩဖျ့ၭဝ့ၫဆ့ဧၪ.- ဟၫမၭ အစဎွၩ,အၫဖၭအစဎွၩ, ဒဲဒိၩ့စ့ၭဖၫဝံၫ့, ဟံနၫဒဲအဲဝၫ အစဎွၩလဖၪမွဲအအီၪခီၫခီၫလဲၪ.",
			"14": "<sup>14</sup> စဟ့ၭဇကဲအၫနီၪ မၩန့လံၬလၧအၥီၫ့လဖၪ အစူၪ ဖၧၩ့တၭ,ဖီဘၪဝ့ၫတၭး လ့ၩထၪ့လၧယဟိဝၩအဂံၪ့ ဖၧၩ့တၭ, စဟ့ၭဇကဲအၫပၠၪလၩ့ဝ့ၫ လၧယဟိဝၩအ",
			"15": "<sup>15</sup> မ့ၬယၫနီၪလီၫ.- တၭစဟ့ၭဇကဲအၫဘၩဆိၪဖၪယဟိ ဝၩတၭ,စံၭဝ့ၫဒၪ, ဆၧၥုၭမုခမျၧးအယဟိဝၩ,အံၫစရ့ လၭအယွၩလၧအအီၪဝ့ၫ လၧခ့ၫၡုၭၥံၪအဘိၩ့ဆၧၩ့လ",
			"16": "<sup>16</sup> ဂၩဧ့,- နဝ့ၫဒၪနမွဲယွၩ လၧဂၪ့ခိၪအဘၩ့အမုးထီးအ",
			"17": "<sup>17</sup> လူၬအဖၫ့ခိၪလီၫ. နတဲၩ့လၩ့မူၭခိၪဂၪ့ခိၪလီၫ.- ယဟိ ဝၩဧ့,ဒိၭနနါတၭ, ခိၭနၪဆံၭး ယဟိဝၩဧ့,ဝဲထၪ့နမ့ၬ ၥၪတၭ,ဒၪဆၧတၭ, ခိၭနၪစနၭကရ့ၭအဆၧချဲၩ့ထီး အလူၬလၧအဖ့ၪယူဝ့ၫ ဘဲၫၥိၭအမိဒုၪဒွ့ၪယွၩ လၧအ",
			"18": "<sup>18</sup> မၧၫ့ဝ့ၫနီၪဆံၭ.- ယဟိဝၩဧ့,မွဲမၬ, အစံရအၫအစဎွၩ လဖၪမၩဂၭဂီၩ့ၦဆၨၩၥံၪ ထီးအလူၬနီၪ ဒဲအထံၫအ",
			"19": "<sup>19</sup> ခး,- တၭခွံၬၡိၭခွံၬအဝ့ၫၥံၪ အယွၩလဖၪလၧမ့ၪဖၧၩ့, (အဂဲးဘဲၫယီၩ မွဲယွၩလဖၪအ့ၬ. အ့ၪမွဲၥံၪ့ဒဲလိး, ၦၡၩ မၩကဲၪထၪ့လၧအစူၪလီၫ.) မၩအၥၭဘဲၫနီၪတၭ, မၩ",
			"20": "<sup>20</sup> ဂၭဂီၩ့ခွံၬဝ့ၫလီၫ.- အခိးမွဲဘဲၫနီၪတၭ, ဘိၩ့နဲၪ့ယီၩ, ယဟိဝၩပယွၩဧ့, ထိးထဲၩ့တၩ့ထဲၩ့ မၩဖီၩ့မၩဖျ့ၭပၧၩ လၧအစူၪဖၧၩ့ဆံၭ. ဘဲၫၥိၭဂၪ့ခိၪအဘၩ့အမုးထီးအ လူၬမိၥ့ၪယၫလၧနမွဲယဟိဝၩ, န့ၫနၧၩလဂၩလီၫ.",
			"21": "<sup>21</sup> ထီးနီၪလဖၧၫ့ စအၫမူၭအဖိၪခွၫစအဲၫစ့ယၫအၪ့မၧၫ့ လၩ့ဆၧလၧစဟ့ၭဇကဲအၫအအီၪတၭ, စံၭဝ့ၫဒၪ, ယ ဟိဝၩအံၫစရ့လၭအယွၩစံၭဝ့ၫဘဲၫယီၩ, ဆၧလၧနဘၩ ဆိၪဖၪယၧၩ လၧအစံရအၫအစဎွၩ စနၭကရ့ၭ အဂဲး",
			"22": "<sup>22</sup> နီၪး- အယီၩမွဲဆၧချဲၩ့လၧယဟိဝၩ ချဲၩ့ယူၭလၧအ ဂဲး,ဇံအိၫ့အဖိၪမုၪၦမုၪနၩ့လဂၩနီၪ, ဒုၪဒွ့ၪနံဘၪနၧၩ, ယရုစလံၫ့အဖိၪမုၪနီၪ ဖျၭအခိၪလၧနလးခဲၫ့ယူၭ.",
			"23": "<sup>23</sup> နဒုၪဒွ့ၪဆိၪအၧၩ့ ပလၫလဂၩလဲၪ. တၭနထုၭထၪ့န လူလၧပလၫ အဖၫ့ခိၪလဲၪး တၭနစၪ့ထၪ့နမ့ၬၥၪ ထၪ့ ထီၫလၧပလၫအဖၫ့ခိၪလဲၪ. နထၫ့ဒုၪဒၩအံၫစရ့လၭအ",
			"24": "<sup>24</sup> ဆၧဆံၫ့ဎံၪလဂၩနီၪလီၫ.- နဒုၪဒွ့ၪကဆါလၧနခ့ၫ နၡၩၥံၪအစူၪဖၧၩ့တၭ, နစံၭယထၪ့ဘၭခိၪလီၩ့အဆၧ ထီၫလဖၪလ့ၭဘနၧၫ့အအိၩဖၧၩ့, လၧယလဲၪ့ၥုၭခ မျၧးတၭ,ယမိခူၬလၩ့ခွံၬအၥံၪ့ၡိၫအ့ရ့ၭအထီၫ, ဒဲအ ၥံၪ့ၡိၫအဂ့ၩထုၬတၭ,ယမိထၪ့ဘၭအလးထီၫထုၬလၧ",
			"25": "<sup>25</sup> မံၩ့လၬကျၩကၫမလၭနီၪလီၫ.- ယခုၪ့လၩ့ဆၧဒဲအီၩ ထံၫတၭ, ယမိမၩလၩ့ၥံၭအံဇံၭအထံၫချိၬထီးအလူၬ လၧယခၪ့ယၫၥၭလီၫ.",
			"26": "<sup>26</sup> လၧထံၭလၧအၥၫ့ယမၩယဝ့ၫတၭ, လၧမုနံၩလဖၪ လၧဖျိၩ့လံၩလံၩ ယမၩဝ့ၫနီၪနနါဂၧၫ့အ့ၬဧၪ. ဘိၩ့နဲၪ့ ယီၩယဒုၭဂဲၫဝ့ၫတၭ, မိမၩအၥၭဘဲၫၥိၭ အမိမၩဂၭ ဂီၩ့ဒိၩ့အီၪလၧအခိၪဒၧၩ့လဖၪတၭ, အီၪက့ၪဝ့ၫဘဲၫ လိးပိၩ့အီၪယူၭဝ့ၫအၥိၭနီၪလီၫ.",
			"27": "<sup>27</sup> တၭၦအီၪဝ့ၫနီၪအဂဲးအဘၭလၩ့ဆါလီၫ. အဝ့ၫၥံၪ ၥၭမဲၪၥၭဖျဲၩ့ဆၧ ဒဲအီၪက့ၪမဲအမ့ၬ ဘဲၫထၩ့မုလၧမံၩ့ လၬကျၩ, ဒဲနၪ့ၥံၪမံၩ့ၥံၪၥံၫ့ဆ့ၬ, ဒဲနၪ့အီၪလၧဂံၪ့ခိၪ, ဒဲ ဆံၬၥံၪနၩၥံၪ လၧဘုၪအနၪ့လချႃၭထၪ့ဒံၭဘၪ ဎဲၫ့ဝ့ၫ",
			"28": "<sup>28</sup> အၥိၭနီၪလီၫ.- နဆၧၫ့နၩ့တၭ, နလ့ၩထၪ့ဒဲနဂဲၫထဲၩ့ နီၪယၥ့ၪယၫ, ဒဲနၥၭထၪ့ထၫ့ဒုၪဒၩယၧၩနီၪဆ့လီၫ.",
			"29": "<sup>29</sup> မွဲနၥၭထၪ့ ထၫ့ဒုၪဒၩဘၪယၧၩ, ဒဲနအီၪက့ၪနၥၭထၪ့ နီၪဂဲၫထၪ့လၧယနါဖၧၩ့အကၠီၩ့တၭ, ယမိအီၪက့ၪနိၪ ကွၭလၧနနၫဖၧၩ့, ဒဲယဖျံၩလၧနနိၭဖၧၩ့တၭ, ယမိဘိၭ ကၠၪကဒၩထဲၩ့နၧၩ လၧဖၧၩ့ၥၭလၧနဂဲၫထၪ့လဘီၩ့နီၪ လီၫ.",
			"30": "<sup>30</sup> အယီၩမိကဲၪထၪ့ဆၧမၩနဲၪ့လၧနဂး, အယီၩလနံၪ့ ယီၩနၥံၪမိအၪ့ဆၧလၧအမဲၪထၪ့ဒၪဆၧ,ဒဲနံၫနံၪ့လနံၪ့ နီၪဆၧလၧအမဲၪထၪ့ဒၪဆၧလၧအဝ့ၫနီၪတၭ, ထီးၥၧၫ့ နံၪ့လနံၪ့နီၪနၥံၪဘၪဎွံၪဆၧ, ဒဲကူၭဆၧ, ဒဲၥုၪ့စဘံၭမု",
			"31": "<sup>31</sup> အလးလဖၪတၭ, အၪ့အၥၪနီၪဆံၭ.- တၭဆၧဖီၩ့ဖျ့ၭ လၧယုဒၫအၡၩဂံၪ့ဖိၪအကျၩ လၧအအီၪလၩ့ထးနီၪ မိဆဲၩလၩ့အဝံလၧလၬလခီၫတၭ, ၥၪထၪ့ဆၧၥၪလၧ",
			"32": "<sup>32</sup> ထၭလခီၫလီၫ.- အဂဲးဘဲၫယီၩဆၧအီၪလၩ့ထးမိစဲၪ့ ထၪ့ခွံၬ လၧယရုစလံၫ့အဖၧၩ့တၭ,ဆၧဖီၩ့ဖျ့ၭနီၪမိဂဲၫ ထၪ့ခွံၬလၧခိၪလီၩ့ဇံအိၫ့လီၫ. ဆၧၥုၭမုခမျၧးအယ",
			"33": "<sup>33</sup> ဟိဝၩအၥၭဆီၪ့မိမၩဆၧနီၪလီၫ.- မၩအၥၭဘဲၫနီၪ တၭ,လၧအစံရအၫအစဎွၩအဂဲးယဟိဝၩစံၭဘဲၫယီၩ, မွဲအမိဂဲၫနုၬဘၪ လၧဒိၩ့လဖျိၪ့ယီၩ အဖၧၩ့အ့ၬ.ခၭ ဘၪဖျါလဘံၪ့ထီးနီၪအ့ၬး တၭလၧဒိၩ့အမ့ၬယၫနီၪ ဂဲၫထၪ့ဒုၭနဲၪဘၪထၩ့ဖံၭအ့ၬတၭ, လၧဒိၩ့အချိၫ့နီၪ မၩထၪ့ဘၪဆၧခိၪဒၧၩ့အ့ၬ.",
			"34": "<sup>34</sup> အဝ့ၫဒၪမိဘၪထဲၩ့ထဲၩ့လၧဖၧၩ့ၥၭလၧအဂဲၫထၪ့ဝ့ၫ လဘီၩ့နီၪတၭ, နုၬဘၪလၧဒိၩ့ဖၧၩ့ယီၩအ့ၬ, ယဟိဝၩ",
			"35": "<sup>35</sup> စံၭဝ့ၫဒၪး- ယဝ့ၫဒၪယီၩ ယမိအီၪခိၭမၩဘိၭမၩဆၧၩ့ ဒိၩ့ဘဲၫၥိၭယမိထိးထဲၩ့တၩ့ထဲၩ့ လၧယဂးဒၪယဝ့ၫ,ဒဲ လၧယခ့ၫယၡၩစဒၫဝံၭအဂးနီၪလီၫ.",
			"36": "<sup>36</sup> ထီးနီၪလဖၧၫ့ယဟိဝၩအၥီၫ့နီၪ စဲၪ့ထၪ့တၭ,ကျီၪ့ ခွံၬၦၡၩလကုၬဎိၭလၬ ယဲထီၫ့လၧအစံရအၫၥုၪ့တဲၩ အလးဖၧၩ့နီၪတၭ, မုဆဲၪ့ထၪ့နီၪအဝ့ၫၥံၪ ဂဲထုၪ့ဂီၩဂီၩ",
			"37": "<sup>37</sup> တၭ,ယိခွါ,ၦထီးအလူၬနီၪမွဲၦအစွၪလီၫ.- ထီးနီၪလ ဖၧၫ့အစံရအၫအစဎွၩစနၭကရ့ၭစဲၪ့ထၪ့ခွံၬ လၧဆၧအ လးနီၪတၭ, လ့ၩဝ့ၫတၭ,ထဲၩ့ထဲၩ့အီၪဝ့ၫလၧဒိၩ့နံနဝ့ၫ နီၪလီၫ.",
			"38": "<sup>38</sup> တၭအဝ့ၫဒၪ ဘိၪ့ဆၧဘၩဆၧလၧအကဆါနံၭစြီၭ အဂံၪ့ဖၧၩ့အဘိၩ့ဘၭနီၪ, ဆၧမၩအၥၭလၧအဖိၪခွၫစ အဒၫ့မလ့ၭ, ဒဲစၡၫရ့ဇၧၫနီၪ ကျီၪ့ၥံၫခွံၬဝ့ၫ လၧနၭတၭ, အဝ့ၫၥံၪစဲၪ့ဝ့ၫလၧခးအၫရၭရၭအဖၧၩ့တၭ, အဖိၪခွၫ စအံစၫဟၭဒၧၫ့ကဲၪထၪ့စဎွၩလၧအလးလီၫ."
		},
		"38": {
			"1": "<sup>1</sup> ဆၧလၧမုနံၩလဖၪနီၪ စဟ့ၭဇကဲအၫဆၫထၪ့ဝ့ၫ ထီးအမိၥံၫကၪယူၭလီၫ. တၭစအၫမူၭအဖိၪခွၫမီၪစအဲၫ စ့ယၫနီၪလ့ၩလၧအအီၪတၭ စံၭဝ့ၫ,ယဟိဝၩစံၭဘဲၫ ယီၩ,တဲၩ့ဝဲၩနၡၩဂံၪ့ဖိၪအဆၧဆံၭ. အဂဲးဘဲၫယီၩ န မိၥံၫတၭမၧၫ့လၧၩ့အ့ၬ.",
			"2": "<sup>2</sup> ထီးနီၪလဖၧၫ့စဟ့ၭဇကဲအၫကၠၪအမ့ၬလၧဆၧဒီၪ့",
			"3": "<sup>3</sup> တၭ,ဘၩဆိၪဖၪလၧယဟိဝၩ,- တၭစံၭဝ့ၫဒၪ, ယဟိ ဝၩဧ့,ယလ့ၩဆၧလၧနမ့ၬယၫ လၧဆၧမွဲဆၧတီၩ အ ဖၧၩ့အီၪလၧယၥၭထၧၫ့ဖျိၪ့ယၫတၭ, ယမၩယူၭဆၧ အဂ့ၩလၧနမ့ၬယၫနီၪနၪ့ထၪ့ထဲၩ့လါဆံၭ. တၭစဟ့ၭ ဇကဲအၫဂၪ့ဝ့ၫနၭနၭလ့ၬလီၫ.",
			"4": "<sup>4</sup> ထီးနီၪလဖၧၫ့ ယဟိဝၩအလူဘၪစအဲၫစ့ယၫတၭ",
			"5": "<sup>5</sup> စံၭဝ့ၫဒၪ,- လ့ၩဘီၪ,စံၭစဟ့ၭဇကဲအၫ, ယဟိဝၩနဖါ စဒၫဝံၭအယွၩစံၭဘဲၫယီၩ, ယနါဂၧၫ့ယူၭ နဘၩဆိၪ ဖၪဆၧယူၭ, ယဒၪဘၪယူၭနမ့ၬထံၫယူၭ. ယိခွါ, ယမိ",
			"6": "<sup>6</sup> ဒုၭအၪထၪ့နနံၩလဖၪ လဆံၫယဲနံၪ့လီၫ.- ယမိမၩဖီၩ့ မၩဖျ့ၭနၧၩ ဒဲဒိၩ့လဖျိၪ့ယီၩ လၧအစံရအၫအစဎွၩအ စူၪဖၧၩ့တၭ, ယမိအီၪခိၭမၩဘိၭမၩဆၧၩ့ ဒိၩ့လဖျိၪ့",
			"7": "<sup>7</sup> ယီၩလီၫ.- အယီၩမွဲဆၧအမၩနဲၪ့ဂဲၫလၧယဟိဝၩ, ယ",
			"8": "<sup>8</sup> ဟိဝၩမိမၩဆၧလမံၩ့ယီၩလၧအဆၧချဲၩ့ယူၭဝ့ၫ,- ယိ ခွါ,ဆၧလၩဒုၩအဆၫ့လဖၪ လၧအလ့ၩဖီၩ့ခွံၬယူၭလၧ စအၫဟဇၭအမုအနၩရံၩအလီၩ့နီၪ ယမိဒုၭထဲၩ့ထဲၩ့ အလးခဲၫ့ အဆၫ့ဆံၫဆၫ့လီၫ.အခိးမွဲမုထဲၩ့ထဲၩ့ဆံၫ ဆၫ့,လၧအဆၫ့လၧအလ့ၩဖီၩ့ခွံၬဝ့ၫနီၪလီၫ.",
			"9": "<sup>9</sup> လၧယုဒၫအစဎွၩ စဟ့ၭဇကဲအၫဆၫဝ့ၫတၭ,ဘျၪ ထဲၩ့ဝ့ၫနီၪအဆၧကွ့ၭ.",
			"10": "<sup>10</sup> ယစံၭ, လၧယမုနံၩလဖၪနီၪ ယမိလ့ၩလၩ့လၧဖျႃ ဖၧၩ့အတရၫ့နီၪ, ဆၧထုၭထၪ့ခွံၬယနံၪ့ လၧအအီၪလၩ့ထးလဖၪနီၪလီၫ.",
			"11": "<sup>11</sup> ယစံၭ,ယမိဒၪဘၪယဟိဝၩ, ယဟိဝၩဒၪလ့ၬလၧ ခးလၧၦၡၩမၧၫ့ဝ့ၫအဖၧၩ့နီၪအ့ၬး ယလဒၪလၧၩ့ဘၪ ၦၡၩဒဲဂၪ့ခိၪဖိၪလဖၪနီၪလီၫ.",
			"12": "<sup>12</sup> ဆၧထ့ၭထၪ့ခွံၬယအီၪအလးတၭ, ၥုၭအၥၭဘဲၫၦ ယူၬၥိၪအတဲၩအၥိၭနီၪလီၫ. ဘဲၫၦထၭထၪထူၪထၪ့ဝ့ၫ အၥိၭနီၪ ယဘၪဆၧထ့ၭခွံၬယူၭ ယၥၭမၧၫ့ယူၭ. အ ဝ့ၫဒၪမိကူၭထ့ၬ ယထၪအထိၭနၫလီၫ. လၧမုဂီၩထီၩ့",
			"13": "<sup>13</sup> လၧမုနၩလခီၫ နမိမၩလူၬခွံၬယၧၩလီၫ.- ယအီၪက့ၪ ဆၧထီးမုဆဲၪ့ထၪ့, ဘဲၫဆၬလၥၧၫ့အၥိၭ, မိမၩခါယ ဎွံၪယနၧၩ့ လၧမုဂီၩထီၩ့လၧမုနၩလခီၫနမိမၩလူၬခွံၬ ယၧၩလီၫ.",
			"14": "<sup>14</sup> ဘဲၫထိၪဘျံၪ့ဘျၪ့, ထိၪဘျံၪ့ဘျၪ့လၧအပံၭပံၭအၥိၭ ယပံၭပံၭလီၫ. ယၥုၪ့အုၭၥၭအုၭဘဲၫဎၧၩ့ဘျူၭအၥိၭ နီၪ,ယမ့ၬယိထၪ့လၧထၭနီၪနၧၩ့ဝါအ့ၬ. ယဟိဝၩဧ့, ယဘၪဆၧဎၧၫ့နၭတၭ, မၩဘိၭမၩဆၧၩ့ယၧၩဆံၭ.",
			"15": "<sup>15</sup> မွဲယမိစံၭဘဲၫၥ့ၪလဲၪ. အဝ့ၫချဲၩ့ဆၧလၧယၧၩတၭ, မၩဝ့ၫအနၫ့ဆါဒၪဝ့ၫနီၪလီၫ. ယမိလ့ၩၡီၫၡီလဆိၩဒၪ ယၧၩလၧယၥၭအဆၧခိဆၧဝီၩအကၠီၩ့လီၫ.",
			"16": "<sup>16</sup> ယဟိဝၩဧ့, ၦမၧၫ့ဝ့ၫလၧဆၧနီၪလဖၪအကၠီၩ့တၭး လၧဆၧထီးအလူၬလဖၪယီၩယၥၭအဆၧမၧၫ့အီၪဝ့ၫ လၧအဖၧၩ့တၭ,နမိမၩဘျၪထဲၩ့ယၧၩဒဲမၩမၧၫ့ထၪ့ဒံၭ",
			"17": "<sup>17</sup> ယၧၩလီၫ.- ယိခွါ, ယဆၧခိဆၧဝီၩနီၪကဲၪထၪ့ဆၧမုၬ ဆၧလၩတၭ, နအဲၪယၧၩတၭ, နမၩဖီၩ့မၩဖျ့ၭယၥၭ လၧဆၧဂၭဂီၩ့အဖၧၩ့, နခွံၬၡိၭခွံၬယဆၧဒဲၩဘၭထီး",
			"18": "<sup>18</sup> အလူၬလၧနချိၫ့လခီၫနီၪလီၫ.- အဂဲးဘဲၫယီၩဖျႃဖၧၩ့ ၥံၫကျံၩထၪ့နၧၩၥ့ၪအ့ၬး ဆၧၥံၫ စံၭထၪ့အၪ့အူၭနၧၩ အ့ၬးၦလၧအလ့ၩလၩ့လၧဆၧဖၧၩ့နီၪ ယိလါနဆၧမွဲ",
			"19": "<sup>19</sup> ဆၧတီၩအဖၧၩ့ၥၭအ့ၬ.- ၦအမၧၫ့, ၦအမၧၫ့အဝ့ၫဒၪ မိအၪ့အူၭထၪ့နၧၩ ဘဲၫယမၩလၧမုဆၫလနံၩယီၩအ ၥိၭနီၪလီၫ. ဖါၥံၪမိဒုၭၥ့ၪယၫဖိၪခွၫလဖၪ လၧနဆၧမွဲ ဆၧတီၩလီၫ.",
			"20": "<sup>20</sup> ယဟိဝၩတဲၩ့ဝဲၩဆၧ လၧအမိထိးထဲၩ့တၩ့ထဲၩ့ ယၧၩး အခိးမွဲပမိဒံၩ့ဆၧဒဲၥံၫကျံၩဆၧလဆိၩဒၪပၧၩ လၧယဟိဝၩအဂံၪ့ဖၧၩ့လီၫ.",
			"21": "<sup>21</sup> တၭစအဲၫစ့ယၫစံၭဝ့ၫဒၪ, မွဲအဝ့ၫၥံၪမၩန့ချိၪ့ဒိၩ့ၥၪ အဎဲၫ့လဖၪလလီၪ့တၭ, တဲၩ့ဝဲၩကျၭလၩ့လၧဝံၫ့အဖၫ့ ခိၪနီၪဆံၭ တၭအဝ့ၫမိမၧၫ့ထၪ့ထဲၩ့ဝ့ၫဒၪလီၫ.",
			"22": "<sup>22</sup> စဟ့ၭဇကဲအၫစံၭဝ့ၫဆ့, ဆၧမၩနဲၪ့လၧယမိလ့ၩ ထၪ့လၧယဟိဝၩအဂံၪ့နီၪ, မွဲဆၧနီၪလမံၩ့လဲၪ."
		},
		"39": {
			"1": "<sup>1</sup> ဆၧလၧအထီနီၪဘၭဘလၧၫ့ အစဎွၩဘၫလဒၫ့အ ဖိၪခွၫစမရီဒၭဘၫလဒၫ့လဂၩနီၪ နါဂၧၫ့လၧစဟ့ၭဇကဲ အၫဆၫဝ့ၫဒဲအဆၧဆၫဘျၪထဲၩ့ဝ့ၫတၭ, ဖ့ၪယူလံၬ တၭ,အၪ့မၧၫ့အၥီၫ့ဆိၬ ဒဲလၬဆီၪ့လၧစဟ့ၭဇကဲအၫ အအီၪလီၫ.",
			"2": "<sup>2</sup> ထီးအဝ့ၫၥံၪထီၩ့ဝ့ၫတၭ, စဟ့ၭဇကဲအၫနီၪၥၭထိၬဝ့ၫ လၧအကၠီၩ့ ဒုၭနဲၪဝ့ၫ လၧအဆၧလူဒိၪဎွ့ၩဒိၪအဂံၪ့ ကျိၪၥံၪစ့ၩၥံၪဒဲထီၫ့ၥံၪလွ့ၫၥံၪ, ဒဲဆၧနၧၫ့မၧၫ့ဒဲၥိၪလၧ အလူဒိၪဎွ့ၩဒိၪ, ဒဲအစူၪဝဲၩအဂံၪ့ထၧၫ့ဖျိၪ့ယၫ,ဒဲကယဲ အဆၧလၧအအီၪ လၧအလူဒိၪဎွ့ၩဒိၪအကျၩနီၪလီၫ. ဆၧလၧစဟ့ၭဇကဲအၫလဒုၭနဲၪဘၪဝ့ၫနီၪ အီၪလၧအ ဂံၪ့ဖၧၩ့, ဒဲအီၪလၧအဘၩ့အမုးထၧၫ့ဘံၪ့ယၫအဖၧၩ့ နးမံၩ့အ့ၬ.",
			"3": "<sup>3</sup> ထီးနီၪလဖၧၫ့မီၪစအဲၫစ့ယၫလဂၩနီၪ လ့ၩလၧစဎွၩ ဟ့ၭဇကဲအၫအအီၪတၭစံၭအဝ့ၫဒၪ, ၦလဖၪနီၪစံၭဝ့ၫ ဘဲၫၥ့ၪလဲၪ. မွဲအဂဲၫလၧနအီၪတၭ, ဂဲၫလၧခးခီၫခီၫ လဲၪ.တၭစဟ့ၭဇကဲအၫစံၭဝ့ၫဒၪ, ဂဲၫထီၩ့လၧယအီၪ လၧထံၫယဲၩ့ခးယဲၩ့လဘံၪ့ လၧဘၭဘလၧၫ့နီၪလီၫ.",
			"4": "<sup>4</sup> ထီးနီၪလဖၧၫ့အဝ့ၫဒၪစံၭ, မွဲအဒၪဘၪဆၧနီၪလၫ လၧနဂံၪ့ဖၧၩ့လဲၪ. တၭစဟ့ၭဇကဲအၫစံၭဝ့ၫဒၪ, အဝ့ၫ ၥံၪဒၪဘၪယူၭ ကယဲဆၧလၧအအီၪလၧယဂံၪ့ဖၧၩ့ထီး အလူၬယူၭ, ဆၧလၧယလဒုၭနဲၪဘၪဝ့ၫနီၪအီၪဘၪလၧ ယဆၧလူဒိၪဎွ့ၩဒိၪအကျၩနးမံၩ့အ့ၬ.",
			"5": "<sup>5</sup> ထီးနီၪလဖၧၫ့ စအဲၫစ့ယၫစံၭစဟ့ၭဇကဲအၫ,ခိၭနၪ",
			"6": "<sup>6</sup> ဆၧၥုၭမုခမျၧးအယဟိဝၩအလူဆံၭ.- ယိခွါ,မုနံၩလ ဖၪမိဂဲၫလၧကယဲဆၧအီၪလၧနဂံၪ့ဖၧၩ့, ဒဲဆၧလၧနဖါ လဖၪအီၪက့ၪကီၪ့ဝ့ၫထီးမုဆၫလနံၩယီၩ, ဆၧမိဆိၬ ထၪ့ခွံၬဝ့ၫ ထီၩ့လၧဘၭဘလၧၫ့လီၫ. ဆၧမိအီၪလၩ့",
			"7": "<sup>7</sup> ထးနးမံၩ့အ့ၬ. ယဟိဝၩစံၭဝ့ၫဒၪ.- အဝ့ၫၥံၪမိဆိၬထၪ့ ခွံၬနဖိၪခွၫၥံၪ လၧအမိလၩ့ဆၨၩလၧနၧၩလၧနထၪ့ဖိၪ တၭ,အဝ့ၫၥံၪမိကဲၪထၪ့ၦဖၫဆွံၪ လၧဘၭဘလၧၫ့အ စဎွၩအနီးဖၧၩ့လီၫ.",
			"8": "<sup>8</sup> တၭစဟ့ၭဇကဲအၫစံၭစအဲၫစ့ယၫ, ယဟိဝၩအ ဆၧချဲၩ့လၧနချဲၩ့ဆၧနီၪဂ့ၩဝ့ၫလီၫ. တၭစံၭဝ့ၫဒၪ, အဂဲး ဘဲၫယီၩ ဆၧဘၪလိၬအိၭလိၬဒဲဆၧမွဲဆၧတီၩမိအီၪဝ့ၫ လၧယမုနံၩလဖၪအဖၧၩ့လီၫ."
		},
		"40": {
			"1": "<sup>1</sup> နၥံၪဝ့ၫဧ့, မၩမုၬထၪ့ထဲၩ့း မၩမုၬထၪ့ထဲၩ့နၥံၪဝ့ၫ",
			"2": "<sup>2</sup> ယၡၩခမျၧးဆံၭး နၥံၪအယွၩစံၭဝ့ၫဒၪ.- ချဲၩ့ဆၧမုၬ ဆၧလၩလၧယရုစလံၫ့ဆံၭ. တၭလီၩဘၪဝ့ၫလၧအ ဆၧဒုၭၥုၭဂီၩ့ယူၭ, လၧအဆၧဒဲၩဘၭဖျါယူၭ, လၧအ ဘၪယူၭဆၧနံၫစၩလၧအဆၧဒဲၩဘၭအကၠီၩ့ လၧယဟိ ဝၩအစူၪဖၧၩ့ယူၭ.",
			"3": "<sup>3</sup> ဆၧအလူၥီၫထၪ့လၧမံၩ့လၬကျၩနီၪ, တဲၩ့ဝဲၩယ ဟိဝၩအဖၧၩ့ၥၭလၧပွ့ၪခိၪပွ့ၪနါ, မၩလီၩ့ဒဲမၩပျၩ့ဖၧၩ့",
			"4": "<sup>4</sup> ၥၭမုလဘီၩ့လၧပယွၩအဂးနီၪဆံၭ.- ကယဲခိၪလီၩ့ဆူၭ လဖၪနီၪမိဘၪဆၧဘွ့ၫဎွ့ၩထၪ့ဝ့ၫတၭ, ကယဲခိၪလီၩ့ဒဲ ဆၧစီၩ့ခိၪမိဘၪဆၧမၩလၩ့ဒၩဝ့ၫတၭ, ဖၧၩ့ၥၭကဲၪ့လ ဖၪမိဘၪဆၧမၩလီၩ့ထၪ့ထဲၩ့တၭ, အလးထၪ့စီၩ့လၩ့",
			"5": "<sup>5</sup> အိၪ့လဖၪမိဘၪဎၩ့လိၬအၥၭး- ယဟိဝၩအလၩအဖၩ့ မိအီၪဖျီၪထၪ့တၭ, ကယဲဆၧယၪထီးအလူၬနီၪမိဒၪ ဘၪဝ့ၫလစီၪ့ဎးလီၫ. အဂဲးဘဲၫယီၩ ယဟိဝၩအနိၭ ချဲၩ့ဆၧလီၫ.",
			"6": "<sup>6</sup> ဆၧအလူနီၪစံၭ, ကိၭၡၭထၪ့ဆံၭ. တၭအဝ့ၫဒၪစံၭ, ယမိဘၪကိၭၡၭထၪ့ဆၧနီၪလမံၩ့လဲၪ. ကယဲဆၧဖံၭ ဆၧယၪနီၪ မွဲနၪ့ၥံၪမံၩ့ၥံၪထီးအလူၬတၭး ကယဲၦၡၩ လဖၪအလၩအဖၩ့နီၪမွဲဘဲၫမံၩ့လၬကျၩအဖူၩၥံၪဖီၫၥံၪ",
			"7": "<sup>7</sup> အၥိၭနီၪထီးအလူၬလီၫ.- နၪ့ၥံၪမံၩ့ၥံၪနီၪဎဲၫ့ထၪ့ခွံၬ, ဖူၩၥံၪဖီၫၥံၪနီၪ လၩ့ယံၭလၩ့ဘဲၩဝ့ၫလီၫ. အဂဲးဘဲၫ ယီၩယဟိဝၩအၥၪအူၪထၪ့ဘၪဝ့ၫလီၫ. မွဲမၬ, ၦခမျၧး",
			"8": "<sup>8</sup> မွဲနၪ့ၥံၪမံၩ့ၥံၪလီၫ.- နၪ့ၥံၪမံၩ့ၥံၪနီၪဎဲၫ့ထၪ့ခွံၬ, ဖူၩၥံၪ ဖီၫၥံၪနီၪလၩ့ယံၭလၩ့ဘဲၩဝ့ၫလီၫ. အ့ၪမွဲပယွၩအလူ အထၫနီၪမိအီၪဝ့ၫလၩ့ဆိၩလၩ့ကၠၪလီၫ.",
			"9": "<sup>9</sup> ၦလၧအဂဲၫဆိၬဆၧၥၭထိၬအပရၧၫ့လၧဇံအိၫ့နီၪလ ဂၩဧ့, နဝ့ၫဒၪယီၩ လ့ၩထၪ့လၧခိၪလီၩ့ထီၫအဒၩ့ခိၪ, ထုၭထၪ့နလူလၧဆၧအဂဲးအဘၭး ၦလၧအဂဲၫဆိၬဆၧ ၥၭထိၬအပရၧၫ့လၧယရုစလံၫ့နီၪလဂၩဧ့, ထုၭထၪ့ ဆံၭ,ၥၭမဲၪဆၧလဂ့ၩ, စံၭယုဒၫအဒိၩ့ၥံၪ, ယိခွါ, နၥံၪ",
			"10": "<sup>10</sup> အယွၩနီၪဆံၭၬ- ယိခွါ,ကဆါယဟိဝၩမိဂဲၫလၧအစီၩ့ အမၩ့တၭ, အစူၪဒူၪမိပၧၩ့ဆၧလၧအဂးဒၪဝ့ၫလီၫ.ယိ ခွါ,အဆၧဖ့ၪလၫ့အီၪလၧအစူၪဖၧၩ့တၭ, အလံၩ့အ",
			"11": "<sup>11</sup> လဲၫနီၪအီၪဝ့ၫလၧအမ့ၬယၫလီၫ.- အဝ့ၫဒၪမိယိထဲၩ့ ခွါထဲၩ့အၥိၪလဒီၪ့ ဘဲၫၦယူၬၥိၪလဂၩအၥိၭနီၪတၭ, မိအၪ့ထုၫ့ကီၪ့ၥိၪဖိၪလဖၪလၧအစူၪတၭ, မိဆိၬဝ့ၫလၧ အၥၭနၫၡါအဖၧၩ့တၭ, ၥိၪမိၡါၥံၪလၧအဒုၭအၪ့နူနီၪ, မိမီၩ့ဝ့ၫဆါဆါလီၫ.",
			"12": "<sup>12</sup> ၦလၧအတိၪ့ထံၫလၧအစူၪယၫၥၭအဖၧၩ့တၭ, ထိၪ မူၭခိၪလၧအစူၪထၫလထၫတၭ, အီၪက့ၪကီၪ့ဂၪ့ခိၪမုၬ လၧဆၧတိၪ့အဖၧၩ့တၭ, ခံၫ့ခိၪလီၩ့ထိၩ့ချိၬလၧခံၫ့ဖၧၩ့, ဒဲဆၧစီၩ့ခိၪလဖၪနီၪ လၧခံၫ့ဖိၪခွ့ၭဖိၪဖၧၩ့နီၪ, မွဲပလၫ",
			"13": "<sup>13</sup> လဂၩလဲၪ.- မွဲပလၫအၪ့စိၭအၪ့စၪ့ယဟိဝၩအၥၭလ ဂၩလဲၪ. မွဲပလၫကဲၪၦကိၪ့လိၬအၥၭလၧအဝ့ၫဒၪအၥိၭ နီၪမိၥီၪ့လိၪဝ့ၫလဂၩလဲၪ.",
			"14": "<sup>14</sup> မွဲအကိၪ့လိၬအၥၭဒဲၥီၪ့လိၪဝ့ၫ, ဒဲနဲၪလိၪဝ့ၫလၧဆၧ စ့ၩရၫ့အဖၧၩ့ၥၭ, ဒဲဒုၭၥ့ၪယၫဝ့ၫလၧဆၧၥ့ၪယၫနီၪ, မွဲ ပလၫလဂၩလဲၪ. တၭမွဲပလၫနဲၪလိၪၥီၪ့လိၪဝ့ၫလၧဆၧ",
			"15": "<sup>15</sup> ၥုၪ့ဆၭၥၭဆၭအဖၧၩ့ၥၭနီၪလဂၩလဲၪ.- ယိခွါ,ၦဆၨၩ လဖၪ,မၩအၥၭဘဲၫထံၫလၩ့ဆၩ့လဖျိၪ့ လၧထံၫဆဲၩ တၭ,ဆၧအီၪက့ၪဝ့ၫဘဲၫဆၧဘံၪၥိၭ လၧခံၫ့အဖၧၩ့အ ၥိၭနီၪလီၫ. ယိခွါ,ကျိၩ့လဖၪနီၪမၩအၥၭဘဲၫဂၪ့ခိၪအ",
			"16": "<sup>16</sup> မုၬလဖျိၪ့အၥိၭ လၧဆၧအၪ့ထုၫ့ဝ့ၫဒၪနီၪလီၫ.- လ့ၭ ဘနၧၫ့အမံၩ့လၬကျၩလၧၫ့လၧဆၧဆူၭခဲၩမ့ၪအဂးနီၪ အ့ၬးဆၧဖိၪဆၧဎါအီၪ လၧမံၩ့လၬကျၩလဖၪနီၪလၧၫ့",
			"17": "<sup>17</sup> လၧဆၧလုမ့ၪအဂးအ့ၬ.- ကယဲၦဆၨၩထီးအလူၬနီၪ မၩအၥၭလၧအမ့ၬယၫ ဘဲၫဆၧနးမံၩ့အ့ၬအၥိၭနီၪလီၫ. အဝ့ၫဒၪအီၪက့ၪအဝ့ၫၥံၪ ဘဲၫဆၧဆံၭနဲၪ့ဒံၭဆၧလမွဲ",
			"18": "<sup>18</sup> ဘၪဆၧနးမံၩ့အၥိၭ, ဒဲပျီၩပျီၩလီၫ.- တၭနၥံၪမိဒီၩ့လၩ့ ယွၩလၧပလၫလဂၩလဲၪ. တၭနၥံၪမိဒီၩ့လၩ့ဝ့ၫလၧဆၧ နီၪအဒီၩ့အထ့ၬလမံၩ့လဲၪ.",
			"19": "<sup>19</sup> ဆၧဂၩ့ဆၧဖၪ့ၥံၪၦမၩဆၧၥ့ၪနီၪၥိၫ့ဝ့ၫတၭ, ထမၬ ထီၫ့နီၪမိဖၩ့ဝ့ၫလၧထီၫ့, ဒဲမိၥိၫ့နၥွ့ၫစ့ၩလၧအဂးလီၫ.",
			"20": "<sup>20</sup> ၦလၧအၡၪ့အယၬဝ့ၫ ထီးအမၩဘိၪ့ဆၧအဎွ့ၩဒိၪလ ၥ့ၪဘၪနီၪ, အၪ့ဎၬရွံန့ၥံၪ့လၧအလအိၪဘၪးအၪ့ဎၬဝ့ၫ ၦမၩဆၧၥ့ၪလၧအကိၪ့ၥ့ၪလဂၩလၧအဂး, ဘဲၫၥိၭအမိ တဲၩ့ဝဲၩဆၧဂၩ့လဒုၩလၧအလဂဲၩလဝၭဘၪနီၪလီၫ.",
			"21": "<sup>21</sup> နၥံၪလၥ့ၪယၫဘၪဧၪး နၥံၪလနါဂၧၫ့ဘၪဧၪးလၧဂၪ့ ခိၪအခၪ့ထံၭလဖၪအီၪထၪ့လံၩလံၩနီၪ, နၥံၪနၪလၥ့ၪ",
			"22": "<sup>22</sup> ဘၪဧၪ.- အဝ့ၫဒၪမွဲၦလၧအဆၧၫ့နၩ့လၧဂၪ့ခိၪအမူၭ ထံၭအဝၩ့အဖၫ့ခိၪတၭ, ၦအီၪဝ့ၫလဖၪနီၪမၩအၥၭဘဲၫ ထွ့ၥံၪအၥိၭနီၪ, ၦလၧအပၠၪလၩ့မူၭခိၪ ဘဲၫကလကၫ အၥိၭတၭ, ဆုးဝ့ၫဘဲၫတဲၩ လၧၦမိအီၪ လၧအဖၧၩ့",
			"23": "<sup>23</sup> အၥိၭနီၪ,- မွဲၦလၧအအီၪက့ၪ ၦဒိၪဖၭဒိၪလဖၪလၧ ဆၧနးမံၩ့အ့ၬး အီၪက့ၪၦဂၪ့ခိၪအၡၩစ့ၩရၫ့ခွးနီၪလၧ",
			"24": "<sup>24</sup> ဆၧပျီၩပျီၩလီၫ.- မွဲမၬ, အဝ့ၫၥံၪၥုၪ့လၩ့အၥၭဖီဂီၩ့း မွဲမၬးဎွံၪလၩ့အၥၭဖီဂီၩ့း မွဲမၬ, အဝ့ၫၥံၪအထုၪ့အဝံ ဆဲၩလၩ့ဘၪအၥၭဖီဂီၩ့း လၧဂၪ့ခိၪလၬတၭ, န့ၫယွၩ အူၪဘၪဝ့ၫနီၪ, အဆၧလၩ့ယံၭဎဲၫ့ထၬဝ့ၫတၭ, လံၩၥဝံၭ မိဆိၬခွံၬဝ့ၫဘဲၫဖ့ၫအၥိၭနီၪလီၫ.",
			"25": "<sup>25</sup> နၥံၪမိဒီၩ့လၩ့ယၧၩ လၧပလၫလဂၩလဲၪး တၭယမိ လၩ့ဂၬလၧပလၫလဂၩလဲၪး ၦဆံၫ့ဎံၪလဂၩစံၭဝ့ၫဒၪ.",
			"26": "<sup>26</sup> စၪ့ထၪ့နၥံၪအမ့ၬၥၪ လၧဆၧထၪ့ထီၫတၭ,မွဲပလၫ တဲၩ့ဆၧလဖၪယီၩ, ယိခွါဘီၪး ၦလၧအၥိၫ့ထၪ့အၥုၭ မုခမျၧး,ဘဲၫအဆၧဝံထၪ့နၬထၪ့အၥိၭနီၪ, မွဲပလၫလ ဂၩလဲၪ. မွဲအကိၭဝ့ၫအမံၩ့ထီးအလူၬလီၫ.မွဲလၧအဂဲး ဆီၪ့အဘၭဆီၪ့, ဒဲအစီၩ့အမၩ့ထီၫတၭ, လၩ့မါဝ့ၫနး မံၩ့အ့ၬ.",
			"27": "<sup>27</sup> နဝ့ၫဒၪယီၩ နမိစံၭဘဲၫၥ့ၪလဲၪ,ယၫကူၭဧ့း ဒဲနချဲၩ့ ဆၧနီၪလဲၪ, အံၫစရ့လၭဧ့း ယဖၧၩ့ၥၭအီၪဘံၭခွံၬလၧ ယဟိဝၩတၭ, ယယွၩလ့ၩဖီၩ့ခွံၬယခွးနီၪ, မွဲအဘၪနီၪ",
			"28": "<sup>28</sup> လဲၪ.- နၥ့ၪယၫဒံၭအ့ၬဧၪးနနါဂၧၫ့ဘၪဒံၭအ့ၬဧၪ. ယဟိ ဝၩမွဲယွၩအဆိၩအကၠၪး ဆၧတဲၩ့လၩ့ဂၪ့ခိၪအထုၬ လဖၪနီၪလလၩ့ဘဲၩဘၪတၭ, ဆၧပွံၭအၥၭဆ့အ့ၬ. အ ၥုၪ့ဖၭအၥၭဖၭနီၪၦအၪ့ဎၬၥ့ၪယၫဘၪဝ့ၫအ့ၬ.",
			"29": "<sup>29</sup> ၦလၧအလၩ့ပွံၭနီၪယွၩဖ့ၪလၫ့ဝ့ၫလၧအဂဲးအဘၭ တၭး ၦလၧအဂဲးအဘၭလအီၪဘၪနီၪအဝ့ၫဒုၭဆီၪ့ထၪ့",
			"30": "<sup>30</sup> အဂဲးအဘၭလီၫ.- ၦဖိၪၥၪခွၫနီၪဒၪလ့ၬ အၥၭမိလၩ့ ဘဲၩဒဲဆၧမိပွံၭအၥၭ, ၦၥၭဘၪ့လၧဆၧရွံန့ဝ့ၫလဖၪအ",
			"31": "<sup>31</sup> ဂဲးအဘၭမိလၩ့ဆါဝ့ၫလီၫ.- အ့ၪမွဲၦလၧအဒိၭနဲၩ့အ ၥၭလၧယဟိဝၩနီၪအဂဲးအဘၭမိဆီၪ့ထၪ့လီၫ. မိ ယၩ့ထၪ့အဒံၭ ဘဲၫလံၬကျီၫ့ကျီၫ့ၥံၪအၥိၭ, စဲၪ့ဝ့ၫလါ နၫ့တၭ,လၩ့ဘဲၩဝ့ၫအ့ၬ. လ့ၩဆၧလါနၫ့တၭ,လၩ့ပွံၭ လၩ့ထၩ့ဘၪအ့ၬ."
		},
		"41": {
			"1": "<sup>1</sup> ထံၫယဲၩ့ခးယဲၩ့ၥံၪဧ့, အီၪလၩ့မါပံၭလၧယမ့ၬယၫ ဆံၭ.တၭၦဆၨၩလဖၪနီၪမွဲအဂဲးအဘၭဆီၪ့ထၪ့ဆံၭး မွဲအၥုၭဘူၭအၥၭဆံၭး မွဲအချဲၩ့ဆၧဆံၭး မွဲပၥုၭဘူၭ ၡီၩ့ပၥၭလၧဆၧစ့ၩရၫ့ခွးနီၪဆံၭ.",
			"2": "<sup>2</sup> မွဲပလၫထိၪဂဲၩဆၧတီၩ လၧမုထၪ့လခီၫလဂၩလဲၪ. ဆၧတီၩကိၭဝ့ၫလၧအခၪ့ထံၭး မိဖ့ၪလၫ့ခွံၬၦဆၨၩလ ဖၪလၧအမ့ၬယၫတၭ, ဒုၭယဲးလၩ့ဝ့ၫစဎွၩလဖၪတၭ, မွဲအဖ့ၪလၫ့ခွံၬအဝ့ၫၥံၪလၧနၭဒဲဖၩ့ ဘဲၫဂၪ့ခိၪမုၬအ ၥိၭ,ဒဲလၧချံၪၥံၪဖျါၥံၪဘဲၫလီထိၭနၫလၩ့ဘျ့ၭလၧလံၩ",
			"3": "<sup>3</sup> အူၪဘၪအၥိၭနီၪလီၫ.- လၧဖၧၩ့ၥၭအခၪ့လဖိၬဘၪနး ဆိၭအဖၧၩ့နီၪး လီၩ့ဆီးဝ့ၫတၭ, လ့ၩဆၧမုၬမုၬလီၫ.",
			"4": "<sup>4</sup> မွဲပလၫကိၭန့ၦၡၩအဆိၩလဖၪ လၧအခၪ့ထံၭမၩဆၧ နီၪလဂၩလဲၪ. ယဝ့ၫဒၪ,ယဟိဝၩ, ဆၧအခၪ့ထံၭဒဲအ ထုၬနီၪမွဲယၧၩလီၫ.",
			"5": "<sup>5</sup> ထံၫယဲၩ့ခးယဲၩ့ဒၪဘၪဝ့ၫတၭ, ၥၭမဲၪဆၧ, ဂၪ့ခိၪ အထုၬလဖၪဝၭထိၬဝၭတ့ၭတၭ, ၥုၭဘူၭအၥၭ, ဂဲၫဝ့ၫ",
			"6": "<sup>6</sup> တၭ,အီၪကိၩ့အီၪကီၪ့ဝ့ၫလီၫ.- အဝ့ၫၥံၪမၩဘိၭမၩ ဆၧၩ့လိၬအၥၭလဂၩဒဲလဂၩဆုၬဆုၬတၭ,စံၭအထၧၫ့ ဖုဝဲ,အီၪက့ၪဒူၩနၥၭဆံၭ.",
			"7": "<sup>7</sup> တၭလဲၬၥမါနီၪဒုၭဆီၪ့ထၪ့ထမၬထီၫ့,ၦမၩဖျ့ၪဆၧ လၧစၭခုၪနီၪၦလၧအထးဆၧ လၧထၭလၬ အဖၫ့ခိၪ တၭ,စံၭဝ့ၫ, ဆၧဘုၭထၬမွဲအဂ့ၩလီၫ. ဘဲၫၥိၭဆၧဂၩ့ နီၪထီးဝၭထီးဂဲၩလဂ့ၩတၭ, ဒိၪထၬဝ့ၫလၧထၭစဲၩလ",
			"8": "<sup>8</sup> ဖၪလီၫ.- တၭနဝ့ၫဒၪ,ယခ့ၫယၡၩအံၫစရ့လၭဧ့, စယၫ ကူၭလၧယရွံန့ဝ့ၫ, ယထံၩယၥိၭစအၫဘြဟၫ့အချံၫ",
			"9": "<sup>9</sup> အၥၪ,- နဝ့ၫဒၪလၧယမၩန့နၧၩလၧဂၪ့ခိၪအထုၬတၭ, ကိၭန့နၧၩလၧဂၪ့ခိၪအၡၩၥံၪအခိၪလဖၪတၭ, စံၭနၧၩ, နဝ့ၫဒၪနမွဲယခ့ၫယၡၩလီၫ. ယရွံန့ယူၭနၧၩယူၭတၭ, ယခွံၬၡိၭနၧၩဆ့အ့ၬ.",
			"10": "<sup>10</sup> ထီးၥၭမဲၪဆၧလဂ့ၩ, အဂဲးဘဲၫယီၩယအီၪလၧနၥိၭး ထီးအၪ့ယိၪဆၧလဂ့ၩ, အဂဲးဘဲၫယီၩယမွဲနယွၩလီၫ. ယမိဒုၭဆီၪ့ထၪ့နဂဲးနဘၭး မွဲမၬ, ယမိမၩဆၧၩ့နၧၩ",
			"11": "<sup>11</sup> လၧယဆၧတီၩဆၧလီၩ့အစူၪထွ့ၪလီၫ.- ယိခွါ, ကယဲ ၦလၧအၥၭထၪ့ဘၪနၧၩနီၪအမ့ၬမိမဲတၭ, မိအီၪက့ၪမဲ အမ့ၬလီၫ. ၦလၧအဂဲးလိၬတ့ၭလိၬ ဆၧလၧနၧၩလဖၪ နီၪမိကဲၪထၪ့ဆၧနးမံၩ့အ့ၬတၭ, မိထီၩ့ဝ့ၫလၧဆၧဂၭ",
			"12": "<sup>12</sup> ဂီၩ့ဂၭစၪလီၫ.- နမိအၪ့ဎၬတၭ, နဒၪန့ဘၪၦလၧအဂဲး လိၬတ့ၭလိၬလၧနၧၩအ့ၬ. ၦလၧအဒုၭဆၧထၫ့ဒုၪဒၩ နၧၩလဖၪမိကဲၪထၪ့ဘဲၫဆၧနးမံၩ့အ့ၬအၥိၭ, ဒဲဘဲၫဆၧ",
			"13": "<sup>13</sup> လမွဲဘၪဆၧအၥိၭလီၫ.- အဂဲးဘဲၫယီၩယဝ့ၫဒၪယဟိ ဝၩနယွၩယီၩယမိဖီၪ့ထၬနစူၪထွ့ၪတၭ, စံၭနၧၩ, ၥၭမဲၪ",
			"14": "<sup>14</sup> ဆၧလဂ့ၩ, ယမိမၩဆၧၩ့နၧၩလီၫ.- အၪ့ယိၪဆၧလဂ့ၩ, လိၪ့ၥံၪ,စယၫကူၭဒဲအံၫစရ့လၭအၡၩၥံၪဧ့, ယမိမၩ ဆၧၩ့နၧၩယဟိဝၩၦလၧအဎွ့ၩန့ထဲၩ့နၧၩအံၫစရ့လၭ",
			"15": "<sup>15</sup> အဆၧဆံၫ့ဎံၪလဂၩ စံၭဝ့ၫဒၪလီၫ.- ယအီၪက့ၪ ယူၭနၧၩလၧနိၪထးဘုၪအၥၫ့လၧအနၭအဲၪ့ဝ့ၫ, အီၪလၧ အမဲၪအၥွၫလီၫ. နမိထးခိၪလီၩ့လဖၪ, ဒဲထးလၩ့ဘျ့ၭ ဝ့ၫတၭ, နမိအီၪက့ၪဆၧစီၩ့ခိၪလဖၪ ဘဲၫဖ့ၫအၥိၭနီၪ",
			"16": "<sup>16</sup> လီၫ.- နမိၡိၫခွံၬအဝ့ၫၥံၪတၭ, လံၩမိအူၪခွံၬဝ့ၫဆ့, ဒဲ လံၩၥဝံၭမိမၩလၩ့ပြံၩလၩ့ပၩဝ့ၫလီၫ. တၭနမိၥၭထိၬ လၧယဟိဝၩအဖၧၩ့တၭ, လၧအံၫစရ့လၭအၡၩဆံၫ့",
			"17": "<sup>17</sup> ဎံၪလဂၩအဖၧၩ့နီၪနမိအီၪက့ၪဖိၫလိၫနၥၭလီၫ.- ၦၡၩလၧ လၧအဘၪၡၪ့ဘၪနၭ,ဒဲၦၡၪ့ဖိၪယၬဖိၪနီၪ, အၪ့ဎၬထံၫ တၭ,လဒၪဘၪနီၪး ဆၧၥၭဝံအၥၭလၧထံၫတၭ, အဖျ့ၩ ဎဲၫ့ဝ့ၫတၭ,ယၧၩယဟိဝၩယီၩယမိခိၭနၪအလူ, ယဝ့ၫ",
			"18": "<sup>18</sup> ဒၪ, အံၫစရ့လၭအယွၩယလ့ၩဒၪအဝ့ၫၥံၪအ့ၬ.- တၭ ယမိဝဲထၪ့ထံၫချိၬ လၧခိၪလီၩ့ပျၩ့အလီၩ့, ဒဲထံၫထၪ့ ဖျိၭလၧခိၪလီၩ့ဆူၭအၥၭခံဖၧၩ့တၭ, ယမိအီၪက့ၪၡါ မုနၧၫ့ဖၫဘဲၫကမၫအၥိၭ, ဒဲဂၪ့ခိၪဎဲၫ့နီၪလၧထံၫထၪ့ဖျိၭ",
			"19": "<sup>19</sup> လဖၪလီၫ.- ယမိၥုၪ့ၥံၪ့ၡိၫအ့ရ့ၭဒဲၥံၪ့ၡံၭတၫဒဲၥမ့ၫဟ ဒၭ,ဒဲၥံၪ့အလဲအိၫ့ အမံၩ့လဖၪ လၧၡါမုနၧၫ့ဖၫလီၫ. တၭလၧမံၩ့လၬၥီၪ့ကျၩနီၪယမိအီၪက့ၪၥံၪ့ၡိၫ, ၥံၪ့ထိၭ",
			"20": "<sup>20</sup> အၪ့,ဒဲၥံၪ့ၡိၫတအၫၡုၫလစီၪ့ဎး,- ဘဲၫၥိၭအဝ့ၫၥံၪမိဒၪ ဆၧ,ဒဲၥ့ၪယၫဝ့ၫ, ဒဲဆီၫ့မီၪ့လၧအၥၭ, ဒဲနၪၥ့ၪလစီၪ့ဎး လၧယဟိဝၩအစူၪမၩဆၧနီၪ, ဒဲအံၫစရ့လၭအဆၧ ဆံၫ့ဎံၪလဂၩဒုၭကဲၪထၪ့ဝ့ၫလီၫ.",
			"21": "<sup>21</sup> နဲၪဖျီၪထၪ့နၥံၪအမူၭဆံၭ, ယဟိဝၩစံၭဝ့ၫဒၪ, ထုၭ ထၪ့ဒုၭနဲၪ နၥံၪအၡၩ ထိးအၥၭ လၧအဂုးခၧၫ့ဆံၭ.",
			"22": "<sup>22</sup> စယၫကူၭအစဎွၩစံၭဝ့ၫဒၪ.- မွဲအၥုၭဘူၭအၥၭတၭ, ဒုၭနဲၪဆၧလၧအမိအီၪထၪ့နီၪဆံၭ. ဆၧလၧအခၪ့ထံၭ လဖၪနီၪ နီၫလဲၪနီၫလဲၪနီၪ, မွဲအဒုၭနဲၪဆံၭ. တၭပမိထီး န့ဝ့ၫလၧပၥၭဒဲၥ့ၪယၫအထုၬလီၫ. အ့ၪလမွဲဘၪဘဲၫနီၪ တၭ,မွဲအဒုၭနါဂၧၫ့ပၧၩလၧဆၧ လၧအမိဂဲၫထၪ့လဖၪ",
			"23": "<sup>23</sup> နီၪဆံၭ.- မွဲအဒုၭနဲၪဆၧလၧအမိဂဲၫထၪ့ လၧခဲၫ့လၧ ယၫဆံၭ.တၭပမိၥ့ၪယၫ လၧနၥံၪမွဲယွၩလဖၪနီၪလီၫ. မွဲမၬ,ဆၧဂ့ၩမွဲဂ့ၩ,ဆၧအၧၩ့မွဲဂ့ၩ, မၩဆံၭ. တၭပမိ",
			"24": "<sup>24</sup> ယိဝၬဖီၩ့ဆၧတၭ, ဒၪဘၪလစီၪ့ဎးနီၪလီၫ.- ယိခွါ,နၥံၪ မွဲဆၧဆံၭနဲၪ့ ဆၧနးမံၩ့အ့ၬတၭ, နၥံၪမၩဆၧနီၪလမွဲ ဘၪဆၧကၭအ့ၬး ၦလၧအရွံန့နၥံၪနီၪမွဲဆၧဘၪၥၭလိၪ လီၫ.",
			"25": "<sup>25</sup> ယဒုၭအီၪထၪ့ယူၭၦလဂၩ လၧမုဖၩလခီၫတၭ, ဂဲၫယူၭဝ့ၫယူၭ.မိဂဲၫလၧမုထၪ့လခီၫနီၪ မိကိၭၡၭထၪ့ယ မံၩ့လီၫ. တၭဘဲၫၦကၧၩ့ဖၧၩ့နီၪ ယဲးဂၪ့ခိၪဖံၬအၥိၭ နီၪ,အဝ့ၫဒၪမိအီၪက့ၪၦဒိၪဖၭဒိၪလဖၪ ဘဲၫဖၧၩ့ဂၪ့ခိၪ",
			"26": "<sup>26</sup> အၥိၭတၭ,မိယဲးဝ့ၫလီၫ.- ပဝ့ၫဒၪယီၩဘဲၫၥိၭပမိၥ့ၪ ယၫအဂဲး, မွဲပလၫဒုၭနဲၪဝ့ၫ လၧအခၪ့ထံၭနီၪလဂၩ လဲၪ.ပဝ့ၫဒၪယီၩ, ဘဲၫၥိၭပမိလီၩဘၪ, တီၩဝ့ၫလီၩ့ဝ့ၫ နီၪ,မွဲပလၫလီၩလၩ့လၬလၩ့လဂၩလဲၪ. မွဲမၬ,ၦဒုၭနဲၪ ဝ့ၫအီၪနးဂၩအ့ၬ. မွဲမၬ,ၦလီၩလၩ့ဝ့ၫအီၪနးဂၩအ့ၬ. မွဲမၬ,ၦလၧအနါဂၧၫ့နၥံၪအဆၧချဲၩ့နီၪအီၪနးဂၩအ့ၬ.",
			"27": "<sup>27</sup> ယစံၭဆိၫလၧဇံအိၫ့,ယိခွါ, ယိဝ့ၫဆံၭ. တၭယ မိဖ့ၪလၫ့ ၦဂဲၫဆိၬဆၧၥၭထိၬအပရၧၫ့ လၧယရုစလံၫ့",
			"28": "<sup>28</sup> လီၫ.- ယယိဆၧထံၫထံၫဆၭဆၭတၭ, ၦၡၩအီၪအ့ၬ. ဘဲၫၥိၭယမိအၪ့စၪ့အဝ့ၫၥံၪ ဒဲအဝ့ၫၥံၪချဲၩ့ဆၧၫ့ဆၧလ မံၩ့မံၩ့တၭ, ၦလၧအမိကိၪ့လိၬ ဆၧလၧအဝ့ၫၥံၪအ",
			"29": "<sup>29</sup> ကျၩအီၪနးဂၩအ့ၬ.- ယိခွါ, မွဲဆၧပျီၩပျီၩ ထီးအလူၬ လီၫ. အဆၧမၩနီၪမွဲဆၧလမွဲဘၪဆၧတၭ, အဆၧဂၩ့ ၥိၫ့အၥၭနီၪ, မွဲလံၩဒဲဆၧအီၪပျီၩနီၪလီၫ."
		},
		"42": {
			"1": "<sup>1</sup> ယိယခ့ၫယၡၩလၧယဖီၪ့ထၬလဂၩနီၪဆံၭး ၦလၧ ယရွံန့ဝ့ၫလၧအဘၪယၥၭလဂၩနီၪ, ယအီၪက့ၪယူၭ ယၥၭလၧအလီၩ့လီၫ. အဝ့ၫဒၪမိလီၩလၩ့လၬလၩ့",
			"2": "<sup>2</sup> ဆၧစ့ၩရၫ့လၧၦဆၨၩလဖၪလီၫ.- မွဲအကိၭၡၭထၪ့ အ့ၬ,ထုၭထၪ့အလူအ့ၬ, တၭဒုၭနါဂၧၫ့ဘၪအလူလၧ",
			"3": "<sup>3</sup> ဖၧၩ့ၥၭနီၪဆ့အ့ၬ.- ဖီးလဘီၩ့လၧအဆ့ၩဖိနီၪ မွဲအလ မၩထ့ၬခွံၬဘၪတၭ, မ့ၪဒိၩ့အဆၪလၧအဖၩ့ဖံၬဖံၬလ့ၫ လ့ၫနီၪ,မွဲအမၩလၩ့ဖံၬဝ့ၫဆ့အ့ၬ. မွဲအမိဒုၭဂဲၫထၪ့",
			"4": "<sup>4</sup> ဆၧစ့ၩရၫ့လၧဆၧမွဲဆၧတီၩလီၫ.- လဖၩ့ဘၪဖံၬဖံၬ လ့ၫလ့ၫတၭ, လဆ့ၩဖိဘၪ ထီးအအီၪက့ၪ ဆၧစ့ၩရၫ့ လၧဂၪ့ခိၪချိၫ့လီၫ. တၭထံၫယဲၩ့ခးယဲၩ့လဖၪနီၪ မိယိ",
			"5": "<sup>5</sup> လါအဆၧၥီၪ့ဆၧၥၫ့ အဖၧၩ့ၥၭလီၫ.- ယဟိဝၩယွၩ လၧအတဲၩ့လၩ့မူၭခိၪတၭ, ပၠၪထၪ့ဝ့ၫ, လၧအဒၩလၩ့ ဂၪ့ခိၪ,ဒဲဆၧလၧအမဲၪထၪ့လၧအဖၧၩ့း ၦလၧအဖ့ၪ လၫ့ၥၪၡိၫလၧဆၧခမျၧး လၧအအီၪဝ့ၫလၧအလီၩ့, ဒဲ ၥၭၡီၩ့လၧၦလၧအလ့ၩဝ့ၫလၧအလီၩ့, လဂၩနီၪ, စံၭ",
			"6": "<sup>6</sup> ဝ့ၫဘဲၫယီၩး- ယၧၩယဟိဝၩယီၩ,ယကိၭန့နၧၩလၧ ဆၧမွဲဆၧတီၩအဂး, ယမိဖီၪ့ထၬနစူၪတၭ,ယမိယိလၩ့ ခွါလၩ့နၧၩ, ဒဲဖ့ၪလၫ့နၧၩလၧဆၧအုၩ့လၩ့ၡီၩ့လၩ့လၧ",
			"7": "<sup>7</sup> ၦခမျၧးအဂး,လၧဆၧဖၩ့လၧၦဆၨၩၥံၪအဂး- ဘဲၫၥိၭ နမိဝဲထၪ့ၦမ့ၬဘျီၪအမ့ၬၥၪ, ဘဲၫၥိၭနမိမၩဂၭဖျ့ၭၦလၧ အဘၪဆၧခၠူၭထၬလဖၪ, ဘဲၫၥိၭနမိထုၭထၪ့အၪ့မၩ န့ၦခံၭဖိၪလၧအအီၪလၧဆၧခံၭအထီၫ့ဖၧၩ့လီၫ.",
			"8": "<sup>8</sup> ယဝ့ၫဒၪယီၩယမွဲယဟိဝၩ,အနီၪမွဲယမံၩ့လီၫ. တၭယလၩယဖၩ့ယဖ့ၪလၫ့လၧၦဂူၫဂၩအ့ၬ. ယဆၧစံၭ",
			"9": "<sup>9</sup> ထၪ့အၪ့အူၭယဖ့ၪလၫ့လၧဆၧဂၩ့ဆၧဖၪ့ဆ့အ့ၬ.- ယိ ခွါ,ဆၧအခၪ့ထံၭလဖၪနီၪမၩယူၭအၥၭယူၭတၭ, ဆၧ အၥၫ့လဖၪနီၪယဒုၭနဲၪလီၫ. ဘိၩ့အဝ့ၫၥံၪလချႃၭအီၪ ထၪ့ဒံၭဘၪတၭ, ယဒုၭနါဂၧၫ့နၥံၪ လၧအဂဲးအကၠီၪ့ လီၫ.",
			"10": "<sup>10</sup> ၦလၧအလ့ၩလၩ့လၧမၫဆမံၭဖၧၩ့, ဒဲဆၧလၧအမၩ ဎွ့ၩဝ့ၫး ကျိၩ့လဖၪ,ဒဲၦလၧအအီၪလၧအဖၧၩ့ၥံၪဧ့,ၥံၫ ကျံၩထၪ့ယဟိဝၩလၧဆၧၥံၫကျံၩအၥၫ့ဆံၭး ဒဲအဆၧ",
			"11": "<sup>11</sup> စံၭထၪ့အၪ့အူၭလၧဂၪ့ခိၪအထုၬလဖၪနီၪဆံၭ.- မံၩ့ လၬကျၩဒဲအဒိၩ့လဖၪမိထုၭထၪ့အလူ, အတဝၫ့လဖၪ လၧကံဒၧၫအီၪဝ့ၫလၧအဖၧၩ့နီၪ ၦအီၪဝ့ၫလၧလိးအိၩ ဖၧၩ့လဖၪမိကိၭလၧအလူဖၭဒိၪ, မိကိၭၡၭထၪ့လၧခိၪ",
			"12": "<sup>12</sup> လီၩ့ခိၪလီၫ.- မွဲအဝ့ၫၥံၪအီၪက့ၪလၩဖၩ့ ယဟိဝၩ,ဒဲ ဒုၭနဲၪအဆၧစံၭထၪ့အၪ့အူၭ လၧထံၫယဲၩ့ခးယဲၩ့ဆံၭ.",
			"13": "<sup>13</sup> ယဟိဝၩမိလ့ၩထၪ့ဘဲၫၦအဆီၪ့အၥိၭနီၪ, မိထိၪ ဂဲၩအၥၭဆီၪ့ဘဲၫၦၥုၭဖိၪအၥိၭနီၪ, မိကိၭထၪ့လၧအလူ ဖၭဒိၪ,မိကိၭၡၭထၪ့, မိမၩနၧၩ့မၩစၪအဒုၪအဒၩလီၫ.",
			"14": "<sup>14</sup> ယအီၪလၩ့မါပံၭယူၭ ယံၬယံၬယူၭး ယအီၪဒၪဆၧ တၭ,ယထုၭယၥၭလီၫ. အ့ၪမွဲဘိၩ့နဲၪ့ယီၩ, ယမိကိၭ ၡၭဘဲၫၦမုၪလၧအဂူၭဆၫအၥိၭ, ယမိမၩဂၭဂီၩ့ဆၧ,",
			"15": "<sup>15</sup> ယမိယုလၩ့ခွံၬဆၧလစီၪ့ဎးလီၫ.- ယမိမၩယူခိၪလီၩ့ လဖၪ,ဒဲဆၧထၪ့စီၩ့လဖၪ, ဒဲဒုၭဎဲၫ့ထၪ့ခွံၬအနၪ့ၥံၪမံၩ့ ၥံၪထီးအလူၬတၭ, ယမိအီၪက့ၪ အထံၫမိၡါလၧခီၫ့",
			"16": "<sup>16</sup> တၭ,ယမိဒုၭလၩ့ၥံၭခွံၬကမၫၥံၪလီၫ.- ယမိဒုၭလ့ၩၦ မ့ၬဘျီၪလၧဖၧၩ့ၥၭမုလၧအလၥ့ၪယၫဘၪဝ့ၫတၭ, ယမိ ဒုၭဖိၬဝ့ၫ လၧဖၧၩ့ၥၭဖိၪလၧအလၥ့ၪယၫဘၪဝ့ၫတၭ, ဆၧခံၭလမံၩ့ယမိဒုၭကဲၪထၪ့ဆၧဖၩ့လၧအမ့ၬယၫ, ဒဲ ဆၧအကဲၪ့လဖၪ ယမိဒုၭလီၩ့ထၪ့ဝ့ၫနီၪလီၫ. ဆၧလ ဖၪနီၪယမိမၩ လၧအဝ့ၫၥံၪအဂးတၭ, ယစဲၪ့ဒၪဝ့ၫ",
			"17": "<sup>17</sup> အ့ၬ.- ၦလၧအဒိၭနဲၩ့အၥၭလၧဆၧဂၩ့စိၭဖျၩအၥၭ, လၧအစံၭဆၧဂၩ့ၥိၫ့န့ဝ့ၫ,နၥံၪမွဲပယွၩလဖၪ, ဧီၪး တၭ အဝ့ၫၥံၪမိဂၧၩ့ထဲၩ့အၥၭလၧအလးခဲၫ့, မိအီၪက့ၪမဲအ မ့ၬဖၭဒိၪဆ့လီၫ.",
			"18": "<sup>18</sup> ၦလၧအနါအၧၩ့ၥံၪဧ့, ခိၭနၪဆံၭး ၦလၧအမ့ၬဘျီၪ ၥံၪဧ့, ယိထံၫယိဆၭ ဘဲၫၥိၭနၥံၪမိဒၪဘၪဆၧဆံၭ.",
			"19": "<sup>19</sup> အ့ၪလမွဲဘၪ ယခ့ၫယၡၩတၭ, မွဲပလၫအမ့ၬဘျီၪလ ဂၩလဲၪ.တၭမွဲပလၫအနါအၧၩ့ ဘဲၫယၥီၫ့လၧယအၪ့ မၧၫ့လၩ့အခဲၫ့ အၥိၭနီၪလဂၩလဲၪ. မွဲပလၫမ့ၬဘျီၪ ဘဲၫၦအလၧၫ့အဎွ့ၩ အၥိၭနီၪလဂၩလဲၪ. တၭမွဲပလၫ မ့ၬဘျီၪဘဲၫယဟိဝၩအခ့ၫအၡၩအၥိၭနီၪလဂၩလဲၪ.",
			"20": "<sup>20</sup> နဒၪဘၪဆၧအၪမံၩ့လါနၫ့တၭနထီးန့အ့ၬ. နါအိၭထၪ့ အၥၭလါနၫ့တၭ,နါဂၧၫ့ဘၪဆၧအ့ၬ.",
			"21": "<sup>21</sup> ဘၪယဟိဝၩအၥၭလၧဆၧတီၩဆၧလီၩ့အကၠီၩ့, မိ အီၪက့ၪဒိၪဆၧၥီၪ့ဆၧၥၫ့တၭ, အီၪက့ၪဝ့ၫလၧအလၩ",
			"22": "<sup>22</sup> အဖၩ့လီၫ.- မွဲလါနၫ့တၭၦလဆၨၩယီၩ, မွဲၦလၧဆၧ အၪ့ဂူၬဆီၪ့ဒဲမၩဂၭဂီၩ့ဆီၪ့အဆၧတၭ, ဘၪဖျံၩခွၩ့လၧ ဆၧအိၩဖၧၩ့ထီးအလူၬတၭ, ဘၪဆၧဒုၭအီၪခိၭၥူၪ လၧထီၫ့လဖၪအဖၧၩ့လီၫ. ကဲၪထၪ့ဆၧလၧၦအၪ့ဂူၬ ဆီၪ့တၭ,ဆၧမၩဖီၩ့မၩဖျ့ၭလအီၪဘၪတၭ, ဆၧလၧ ၦမၩန့ဆီၪ့ဝ့ၫနီၪ, ၦလၧအစံၭ, ဖ့ၪထဲၩ့ဆၧဆံၭနီၪအီၪ",
			"23": "<sup>23</sup> နးဂၩအ့ၬ.- မွဲပလၫလၧနၥံၪအကျၩ မိခိၭနၪဆၧနီၪလ ဂၩလဲၪ. မွဲပလၫမိဒိၭအနါဒဲခိၭနၪဆၧကဲၪခိၬအဆၧၫ့",
			"24": "<sup>24</sup> အထီနီၪလဂၩလဲၪ.- မွဲပလၫဖ့ၪလၫ့စယၫကူၭလၧဆၧ မၩန့ဆီၪ့, ဒဲအံၫစရ့လၭလၧၦအၪ့ဂူၬဆီၪ့အစူၪဖၧၩ့နီၪ လဂၩလဲၪ. ယဟိဝၩလၧပမၩမၪဘၪဝ့ၫမွဲအ့ၬဧၪး အ ဝ့ၫဒၪအဖၧၩ့ၥၭနီၪအဝ့ၫၥံၪလမိဖိၬဘၪဝ့ၫတၭ, ခိၭနၪ",
			"25": "<sup>25</sup> ဝ့ၫအဆၧၥီၪ့ဆၧၥၫ့ဆ့အ့ၬ.- မၩအၥၭဘဲၫနီၪတၭ, အ ဝ့ၫလူၫလၩ့အၥၭထၪ့ဆီၪ့ ဒဲဆၧဒုၭၥုၭဆီၪ့နီၪ လၧအ လီၩ့လီၫ. တၭဆၧနီၪလမံၩ့ ဆူၭခဲၩဝ့ၫ လၧမ့ၪအီၪဝၬ ဖီၩ့ဝ့ၫလါနၫ့တၭ,အဝ့ၫၥံၪၥ့ၪယၫအ့ၬ. တၭမ့ၪအၪ့ဝ့ၫ လါနၫ့တၭ, လဆီၫ့မီၪ့လၩ့ဘၪအၥၭနီၪလီၫ."
		},
		"43": {
			"1": "<sup>1</sup> အ့ၪမွဲဘိၩ့နဲၪ့ယီၩ, ယဟိဝၩလၧအတဲၩ့လၩ့နၧၩ စယၫကူၭဧ့,ဒဲမၩကဲၪထၪ့နၧၩအံၫစရ့လၭဧ့, စံၭဘဲၫ ယီၩ,ထီးၥၭမဲၪလဂ့ၩး အဂဲးဘဲၫယီၩ ယဎွ့ၩန့ထဲၩ့ ယူၭနၧၩယူၭး ယကိၭယူၭနၧၩ လၧနမံၩ့တၭး နမွဲယ",
			"2": "<sup>2</sup> ဆၧလီၫ.- ထီးနအ့ၪခၫ့ဂၬထံၫနီၪ ယမိအီၪလၧနၥိၭ တၭ,ထီးနအ့ၪခၫ့ဂၬထံၫမိၡါလဖၪနီၪ, အဝ့ၫၥံၪမိလုၬ ဘံၭဘၪနၧၩအ့ၬ. ထီးနအ့ၪခၫ့ဂၬမ့ၪတၭ, မ့ၪအၪ့ဘၪ",
			"3": "<sup>3</sup> နၧၩအ့ၬ.မ့ၪခိဎီၩခိၥွၪဘၪနၧၩဆ့အ့ၬ.- အဂဲးဘဲၫယီၩ ယဝ့ၫဒၪယဟိဝၩနယွၩ, အံၫစရ့လၭအဆၧဆံၫ့ဎံၪ လဂၩ,ဆၧဎွ့ၩန့ထဲၩ့နၧၩယီၩ, ယဖ့ၪလၫ့ခးအံဇံၭ",
			"4": "<sup>4</sup> ခးကုၡၫ,ဒဲခးစံဘၫလၧနဆၧဎွ့ၩလီၫ.- လၧနမွဲဆၧလူ ဒိၪဎွ့ၩဒိၪလၧယမ့ၬယၫအကၠီၩ့ နဘၪဆၧလၩဖၩ့တၭ, ယအဲၪယူၭနၧၩ, ဒဲယမိဖ့ၪလၫ့ၦခ့ၫၦၡၩလၧနဂး, ဒဲၦ",
			"5": "<sup>5</sup> ဆၨၩလဖၪလၧနၥၭမၧၫ့အဂးလီၫ.- ၥၭမဲၪဆၧလဂ့ၩး အဂဲးဘဲၫယီၩ ယအီၪလၧနၥိၭလီၫ. ယမိဒုၭဂဲၫနချံၫန ၥၪလၧမုထၪ့လခီၫ ဒဲယမိအၪ့ထုၫ့ကီၪ့နၧၩလၧမုနုၬလ",
			"6": "<sup>6</sup> ခီၫလီၫ.- ယမိစံၭမုဖၩလခီၫနီၪ, ဖ့ၪလၫ့ထဲၩ့ဆံၭး ဒဲမု ခံၫ့လခီၫနီၪ ထီးပဒၩ့လဂ့ၩ. ဒုၭဂဲၫထၪ့ ယဖိၪခွၫၥံၪ လၧအယဲၩ့, ဒဲယဖိၪမုၪၥံၪလၧဂၪ့ခိၪအထုၬနီၪဆံၭ",
			"7": "<sup>7</sup> ကယဲၦလၧဆၧကိၭဝ့ၫလၧယမံၩ့း အဂဲးဘဲၫယီၩယ တဲၩ့ဝ့ၫလၧယလၩယဖၩ့အဂး, မွဲမၬ, ယဒုၭအီၪထၪ့ အခံးအဂၩ့ဒဲယမၩဝ့ၫလီၫ.",
			"8": "<sup>8</sup> ၦလၧအမ့ၬၥၪအီၪတၭအမ့ၬဘျီၪ, ဒဲၦအနါအီၪတၭ",
			"9": "<sup>9</sup> အနါအၧၩ့လဖၪနီၪ, ဒုၭဂဲၫထၪ့ဆံၭ.- ၦဆၨၩထီးအ လူၬနီၪအီၪကိၩ့အီၪကီၪ့တၭ, ဆၧဒုၭအီၪကီၪ့ၦခမျၧး လီၫ.မွဲပလၫလၧအကျၩနီၪ မိဒုၭနဲၪဆၧယီၩလဂၩ လဲၪ.ဒုၭနါဂၧၫ့ ၦလၧဆၧအခၪ့ထံၭလဖၪနီၪဆံၭ. မွဲ အအီၪက့ၪလၩ့အၡၩထိးအၥၭတၭ, ဒိၭဆၧအီၪက့ၪ တီၩဝ့ၫဆံၭ. တၭမွဲအခိၭနၪတၭ, စံၭ, မွဲဝ့ၫတီၩဝ့ၫနီၪ",
			"10": "<sup>10</sup> ဆံၭ.- နၥံၪဝ့ၫဒၪယီၩနၥံၪမွဲယၡၩထိးအၥၭ, ယဟိဝၩ စံၭဝ့ၫဒၪ, ယခ့ၫယၡၩ လၧယအၪ့ရွံန့ဝ့ၫဘဲၫၥိၭနၥံၪ မိၥ့ၪယၫ,ဒဲနဲၩထဲၩ့ယွၩ, ဒဲနၪၥ့ၪလၧယမွဲအဝ့ၫဒၪလီၫ. လၧယလချႃၭအီၪဒံၭဘၪနီၪ ယွၩဒိၭဆၧတဲၩ့ဝ့ၫနးဂၩ",
			"11": "<sup>11</sup> အ့ၬတၭ,လၧယလးခဲၫ့နီၪမိအီၪဆ့အ့ၬ.- ယဝ့ၫဒၪယီၩ ယမွဲယဟိဝၩလီၫ. အ့ၪလမွဲဘၪယၧၩတၭ, ဆၧထိး",
			"12": "<sup>12</sup> ထဲၩ့တၩ့ထဲၩ့ အီၪနးဂၩအ့ၬ.- ထီးၦလခီၫဘၩ့မုးဖိၪ လအီၪဘၪလၧနၥံၪအကျၩး ယဒုၭနဲၪဆၧဒဲယထိးထဲၩ့ တၩ့ထဲၩ့ဆၧဒဲယဒုၭနါဂၧၫ့ဆၧ, မၩအၥၭဘဲၫနီၪတၭ, ယဟိဝၩစံၭဝ့ၫဒၪ, နၥံၪမွဲယၡၩထိးအၥၭ,လၧယဝ့ၫဒၪ",
			"13": "<sup>13</sup> ယီၩ,ယမွဲယွၩလီၫ.- မွဲကဒၪယူၭလၧမုနံၩလချႃၭအီၪ ဒံၭဘၪတၭ,ယအီၪယဝ့ၫလီၫ. တၭဆၧမၩဖီၩ့ဖျ့ၭထၪ့ လၧယစူၪဖၧၩ့အီၪအ့ၬ. ယမိမၩယဝ့ၫတၭ, မွဲပလၫမိ မၩကဒၩထဲၩ့လဂၩလဲၪ.",
			"14": "<sup>14</sup> ယဟိဝၩဆၧဎွ့ၩန့ထဲၩ့နၥံၪ, အံၫစရ့လၭအဆၧဆံၫ့ ဎံၪလဂၩစံၭဘဲၫယီၩး လၧနၥံၪအဂးနီၪ ယအၪ့မၧၫ့ လၩ့ဆၧလၧဘၭဘလၧၫ့တၭ, ၦလၧအစဲၪ့ဖျိၭၥံၪဒုၭ လ့ၩလၩ့လၧကဘၩ့ဖၧၩ့ထီးအလူၬ ဒဲၦခၫလဒံအၫဖိၪ",
			"15": "<sup>15</sup> လၧအကိၭၡၭထၪ့လၧကဘၩ့ဖၧၩ့လီၫ.- ယဝ့ၫဒၪယီၩ ယမွဲယဟိဝၩ, နၥံၪအဆၧဆံၫ့ဎံၪလဂၩဆၧဒုၭကဲၪ",
			"16": "<sup>16</sup> ထၪ့အံၫစရ့လၭနၥံၪအစဎွၩလီၫ.- ယဟိဝၩ စံၭဘဲၫ ယီၩ,ၦလၧအမၩဖၧၩ့ၥၭမုလၧမၫဆမံၭဖၧၩ့ ဒဲဖၧၩ့ၥၭ",
			"17": "<sup>17</sup> လၧထံၫဆီၪ့အဖၧၩ့,- ၦလၧအဒုၭဂဲၫထၪ့လဲၪ့ၥုၭဒဲက ၥ့ၪ,ဆၧၥုၭမုဒဲဆၧအစီၩ့အမၩ့တၭ, အဝ့ၫၥံၪမိမံၫနၩ့ ဝ့ၫလစီၪ့ဎး, လဂဲထုၪ့လၧၩ့ဘၪ, လၩ့ဖံၬယူၭ,လၩ့ဖံၬ",
			"18": "<sup>18</sup> ယူၭဘဲၫမ့ၪဒိၩ့အဆၪအၥိၭနီၪလီၫ.- ဆၧလၧအခၪ့ ထံၭလဖၪနၪ့ထၪ့ထဲၩ့ဝ့ၫလဂ့ၩတၭ, ဆၧအီၪလၧဖျိၩ့",
			"19": "<sup>19</sup> လၧၥၫ့လဖၪနီၪဆီၫ့မီၪ့လၧအဂဲးလဂ့ၩ.- ယိခွါ,ယမၩ ဆၧအၥၫ့လမံၩ့လီၫ. ဘိၩ့နဲၪ့ယီၩမိမဲၪထၪ့တၭ, မွဲနၥံၪ ၥ့ၪယၫအ့ၬဧၪ. မွဲမၬယမိအီၪက့ၪဖၧၩ့ၥၭလၧၡါမုနၧၫ့",
			"20": "<sup>20</sup> ဖၫ,ဒဲထံၫချိၬလဖၪလၧမံၩ့လၬကျၩလီၫ.- ထွံၪဂၪ့ခိၪ, ဒဲထိၪကလအူၭ, မံၩ့လၬကျၩအဆၧဖိၪဆၧဎါလဖၪမိ မၩလၩဖၩ့ယၧၩလီၫ. အဂဲးဘဲၫယီၩယအီၪက့ၪလၩ့ ထံၫလၧၡါမုနၧၫ့ဖၫ ဒဲထံၫချိၬလဖၪလၧမံၩ့လၬၥီၪ့ကျၩ ဘဲၫၥိၭယမိဖ့ၪလၫ့ဆၧအီၩလၧယၡၩခမျၧး ၦလၧယရွံ",
			"21": "<sup>21</sup> န့လဖၪနီၪအဂးလီၫ.- ၦလဆၨၩယီၩ ယဒုၭကဲၪထၪ့ လၧယဂးဒၪယဝ့ၫတၭ, အဝ့ၫၥံၪမိဒုၭနဲၪဖျီၪထၪ့ယဆၧ စံၭထၪ့အၪ့အူၭလီၫ.",
			"22": "<sup>22</sup> မွဲလါနၫ့တၭ,နလကိၭထၪ့ဘၪယၧၩ,စယၫကူၭဧ့, အဂဲးဘဲၫယီၩ ဆၧပွံၭနၥၭလၧယကၠီၩ့အံၫစရ့လၭ",
			"23": "<sup>23</sup> ဧ့,- နလဂဲၫဆိၬဘၪ ဆၧလုမ့ၪအၥိၪ ဖိၪလဖၪလၧ ယအီၪ,ဒဲနမၩလၩဖၩ့ယၧၩ လၧနဆၧလုၥံၪဆ့အ့ၬ. ယလဒုၭမၩနၧၩ လၧဆၧမၩဘိၪ့တၭ, ယဒုၭပွံၭနၥၭ",
			"24": "<sup>24</sup> လၧဆၧဆူၭခဲၩနၧၫ့မၧၫ့ဆ့အ့ၬ.- နဎွ့ၩန့အ့ၪယၧၩ ဆံၫဖိၬလၧစ့ၩအ့ၬ. တၭနဒုၭဘျဲၩအၪ့ဘၪယၧၩ လၧန ဆၧလုအၥိၪအယဲၩဆ့အ့ၬ. မွဲနအီၪက့ၪဆၧမၪလၧ ယလီၩ့လၧနဆၧဒဲၩဘၭတၭ, နမၩပွံၭယၥၭလၧနဆၧ",
			"25": "<sup>25</sup> မၪလီၫ.- ယဝ့ၫဒၪယီၩယထူၭခွံၬ နဆၧၥူၭဆၧမၪ လၧယဂးဒၪယဝ့ၫလီၫ. ယနၪ့ထၪ့ထဲၩ့လၧၩ့ နဆၧ ဒဲၩဘၭအ့ၬ.",
			"26": "<sup>26</sup> ဒုၭနၪ့ထၪ့ထဲၩ့ယၧၩဆံၭ. မွဲပလိၭခွးလိၬပၥၭဆံၭ. လီၩလၩ့လၬလၩ့ဆၧဘဲၫၥိၭ နမိဘၪဆၧတီၩဆၧလီၩ့",
			"27": "<sup>27</sup> နီၪဆံၭ.- နဖါအဝံခိၪလဂၩနီၪမၩဆၧဒဲၩဘၭ,ဒဲနဆရၫ",
			"28": "<sup>28</sup> ၥံၪမၩမၪဘၪယၧၩလီၫ.- မၩအၥၭဘဲၫနီၪတၭ, ယမၩ စံၪစၪယူၭလးဆံၫ့ဎံၪအၦဒိၪလဖၪတၭ, ယဖ့ၪလၫ့ခွံၬ ယူၭစယၫကူၭလၧဆၧဆိၪအၧၩ့, ဒဲအံၫစရ့လၭနီၪလၧ ဆၧဒုၪဒွ့ၪအဂးလီၫ."
		},
		"44": {
			"1": "<sup>1</sup> တၭဘိၩ့နဲၪ့ယီၩခိၭနၪ, ယခ့ၫယၡၩစယၫကူၭဧ့,",
			"2": "<sup>2</sup> ဒဲအံၫစရ့လၭလၧယရွံန့ဝ့ၫလဂၩဧ့,- ယဟိဝၩလၧအ တဲၩ့လၩ့နၧၩ ဒဲဒုၭကဲၪထၪ့နၧၩ လၧဆၧဒၧၩ့လးဖၧၩ့ လံၩလံၩလဂၩနီၪ, မိမၩဆၧၩ့နၧၩတၭ, စံၭဝ့ၫဘဲၫယီၩ, ယခ့ၫယၡၩစယၫကူၭဧ့, ဒဲၦလၧယရွံန့ဝ့ၫစယ့ၭၡရၧၫ့",
			"3": "<sup>3</sup> လဂၩဧ့,ထီးၥၭမဲၪလဂ့ၩ.- အဂဲးဘဲၫယီၩယမိလူၫ လၩ့ထံၫလၧၦလၧဆၧၥၭဝံအၥၭလၧထံၫအလီၩ့,ဒဲဒုၭ လၩ့ယွၩထံၫလၧဂၪ့ခိၪဎဲၫ့ထၬအဖၫ့ခိၪလီၫ. ယမိလူၫ လၩ့ယၥၭမုလၧနချံၫနၥၪအလီၩ့,ဒဲယဆၧဆိၪဂ့ၩလၧ",
			"4": "<sup>4</sup> နဆၨၩနဆၬအလီၩ့လီၫ.- တၭအဝ့ၫၥံၪမိမၩအၥၭဘဲၫ ဖံစလီၫ့မဲၪထၪ့ လၧနၪ့ၥံၪမံၩ့ၥံၪအကျၩ လၧထံၫကၠီၪ့",
			"5": "<sup>5</sup> နဲၩ့အၥိၭနီၪလီၫ.- ၦလဂၩမိစံၭယဝ့ၫဒၪယီၩ ယမွဲယ ဟိဝၩအၡၩလီၫ. တၭအလဂၩဒၪမိကိၭလၩ့အၥၭလၧ စယၫကူၭအမံၩ့လီၫ.တၭအလဂၩဒၪမိကွ့ၭဝ့ၫလၧအ စူၪလၧအမွဲယဟိဝၩအဆၧတၭ, မိကိၭလၩ့အၥၭလၧ အမံၩ့ၥၫ့အံၫစရ့လၭလီၫ.",
			"6": "<sup>6</sup> ယဟိဝၩအံၫစရ့လၭအစဎွၩ, ဆၧလၧအဎွ့ၩန့ထဲၩ့ အံၫစရ့လၭ, ဆၧၥုၭမုခမျၧးအယဟိဝၩစံၭဘဲၫယီၩ, ယဝ့ၫဒၪယီၩယမွဲဆၧအခၪ့ထံၭတၭ, ယဝ့ၫဒၪယီၩယ မွဲဆၧအခဲၫ့ထုၬတၭ, အ့ၪလမွဲဘၪယၧၩယွၩအီၪနးဂၩ အ့ၬ.",
			"7": "<sup>7</sup> တၭခီၫလၧယအီၪက့ၪလၩ့ ၦခမျၧးအဆိၩအကၠၪ လဆၨၩနီၪ,မွဲပလၫမိကိၭထၪ့ဆၧတၭ,ဒုၭနဲၪဝ့ၫ, ဒဲတဲၩ့ ဝဲၩဆၧလၧယဂးတၭ, ဆၧလၧအမၩအၥၭ, ဒဲဆၧလၧ အမိမၩအၥၭနီၪ, မိလီၩဘၪဝ့ၫဘဲၫယၧၩအၥိၭလဂၩ",
			"8": "<sup>8</sup> လဲၪ.မွဲအဒုၭနဲၪဖျီၪထၪ့ဝ့ၫဆံၭ.- ထီးၥၭမဲၪနၥံၪဝ့ၫ လဂ့ၩ,ဒဲအၪ့ယိၪဆၧလဂ့ၩ, ယဒုၭနါဂၧၫ့နၧၩတၭ, လီၩဘၪနၧၩ လၧဖျိၩ့လံၩလံၩမွဲအ့ၬဧၪ. တၭနၥံၪမွဲ ယၡၩထိးအၥၭမွဲအ့ၬဧၪ. အ့ၪလမွဲဘၪယၧၩ, မွဲယွၩ လဂၩဂၩအီၪဒံၭဆ့ဧၪ. မွဲကဒၪယူၭ, လဲၫ့လအီၪဘၪ, ယၥ့ၪယၫနးစီၪ့အ့ၬ.",
			"9": "<sup>9</sup> ၦလၧအတဲၩ့ဆၧဂၩ့ဆၧဖၪ့ မွဲဆၧအီၪပျီၩ ထီး အလူၬတၭ, အဆၧအဂ့ၩအဘၪနီၪ မွဲဆၧန့ကၩ ဆၧအ့ၬ.တၭမွဲအၡၩထိးအၥၭဒၪဝ့ၫနီၪ, လဒၪ ဘၪဆၧဒဲလၥ့ၪယၫဘၪဆၧ ဘဲၫၥိၭအမ့ၬ မိမဲလီၫ.",
			"10": "<sup>10</sup> မွဲပလၫတဲၩ့လၩ့ ယွၩတၭ, ၥိၫ့ဆၧဂၩ့ဆၧဖၪ့လၧ",
			"11": "<sup>11</sup> အလန့ကဲၩ့န့ကၩဘၪဆၧလဂၩလဲၪ.- ယိခွါ, အထံၩ အၥိၭထီးအလူၬအမ့ၬမိမဲလီၫ. တၭၦတဲၩ့ဆၧလဖၪ နီၪမွဲၦၡၩလီၫ. မိအီၪကီၪ့ထီးအလူၬနီၪမိဆၧၫ့ထုၪ့, မိ",
			"12": "<sup>12</sup> ၥၭမဲၪၥၭဖျဲၩ့ဆၧ, မိမ့ၬလဲၩလစီၪ့ဎးလီၫ.- ဘဲၫၥိၭအမိ မၩထၪ့အခံးအဂၩ့ လၧစၭခုၪနီၪ ထမၬၥံၪလူၭလၩ့ဝ့ၫ လၧအနိၪထံၬလၧမ့ၪအၧၩ့ကျၩတၭ, မိထုၭထၪ့အစူၪ ဒူၪအဂဲးအဘၭတၭ, မိထးဝ့ၫလီၫ. လၧနီၪအမ့ၬယၫ ဆၧၥၭဝံအၥၭတၭ, အဂဲးအဘၭအီၪအ့ၬ. လအီၩဘၪ",
			"13": "<sup>13</sup> ထံၫတၭလၩ့ဘဲၩဝ့ၫလီၫ.- လဲၬၥမါနီၪ,စိၭဖျၩယူၭၥံၪ့ ၥံၪယူၭ,ဆုးထၪ့ယူၭပနီၫ့ဖျံၩယူၭ, မိကွ့ၭနဲၪ့ဝ့ၫလၧနိၪ ကွ့ၭဆၧ,မိတဲၩ့ဝ့ၫလၧနိၪဖျၩတၭ, မိမၩနဲၪ့ဝ့ၫလၧနိၪ ဖၭထါလီၫ. အနီၪတၭ, တဲၩ့ဝဲၩဝ့ၫဘဲၫၦၡၩအဂၩ့အ ၥိၭ,ဘဲၫၦၡၩအဎံၫအလၩအၥိၭ ဘဲၫၥိၭအမိအီၪလၧ",
			"14": "<sup>14</sup> ဂံၪ့ဖၧၩ့လီၫ.- အဝ့ၫခူၬလၩ့ခွံၬၥံၪ့ၡိၫအ့ရ့ၭ လၧအဂး နီၪးဒဲအၪ့မၩန့ၥံၪ့အကိၩ့ ဒဲၥံၪ့ထိၭဖၫတၭ, မၩန့ထၪ့ ဝ့ၫလၧအဂးဒၪဝ့ၫလၧမံၩ့လၬကျၩအၥံၪ့ကျၩလီၫ. ၥုၪ့ ၥံၪ့ၡိၫလထုၪ့တၭ,ဆၧဆၧၩ့မိဒုၭဒိၪထၪ့ဝ့ၫလီၫ.- ထီး",
			"15": "<sup>15</sup> နီၪလဖၧၫ့မွဲအကဲၪထၪ့ဝ့ၫလၧၥံၪ့မုလၧ ၦၡၩအဂးလီၫ. တၭမိမၩန့ဝ့ၫလကုၭ ဆူၭဆူၭမ့ၪ လၧအနၫ့ဆါဒၪဝ့ၫ လီၫ.မွဲမၬ, မိဆူၭခဲၩ့မ့ၪတၭ အၪ့ကၪကိၪလီၫ. မွဲမၬ, မိတဲၩ့ဆ့အယွၩတၭ, ထွံၩလၩ့ဘၩဝ့ၫလီၫ. တဲၩ့ယူၭ ဆၧဂၩ့စိၭဖျၩတၭ, ထွံၩလၩ့ဝ့ၫလၧအမ့ၬယၫလီၫ.",
			"16": "<sup>16</sup> ဆူၭထၪ့ခွံၬယူၭလကုၭလၧမ့ၪယူၭ, အလကုၭနီၪမိအၪ့ ဖီၫ့အၪ့ဆၧယၪ,မိအၪ့ကၪဆၧယၪတၭ,မိအၪ့ဘျဲၩအၪ့, ဒဲမိဆူၭဆူၭအၥၭလၧမ့ၪတၭ, စံၭဝ့ၫ, အၫဟါ, ယလၧၩ့",
			"17": "<sup>17</sup> ယူၭ,ယဒၪဘၪမ့ၪယူၭ.- တၭဆၧအီၪလၩ့ထးနီၪတဲၩ့ ယူၭဝ့ၫလၧအယွၩ, အဆၧဂၩ့စိၭဖျၩအၥၭလီၫ. ထွံၩ လၩ့ဒဲဘိၪ့ထၪ့ဘၩထၪ့ဝ့ၫတၭ, ဘၩဆိၪဖၪဝ့ၫစံၭ, မၩ ဖီၩ့မၩဖျ့ၭယၧၩဆံၭ. အဂဲးဘဲၫယီၩ နမွဲယယွၩလီၫ.",
			"18": "<sup>18</sup> ၦဘဲၫနီၪလဖၪ လၥ့ၪယၫဘၪဆၧတၭ, နၪဆၧၥ့ၪအ့ၬ. အဂဲးဘဲၫယီၩဆၧကၭဘံၭထၬအမ့ၬဘဲၫၥိၭအထီးဒၪ ဆၧလဂ့ၩ, ဒဲအၥၭနီၪဘဲၫၥိၭအထီးမၩလၧဆၧကိၪ့ၥ့ၪ",
			"19": "<sup>19</sup> လဂ့ၩလီၫ.- လထီးန့ဘၪအၥၭတၭ,လအီၪဘၪလၧ ဆၧၥ့ၪယၫအၥုၪ့ဆၭအၥၭဆၭလၧအမိစံၭ, ယဆူၭခွံၬ ယူၭလကုၭလၧမ့ၪယူၭ. မွဲမၬ, လၧအမ့ၪအၧၩ့အဖၫ့ခိၪ ယဎူယူၭကိၪး ယအၪ့ကၪယူၭဆၧယၪတၭ, အၪ့ဆၧ ယူၭတၭ, လၧဆၧအီၪလၩ့ထးနီၪ, မွဲယမိမၩဆၧၥၭ လိၪဆ့ဧၪး မွဲယမိထွံၩလၩ့လၧၥံၪ့ကုၭအမ့ၬယၫနီၪဆ့",
			"20": "<sup>20</sup> ဧၪ.- အဝ့ၫဒၪအၪ့ဖံၫ့ချၪး အၥၭလၧဆၧအၪ့လီၫန့ဝ့ၫ လမံၩ့ဒုၭဂၭဖျိၭဝ့ၫလၧဖၧၩ့ၥၭတၭ, မၩဖီၩ့မၩဖျ့ၭအ ၥၭဒၪဝ့ၫၥ့ၪအ့ၬတၭ, လစံၭဘၪ, ဆၧကဘျံၭကဘျၪအီၪ ဝ့ၫလၧယစူၪထွ့ၪနီၪ, မွဲအ့ၬဧၪ.",
			"21": "<sup>21</sup> စယၫကူၭဧ့, ဒဲအံၫစရ့လၭဧ့,နၪ့ထၪ့ထဲၩ့ဆၧနီၪလ ဖၪဆံၭ. အဂဲးဘဲၫယီၩနမွဲယခ့ၫယၡၩလီၫ. ယတဲၩ့ လၩ့နၧၩနမွဲယခ့ၫယၡၩလီၫ. အံၫစရ့လၭဧ့,ယၥၭနၪ့",
			"22": "<sup>22</sup> ဘၪနၧၩအ့ၬ.- ယထူၭခွံၬယူၭနဆၧမၪဘဲၫဆၧအုၪ့တၪ့ အၥိၭ,ဒဲနဆၧဒဲၩဘၭဘဲၫဆၧအုၪ့အၥိၭနီၪယူၭ. ဂဲၫထဲၩ့ ကဒၩထဲၩ့လၧယအီၪဆံၭ. အဂဲးဘဲၫယီၩယဎွ့ၩန့ထဲၩ့ ယူၭနၧၩယူၭ.",
			"23": "<sup>23</sup> ၥံၫကျံၩဆၧမူၭခိၪဧ့, အဂဲးဘဲၫယီၩယဟိဝၩမၩယူၭ ဝ့ၫယူၭ, ကိၭၡၭထၪ့ဆၧ, ၦလၧဂၪ့ခိၪချိၫ့လခီၫဧ့, ဆၬ ထၪ့ထၭခိၪ, ခိၪလီၩ့ၥံၪဧ့, မံၩ့လၬကျၩဒဲကယဲၥံၪ့လၧ အဖၧၩ့ကိၭထံၭဒ့ၭဆံၭ. အဂဲးဘဲၫယီၩယဟိဝၩဎွ့ၩန့ ထဲၩ့ယူၭစယၫကူၭတၭ, မိမၩလၩဖၩ့လၩ့အၥၭလၧ အံၫစရ့လၭအကျၩလီၫ.",
			"24": "<sup>24</sup> ယဟိဝၩလၧအဎွ့ၩန့ထဲၩ့နၧၩ ဒဲဒုၭကဲၪထၪ့နၧၩခီၫ လၧဒၧၩ့လးအဖၧၩ့နီၪစံၭဘဲၫယီၩ, ယဝ့ၫဒၪယီၩယမွဲ ယဟိဝၩလၧအၥ့ၪဆၧလူၬ, လၧအပၠၪထၪ့မူၭခိၪလဂၩ ဎး,လၧအဒၩလၩ့ဂၪ့ခိၪ ယနၫ့ဆါဒၪယဝ့ၫလဂၩဎး,",
			"25": "<sup>25</sup> လၧအမၩဂၭဂီၩ့ၦချဲၩ့ဘျံၭချဲၩ့ဘျၪအဆၧနဲၪ့, ဒဲဒုၭဖျႃ ထၪ့ၦၡၩအၪ့ဖၩ့ဆၧလဖၪ လၧအဒုၭထဲၩ့ထဲၩ့ၦကိၪ့ ဆၧၥ့ၪတၭ, အီၪက့ၪအဆၧၥ့ၪယၫလၧဆၧဘၪဆဲၫ့လၧ",
			"26": "<sup>26</sup> ၦဂီၩ့ဖိၪး- လၧအဒုၭအီၪဂုးအီၪခၧၫ့အခ့ၫအၡၩ အဆၧ ချဲၩ့တၭ,မိမၩလၧၫ့ထၪ့ဎွ့ၩထၪ့အၥီၫ့အဆၧကိၭး ၦလၧ အစံၭဆၧလၧယရုစလံၫ့အဂဲး, ၦၡၩမိအီၪလၧနဖၧၩ့း ဒဲလၧယုဒၫအဒိၩ့လဖၪအဂဲးနီၪ, ၦၡၩမိမၩကဲၪထၪ့ ထဲၩ့ဝ့ၫတၭ,အလးလၩ့ဎီးနီၪယမိမၩထၪ့ထဲၩ့ဝ့ၫလီၫ.",
			"27": "<sup>27</sup> ၦလၧအစံၭ, ဆၧယိၬဖၧၩ့နီၪလၩ့ၥံၭခွံၬဆံၭး တၭယမိ",
			"28": "<sup>28</sup> မၩလၩ့ၥံၭခွံၬနၥံၪအထံၫမိၡါနီၪလီၫ.- လၧအစံၭဆၧ လၧစဲရၧၭအဂဲး, မွဲယၡၩယူၬၥိၪတၭ, မိမၩဝ့ၫကယဲ ဆၧဘၪယၥၭတၭး စံၭဆၧလၧယရုစလံၫ့အဂဲးနီၪ,နမိ ဘၪဆၧဒုၭကဲၪထၪ့နၧၩတၭးလၧဆၧလုအဂံၪ့အဂဲးနီၪ, နခၪ့ထံၭလဖၪမိဘၪဆၧအီၪက့ၪလၩ့ဝ့ၫလီၫ."
		},
		"45": {
			"1": "<sup>1</sup> ယဟိဝၩစံၭအၡၩဒိၭဂုၪအၥၭ, စစဲရၧၭနီၪဘဲၫယီၩ, ယဖီၪ့ထၬဝ့ၫလၧအစူၪထွ့ၪဘဲၫၥိၭ အမိယဲးလၩ့ထဲးၦ ဆၨၩလဖၪလၧအမ့ၬယၫတၭ, ယကွဲၪလၩ့စဎွၩလဖၪ အခၧၩ့ယးနီၪ, ဒဲဝဲထၪ့တရၫ့အီၪနံၫဘံၪ့လၧအမ့ၬယၫ",
			"2": "<sup>2</sup> တၭ,တရၫ့လဖၪကၭဘံၭထၬလၧၩ့အၥၭအ့ၬ.- ယမိ လ့ၩလၧနမ့ၬယၫတၭ, မၩဎၩ့ဆၧထၪ့စီၩ့လၩ့အိၪ့း ယ မိမၩခါတရၫ့ထီးလဖၪ, ဒဲဒၪ့ထ့ၬအနိၪဘီၩ့ထၭလကုၭ",
			"3": "<sup>3</sup> လကုၭလီၫ.- ဆၧလူဒိၪဎွ့ၩဒိၪလၧဆၧခံၭကျၩ,ဒဲဆၧ အစူၪလးခၪ့ခိၪအီၪဘံၭအၥၭ လၧအလးအီၪၥူၪလဖၪ နီၪ,ယမိဖ့ၪလၫ့နၧၩဘဲၫၥိၭနမိၥ့ၪယၫလၧယၧၩ, ၦလၧ အကိၭထၪ့နၧၩလၧနမံၩ့, မွဲယဟိဝၩၦအံၫစရ့လၭအ",
			"4": "<sup>4</sup> ယွၩလီၫ.- လၧယခ့ၫယၡၩစယၫကူၭအဂး,ဒဲၦလၧယ ရွံန့ဝ့ၫအံၫစရ့လၭအဂးယကိၭယူၭနၧၩလၧနမံၩ့, ယ ကိၭယူၭလါနၫ့နၧၩ လၧနမံၩ့ၥၫ့တၭ, နလၥ့ၪယၫဘၪ",
			"5": "<sup>5</sup> ယၧၩလီၫ.- ယဝ့ၫဒၪယီၩယမွဲယဟိဝၩတၭ,အဂူၫဂၩ အီၪနးဂၩအ့ၬ. အ့ၪလမွဲဘၪယၧၩတၭ, ယွၩအီၪအ့ၬ. ယခဲးထူၬယူၭနယးဒံၩ့ လါနၫ့တၭ, နၥ့ၪယၫယၧၩ",
			"6": "<sup>6</sup> အ့ၬ.- ဘဲၫၥိၭၦၡၩမိၥ့ၪယၫ လၧမုထၪ့ဖိးလၧမုနုၬနီၪ အ့ၪလမွဲဘၪယၧၩတၭ, အီၪနးဂၩအ့ၬ. ယမွဲယဟိဝၩ",
			"7": "<sup>7</sup> တၭ,အဂူၫဂၩအီၪနးစီၪ့အ့ၬ.- ယတဲၩ့ဆၧဖၩ့ယီၩ တၭ,ယမၩဆၧခံၭ, ယဒုၭအီၪထၪ့ ဆၧဘၪလိၬအိၭ လိၬတၭ,ယတဲၩ့ဆၧအၧၩ့လီၫ. ယဝ့ၫဒၪ ယဟိဝၩ",
			"8": "<sup>8</sup> ယီၩယမၩဆၧလဖၪနီၪထီးအလူၬလီၫ.- မူၭခိၪဧ့,ဒုၭ လၩ့ဆၩ့ဆၧလၧထၭနီၪဆံၭ. မွဲဆၧအုၪ့ဆၧၩ့လၩ့ဆၧ တီၩဆၧလီၩ့ဆံၭ. မွဲဂၪ့ခိၪအိၭထၪ့တၭ, မွဲအဒုၭအီၪ ထၪ့ဆၧထိးထဲၩ့တၩ့ထဲၩ့ ဒဲဆၧတီၩဆၧလီၩ့မဲၪထၪ့,မွဲ အဒုၭမဲၪထၪ့ဆၧလစီၪ့ဎးဆံၭ. ယဝ့ၫဒၪ ယဟိဝၩ ယီၩတဲၩ့လၩ့ယူၭဝ့ၫယူၭ.",
			"9": "<sup>9</sup> ၦၡၩလၧအဂဲးလိၬတ့ၭလိၬ လၧၦလဂၩလၧအတဲၩ့ လၩ့ဝ့ၫနီၪဘၪအၡၪ့လီၫ. မွဲဖၧၩ့အကဲၩ့လၧဖၧၩ့ဂၪ့ခိၪ အကဲၩ့အကျၩလီၫ. ကဖံၬမိစံၭၦလၧအကၧၩ့ဝ့ၫနီၪ,မွဲ နကၧၩ့နီၫလဲၪနီၪဆ့ဧၪ. ဆၧလၧနတဲၩ့နီၪမိစံၭ, နစူၪ",
			"10": "<sup>10</sup> လအီၪဘၪနီၪဆ့ဧၪ.- ၦလၧအစံၭအဖါ, မွဲနထၪ့ဖိၪ နီၪလဲၪးဒဲအမိ, နအီၪဖျဲၪန့နီၫလဲၪနီၪ, မွဲအဘၪအၡၪ့ လီၫ.",
			"11": "<sup>11</sup> ယဟိဝၩအံၫစရ့လၭအ ဆၧဆံၫ့ဎံၪလဂၩ, ဒဲဆၧ တဲၩ့လၩ့အဝ့ၫနီၪ, စံၭဘဲၫယီၩ,ဆၧလၧအမိမၩအၥၭ အဂဲးအကၠီၪ့နီၪအၪ့စၪ့ယၧၩဘီၪး ဒဲယဖိၪလဖၪဒဲဆၧ မၩလၧယစူၪအဂဲးအကၠီၪ့နီၪ, မွဲအအီၪဒၪဝ့ၫလၧယ",
			"12": "<sup>12</sup> စူၪဖၧၩ့ဆံၭ.- ယတဲၩ့လၩ့ဂၪ့ခိၪ ဒဲဒုၭကဲၪထၪ့ ၦၡၩ အီၪလၧအဖၫ့ခိၪနီၪဆ့လီၫ. ယဝ့ၫဒၪယစူၪပၠၪထၪ့မူၭ ခိၪတၭ,အၥုၭမုခမျၧးထီးအလူၬနီၪ ယအီၪက့ၪလၧအ",
			"13": "<sup>13</sup> လးလီၫ.- ယဝ့ၫဒၪယဒုၭအီၪထၪ့အဝ့ၫလၧဆၧတီၩ ဆၧလီၩ့တၭ, ယမိမၩလီၩ့အဖၧၩ့ၥၭထီးအလူၬလီၫ. အဝ့ၫဒၪမိမၩကဲၪထၪ့ထဲၩ့ယဒိၩ့လဖျိၪ့, အဝ့ၫဒၪမိမၩ ဂၭဖျ့ၭယၡၩလၧဆၧအၪ့မၧၫ့ဎီးဝ့ၫလဖၪနီၪ, လၧဆၧ အဎွ့ၩအဂး, လၧဆၧအလံၩ့အလဲၫအဂး လမွဲဘၪး ဆၧၥုၭမုခမျၧးအယဟိဝၩစံၭဝ့ၫဒၪ.",
			"14": "<sup>14</sup> ယဟိဝၩစံၭဝ့ၫဘဲၫယီၩ, အံဇံၭအမၩဆၧဖံၭဆၧ, ဒဲကုၡၫ, ဒဲၦစဘံအၫ့ဖိၪလၧအမိၡါဒိၪလဖၪ လၧအန့ ဆၧနီၪမိဂဲၫလၧနအီၪတၭ, မိကဲၪထၪ့နဆၧလီၫ. အဝ့ၫ ၥံၪမိဖိၬနခဲၫ့တၭ, လၧၥွ့ၫထၭအဖၧၩ့နီၪအဝ့ၫၥံၪဂဲၫထီၩ့ နီၪ,မိဘိၪ့ထၪ့ဘၩထၪ့နၧၩ, မိဘၩဆိၪဖၪနၧၩတၭ, စံၭ, ယွၩအီၪလၧနဖၧၩ့တၭ, ယွၩအဂူၫဂၩအီၪနးဂၩအ့ၬ.",
			"15": "<sup>15</sup> မွဲမၬ,နမွဲယွၩလဂၩလၧအအီၪက့ၪၥူၪနၥၭ, ၦထိးထဲၩ့",
			"16": "<sup>16</sup> တၩ့ထဲၩ့ဆၧ, အံၫစရ့လၭအယွၩဧ့.- အဝ့ၫၥံၪအမ့ၬ မိမဲတၭ, မိအီၪက့ၪမဲအမ့ၬထီးအလူၬတၭး ၦလၧအ တဲၩ့ဆၧဂၩ့လဖၪနီၪ မိဘၪဆၧဂၭဂီၩ့ဘံၪဘူၪဝ့ၫလစီၪ့ ဎးလီၫ.",
			"17": "<sup>17</sup> အံၫစရ့လၭမိထီၩ့လၧဆၧထိးထဲၩ့တၩ့ထဲၩ့ဝ့ၫအ ဆိၩအကၠၪ လၧယဟိဝၩအဖၧၩ့လီၫ. နၥံၪအမ့ၬလမဲ ဘၪတၭ,နၥံၪလအီၪက့ၪမဲဘၪနၥံၪအမ့ၬ အဆိၩဆိၩ",
			"18": "<sup>18</sup> အကၠၪကၠၪနီၪလီၫ.- အဂဲးဘဲၫယီၩယဟိဝၩလၧအတဲၩ့ လၩ့မူၭခိၪ,စံၭဘဲၫယီၩ, ယွၩအနၫ့ဆါဒၪဝ့ၫလၧအတဲၩ့ လၩ့ဂၪ့ခိၪဒဲမၩဝ့ၫ, အဝ့ၫဒၪဒုၭအီၪခၧၫ့ဝ့ၫ, အဝ့ၫဒၪ တဲၩ့လၩ့ဝ့ၫမွဲဘဲၫၥိၭ အမိအီၪပျီၩအ့ၬ. မွဲဘဲၫၥိၭ မိ အီၪလၧၦမိအီၪလၧအဖၫ့ခိၪအဂးလီၫ. ယဝ့ၫဒၪယီၩ,",
			"19": "<sup>19</sup> ယမွဲယဟိဝၩတၭ, အဂူၫဂၩအီၪနးဂၩအ့ၬ.- ယချဲၩ့ ၥူၪဆၧလၧဂၪ့ခိၪ ဆၧခံၭအလးဖၧၩ့နီၪမွဲအ့ၬ. မွဲယစံၭ စယၫကူၭအဆၨၩအဆၬ, နၥံၪဝ့ၫယီၩအၪ့ဎၬန့ယၧၩ ဆံၭနီၪ,မွဲအပျီၩပျီၩအ့ၬ. ယဝ့ၫဒၪယီၩယမွဲယဟိဝၩ လၧအချဲၩ့ဆၧတီၩတီၩလီၫ. ယဒုၭနဲၪဆၧလၧအတီၩ အလီၩ့လီၫ.",
			"20": "<sup>20</sup> အီၪကိၩ့အီၪကီၪ့နၥံၪဝ့ၫတၭ, ဂဲၫထဲၩ့ဆံၭ. ၥုၭဘူၭ နၥံၪအၥၭစီၪ့ဎး, ၦလၧအဖီၩ့ဖျ့ၭလၧၦဆၨၩလဖၪအ ကျၩၥံၪဧ့, ၦလၧအဆိၬထၪ့ၥံၪ့အဆၧဂၩ့စိၭဖျၩအၥၭ နီၪဒဲဘၩဆိၪဖၪယွၩလဂၩ လၧအထိးထဲၩ့တၩ့ထဲၩ့ ဆၧလၥ့ၪဘၪလဖၪနီၪ ၦၡၩလဖၪနီၪၥ့ၪယၫဆၧနးမံၩ့",
			"21": "<sup>21</sup> အ့ၬ.- ဒုၭနဲၪဆၧ ဒဲဒုၭဂဲၫဘူၭဝ့ၫတၭး မွဲမၬ, အကိၪ့ လိၬအၥၭဆံၭ. မွဲပလၫဒုၭနါဂၧၫ့ဆၧနီၪ လၧဖျိၩ့လံၩ လံၩလဂၩလဲၪး မွဲပလၫဒုၭနဲၪဝ့ၫ လၧအၥၫ့နီၪလဂၩ လဲၪ.ယဝ့ၫဒၪယဟိဝၩမွဲအ့ၬဧၪ. တၭအ့ၪလမွဲဘၪ ယၧၩယွၩအီၪဝ့ၫနးဂၩအ့ၬ. ယွၩအတီၩအလီၩ့ၦထိး ထဲၩ့တၩ့ထဲၩ့ဆၧး အ့ၪလမွဲဘၪယၧၩအီၪနးဂၩအ့ၬ.",
			"22": "<sup>22</sup> ဂၪ့ခိၪထုၬ ၦထီးအလူၬၥံၪဧ့, ဘဲၫၥိၭနၥံၪမိန့ဘၪဆၧ ထိးထဲၩ့တၩ့ထဲၩ့နီၪ, ယိထၪ့ယၧၩဆံၭ. အဂဲးဘဲၫယီၩ",
			"23": "<sup>23</sup> ယမွဲယွၩတၭ,အဂူၫဂၩအီၪနးဂၩအ့ၬ.- ယဆိၪလၩ့ယ ၥၭလၧယနၫ့ဆါဒၪယဝ့ၫ, ဆၧချဲၩ့နီၪထၪ့ဖျ့ၭယူၭလၧ ယနိၭလၧဆၧတီၩဆၧလီၩ့ အဖၧၩ့ယူၭး တၭလမိဂဲၫ ထဲၩ့ထဲၩ့ဘၪနီၪမွဲဘဲၫယီၩ, ကယဲၦၡၩမိဘၪချံၭလၩ့အ ခၪ့လုးခိၪလၧယမ့ၬယၫး ကယဲၦၡၩအဖျ့ၩ မိဆိၪလၩ့",
			"24": "<sup>24</sup> အၥၭလၧယမ့ၬယၫလီၫ.- ၦလဂၩဂၩမိစံၭတၡါ, န့ၫ လၧယဟိဝၩအဖၧၩ့ ယအီၪလၧဆၧတီၩဆၧလီၩ့, ဒဲ ဆၧအဂဲးအဘၭလီၫ. ၦၡၩမိဂဲၫလၧအအီၪတၭ, က ယဲၦလၧအၥၭထၪ့ထၫ့ဒၩအဝ့ၫနီၪ အမ့ၬမိမဲထီးအလူၬ",
			"25": "<sup>25</sup> လီၫ.- ကယဲၦအံၫစရ့လၭအချံၫအၥၪ ထီးအလူၬနီၪ, ဆၧမိအီၪက့ၪတီၩအီၪက့ၪလီၩ့ဝ့ၫလၧ ယဟိဝၩအဖၧၩ့ ဒဲမိအီၪက့ၪဖိၫလိၫအၥၭလၧအဖၧၩ့လီၫ."
		},
		"46": {
			"1": "<sup>1</sup> ဘၫအလၭခိၬလၩ့, နံဘိၫကူၭလၩ့အၥၭ,အဆၧဂၩ့ ဆၧဖၪ့ၥံၪနီၪ ဘၪဆၧအီၪက့ၪဝ့ၫလၧဆၧဖိၪဆၧဎါအ လီၩ့,ဒဲဆၧဖိၪဆၧဎါ အဒိၩ့အလီၩ့လီၫ. နၥံၪအဆၧ အွံၪဆၧယိၭတဲၩ့ဝဲၩယူၭ, ဆၧဖဒၨၭလၧဆၧဖိၪဆၧဎါ",
			"2": "<sup>2</sup> လၧဆၧပွံၭအၥၭအဂးလီၫ.- အဝ့ၫၥံၪၡီၫ့လၩ့ကူၭလၩ့ အၥၭ,ခိၬလၩ့ဝ့ၫလစီၪ့ဎးတၭ, မၩဖီၩ့ဖျ့ၭဆၧဖဒၨၭၥ့ၪ အ့ၬ.အဝ့ၫၥံၪအနၫ့ဆါဒၪဝ့ၫ လ့ၩလၧဆၧအၪ့မၧၫ့ကဲၪ ဎီးအဖၧၩ့လီၫ.",
			"3": "<sup>3</sup> ခိၭနၪယလူစယၫကူၭအဂံၪ့ဖိၪ, ဒဲကယဲၦလၧအအီၪ လၩ့ထးလၧအံၫစရ့လၭအဂံၪ့ဖိၪထီးအလူၬ,ၦလၧယ ဆိၬဝ့ၫ လၧဆၧဂူၭဖိၫ့ဖၧၩ့ လံၩလံၩ ခီးဘိၩ့နဲၪ့ယီၩ, လၧအဘၪဆၧဆိၬဝ့ၫ လၧအမိအဒၧၩ့လးဖၧၩ့လံၩလံၩ",
			"4": "<sup>4</sup> ခီးဘိၩ့နဲၪ့ယီၩ,ၥံၪဧ့,- ယမွဲအဝ့ၫဒၪထီၩ့လၩ့လၧၦၥၭ ၡါတၭ,ယမိဆိၬနၥံၪထီးနၥံၪအခိၪဘွၩလီၫ. ယဝ့ၫဒၪ ယမၩယူၭတၭ, ယဝ့ၫဒၪယမိဆိၬဆၧတၭ, ယဝ့ၫဒၪ ယမိအွံၪဆၧယိၭဆၧတၭ, ယမိမၩဖီၩ့ဖျ့ၭဆၧလီၫ.",
			"5": "<sup>5</sup> နၥံၪမိဒီၩ့လၩ့ယၧၩတၭ, အီၪက့ၪမီၪ့ဎီၩ့ယၧၩ, ဒဲယိဎီၩ့ ယၧၩဘဲၫၥိၭပမိလၩ့ဂၬလိၬပၥၭ လၧပလၫလဂၩလဲၪ.",
			"6": "<sup>6</sup> ၦလၧအလလီၫ့ကီၩ့ဘၪဆၧနီၪ ထုၭထၪ့ထီၫ့လၧထိၪ့ ဖၧၩ့အၪအၪလ့ၬတၭ, ခံၫ့စ့ၩလၧခံၫ့ဖၧၩ့, အၪ့လံၩ့ၦနဲၫ့ ထီၫ့တၭ,အဝ့ၫဒၪတဲၩ့ယွၩ လၧအဝ့ၫလီၫ. အဝ့ၫၥံၪ",
			"7": "<sup>7</sup> ထွံၩလၩ့ဝ့ၫ,မွဲမၬ, ဘိၪ့ထၪ့ဘၩထၪ့ဝ့ၫလီၫ.- အဝ့ၫ ၥံၪယိၭဝ့ၫလၧအခိၬထံၭခိၪတၭ,ဆိၬဝ့ၫတၭ, အီၪက့ၪ ဝ့ၫလၧအလးဒၪဝ့ၫတၭ, အဆၧၫ့ထုၪ့ထီးနီၪလီၫ. ၥုၭ အၥၭလၧအလးအ့ၬ, မွဲမၬ, ၦမိကိၭထၪ့လါနၫ့လၧအ အီၪနီၪ, စံၭဆၧၫ့ဆၧၥ့ၪအ့ၬး တၭထိးထဲၩ့တၩ့ထဲၩ့ဝ့ၫ လၧအဆၧခိဆၧဝီၩအဖၧၩ့နီၪၥ့ၪဆ့အ့ၬ.",
			"8": "<sup>8</sup> နၪ့ထၪ့ထဲၩ့ဆၧနီၪတၭ, ဒုၭနဲၪနၥံၪအၥၭ လၧနၥံၪ မွဲၦၡၩဆံၭ. ၦမၩမၪဆၧဖိၪၥံၪဧ့, ထီးန့လၧနၥံၪအၥၭ",
			"9": "<sup>9</sup> ဆံၭ.- နၪ့ထၪ့ထဲၩ့ဆၧလၧအခၪ့ထံၭ လၧဖျိၩ့နီၪဆံၭ. အဂဲးဘဲၫယီၩယမွဲယွၩတၭ, အဂူၫဂၩအီၪနးဂၩအ့ၬ.",
			"10": "<sup>10</sup> ယမွဲယွၩတၭ, ဆၧလၩ့ဂၬယၧၩအီၪအ့ၬ.- ခီၫလၧဖျိၩ့ နီၪယဒုၭနဲၪဆၧလၧအခၪ့ထံၭထီးအထုၬ, ဆၧလၧအ လမၩဒံၭဘၪအၥၭတၭ, ယစံၭ, ဆၧလၧယကၩ့ကၩ ဝဲၩနီၪမိအီၪခၧၫ့ဝ့ၫတၭ, ကယဲဆၧဘၪယၥၭနီၪ ယမိ",
			"11": "<sup>11</sup> မၩထီးအလူၬလီၫ.- ယကိၭထိၪဖၭဒိၪလဘံၪ့လၧမု ထၪ့လခီၫ, ဒဲၦလၧအမၩယကိၪ့ထၪ့ဆၧလဂၩနီၪလၧ ထံၫယဲၩ့ခးယဲၩ့လီၫ. ယချဲၩ့ယူၭ, မွဲမၬ, ယမိမၩအီၪ",
			"12": "<sup>12</sup> ထၪ့ယကၩ့ကၩဆၧ, မွဲမၬ, ယမိဒုၭမၩအၥၭလီၫ.- ၦ လၧအၥၭကၪ လၧအအီၪယဲၩ့လၧဆၧတီၩဆၧလီၩ့ၥံၪ",
			"13": "<sup>13</sup> ဧ့,ခိၭနၪယလူဆံၭ.- ယဆၧတီၩဆၧလီၩ့နီၪ ယမိဒုၭ ဂဲၫဘူၭဝ့ၫတၭး အီၪဘၪလၧအယဲၩ့အ့ၬး တၭယဆၧ ထိးထဲၩ့တၩ့ထဲၩ့နီၪ ၥုၭနံၩၥုၭၥၫ့အ့ၬ. တၭယမိအီၪ က့ၪလၩ့ယဆၧထိးထဲၩ့တၩ့ထဲၩ့ လၧဇံအိၫ့အဖၧၩ့လၧ အံၫစရ့လၭအဂးယဆၧလၩဖၩ့လီၫ."
		},
		"47": {
			"1": "<sup>1</sup> ဘၭဘလၧၫ့အဖိၪမုၪနၩ့ဧ့, စဲၪ့လၩ့ဆၧၫ့နၩ့လၧဂၪ့ ခိၪမုၬအကျၩဆံၭ. ခၫလဒံအၫဖိၪမုၪဧ့, လးဆီၩ့ဆီလ အီၪဘၪတၭ, ဆၧၫ့နၩ့လၧဂၪ့ခိၪလီၩ့ဆံၭ. အဂဲးဘဲၫ ယီၩနမွဲၦအဆါ, ဒဲၦအမုၬလၩဆၧဂ့ၩဂ့ၩနီၪ, လၧခဲၫ့",
			"2": "<sup>2</sup> ထဲၩ့ၦကိၭဘၪလၧၩ့နၧၩအ့ၬ.- မၩန့ဆုၪ့ဂူၬလိးတၭ, ကၠံၭဆၧအမုၬဆံၭ, ပဲၩထၪ့နဆၧချႃၬဘံၭမ့ၬဆံၭ, ဘျူၭ လၩ့ခွံၬနဆဲၫ့ဖၭထီၫဆံၭ, ထုၭထၪ့နဆၧကံၪဖျၪ့တၭ, နဲၪဖျီၪထၪ့နခၪ့ဒူၪ, ခၫ့ဂၬလၧထံၫချိၬ လၧနခၪ့ဆံၭ.",
			"3": "<sup>3</sup> နဆၧအီၪဘိၪ့နီၪ, မွဲမၬ,နဆၧမ့ၬမဲအလးမိအီၪဖျီၪလီၫ. ယမိမၩဆၧၫ့ဆၧအၧၩ့တၭ, ယထၧၫ့ထံၩထၧၫ့ၥိၭလၧ ၦၡၩနးဂၩအ့ၬ.",
			"4": "<sup>4</sup> ဆၧဎွ့ၩန့ထဲၩ့ပၧၩ, အံၫစရ့လၭအဆၧဆံၫ့ဎံၪလ ဂၩနီၪးအမံၩ့မွဲဆၧၥုၭမုခမျၧးအယဟိဝၩလီၫ.",
			"5": "<sup>5</sup> ဆၧၫ့နၩ့အီၪလၩ့မါပံၭတၭ, လ့ၩနုၬလၧဆၧခံၭကျၩ ခၫလဒံအၫအဖိၪမုၪဧ့, အဂဲးဘဲၫယီၩလၧခဲၫ့ထဲၩ့ၦကိၭ",
			"6": "<sup>6</sup> ဘၪလၧၩ့နၧၩလၧၦဆၨၩလဖၪအကဆါမုၪအ့ၬ.- ယ ၥၭထၪ့ဘၪယူၭယၡၩခမျၧး, ယမၩဘၪၥၭလိၪယူၭယ ဆၧန့ၥၫတၭ, ယဖ့ၪလၫ့အဝ့ၫလၧနစူၪဖၧၩ့လီၫ. တၭ နယၫ့ၥၭဝ့ၫအ့ၬ. လၧၦၥၭၡါအလီၩ့ဒၪလ့ၬ နအီၪက့ၪ",
			"7": "<sup>7</sup> နနိၪယိၭဘီၩ့ ဎၧၫ့ဎၧၫ့လ့ၬလီၫ.- တၭနစံၭ, ယမိကဲၪ ကဆါမုၪလၩ့ဆိၩလၩ့ကၠၪလီၫ. ဆၧလဖၪနီၪနထီးန့ လၧနၥၭအ့ၬ. တၭနနၪ့ထၪ့ထဲၩ့ ဆၧလၧအခဲၫ့ထုၬနီၪ",
			"8": "<sup>8</sup> ဆ့အ့ၬ.- တၭဘိၩ့နဲၪ့ယီၩခိၭနၪဆၧယီၩဘီၪ, ဆၧအဲၪ လဲးအဲၪဘျၪမုၬမုၬနဝ့ၫဧ့, ၦလၧအဆၧၫ့နၩ့ဒိၭနဲၩ့အၥၭ လၧနၥၭခံဖၧၩ့ဒၪနဝ့ၫတၭ, စံၭ, ယအီၪယဝ့ၫတၭ,အ့ၪ လမွဲဘၪယၧၩ, အဂူၫဂၩအီၪနးဂၩအ့ၬ. ယမိအီၪမဲၫ ဘၪနးဖၧၫ့အ့ၬ. ယဖိၪလၩ့မါနီၪ ယမိၥ့ၪယၫဆ့အ့ၬ.",
			"9": "<sup>9</sup> အ့ၪမွဲဆၧနံၫမံၩ့ယီၩမိဘၪနၧၩချဲၫ့မၬ, လၧမုလနံၩဎး, နဖိၪလဖၪမိလၩ့မါဒဲနမိဘၪဆၧမုၪမဲၫနီၪး လၧၫ့ဝ့ၫဎွ့ၩ ဝ့ၫတၭ, မိဘၪနၧၩလၧနမၩကဒၩၦမ့ၬလၧနမၩဆၧအူၪ",
			"10": "<sup>10</sup> ဆၧပီၩအအၪအဆီၪ့အကၠီၩ့လီၫ.- တၭနဒိၭနဲၩ့နၥၭ လၧနဆၧအၧၩ့,နစံၭ, ဆၧအမ့ၬလဒၪဘၪယၧၩနီၪလီၫ. နဆၧကိၪ့ၥ့ၪ ဒဲနဆၧၥ့ၪယၫနီၪ အၪ့လွ့ၫကဒံၩ အၪ့လွ့ၫ ကဒၩနၧၩတၭ, နစံၭလၧနၥၭခံဖၧၩ့, ယဝ့ၫဒၪယီၩယ အီၪတၭ,အ့ၪလမွဲဘၪယၧၩ, အဂူၫဂၩအီၪနးဂၩအ့ၬ.",
			"11": "<sup>11</sup> မၩအၥၭဘဲၫနီၪတၭ,ဆၧအၧၩ့မိလၩ့ဘၪနၧၩတၭ, အ လးခဲၫ့နီၪနၥ့ၪယၫမုဂိးထၪ့အ့ၬ. ဆၧမၩဂၭဂီၩ့လၧနၥုၭ ခွံၬလၥ့ၪဘၪမိလၩ့ဘၪနၧၩတၭ, ဆၧမၩယူလၧနလၥ့ၪ",
			"12": "<sup>12</sup> ယၫဘၪမိလၩ့ဘၪၡုၭနၧၩလီၫ.- ဆၧၫ့ထုၪ့လါ, အီၪ လၧနဆၧအူၪဆၧပီၩ, ဒဲနမၩကဒၩၦမ့ၬအအၪ, လၧန မၩခီၫလၧနၥၭဘၪ့နီၪဆံၭ. ဘၪလဘၪနမိဘၪခိးဘၪ",
			"13": "<sup>13</sup> တၩလၧအကၠီၩ့တၭ, ဘၪလဘၪနမိနၧၩ့ဆၧလီၫ.- ဆၧ ပွံၭနၥၭ လၧနၡၩကိၪ့လိၬအၥၭ အၪဂၩအကၠီၩ့လီၫ. ၦအၪ့နၩ့ဖၭ မူၭခိၪအဆၧၫ့, ၦယိထံၫၡၪၥံၪ ဖီၫၥံၪ, ၦ လၧအဒုၭၥ့ၪယၫ လၩၥံၫအထီ, ဆၧလၧအမိဂဲၫဘၪ နၧၩလဖၪနီၪ, မွဲအဆၧၫ့ထုၪ့လါတၭ,ထိးထဲၩ့တၩ့ထဲၩ့",
			"14": "<sup>14</sup> နၧၩဆံၭ.- ယိခွါ, အဝ့ၫၥံၪမၩအၥၭဘဲၫလီထိၭနၫလၩ့ ဘျ့ၭအၥိၭနီၪ, မ့ၪမိအၪ့ခွံၬဝ့ၫတၭ, အဝ့ၫၥံၪမၩဖီၩ့မၩ ဖျ့ၭအနၫ့ဆါဒၪဝ့ၫ လၧမ့ၪလၪၥ့ၪအ့ၬ. မွဲမ့ၪအၧၩ့ဖၭ လၧၦမိၥၪဎဲၫ့ကိၪ လၧအဝ့ၫအီၪအ့ၬ. မွဲမ့ၪလၧၦမိဆူၭ",
			"15": "<sup>15</sup> ဆူၭမ့ၪလၧအမ့ၬယၫအီၪဆ့အ့ၬ.- ၦလၧနမၩဆၧလၧ အၥိၭလဖၪ, နၡၩဖနံၬဖိၪၥံၪခီၫ လၧနၥၭဘၪ့နီၪမိမၩ အၥၭဘဲၫနီၪလီၫ. အဝ့ၫၥံၪမိစဲၪ့ဖျိၭဆၧလဂၩလၧအ ဖၧၩ့ၥၭဒၪဝ့ၫတၭ, ဆၧထိးထဲၩ့တၩ့ထဲၩ့နၧၩအီၪနးဂၩ အ့ၬ."
		},
		"48": {
			"1": "<sup>1</sup> ခိၭနၪဆၧယီၩ, စယၫကူၭအၡၩဂံၪ့ဖိၪၥံၪဧ့, ၦလၧ ဆၧကိၭဝ့ၫလၧအံၫစရ့လၭအမံၩ့တၭ, ဂဲၫထၪ့ဝ့ၫလၧ ယုဒၫအထံၫထၪ့ဖျိၭ, ၦလၧအဆိၪလၩ့အၥၭလၧယဟိ ဝၩအမံၩ့လၧ အဒုၭနၪ့ထၪ့ထဲၩ့အံၫစရ့လၭအယွၩနီၪ, မွဲလါနၫ့ဘိၩ မွဲလၧဆၧမွဲဆၧတီၩအ့ၬ, မွဲလၧဆၧတီၩ",
			"2": "<sup>2</sup> ဆၧလီၩ့ဆ့အ့ၬ.- အဂဲးဘဲၫယီၩစံၭလၩ့အၥၭလၧအ ဘၪဆဲၫ့လၧဒိၩ့ဆံၫ့ဎံၪတၭ, ဒိၭနဲၩ့အၥၭလၧအံၫစရ့လၭ အယွၩ, ဆၧၥုၭမုခမျၧးအယဟိဝၩမွဲအမံၩ့လီၫ.",
			"3": "<sup>3</sup> ဆၧအခၪ့ထံၭလဖၪနီၪ ယဒုၭနဲၪလၧဖျိၩ့, ထၪ့ဖျ့ၭဝ့ၫ လၧယနိၭတၭ, ယဒုၭနဲၪဝ့ၫး ယမၩယဝ့ၫချဲၫ့မၬတၭ,",
			"4": "<sup>4</sup> ဆၧကဲၪထၪ့ဝ့ၫဒၪလီၫ.- အဂဲးဘဲၫယီၩယၥ့ၪယၫလၧ နၥၭကၪတၭ, နခိၬမွဲထၭဘီၩ့တၭ, နမ့ၬထုးခိၪနီၪမွဲထီး",
			"5": "<sup>5</sup> ဘၩ့လီၫ.- ယဒုၭနဲၪနၧၩလၧအခၪ့ထံၭနီၪ, လၧအလ ချႃၭဂဲၫဒံၭဘၪတၭ, ယဒုၭၥ့ၪယၫနၧၩ, ဘဲၫၥိၭနထီး စံၭ,ဆၧလၧယဆၧဂၩ့မၩဆၧယီၩ, ဒဲယဆၧဂၩ့စိၭဖျၩ အၥၭ,ဒဲယဆၧဂၩ့ၥိၫ့အၥၭ မၪလူၬဝ့ၫနီၪလဂ့ၩလီၫ.",
			"6": "<sup>6</sup> နနါဂၧၫ့ယူၭ, ယိဆၧယီၩထီးအလူၬဆံၭ. တၭနၥံၪမိ ဒုၭနါဂၧၫ့အ့ၬဧၪ. တၭဆၧအၥၫ့, ဆၧလၧအအီၪၥူၪ လၧနလၥ့ၪယၫဘၪလဖၪ, ယဒုၭနါဂၧၫ့လၧနၧၩလီၫ.",
			"7": "<sup>7</sup> ဆၧလဖၪနီၪတဲၩ့လၩ့အၥၭဘိၩ့နဲၪ့ယီၩ မွဲလၧဖျိၩ့အ့ၬ. မုလနံၩယီၩ လချႃၭဘၪဒံၭဘၪတၭ, နနါဂၧၫ့ဘၪဝ့ၫ အ့ၬ,ယိခွါ, ဘဲၫၥိၭနထီးစံၭ,ယၥ့ၪယၫဝ့ၫနီၪလဂ့ၩ.",
			"8": "<sup>8</sup> မွဲမၬ,နနါဂၧၫ့အ့ၬ, မွဲမၬ, နၥ့ၪယၫဝ့ၫအ့ၬး မွဲမၬ, ခီၫ လၧအခၪ့ထံၭနီၪနနါအိၭထၪ့အၥၭအ့ၬ. အဂဲးဘဲၫယီၩ ယၥ့ၪယၫလၧနမိမၩအၪ့လီၫဆၧနၭနၭလ့ၬတၭ, ခီၫလၧ ဆၧဒၧၩ့လးအဖၧၩ့နီၪနဘၪဆၧကိၭနၧၩ လၧၦလၧအ မၩမၪဆၧလီၫ.",
			"9": "<sup>9</sup> လၧယမံၩ့ဒၪယဝ့ၫအကၠီၩ့နီၪ ယမိၥုၭယဲၩ့ယဆၧ ၥၭထၪ့တၭ, လၧယဆၧစံၭထၪ့အၪ့အူၭအကၠီၩ့နီၪ ယမိ ပဒၩ့ဆၧလၧနကၠီၩ့ ဘဲၫၥိၭယထီးဒၪ့ထ့ၬခွံၬနၧၩလဂ့ၩ",
			"10": "<sup>10</sup> လီၫ.- ယိခွါ,ယအၪ့ကဲၪ့ယူၭနၧၩလါနၫ့တၭ, မွဲဘဲၫ ကျိၪၥံၪစ့ၩၥံၪအၥိၭအ့ၬး ယမၩခွါယူၭနၧၩလၧဆၧၡၪ့",
			"11": "<sup>11</sup> ဆၧနၭအမ့ၪဖၭဒိၪအဖၧၩ့ယူၭ.- လၧယဂးဒၪယဝ့ၫ, လၧယဂးဒၪယဝ့ၫဒၪလ့ၬ ယမိမၩဝ့ၫလီၫ. အဂဲးဘဲၫ ယီၩယမံၩ့မိဘၪဆၧမၩဘၪၥၭလိၪဝ့ၫဘဲၫၥ့ၪလဲၪ. တၭ ယလၩယဖၩ့နီၪယဖ့ၪလၫ့ၦဂူၫဂၩအ့ၬ.",
			"12": "<sup>12</sup> ခိၭနၪယလူ,စယၫကူၭဧ့, ဒဲအံၫစရ့လၭလၧ ယ ကိၭန့ဝ့ၫ, ယဝ့ၫဒၪယီၩယမွဲအဝ့ၫဒၪလီၫ. ယဝ့ၫဒၪယီၩ ယမွဲဆၧအခၪ့ထံၭတၭ, ယဝ့ၫဒၪယီၩယမွဲဆ့ဆၧအခဲၫ့",
			"13": "<sup>13</sup> ထုၬလီၫ.- ယစူၪအီၪက့ၪလၩ့ဆ့ဂၪ့ခိၪအခၪ့ထံၭတၭ, ယစူၪထွ့ၪနီၪ ထၫမူၭခိၪလီၫ. ယကိၭန့အဝ့ၫၥံၪတၭ,",
			"14": "<sup>14</sup> မွဲအဆၧၫ့ထုၪ့ဝ့ၫလစီၪ့ဎးလီၫ.- နၥံၪဝ့ၫထီးအလူၬၥံၪ ဧ့,အီၪကိၩ့အီၪကီၪ့တၭခိၭနၪဆၧဆံၭ. မွဲပလၫဒုၭနဲၪ ဆၧလဖၪနီၪ လၧအကျၩလဂၩလဲၪ. ယဟိဝၩအဲၪဝ့ၫ, မိမၩဆၧထီးဒၪအၥၭ လၧဘၭဘလၧၫ့အဖၧၩ့တၭ, အ",
			"15": "<sup>15</sup> စူၪဒူၪမိအီၪလၧၦခၫလဒံအၫဖိၪအလီၩ့လီၫ.- ယဝ့ၫဒၪ ယီၩယချဲၩ့ယူၭဆၧယူၭ. မွဲမၬ,ယကိၭန့အဝ့ၫ, ယဒုၭ အီၪထၪ့ဝ့ၫတၭ, မွဲအမိမၩဘီၪထၪ့ယီၫထၪ့အဖၧၩ့ၥၭ လီၫ.",
			"16": "<sup>16</sup> ၥုၭဘူၭနၥံၪအၥၭလၧယအီၪ, ခိၭနၪဆၧယီၩဆံၭ. ခီၫလၧအခၪ့ထံၭယချဲၩ့လၧဆၧအီၪၥူၪအ့ၬ. လၧအအီၪ ထၪ့ၥၫ့နီၪယအီၪထီးနီၪလီၫ. တၭဘိၩ့နဲၪ့ယီၩကဆါ",
			"17": "<sup>17</sup> ယဟိဝၩအၪ့မၧၫ့လၩ့ယၧၩလၧအၥၭလီၫ.- ဆၧဎွ့ၩ န့ထဲၩ့နၧၩ, ယဟိဝၩ, အံၫစရ့လၭအဆၧဆံၫ့ဎံၪလ ဂၩ,စံၭဘဲၫယီၩ, ယဝ့ၫဒၪယီၩယမွဲယဟိဝၩ, နယွၩ လၧအၥီၪ့လိၪနၧၩဘဲၫၥိၭနမိဘၪအခိးအတၩတၭ, ယ ဒုၭဖိၬနၧၩလၧဖၧၩ့ၥၭ လၧနကြၨၭဖိၬလဘီၩ့နီၪလီၫ.",
			"18": "<sup>18</sup> ယဆိၫ့ယူၭလၧနခိၭနၪဝဲၩယူၭ ယဆၧမၪလူၬတၭ,အ့ၪ မွဲဘဲၫနီၪတၭ, နဆၧမုၬဆၧဎၩ့မိမၩအၥၭဘဲၫထံၫမိၡါ အၥိၭ,ဒဲနဆၧတီၩဆၧလီၩ့ ဘဲၫမၫဆမံၭအလပီၩအ",
			"19": "<sup>19</sup> ၥိၭနီၪလီၫ.- နချံၫနၥၪဆ့မိမၩအၥၭဘဲၫမ့ၭအဖျိၪ့အၥိၭ တၭနဆၨၩနဆၬဘဲၫလိးပွ့ၪအၥိၭနီၪတၭး ဆၧဒၪ့ထ့ၬ ခွံၬအမံၩ့အ့ၬ, ဒဲမၩဂၭဂီၩ့ဝ့ၫလၧယမ့ၬယၫဆ့အ့ၬ.",
			"20": "<sup>20</sup> ဂၭထၪ့ခွံၬလၧဘၭဘလၧၫ့အဖၧၩ့, စဲၪ့ထၪ့ခွံၬလၧ ၦခၫလဒံအၫဖိၪအအီၪ, လၧဆၧၥၭထိၬအၥီၫဆံၭ. ဒုၭ နဲၪဒဲဒုၭနါဂၧၫ့ဆၧယီၩဆံၭ. ဒုၭဂၧၫ့ထၪ့ၥၩလၩ့ဆၧ ထီၩ့လၧဂၪ့ခိၪအထုၬဆံၭ.စံၭ, ယဟိဝၩဎွ့ၩန့ထဲၩ့ယူၭ",
			"21": "<sup>21</sup> အခ့ၫအၡၩစယၫကူၭနီၪဆံၭ.- ထီးအဒုၭလ့ၩအဝ့ၫၥံၪ လၧၡါမုနၧၫ့ဖၫနီၪ, ဆၧၥူၫအၥၭလၧထံၫအ့ၬ, အဝ့ၫဒၪ ဒုၭယွၩထၪ့ထံၫလၧလိးဖၧၩ့ လၧအဝ့ၫဒၪအဂး, ဒိၪလိး တၭ,ထံၫဖျိၭထၪ့ဝ့ၫဒၪလီၫ.",
			"22": "<sup>22</sup> ဆၧမုၬဆၧဎၩ့လၧၦလတီၩလလီၩ့ဘၪ အဂးအီၪနး ဆံၭအ့ၬ, ယဟိဝၩစံၭဝ့ၫဒၪ."
		},
		"49": {
			"1": "<sup>1</sup> ခိၭနၪယလူ, ထံၫယဲၩ့ခးယဲၩ့ၥံၪဧ့, ခိၭနၪဆၧဆံၭ. ၦဆၨၩလဖၪ, အီၪလၧအယဲၩ့အယိၬၥံၪဧ့, ယဟိဝၩ ကိၭန့ယၧၩခီၫလၧဆၧအဒၧၩ့လးဖၧၩ့, ခီၫလၧယမိအ ဂူၭဖိၫ့ဖၧၩ့နီၪဖျိၬယမံၩ့လီၫ.",
			"2": "<sup>2</sup> မွဲအအီၪက့ၪယနိၭဘဲၫနၭ, လၧအအဲၪ့ဝ့ၫအၥိၭနီၪ တၭ,ချႃၬဘံၭယၧၩ လၧအစူၪအလၩၡုၪလီၫ. တၭ အီၪက့ၪယၧၩလၧဖျါဖျ့ၫလံၬကံၭလဘီၩ့တၭ, အီၪက့ၪ",
			"3": "<sup>3</sup> ၥူၪယၧၩလၧအလၧၫ့ဖီၩ့ဖၧၩ့လီၫ.- တၭစံၭယၧၩ, နမွဲ ယခ့ၫယၡၩ, အံၫစရ့လၭဧ့, ၦလၧယဒိၭဆၧလၩဖၩ့",
			"4": "<sup>4</sup> လၧအဖၧၩ့လီၫ.- ထီးနီၪလဖၧၫ့ယစံၭယမၩယူၭဆၧ ပျီၩပျီၩယူၭ, လၧဆၧအီၪပျီၩအဂး, လၧဆၧနးမံၩ့ဘၪ အဂးနီၪယလူၬဂဲးလူၬဘၭလီၫ. မွဲလါနၫ့တၭယဆၧ စ့ၩရၫ့အီၪလၧယဟိဝၩတၭ, ယမၩဆၧအီၪလၧယ",
			"5": "<sup>5</sup> ယွၩလီၫ.- တၭဘိၩ့နဲၪ့ယီၩယဟိဝၩ, ၦလၧအအီၪက့ၪ ယၧၩလၧအခ့ၫအၡၩဒၪဝ့ၫအဂး ခီၫလၧဒၧၩ့လးအ ဖၧၩ့ဘဲၫၥိၭယမိဒုၭဂဲၫထဲၩ့ စယၫကူၭလၧအအီၪနီၪစံၭ ဝ့ၫဒၪ,အံၫစရ့လၭအ့ၪလအီၪကိၩ့အီၪကီၪ့ဘၪလါနၫ့ တၭ,ယမိအီၪလၧဆၧလၩဖၩ့ လၧယဟိဝၩအမ့ၬၥၪ",
			"6": "<sup>6</sup> ဖၧၩ့တၭ,ယယွၩမိကဲၪထၪ့ယဂဲးယဘၭလီၫ.- မွဲအစံၭ ဝ့ၫဒၪ, လၧနမိကဲၪထၪ့ယခ့ၫယၡၩဘဲၫၥိၭနမိဒုၭဂဲထုၪ့ ထၪ့စယၫကူၭအဒီၪ့လဖၪတၭ, ဒုၭဂဲၫထဲၩ့ၦလၧအ အီၪဒံၭလၧအံၫစရ့လၭအကျၩနီၪ, မွဲဆၧဆံၭခိၬလီၫ. တၭယမိအီၪက့ၪနၧၩ လၧဆၧဖၩ့လၧၦဆၨၩလဖၪအ ဂး,ဘဲၫၥိၭနမိကဲၪ ယဆၧထိးထဲၩ့တၩ့ထဲၩ့ထီၩ့လၧ",
			"7": "<sup>7</sup> ဂၪ့ခိၪအထုၬနီၪလီၫ.- ယဟိဝၩဆၧဎွ့ၩန့ထဲၩ့အံၫစရ့ လၭအၡၩဆံၫ့ဎံၪလဂၩ,စံၭ, ၦလၧဆၧလအီၪက့ၪ ဘၪအလးလၧၦလဆၨၩၥၭလိၪဝ့ၫ, ၦဒိၪလဖၪအခ့ၫ အၡၩဘဲၫယီၩ, စဎွၩလဖၪမိဒၪဘၪဒဲဂဲထုၪ့ဝ့ၫတၭ,ၦ ဒိၪဖၭဒိၪလဖၪ မိထွံၩလၩ့လၧယဟိဝၩအလူတီၩလ ဂၩအကၠီၩ့, အံၫစရ့လၭအၡၩဆံၫ့ဎံၪလဂၩလၧအ ရွံန့နၧၩလီၫ.",
			"8": "<sup>8</sup> ယဟိဝၩစံၭဘဲၫယီၩ, လၧအထီလၧဆၧဘၪ အၥၭနီၪယခိၭနၪယူၭ နလူယူၭတၭ, လၧဆၧထိး ထဲၩ့တၩ့ထဲၩ့အမုလနံၩနီၪ ယမၩဆၧၩ့ယူၭနၧၩယူၭ. တၭယမိယိထဲၩ့ခွါထဲၩ့နၧၩတၭ, အီၪက့ၪနၧၩလၧဆၧ အုၩ့လၩ့လၧၦခမျၧးအဂး, ဘဲၫၥိၭအမိဒုၭဂုးထၪ့ဂၪ့ ခိၪ,ဘဲၫၥိၭနမိဒုၭန့ၥၫဆၧလၧဆၧန့ၥၫၥံၪအီၪယူဝ့ၫး",
			"9": "<sup>9</sup> ဘဲၫၥိၭနမိစံၭၦထီၫ့ဖိၪၥံၪ, စဲၪ့ထၪ့ခွံၬဘီၪး ၦအီၪလၧ ဆၧခံၭကျၩနီၪမၩဖျီၪထၪ့နၥံၪအၥၭဘီၪ. အဝ့ၫၥံၪမိ အၪ့ဆၧလၧဖၧၩ့ၥုၪ့ဖၧၩ့ၥၭတၭ, ဆၧစီၩ့ခိၪပျၩ့ထီးအ",
			"10": "<sup>10</sup> လူၬနီၪမိကဲၪထ့ဆၧအၪ့အဆၪအလးနီၪလီၫ.- ဆၧၥၭ ဝံလၧၩ့အၥၭအ့ၬ. တၭဆၧလၥူၫလၧၩ့ဘၪအၥၭလၧထံၫ တၭ,ဆၧခိမွဲဂ့ၩ,မုမွဲဂ့ၩ, ဘၪဝ့ၫအ့ၬ. အဂဲးဘဲၫယီၩ ၦလၧအယၫ့ၥၭဝ့ၫနီၪၥိၫ့ဝ့ၫတၭ, မိၥိၫ့ဝ့ၫထီးဒၪလ့ၬ",
			"11": "<sup>11</sup> လၧထံၫထၪ့ဖျိၭအလးလဖၪနီၪလီၫ.- ယမိအီၪက့ၪ ယခိၪလီၩ့ထီးအလူၬကဲၪလၧအဖၧၩ့ၥၭနီၪတၭ, ယဖၧၩ့",
			"12": "<sup>12</sup> ၥၭမုၥံၪအဆီၩ့ဆီထၪ့နီၪ,မွဲအထီၫလီၫ.- ယိခွါ,ၦလဖၪ ယီၩမိဂဲၫဝ့ၫလၧအယဲၩ့, ယိခွါ,ၦလဖၪယီၩလၧမုဖၩလ ခီၫ,ဒဲလၧမုနုၬလခီၫ, ဒဲၦလဖၪယီၩ, လၧခးစံၫနံၩ့နီၪ",
			"13": "<sup>13</sup> လီၫ.- ကိၭၡၭထၪ့,မူၭခိၪဧ့, တၭၥုၪ့ထိၬၥၭထိၬ, ဂၪ့ခိၪ ဧ့,မွဲခိၪလီၩ့ထိၩ့ချိၬထၪ့ဖျ့ၭ လၧဆၧကိၭၡၭထၪ့ဆံၭ. အဂဲးဘဲၫယီၩ ယဟိဝၩမၩမုၬထၪ့ထဲၩ့ယူၭ အခ့ၫအ ၡၩယူၭ. တၭမိယၫ့ၥုၪ့ယၫ့ၥၭအၡၩ လၧအဘၪဆၧ",
			"14": "<sup>14</sup> ၡၪ့ဆၧနၭလီၫ.- မွဲလါနၫ့တၭ,ဇံအိၫ့စံၭဝ့ၫဒၪ,ယဟိဝၩ ခွံၬၡိၭယူၭယၧၩ ယူၭတၭ, ယကဆါနီၪ ၥၭနၪ့ယူၭ",
			"15": "<sup>15</sup> ယၧၩယူၭ.- ၦမုၪမိၥၭနၪ့အဖိၪ လၧအအၪ့နူ ထီးအ လယၫ့ၥၭဘၪ အဒၧၩ့လးအဖိၪခွၫနီၪ ဘၪမိၥ့ၪဧၪ. မွဲ ကဒၪယူၭ, အဝ့ၫၥံၪနီၪဒၪလ့ၬ မိၥၭနၪ့လီၫ. အ့ၪမွဲယ",
			"16": "<sup>16</sup> ဝ့ၫဒၪယီၩယမိၥၭနၪ့နၧၩအ့ၬ.- ယိခွါ,ယကွ့ၭယူၭနၧၩ လၧယစူၪယၫၥၭအလီၩ့ယူၭတၭ, နဒိၩ့ခိၪဒၧၩ့အီၪဝ့ၫ",
			"17": "<sup>17</sup> လၧယမ့ၬယၫလထံၪဎးလီၫ.- နဖိၪၥံၪမိဂဲၫချဲၫ့ချဲၫ့, ၦ လၧအမၩဂၭဂီၩ့နၧၩဒဲမၩယူနၧၩလဖၪနီၪ မိဂၭဂီၩ့လၧ",
			"18": "<sup>18</sup> နမ့ၬယၫလီၫ.- စၪ့ထၪ့နမ့ၬယိဝၬဖီၩ့တၭ, ဒၪဆၧဆံၭ. အဝ့ၫၥံၪထီးအလူၬအီၪကိၩ့အီၪကီၪ့လစီၪ့ဎးတၭ, ဂဲၫ လၧနအီၪလီၫ. ယမၧၫ့ယဝ့ၫယဟိဝၩစံၭဝ့ၫဒၪ,မွဲမၬ,န မိကီၩ့ထၪ့ၥိၭထၪ့နၥၭလၧအဝ့ၫၥံၪဘဲၫကယၧၩ့ကယီၫ အဎံၫအလၩထီးအလူၬအၥိၭတၭ, နမိစၧၩ့ထၬဝ့ၫလၧ",
			"19": "<sup>19</sup> နလီၩ့,ဘဲၫတလၭမူၭမုၪအၥိၭနီၪလီၫ.- အဂဲးဘဲၫယီၩ နဆၧလၩ့ဎီး, ဒဲနလးလၧဆၧမၩဂၭဂီၩ့, ဒဲနခးလၧအ အီၪယူယူၭနီၪး ဘိၩ့နဲၪ့ယီၩဒၪလ့ၬ, လၧၦအီၪဝ့ၫအဂး မိထီဝါအ့ၬ. တၭၦလၧအယုလၩ့နၧၩလဖၪနီၪ မိအီၪ",
			"20": "<sup>20</sup> ယဲၩ့ဝ့ၫလီၫ.- ၦထူၬဖိၪဧ့,နဖိၪခွၫလဖၪမိစံၭဒီၭလၧနနါ ဖၧၩ့း ဆၧအလးယီၩ ထီလၧယဂးအ့ၬ, အီၪပဲၩယၧၩ",
			"21": "<sup>21</sup> ဘဲၫၥိၭယမိအီၪဆံၭ.- ထီးနီၪလဖၧၫ့နမိစံၭလၧနၥၭခံ ဖၧၩ့းမွဲပလၫဒုၭအီၪထၪ့န့ယၧၩလၧအဝ့ၫၥံၪနီၪလဂၩ လဲၪးယဖိၪလၩ့မါတၭ,ယထူၬဖိၪ, ယမွဲၦဆၧအၪ့မၧၫ့ ကဲၪဎီးဝ့ၫ, ဒဲၦဘၪဆၧနၫ့ထၪ့ခွံၬဝ့ၫလီၫ. တၭၦလဖၪ ယီၩ,မွဲပလၫလုထၪ့ဝ့ၫလဂၩလဲၪ. ယိခွါ, ယအီၪလၩ့",
			"22": "<sup>22</sup> ထးလဂၩဎးလီၫ.ၦလဖၪယီၩမွဲအအီၪခီၫခီၫလဲၪ.- က ဆါယဟိဝၩစံၭဘဲၫယီၩ, ယမိယၩ့ထၪ့ယစူၪလၧၦ ဆၨၩလဖၪတၭ, ယမိဘီၩ့ထၪ့ယၥုၭဖိၪအလၫ့ လၧၦ ခမျၧးအဂးလီၫ. တၭၦမိဂဲၫဆိၬနဖိၪခွၫ လၧအစူၪဒူၪ လီၩ့တၭ, မိဆိၬနဖိၪမုၪလဖၪ လၧအခိၬထံၭခိၪလီၫ.",
			"23": "<sup>23</sup> စဎွၩလဖၪမိကဲၪထၪ့နဖါလၧအအၪ့လုဖိၪနၧၩတၭ, အ ဝ့ၫၥံၪအနးဎွၩမုၪလဖၪမိကဲၪထၪ့ နမိလၧအအၪ့လုဖိၪ နၧၩလီၫ. မိကျၭလၩ့အမ့ၬလၧဂၪ့ခိၪလီၩ့တၭ, မိအၪ့ လဲၪ့နခၪ့အဂၪ့ခိၪမုၬလီၫ. တၭနမိၥ့ၪယၫလၧယမွဲယ ဟိဝၩတၭ, ၦလၧအဒိၭနဲၩ့အၥၭလၧယၧၩလဖၪအမ့ၬ",
			"24": "<sup>24</sup> လမဲဘၪလီၫ.- တၭလၧၦအဆီၪ့အၪ့ဂူၬန့ဆၧအီၪလၧ အစူၪဖၧၩ့နီၪ, မွဲဆၧမိမၩန့ခွံၬဆ့ဧၪ. တၭၦဘၪဆၧ",
			"25": "<sup>25</sup> အၪ့မၧၫ့ဎီးဝ့ၫဘဲၫအထူၫအရူၫနီၪမိဖီၩ့ဖျ့ၭဆ့ဧၪ.- အ ဂဲးဘဲၫယီၩယဟိဝၩစံၭဘဲၫယီၩ, ၦအဆီၪ့အဆၧအၪ့ မၧၫ့ဎီးဝ့ၫနီၪဆၧမိမၩန့ခွံၬဝ့ၫတၭ, ဆၧၥၭမဲၪၥၭဖျဲၩ့ဆၧ အဆၧအၪ့ဂူၬန့နီၪမိဖီၩ့ဖျ့ၭတၭ, ယမိဒုၭဆၧလၧၦလၧ အဒုၭဆၧလၧနၧၩတၭ, ယမိထိးထဲၩ့တၩ့ထဲၩ့နဖိၪခွၫ",
			"26": "<sup>26</sup> လဖၪလီၫ.- ၦလၧအမၩအၧၩ့နၧၩနီၪယမိဒုၭအၪ့လၧ အဖံၭအယၪဒၪဝ့ၫတၭ, မိအီၩမၧၩ့အၥၭလၧအၥွံၪဒၪ ဝ့ၫဘဲၫလၧစဘံၭထံၫအၥၫ့အၥိၭနီၪတၭ, ကယဲဆၧဖံၭ ဆၧယၪထီးအလူၬမိၥ့ၪယၫလၧယဝ့ၫဒၪယီၩ, ယမွဲယ ဟိဝၩ, ဆၧထိးထဲၩ့တၩ့ထဲၩ့နၧၩ, ဒဲဆၧလၧအဎွ့ၩန့ ထဲၩ့နၧၩ,စယၫကူၭအဆၧဒိၪဆၧဆီၪ့လဂၩနီၪလီၫ."
		},
		"50": {
			"1": "<sup>1</sup> ယဟိဝၩစံၭဘဲၫယီၩ, နၥံၪအမိလၧယခွံၬၡိၭဝ့ၫလ ဂၩအလံၬလၩ့ၡၪလဘံၪ့နီၪ, မွဲအအီၪခီၫခီၫလဲၪ. တၭ ယအၪ့ဆၫခွံၬနၥံၪ, လၧယဒ့ၪယမါ ကဆါဂၩဂၩလဲၪ. ယိခွါ,လၧနၥံၪအဆၧအၧၩ့အကၠီၩ့နီၪ, နၥံၪဘၪဆၧ အၪ့ဆၫခွံၬဝ့ၫတၭး နၥံၪအမိဘၪဆၧခွံၬၡိၭခွံၬဝ့ၫလၧ",
			"2": "<sup>2</sup> နၥံၪအဆၧမၪအကၠီၩ့လီၫ.- လၧယဂဲၫထီၩ့တၭး ၦလ အီၪဘၪနီၪမွဲဘၪလဲၪ. လၧယကိၭထၪ့ဝ့ၫတၭ, ၦစံၭ ဆၧၫ့ဆၧလအီၪဘၪမွဲဘၪလဲၪ. မွဲယစူၪလၩ့ဖၨၪထီး ယဎွ့ၩန့ထဲၩ့ဆၧလၥ့ၪဘၪဆ့ဧၪ. တၭဘဲၫၥိၭယမိမၩ ဖီၩ့မၩဖျ့ၭဆၧတၭ, ယစီၩ့ယမၩ့လအီၪဘၪဧၪ. ယိခွါ, ယအၪ့ၥီၪ့ဆၧတၭ, ယမၩလၩ့ၥံၭမၫဆမံၭတၭ, ယ အီၪက့ၪထံၫမိၡါ ကဲၪထၪ့လၧၡါမုနၧၫ့ဖၫလီၫ. အဒ့ၪ အယၪနၧၫ့အုၪ လၧထံၫလအီၪဘၪအကၠီၩ့တၭ, ၥံၫဝ့ၫ",
			"3": "<sup>3</sup> လၧဆၧၥူၫအၥၭလၧထံၫအကၠီၩ့လီၫ.- ယဒုၭၥိၭမူၭခိၪ လၧဆၧၥၧၫ့တၭ, ယဒုၭလုၬဝ့ၫ လၧရၧၬအဆၧယၬ လီၫ.",
			"4": "<sup>4</sup> ကဆါယွၩဖ့ၪလၫ့ယူၭယၧၩ လၧၦၥီၪ့လိၪဆၧအဖျ့ၩ ဘဲၫၥိၭ ယမိၥ့ၪယၫ ဒုၭဆီၪ့ထၪ့ ၦလၧဆၧပွံၭအၥၭ လၧဆၧချဲၩ့လထံၪ ဘဲၫၥ့ၪလဲၪ ဘဲၫၥ့ၪလဲၪနီၪလီၫ. ၦ လၧအထိၪဂဲထုၪ့ဝ့ၫလဂီၩဘၪလဂီၩ, ထိၪဂဲထုၪ့ယနါ ဘဲၫၥိၭယမိနါဂၧၫ့ဆၧဘဲၫ ၦမၩလိၪဆၧအၥိၭနီၪလီၫ.",
			"5": "<sup>5</sup> ကဆါယွၩဝဲထၪ့ယူၭယနါတၭ, ယလပိၩ့ထၪ့ဘၪဆၧး",
			"6": "<sup>6</sup> တၭ,ယဂၧၩ့ထဲၩ့လၧယလးခဲၫ့ဆ့အ့ၬ.- ယဖ့ၪလၫ့ယ ချိၫ့လၧၦထးဆၧတၭ, ယဖ့ၪလၫ့ယနိၭဖၩထံၭ လၧၦ လၧအထ့ၭထၪ့ခွံၬၦခၪဆီၪ့လီၫ.ယအီၪက့ၪပဲၩယမ့ၬ",
			"7": "<sup>7</sup> လၧဆၧမ့ၬမဲဒဲဆၧထိၪဖျံၭအ့ၬ.- အဂဲးဘဲၫယီၩကဆါ ယွၩမိမၩဆၧၩ့ယၧၩယီၩး မၩအၥၭဘဲၫနီၪတၭယမ့ၬ မဲအ့ၬ.မၩအၥၭဘဲၫနီၪတၭ, ယအီၪက့ၪယမ့ၬဘဲၫလိး မ့ၪအၥိၭနီၪတၭ, ယၥ့ၪယၫလၧယမ့ၬလမိမဲဘၪလီၫ.",
			"8": "<sup>8</sup> ၦလၧအအီၪက့ၪတီၩယၧၩ လဂၩနီၪအီၪဘူၭဝ့ၫလီၫ. မွဲပလၫမိလိၭခွးလၧယၧၩလဂၩလဲၪ. မွဲပဆၧၫ့ထုၪ့ၡီၩ့ ဆံၭ.မွဲပလၫမိထၫ့ဒၩယၧၩလဂၩလဲၪ. မွဲအၥုၭဘူၭ",
			"9": "<sup>9</sup> အၥၭဆံၭ.- ယိခွါ, ကဆါယဟိဝၩမိမၩဆၧၩ့ယၧၩ တၭ,မွဲပလၫမိစ့ၩရၫ့စၪယၧၩလဂၩလဲၪ. ယိခွါ, အဝ့ၫ ၥံၪထီးအလူၬနီၪ မိလးလံၩဘဲၫဆဲၫ့လဘံၪ့အၥိၭနီၪ, အဎိၩ့အဎါမိအၪ့ခွံၬဝ့ၫလီၫ.",
			"10": "<sup>10</sup> ၦလၧနၥံၪအကျၩလၧအၥၭမဲၪယဟိဝၩတၭ, ခိၭနၪ အခ့ၫအၡၩအလူအထၫ လၧအလ့ၩဆၧလၧဆၧခံၭ ကျၩတၭ, ဆၧဖၩ့လအီၪဘၪနီၪမွဲပလၫလဂၩလဲၪ. မွဲ အဒိၭနဲၩ့အၥၭလၧယဟိဝၩအမံၩ့တၭ, ပထဲအၥၭလၧ",
			"11": "<sup>11</sup> အယွၩနီၪဆံၭ.- ယိခွါ,ကယဲၦလၧအဆူၭခဲၩမ့ၪလၧအ ဒုၭအီၪဝၬဖီၩ့နၥံၪအၥၭ လၧမ့ၪဖီၫလဖၪထီးအလူၬၥံၪ ဧ့,လ့ၩဆၧလၧနၥံၪအမ့ၪအဆၧဖၩ့အကျၩ, ဒဲလၧမ့ၪ ဖီၫလဖၪလၧနၥံၪဆူၭခဲၩဝ့ၫအကျၩနီၪဆံၭ. နၥံၪမိဘၪ ဆၧယီၩလၧယစူၪ, နၥံၪမိမံၫနၩ့လၧဆၧဆိၭက့ၭအ ဖၧၩ့နီၪလီၫ."
		},
		"51": {
			"1": "<sup>1</sup> ၦလၧအလီၩ့ဆၧတီၩဆၧလီၩ့ၥံၪဧ့, ခိၭနၪယလူဆံၭး ၦလၧအအၪ့ဎၬယဟိဝၩၥံၪဧ့, ယိထၪ့လိးမုလၧဆၧ ဘုၪ့ထၪ့နၥံၪ, ဒဲဆၧဖၧၩ့အအိၩဖၧၩ့ ထီးဆၧခုၪ့ထၪ့န",
			"2": "<sup>2</sup> ၥံၪနီၪဆံၭ.- ယိထၪ့ဘၪနၥံၪအဖါစအၫဘြဟၫ့,ဒဲနးစၫ ရၫလၧအအီၪဖျဲၪန့နၥံၪဆံၭ. အဂဲးဘဲၫယီၩလၧအမွဲ လဂၩဎးနီၪ ယကိၭန့ဝ့ၫတၭ, ယဆိၪဂ့ၩအဝ့ၫဒဲမၩ",
			"3": "<sup>3</sup> အၪထၪ့ဝ့ၫဆ့လီၫ.- အဂဲးဘဲၫယီၩ ယဟိဝၩမိမၩမုၬ ထၪ့ဇံအိၫ့တၭ, မိမၩမုၬထၪ့ထဲၩ့အလးအီၪယူဝ့ၫလ ဖၪတၭ, မိအီၪက့ၪအၡါမုနၧၫ့ဖၫဘဲၫအံဒံၫ့အၥိၭ, ဒဲအ မံၩ့ခိၪၥီၪ့လၬဘဲၫယဟိဝၩအကျိၭအၥိၭနီၪလီၫ. ဆၧ ၥုၪ့ဎွံၫၥၭယီၫ, ဆၧၥုၪ့ထိၬၥၭထိၬ မိအီၪလၧအဖၧၩ့, ဆၧစံၭထၪ့အၪ့အူၭလၧအလူမုၬနီၪလီၫ.",
			"4": "<sup>4</sup> ခိၭနၪယလူ,ယၡၩခမျၧးၥံၪဧ့, ဒဲယၡၩလဆၨၩဧ့, ခိၭနၪယလူယထၫဆံၭ. အဂဲးဘဲၫယီၩ ဆၧမၪလူၬမိ စဲၪ့ထၪ့ခွံၬလၧယၧၩတၭ, ယမိဒုၭအီၪဂုးခၧၫ့ ယဆၧ",
			"5": "<sup>5</sup> စ့ၩရၫ့လၧဆၧဖၩ့လၧၦခမျၧးအဂးလီၫ.- ယဆၧတီၩ ဆၧလီၩ့ ဘူၭထၪ့ယူၭ. ယဆၧထိးထဲၩ့တၩ့ထဲၩ့စဲၪ့ ထၪ့ယူၭတၭ, ယစူၪဒူၪမိစ့ၩရၫ့ၦမျၧးလီၫ. ထံၫယဲၩ့ ခးယဲၩ့မိယိလါယဖၧၩ့ၥၭတၭ, မိဒိၭနဲၩ့အၥၭလၧယ",
			"6": "<sup>6</sup> စူၪဒူၪလီၫ.- စၪ့ထၪ့နၥံၪအမ့ၬၥၪလၧမူၭခိၪတၭ, ယိ လၩ့ဆၧလၧဂၪ့ခိၪ လၧလၬလခီၫနီၪဆံၭ. အဂဲးဘဲၫ ယီၩမူၭခိၪမိဒံၩခွံၬ ဘဲၫမ့ၪခူၪအၥိၭတၭ, ဂၪ့ခိၪမိလး လံၩဘဲၫဆဲၫ့လဘံၪ့အၥိၭနီၪတၭ, ဂၪ့ခိၪဖိၪမိၥံၫဘဲၫနီၪ ၥိၭလီၫ.အ့ၪမွဲယဆၧထိးထဲၩ့တၩ့ထဲၩ့နီၪ မိအီၪလၩ့ ဆိၩလၩ့ကၠၪတၭ, ယဆၧတီၩဆၧလီၩ့နီၪ လးလံၩဝ့ၫ အ့ၬ.",
			"7": "<sup>7</sup> ၦလၧအၥ့ၪယၫဆၧတီၩဆၧလီၩ့ၥံၪဧ့, ခိၭနၪယလူ ဆံၭ. ၦခမျၧးလၧယဆၧၥီၪ့ဆၧၥၫ့ အီၪလၧအၥၭခံ ဖၧၩ့ၥံၪဧ့,ထီးၥၭမဲၪ ၦၡၩအဒုၪဒွ့ၪဆၧလဂ့ၩ. တၭ",
			"8": "<sup>8</sup> အၪ့ယိၪဆၧလၧအစံၭအၧၩ့ဆၧအကၠီၩ့နီၪလဂ့ၩ.- အ ဂဲးဘဲၫယီၩ ဘဲၫဆဲၫ့လဘံၪ့အၥိၭနီၪ,ဆၧအဎါၥံၪမိအၪ့ ခွံၬအဝ့ၫၥံၪတၭ,ဘဲၫအဆီၪ့အၥိၭနီၪအဎိၩ့အဎါမိအၪ့ ခွံၬဝ့ၫလီၫ. အ့ၪမွဲယဆၧတီၩဆၧလီၩ့ မိအီၪဝ့ၫလၩ့ ဆိၩလၩ့ကၠၪ, ဒဲယဆၧထိးထဲၩ့တၩ့ထဲၩ့လဆိၩဘၪလ ဆိၩလီၫ.",
			"9": "<sup>9</sup> နၪ့ထၪ့နၥၭၬနၪ့ထၪ့နၥၭၬ ၥိၭထၪ့ဆၧအဂဲးအဘၭ, ယဟိဝၩအစူၪဒူၪဧ့,နၪ့ထၪ့နၥၭၬ ဘဲၫလၧမုနံၩလဖၪ လၧဖျိၩ့လၧအဆိၩလဖၪ လၧဖျိၩ့အၥိၭနီၪဘီၪ. နမွဲၦ လဂၩဎး ဒဲၦလၧအကျီၪ့ခွံၬရၫဟၭ, ဒဲဆ့ၭနုၬၡီၩ့နီၪမွဲ",
			"10": "<sup>10</sup> အ့ၬဧၪ.- နမွဲၦလဂၩဎးလၧအမၩလၩ့ၥံၭမၫဆမံၭဆၧ ယိၬဖၭဒိၪအထံၫ,လၧအအီၪက့ၪမၫဆမံၭ အဆၧယိၬ ဖၧၩ့လၧဖၧၩ့ၥၭလဘီၩ့ ဘဲၫၥိၭၦလၧအဘၪဆၧဎွ့ၩန့",
			"11": "<sup>11</sup> ထဲၩ့ဝ့ၫနီၪမိခၫ့ဂၬဆၧမွဲအ့ၬဧၪ.- မၩအၥၭဘဲၫနီၪတၭ, ၦလၧယဟိဝၩ ဎွ့ၩန့ထဲၩ့ဝ့ၫလဖၪနီၪ မိဂဲၫထဲၩ့ကဒၩ ထဲၩ့တၭ, မိဂဲၫထဲၩ့ၥံၫကျံၩ ဆၧလၧဇံအိၫ့အအီၪ,ဒဲ ဆၧၥုၪ့ထိၬၥၭထိၬအဆိၩအကၠၪ အၥရဖူၩအီၪလၧအ ခိၪဎွံၪတၭ, ဆၧၥုၪ့ဎွံၫၥၭယီၫ, ဒဲဆၧၥုၪ့ထိၬၥၭထိၬမိ ချႃၭန့ဝ့ၫတၭ, ဆၧၥုၪ့အုၭၥၭအုၭ, ဒဲဆၧဂၪ့အုၩဂၪ့",
			"12": "<sup>12</sup> ထိၬစဲၪ့ထၪ့ခွံၬယူၭ.- ယဝ့ၫဒၪယီၩယမွဲၦလၧအမၩမုၬ ထၪ့ထဲၩ့နၥံၪလီၫ. နမွဲပလၫလၧနမိၥၭမဲၪၦၡၩလၧအ မိၥံၫ,ဒဲၦၡၩအဖိၪခွၫ လၧအမိကဲၪထၪ့ဘဲၫနၪ့ၥံၪမံၩ့ၥံၪ",
			"13": "<sup>13</sup> အၥိၭနီၪလဂၩလဲၪ.- တၭနၥၭနၪ့ယဟိဝၩလၧအတဲၩ့ လၩ့နၧၩ လၧအပၠၪထၪ့မူၭခိၪ, ဒဲအီၪက့ၪလၩ့ဂၪ့ခိၪအ ခၪ့ထံၭလဖၪ, ဒဲနဘၪယိၪဆၧလထံၪဎး ကိၭမုနံၩဒ့ၭ လၧၦမၩအၧၩ့ဆၧ အၥၭထၪ့အကၠီၩ့, ဘဲၫအတဲၩ့ဝဲၩ ဆၧလၧအမိမၩဂၭဂီၩ့ဆၧအၥိၭနီၪဆ့ဧၪ. တၭၦမၩ",
			"14": "<sup>14</sup> အၧၩ့ဆၧအၥၭထၪ့နီၪ, မွဲအအီၪခီၫခီၫလဲၪ.- ၦလၧအ ဘၪထိးအခၠူၭလဖၪနီၪၥံၫလၧထီၫ့ဖၧၩ့အ့ၬ, မိထီၩ့ဝ့ၫ လၧဆၧမၩဖီၩ့ဖျ့ၭချဲၫ့ချဲၫ့တၭ, အကိၪမိလူၬဆ့အ့ၬ.",
			"15": "<sup>15</sup> အ့ၪမွဲယဝ့ၫဒၪယီၩ, ယမွဲယဟိဝၩနယွၩလၧအအၪ့နၩ့ ဖၭမၫဆမံၭဒဲအလပီၩၥီၫထၪ့လီၫ. တၭဆၧၥုၭမုခမျၧး",
			"16": "<sup>16</sup> အယဟိဝၩမွဲအမံၩ့လီၫ.- ယအီၪက့ၪနဆၧချဲၩ့လၧ နနိၭအဖၧၩ့တၭ, ယချႃၬဘံၭနၧၩလၧယစူၪအလၩဒုၩ ဘဲၫၥိၭယမိၥုၪ့လၩ့မူၭခိၪ, ဒဲအီၪက့ၪဂၪ့ခိၪအခၪ့ထံၭ လဖၪ,ဒဲစံၭဇံအိၫ့, နဝ့ၫဒၪယီၩနမွဲယၡၩခမျၧးလီၫ.",
			"17": "<sup>17</sup> နၪ့ထၪ့နၥၭၬနၪ့ထၪ့နၥၭၬ ဂဲထုၪ့ထၪ့ယရုစလံၫ့လၧ အအီၩယူၭယဟိဝၩအဆၧၥၭထၪ့အလိၫ့ လၧအစူၪ, နဝ့ၫဒၪဧ့,နအီၩယူၭအဆၧဒုၭဝၭထိၬ အလိၫ့လဖျိၪ့အ",
			"18": "<sup>18</sup> ၥံၭအခၩယူၭး နဘံၭဆံၭထၪ့ခွံၬယူၭ.- လၧကယဲဖိၪ ခွၫလၧနအီၪဖျဲၪန့ဝ့ၫအကျၩနီၪမိၥိၫ့နၧၩ အီၪနးဂၩအ့ၬ. လၧကယဲၦလၧနအၪ့လုဖိၪဝ့ၫအကျၩနီၪ,မိဖီၪ့မီၩ့နစူၪ",
			"19": "<sup>19</sup> အီၪနးဂၩအ့ၬ.- ဆၧၥၭဝံလၩ့ဒိၩ, ဒဲဆၧအီၪယူတၭ, နၭၥံၪဖၩ့ၥံၪ, ဒဲဆၧလၩ့ဎီး, ဆၧနံၫမံၩ့ယီၩ မိဂဲၫဘၪ နၧၩ,မွဲပလၫမိဂၪ့မိယၧၩ့ဆၧ လၧနဂးလဂၩလဲၪ. အ့ၪ လမွဲဘၪယၧၩတၭ,မွဲပလၫမိမၩမုၬထၪ့ထဲၩ့နၧၩလဲၪ.",
			"20": "<sup>20</sup> နဖိၪခွၫလဖၪ လၩ့ဘဲၩဝ့ၫလီၫ. အဝ့ၫၥံၪမံၫနၩ့ဝ့ၫလၧ ဖၧၩ့ၥၭထီးအလူၬ အခၪ့ထံၭဘဲၫချီမံၩ့အဖၫ လၧဖျံၩ ခွၩ့ဖၧၩ့အၥိၭနီၪလီၫ. မွဲအဎွ့ၩဝ့ၫလၧယဟိဝၩအဆၧ",
			"21": "<sup>21</sup> ၥၭထၪ့,နယွၩအအၪ့ၥီၪ့ဆၧလီၫ.- မၩအၥၭဘဲၫနီၪ တၭ,ခိၭနၪလါဆၧယီၩ, ၦလၧအဘၪၡၪ့ဘၪနၭဒဲအီၩ",
			"22": "<sup>22</sup> မၧၩ့အၥၭလါနၫ့လမွဲဘၪလၧစဘံၭထံၫနီၪဧ့,- နကဆါ ယဟိဝၩဒဲနယွၩမိချဲၩ့ခွးလၧအၡၩခမျၧးအဂးနီၪ, စံၭ ဝ့ၫဘဲၫယီၩ, ယိခွါ, ယမၩန့ခွံၬယူၭဆၧဒုၭဝၭထိၬအ လိၫ့လဖျိၪ့လၧနစူၪဖၧၩ့, ယဆၧၥၭထၪ့အလိၫ့အၥံၭအ",
			"23": "<sup>23</sup> ခၩနမိဘၪအီၩလၧၩ့ဝ့ၫအ့ၬ.- အ့ၪမွဲယမိအီၪက့ၪဝ့ၫ လၧၦလၧအမၩၡၪ့မၩနၭနၧၩအစူၪဖၧၩ့, လၧအစံၭန ၥၭ,ထွံၩလၩ့ဆံၭ, တၭပမိခၫ့ဖၬနၧၩလီၫ. တၭနအီၪ က့ၪနမိၡါလၧဂၪ့ခိၪအလီၩ့နီၪ, ဒဲဘဲၫဖၧၩ့ၥၭအၥိၭလၧ ၦလၧအဖိၬဖၧၩ့ၥၭနီၪအဂးလီၫ."
		},
		"52": {
			"1": "<sup>1</sup> နၪ့ထၪ့နၥၭၬနၪ့ထၪ့နၥၭၬ ၥိၭထၪ့နဂဲးနဘၭဇံအိၫ့ ဧ့,ၥိၭထၪ့နကီၩ့နၥိၭ အဎံၫအလၩ, ယရုစလံၫ့, ဒိၩ့ ဆံၫ့ဎံၪဧ့,အဂဲးဘဲၫယီၩ, ၦလဒိၭဘၪဆၧကူၭတရံၭ, ဒဲၦလဆံၫ့ဘၪလ့ၩနုၬဘၪလၧၩ့လၧနဖၧၩ့အ့ၬ.",
			"2": "<sup>2</sup> ယရုစလံၫ့ဧ့,ဂၪ့ခိၪအမုၬ လၧအဘုၭထၬလၧနလီၩ့ နီၪတရူၩလၩ့ခွံၬတၭ, ဂဲထုၪ့ထၪ့ဆၧၫ့နၩ့ လၧဆၧအ လးထၪ့ထီၫဆံၭ. ဇံအိၫ့အဖိၪမုၪ လၧဆၧဖီၪ့ထၬဝ့ၫ",
			"3": "<sup>3</sup> လဂၩဧ့,ဖျံၩစၧၩ့ထၬနခိၬနီၪကွဲၪလၩ့ဆံၭ.- အဂဲးဘဲၫ ယီၩယဟိဝၩစံၭဘဲၫယီၩ, ဆၧအၪ့ဆၫခွံၬနၥံၪလၧဆၧ နးမံၩ့အ့ၬတၭ, ဆၧမိဎွ့ၩန့ထဲၩ့နၥံၪ လၧဆၧလမွဲဘၪ",
			"4": "<sup>4</sup> စ့ၩနီၪလီၫ.- အဂဲးဘဲၫယီၩကဆါယဟိဝၩစံၭဘဲၫယီၩ, ယၡၩခမျၧးလ့ၩလၩ့လၧဖျိၩ့ လၧခးအံဇံၭအဖၧၩ့ဘဲၫ ၥိၭအမိအီၪထီးနီၪတၭး လၧခဲၫ့ထဲၩ့ဆၧအဂဲးအကၠီၪ့",
			"5": "<sup>5</sup> လအီၪဘၪနီၪ, ၦအစံရအၫဖိၪမၩအၧၩ့ဝ့ၫလီၫ.- တၭ ဘိၩ့နဲၪ့ယီၩ, ဆၧဆိၬထၪ့ခွံၬယၡၩခမျၧးပျီၩပျီၩ, အ ၦဒိၪဖၭဒိၪဒုၭအိၩ့ယိၩ့ထၪ့အဝ့ၫၥံၪ ယဟိဝၩစံၭဝ့ၫ ဒၪတၭ,ၦဒုၪဒွ့ၪယမံၩ့ၥံၫ့နံၩချီၩ့တၭ, ယမိမၩဘဲၫၥ့ၪ",
			"6": "<sup>6</sup> လဲၪ.- မၩအၥၭဘဲၫနီၪတၭ, ယၡၩခမျၧးမိၥ့ၪယၫယ မံၩ့,မၩအၥၭဘဲၫနီၪတၭ, လၧမုလနံၩနီၪမိၥ့ၪယၫလၧ ယမွဲၦလၧအချဲၩ့ဆၧ, ယိခွါ, ယၧၩလီၫ.",
			"7": "<sup>7</sup> ၦလၧအလီၩလၩ့လၬလၩ့ဆၧၥၭထိၬအပရၧၫ့လၧ အလီၩ့လၩ့လၬလၩ့ဆၧဘၪလိၬအိၭလိၬ, လၧအလီၩ လၩ့လၬလၩ့ဆၧအဂ့ၩ, လၧအဒုၭဂၧၫ့ထၪ့ၥၩလၩ့ဆၧ ထိးထဲၩ့တၩ့ထဲၩ့း ၦၡၩလၧအစံၭဇံအိၫ့, နယွၩကဲၪ စဎွၩနီၪလဂၩ, အခၪ့အီၪလၧခိၪလီၩ့ မွဲအဎံၫအလၩ",
			"8": "<sup>8</sup> ဆံၭဒိၪလဲၪ.- နၡၩခိၭဆၧလဖၪထုၭထၪ့အလူအၥီၫ, မိကိၭၡၭထၪ့လစီၪ့ဎးလီၫ. အဂဲးဘဲၫယီၩထီးယဟိ ဝၩဂဲၫထဲၩ့လၧဇံအိၫ့တၭ, အဝ့ၫၥံၪမိယိဆၧၫ့ယၫလိၬ",
			"9": "<sup>9</sup> အၥၭလီၫ.- ကိၭထၪ့ဆၧ,ကိၭၡၭထၪ့လစီၪ့ဎး, ယရု စလံၫ့အဆၧလၩ့ဎီးၥံၪဧ့, အဂဲးဘဲၫယီၩယဟိဝၩမၩ မုၬထၪ့ထဲၩ့ယူၭအၡၩခမျၧး, ဎွ့ၩန့ထဲၩ့ယူၭယရုစလံၫ့",
			"10": "<sup>10</sup> နီၪယူၭ.- ယဟိဝၩမၩအီၪဘိၪ့အစူၪဒူၪဆံၫ့ဎံၪလၧၦ ဆၨၩထီးအလူၬအမ့ၬယၫ, ဘဲၫၥိၭဂၪ့ခိၪအထုၬထီး အလူၬနီၪမိဒၪဘၪပယွၩ အဆၧထိးထဲၩ့တၩ့ထဲၩ့ဆၧ လီၫ.",
			"11": "<sup>11</sup> စဲၪ့ထၪ့ခွံၬနၥံၪၬ စဲၪ့ထၪ့ခွံၬနၥံၪၬ လ့ၩထၪ့ခွံၬနၥံၪ လၧအလးထီးနီၪဆံၭ. ဆၧလဆံၫ့ဘၪနီၪထိၭဝ့ၫနးမံၩ့ လဂ့ၩ. စဲၪ့ထၪ့ခွံၬလၧအၥၭခံဖၧၩ့နီၪဆံၭ. ၦလၧအ ဆိၬယဟိဝၩ အဎၧၩ့အဎီၥံၪဧ့, အီၪဆံၫ့ထၪ့နၥံၪဝ့ၫ",
			"12": "<sup>12</sup> ဆံၭ.- အဂဲးဘဲၫယီၩ နၥံၪစဲၪ့ထၪ့ဘၪချဲၫ့ချဲၫ့အ့ၬ, နၥံၪ ဘၪစဲၪ့တလဲးအ့ၬ. အဂဲးဘဲၫယီၩ ယဟိဝၩမိလ့ၩဆၧ လၧနၥံၪအမ့ၬယၫတၭ, အံၫစရ့လၭအယွၩမိယိထိနၥံၪ လၧနၥံၪအလးခဲၫ့ဆ့လီၫ.",
			"13": "<sup>13</sup> ယိခွါ,ယခ့ၫယၡၩမိမၩဆၧလၧဆၧကိၪ့ၥ့ၪ, မိဘီၪ ထၪ့ယီၫထၪ့တၭ, မိထၪ့မိထီၫတၭ, မိဒိၪထၪ့ထီၫထၪ့",
			"14": "<sup>14</sup> ဒိၪမၬလီၫ.- ဘဲၫၦအၪဂၩထီၫမံၫထီၫမၪလၧအကၠီၩ့ အၥိၭ,(အမ့ၬအခံးအဂၩ့ဂၭဂီၩ့ထီးအလမွဲလၧၩ့ဘၪ ဘဲၫၦၡၩအၥိၭ, ဒဲအမိၡါအခံးအဂၩ့ နၭနဲၪ့ဒံၭၦၡၩ",
			"15": "<sup>15</sup> အဖိၪခွၫၥံၪလီၫ.)- အဝ့ၫဒၪမိဎွံၪဆၧလၧၦအၪဆၨၩ အလီၩ့ဘဲၫနီၪၥိၭး စဎွၩလဖၪမိကၭဘံၭထၬအနိၭလၧ အမ့ၬယၫလီၫ. အဂဲးဘဲၫယီၩဆၧလၧၦလလီၩဘၪဝ့ၫ နီၪ,အဝ့ၫၥံၪမိဒၪဘၪဝ့ၫး ဒဲဆၧလၧအလနါဂၧၫ့ဘၪဝ့ၫ နီၪအဝ့ၫၥံၪနၪဝ့ၫမိၥ့ၪဆ့လီၫ."
		},
		"53": {
			"1": "<sup>1</sup> မွဲပလၫနဲၩထဲၩ့ယူၭဆၧပရၧၫ့ လၧပလီၩလၩ့လၬ လၩ့လဂၩလဲၪ. တၭယဟိဝၩအစူၪဒူၪအီၪဖျီၪထၪ့ယူၭ",
			"2": "<sup>2</sup> လၧပလၫအမ့ၬယၫလဂၩလဲၪ.- မွဲအမဲၪထၪ့ဝ့ၫလၧအ မ့ၬယၫဘဲၫၥံၪ့အယိၬဘၪ့အၥိၭတၭ, ဘဲၫၥံၪ့အဝံလၧ ဂၪ့ခိၪဎဲၫ့ဒိၭဒူၪထၪ့အၥိၭနီၪလီၫ. အခံးအဂၩ့လအီၪ ဘၪ,အဎံၫအလၩဆ့လအီၪဘၪတၭ, ထီးပဒၪဘၪအ",
			"3": "<sup>3</sup> ဝ့ၫအခံးအဂၩ့ လၧအဘၪပမ့ၬနီၪအီၪအ့ၬ.- ၦၡၩမၩ ကြၩ့ထမးတၭ,လ့ၩဒၪခွံၬအဝ့ၫး မွဲဝ့ၫလၧၦၡၩၥုၪ့အုၭ ၥၭအုၭတၭ,ၥ့ၪယၫဆၧၡၪ့ဆၧနၭ, ဘဲၫၦလဂၩလၧပ မၩဘံၭခွံၬပမ့ၬလၧအမ့ၬယၫအၥိၭ, ၦမၩကြၩ့ထမး ဝ့ၫတၭ,ပအီၪက့ၪအလးအ့ၬ.",
			"4": "<sup>4</sup> မွဲမၬ, အဝ့ၫဒၪဆိၬ ပဆၧစူၭဆၧဆၫတၭ, အွံၪဝ့ၫ ပဆၧၥုၪ့အုၭၥၭအုၭလီၫ. တၭပဆီၫ့မီၪ့လၧဆၧကျီၪ့",
			"5": "<sup>5</sup> ဝ့ၫ,လၧယွၩထးဝ့ၫတၭ, ဘၪၡၪ့ဘၪနၭလီၫ.- တၭမွဲအ ဘၪဆၧဆ့ၭဖိးဝ့ၫ လၧပဆၧမၪအကၠီၩ့တၭ, ဘၪဆၧ မၩလၩ့ဘျ့ၭဝ့ၫလၧပဆၧဒဲၩဘၭအကၠီၩ့လီၫ. ဆၧအၪ့ ၥီၪ့ဘၪဆဲၫ့လၧပဆၧဘၪလိၬအိၭလိၬနီၪ အီၪဝ့ၫလၧ အလီၩ့တၭ, ပဘျၪထဲၩ့လၧအဝ့ၫဒၪဘၪထးအဖၧၩ့လး",
			"6": "<sup>6</sup> အကၠီၩ့နီၪလီၫ.- ပဝ့ၫဒၪယီၩဘဲၫၥိၪအၥိၭနီၪပဂၭဖျိၭ ယူၭဖၧၩ့ၥၭကိၭဂၩဒ့ၭယူၭ. ပလ့ၩလဂၩလၧအဖၧၩ့ ၥၭဒၪဝ့ၫ,လဂၩလၧအဖၧၩ့ၥၭဒၪဝ့ၫဆုၬဆုၬလီၫ. တၭ ပဝ့ၫဒၪထီးအလူၬယီၩ ကဆါအီၪက့ၪပဆၧအၧၩ့ဆၧ ၥၫ့လၧအဝ့ၫဒၪအလီၩ့လီၫ.",
			"7": "<sup>7</sup> အဝ့ၫဒၪဘၪဆၧမၩအၧၩ့မၩၥၫ့ဝ့ၫတၭ, ထိးဆၧၡၪ့ ဆၧနၭ,အနၫ့ဆါဒၪဝ့ၫလါနၫ့တၭ, အၩ့ထၪ့အနိၭအ့ၬး ဘဲၫၥိၪဖိၪလၧၦမီၩ့မၩၥံၫဝ့ၫအၥိၭ, ဘဲၫၥိၪလၧအအီၪ လၩ့မါပံၭ လၧၦထံၭအဆီၪ့အမ့ၬယၫအၥိၭနီၪ, အၩ့",
			"8": "<sup>8</sup> ထၪ့အနိၭအ့ၬ.- လၧဆၧၡၪ့ဆၧနၭအဖၧၩ့,ဒဲလၧဆၧ စ့ၩရၫ့ခွးအဖၧၩ့နီၪ ဆၧထုၭထၪ့ခွံၬအဝ့ၫလီၫ. လၧၦ ၥၭမၧၫ့အခးဖၧၩ့နီၪ ဆၧဒၪ့ထ့ၬခွံၬဝ့ၫတၭ, လၧအၡၩ လဆိၩလကၠၪအကျၩနီၪ မွဲပလၫမိဒုၭနဲၪ အဆၨၩအ ဆၬလဂၩလဲၪ. မွဲလၧယၡၩခမျၧးအဆၧမၪအကၠီၩ့ထိး",
			"9": "<sup>9</sup> ဘၪဆၧဆိၪအၧၩ့လၧအဝ့ၫၥံၪအလးလီၫ.- တၭဆၧဖ့ၪ လၫ့အၥွၪခိၪအီၪလၧၦအၧၩ့ၦၥၫ့အကျၩ, လၧအၥံၫဝ့ၫ နီၪအီၪလၧၦၥထံၫအကျၩလီၫ. မွဲလါနၫ့တၭမၩဆၧ အၧၩ့ဆၧၥၫ့နးမံၩ့အ့ၬ, ဆၧအၪ့လီၫအီၪလၧအနိၭအ့ၬ.",
			"10": "<sup>10</sup> မွဲလါနၫ့တၭ, ဘၪယဟိဝၩအၥၭလၧအမိမၩလၩ့ ဘျ့ၭဝ့ၫမၩၡၪ့မၩနၭဝ့ၫလီၫ. ထီးအအီၪက့ၪအၥၭလၧ ဆၧလုလၧဆၧဒဲၩဘၭအကၠီၩ့တၭ, မိဒၪဘၪအချံၫအ ၥၪ,ဆၧထုၭထီၫထၪ့အနံၩအၥၫ့တၭ, ဆၧဘၪယဟိ",
			"11": "<sup>11</sup> ဝၩအၥၭမိဘီၪထၪ့ယီၫထၪ့လၧအစူၪဖၧၩ့လီၫ.- အဝ့ၫ ဒၪမိဒၪဘၪဆၧလၧအထိးၡၪ့ထိးနၭအကၠီၩ့တၭ, မိမံၫ့ ၥုၪ့မံၫ့ၥၭလီၫ. ယခ့ၫယၡၩ အတီၩအလီၩ့ မိအီၪက့ၪ တီၩအီၪက့ၪလီၩ့ၦအၪဂၩလၧအဆၧၥ့ၪယၫလီၫ. အဂဲး ဘဲၫယီၩအဝ့ၫဒၪလဂၩနီၪ မိဆိၬအဝ့ၫၥံၪအဆၧအၧၩ့",
			"12": "<sup>12</sup> ဆၧၥၫ့လီၫ.- မၩအၥၭဘဲၫနီၪတၭ, ယမိဖ့ၪအၪ့နၩ့ဖၭ အဂးလၧၦအဒိၪအကျၩတၭ, အဝ့ၫဒၪမိအၪ့နၩ့ဖၭဆၧ အၪ့ဂူၬန့လၧၦအဂဲးဆီၪ့အဘၭဆီၪ့အကျၩလီၫ. အဂဲး ဘဲၫယီၩမွဲအလူၫလၩ့အၥၭထီးအၥံၫတၭ, ဆၧဝံထၪ့နၬ ထၪ့ဝ့ၫ လၧၦမၩမၪဆၧအကျၩတၭ, မွဲအဆိၬထၪ့ခွံၬ ၦအၪဂၩအဆၧဒဲၩဘၭတၭ, မိအၪ့ကံၩ့အၪ့ယၫဆၧ လၧၦမၩမၪဆၧအဂးလီၫ."
		},
		"54": {
			"1": "<sup>1</sup> ကိၭၡၭထၪ့ၦထူၬဖိၪလၧအလဆီၫ့အီၪန့ဘၪဆၧဧ့, ဂၪ့ကိၭဂၪ့ၡၭထၪ့တၭ, ထုၭထၪ့နလူၦလၧအလဘၪ ဘၪဆၧဂူၭဆၫဘၪလဂၩဧ့, အဂဲးဘဲၫယီၩၦလၧအ အီၪယူဝ့ၫလဂၩနီၪ အဖိၪအၪနဲၪ့ဒံၭၦမုၪအီၪလၧအဝၩ",
			"2": "<sup>2</sup> အဖိၪလီၫ.ယဟိဝၩစံၭဝ့ၫဒၪ,- မၩလဲထၪ့နတဲၩအလး တၭ,နအီၪအလးအဒီၪ့နီၪမၩထီၫဝ့ၫဆံၭ. လီၫ့ကီၩ့ဆၧ လဂ့ၩ, မၩထီၫနဖျံၩတၭ, မၩခၧၫ့နတၧၩ့လဖၪဆံၭ.",
			"3": "<sup>3</sup> အဂဲးဘဲၫယီၩနမိဖျိၭထၪ့ လၧနစူၪထွ့ၪဒဲလၧစူၪစ့ၪတၭ, နချံၫနၥၪမိန့ၥၫၦဆၨၩလဖၪ, ဒဲမိအီၪဝ့ၫလၧဒိၩ့အီၪယူ",
			"4": "<sup>4</sup> အဖၧၩ့လီၫ.- ထီးၥၭမဲၪလဂ့ၩ, အဂဲးဘဲၫယီၩနမ့ၬမိမဲ ဘၪအ့ၬ. တၭအီၪက့ၪမဲနမ့ၬလဂ့ၩ, အဂဲးဘဲၫယီၩဆၧ မိဒုၭမ့ၬမဲနၧၩအ့ၬ. အဂဲးဘဲၫယီၩနၥၭဘၪ့အမ့ၬမဲနီၪ နမိၥၭနၪ့တၭ, နအီၪမုၪမဲၫအဆၧဒုၪဒွ့ၪနီၪနနၪ့ထၪ့ထဲၩ့ လၧၩ့အ့ၬ.",
			"5": "<sup>5</sup> အဂဲးဘဲၫယီၩ ၦလၧအတဲၩ့လၩ့နၧၩလဂၩနီၪမွဲန ဝၩတၭ,အမံၩ့မွဲဆၧၥုၭမုခမျၧးအယဟိဝၩလီၫ. တၭၦ လၧအဎွ့ၩန့ထဲၩ့နၧၩ လဂၩနီၪ မွဲအံၫစရ့လၭအဆၧ ဆံၫ့ဎံၪလဂၩလီၫ. တၭဆၧမိကိၭဝ့ၫလၧဂၪ့ခိၪထၧၫ့",
			"6": "<sup>6</sup> ဘံၪ့ယၫအယွၩလီၫ.- အဂဲးဘဲၫယီၩဘဲၫၦမုၪလၧဆၧ စဲၪ့ဒၪဝ့ၫတၭ, ဘၪဆၧၡၪ့ဆၧနၭ လၧအၥၭခံဖၧၩ့နီၪ ယဟိဝၩကိၭထဲၩ့ယူၭနၧၩတၭ, ဘဲၫမၫလဂၩလၧအန့ ဝၩလၧအမုၪနၩ့ထၪ့အၥိၭနီၪ, အဂဲးဘဲၫယီၩယဟိဝၩ",
			"7": "<sup>7</sup> လီၩဝဲၩဝ့ၫ, မိဘၪဆၧခွံၬၡိၭခွံၬဝ့ၫလီၫ.- ယစဲၪ့ဒၪနၧၩ လဆိဖိၪလါနၫ့တၭ, ယမိအၪ့ထုၫ့ကီၪ့နၧၩလၧဆၧယၫ့",
			"8": "<sup>8</sup> ၥၭဖၭဒိၪလဖၪလီၫ.- မွဲယၥၭခိထၪ့လကၠၪတၭ,ယအီၪ က့ၪၥူၪယၥၭလၧနမ့ၬယၫလဆိဖိၪလီၫ. မွဲလါနၩ့ဘိၩ ယမိယၫ့ၥုၪ့ယၫ့ၥၭနၧၩ အီၪလၧဆၧအခိးအတၩအ ဆိၩအကၠၪတၭ, ယဎွ့ၩန့ထဲၩ့နၧၩယဟိဝၩစံၭဝ့ၫဒၪ",
			"9": "<sup>9</sup> လီၫ.- အဂဲးဘဲၫယီၩအယီၩ မွဲဘဲၫစနိအၫအထံၫအၥိၭ လၧယဂးလီၫ.ဘဲၫယဆိၪလၩ့ယၥၭလၧထံၫဘၪဆဲၫ့ လၧစနိအၫလၧအလမိလုၬဘံၭလၧၩ့ဘၪ ဂၪ့ခိၪအၥိၭ နီၪ,ယဆိၪလၩ့ယၥၭ လၧယလၥၭထၪ့လၧၩ့ဘၪနၧၩ",
			"10": "<sup>10</sup> တၭ,ယလအၪ့ၥီၪ့လၧၩ့ဘၪနၧၩလီၫ.- အဂဲးဘဲၫယီၩ ခိၪလီၩ့ထိၩ့ချိၬမိၥုၭအလး, ဒဲဆၧစီၩ့ခိၪမိဝၭဝ့ၫလီၫး အ့ၪမွဲယခိးယတၩ လစဲၪ့ထၪ့ခွံၬဘၪ လၧနအီၪတၭ, ယဆၧအုၩ့လၩ့ဘၪဆဲၫ့ လၧဆၧဎူၫဆၧဎၩ့ လဂဲၩလ ဝၭဘၪနီၪ, ယဟိဝၩလၧအယၫ့ၥၭနၧၩလဂၩစံၭဝ့ၫဒၪ.",
			"11": "<sup>11</sup> ၦလၧအဘၪဆၧၡၪ့ဆၧနၭ, ဘၪလံၩမုတၭ,လဘၪ ဘၪဆၧမၩမုၬထၪ့ထဲၩ့နၧၩ,လဂၩဧ့,ယိခွါ, ယအီၪက့ၪ နလိးလဖၪ လၧလိးအဎံၫအလၩတၭ,နခၪ့ထံၭလဖၪ",
			"12": "<sup>12</sup> လၧထၫ့မျါနံၩလၩၥံၪလီၫ.- ယမိတဲၩ့တၨၭထီၫလၧနခိၪ စီၪ့လၧထၫ့မျါဝီၩၡုၬတၭ, နတရၫ့လၧထၫ့မျါဂိးၡ့ၭဂိး ၡီၫတၭ,ဆၧလၧနနဲၩ့ထံၭထီးအလူၬနီၪ မိမွဲလိးဘၪ",
			"13": "<sup>13</sup> ၦၡၩအမ့ၬလီၫ.- တၭနဖိၪနလံၩထီးအလူၬမိဘၪဆၧ ၥီၪ့လိၪဝ့ၫလၧယဟိဝၩတၭ, နဖိၪၥံၪအဆၧဎူၫဆၧဎၩ့",
			"14": "<sup>14</sup> နီၪမိဒိၪဝ့ၫအၪဝ့ၫလီၫ.- နမိအီၪဂုးအီၪခၧၫ့လၧဆၧတီၩ ဆၧလီၩ့လီၫ. နမိအီၪယဲၩ့ လၧဆၧမၩအၧၩ့မၩၥၫ့နီၪ, အဂဲးဘဲၫယီၩ နလၥၭမဲၪဘၪဆၧတၭ, အီၪယဲၩ့လၧဆၧ မၩဂၭဂီၩ့း အဂဲးဘဲၫယီၩ မွဲအလဂဲၫဘူၭဘၪလၧနၧၩ",
			"15": "<sup>15</sup> လီၫ.- ယိခွါ,ၦၡၩမိအီၪကိၩ့အီၪကီၪ့လါနၫ့တၭ, မွဲလၧ ယမၪလူၬဝ့ၫအကၠီၩ့အ့ၬး ၦၡၩလၧအအီၪကီၪ့ထၫ့ဒုၪ ဒၩနၧၩမွဲပလၫလဂၩလဲၪနီၪ, အဝ့ၫၥံၪမိနုၬထဲၩ့လၧ",
			"16": "<sup>16</sup> နအီၪလခီၫလီၫ.- ယိခွါ, ယတဲၩ့လၩ့ယူၭၦထမၬဖိၪ လၧအအူၪၡိၫမ့ၪအၧၩ့ဖၭ လၧမ့ၪကျၩလၧအဝ့ၫဒုၭဂဲၫ ထၪ့အစူၪဝဲၩ လၧအမၩဆၧအကၠီၩ့ယူၭတၭ, ယတဲၩ့ လၩ့ယူၭဆၧမၩယူနီၪ,ဘဲၫၥိၭအမိမၩဂၭဂီၩ့ဆၧယူၭ.",
			"17": "<sup>17</sup> ဆၧစူၪဝဲၩလၧအဘၪဆၧတဲၩ့လၩ့ဝ့ၫထၫ့ဒုၪဒၩနၧၩနီၪ မိကဲၪထၪ့ကဲၪထီၫနးမံၩ့အ့ၬ. ကယဲၦၡၩအဖျ့ၩလၧ အဂဲထုၪ့ထၫ့ဒုၪဒၩနၧၩ လၧဆၧစ့ၩရၫ့အဖၧၩ့နီၪနမိဒုၭ စ့ၩရၫ့စၪဝ့ၫလီၫ. အနီၪမွဲယဟိဝၩအခ့ၫအၡၩအဆၧ န့ၥၫတၭ,အဆၧတီၩဆၧလီၩ့ဂဲၫလၧယၧၩလီၫး ယဟိ ဝၩစံၭဝ့ၫဒၪ."
		},
		"55": {
			"1": "<sup>1</sup> ဂဲၫဘီၪၬ ကယဲၦၡၩလၧအၥၭဝံအၥၭလၧထံၫလဂၩ လါလါဧ့, ဂဲၫလၧထံၫအအီၪဆံၭ. တၭၦလၧအစ့ၩ လအီၪဘၪၥံၪဧ့,ဂဲၫဘီၪ,ဎွ့ၩဆၧ,ဒဲအၪ့ဆၧဆံၭ. မွဲမၬ, စ့ၩလအီၪအဎွ့ၩလအီၪဘၪနီၪ ဂဲၫဘီၪ, ဎွ့ၩစဘံၭထံၫ",
			"2": "<sup>2</sup> ဒဲဆၧနူထံၫဆံၭ.- နၥံၪလူၬစ့ၩလၧဆၧအဂးလၧအလမွဲ ဘၪကိၪတၭ,နၥံၪမၩဆၧလၧအလဒုၭဘျဲၩအၪ့ဘၪနီၪ အဂးမွဲဘၪလဲၪ. ခိၭနၪယလူလၩ့ထံးလၩ့ဆ့ၭတၭ,အၪ့ ဆၧအဂ့ၩနီၪဆံၭ. တၭနၥံၪအၥၭ မိမုၬထၪ့ထဲၩ့လၧ",
			"3": "<sup>3</sup> ဆၧအွံၪဆၧဆၧၫ့အဖၧၩ့လီၫ.- ဒိၭနၥံၪအနါတၭ,ဂဲၫ လၧယအီၪဆံၭ.ခိၭနၪတၭ,နၥံၪအၥၭမိမၧၫ့ဝ့ၫ, ဒဲယ မိမၩဆၧအုၩ့လၩ့အဆိၩအကၠၪလၧနၥံၪ, ဆၧအခိးအ",
			"4": "<sup>4</sup> တၩဂုးခၧၫ့ဘၪဆဲၫ့လၧစဒၫဝံၭလီၫ.- ယိခွါၬ ယအီၪက့ၪ အဝ့ၫဒၪလၧဆၧထိးအၥၭလၧၦဆၨၩလဖၪအဂး,ဆၧ အခိၪဒဲၦၡၩမၪလူၬဆၧလၧၦဆၨၩလဖၪအဂးလီၫ.",
			"5": "<sup>5</sup> ယိခွါ,ၦလဆၨၩလၧနလၥ့ၪယၫဘၪဝ့ၫနီၪ နမိကိၭန့ဝ့ၫ တၭ,ၦဆၨၩၥံၪလၧအလၥ့ၪယၫဘၪနၧၩနီၪ မိဂဲၫစဲၪ့ တလဲးလၧနအီၪ, လၧယဟိဝၩနယွၩအကၠီၩ့,ဒဲလၧအံၫ စရ့လၭအဆၧဆံၫ့ဎံၪလဂၩအကၠီၩ့လီၫ. အဂဲးဘဲၫ ယီၩမွဲအမၩလၩမၩဖၩ့ယူၭနၧၩယူၭ.",
			"6": "<sup>6</sup> လၧၦဒၪန့ယဟိဝၩၥ့ၪအဘိၩ့ဘၭနီၪ အၪ့ဎူၫအၪ့ဎၬ နၥံၪဝ့ၫဆံၭ, လၧအအီၪဘူၭအဘိၩ့ဘၭနီၪ ကိၭထၪ့",
			"7": "<sup>7</sup> နၥံၪဝ့ၫဆံၭ.- ၦလတီၩလလီၩ့ဘၪနီၪ, မွဲအခွံၬၡိၭခွံၬ အဖၧၩ့ၥၭဒၪဝ့ၫတၭ, ၦအၧၩ့နီၪမွဲအ ဎခွံၬၡိၭခွံၬၭ အဆီၫ့ မီၪ့ဆၧတၭ, ဂဲၫထဲၩ့ထဲၩ့လၧယဟိဝၩအအီၪနီၪဆံၭ. မွဲအဝ့ၫဒၪမိယၫ့ၥုၪ့ယၫ့ၥၭဝ့ၫလီၫ. မွဲအဂဲၫလၧပယွၩ အအီၪဆံၭ. အဂဲးဘဲၫယီၩ, အဝ့ၫဒၪမိဖျါခွံၬ ဆၧအၪ",
			"8": "<sup>8</sup> အၪလ့ၬလီၫ.- အဂဲးဘဲၫယီၩ ယဆီၫ့မီၪ့ဆၧလမွဲဘၪ ဘဲၫနၥံၪဆီၫ့မီၪ့ဆၧအၥိၭတၭ နၥံၪအဖၧၩ့ၥၭလမွဲဘၪ",
			"9": "<sup>9</sup> ယဖၧၩ့ၥၭဒၪယဝ့ၫ, ယဟိဝၩစံၭဝ့ၫဒၪ.- အဂဲးဘဲၫယီၩ ဘဲၫမူၭခိၪထီၫနဲၪ့ဒံၭ ဂၪ့ခိၪအၥိၭနီၪ, ယဖၧၩ့ၥၭထီၫ နဲၪ့ဒံၭနၥံၪအဖၧၩ့ၥၭတၭ, ယဆီၫ့မီၪ့ဆၧယိၬနဲၪ့ဒံၭ",
			"10": "<sup>10</sup> နၥံၪဆီၫ့မီၪ့ဆၧဘဲၫနီၪၥိၭလီၫ.- ဆၧဆၧၩ့ဒဲမူၭခိၪဖီၫ ဂဲၫလၩ့လၧမူၭခိၪတၭ, လထဲၩ့ထဲၩ့ဘၪလၧနီၪး အ့ၪမွဲ အမၩဘၪစီၪဂၪ့ခိၪတၭ, ဒုၭမဲၪထၪ့ဖၭထၪ့ဆၧၥၪတၭ, ဖ့ၪလၫ့ၦဎွံၪဆၧအချံၫ, ဒဲဆၧအၪ့လၧၦအၪ့ဆၧအဂး",
			"11": "<sup>11</sup> လီၫ.- ဘဲၫနီၪအၥိၭ, ယဆၧချဲၩ့လၧအဂဲၫထၪ့လၧယ နိၭမိမၩအၥၭဘဲၫနီၪတၭ, မိဂဲၫထဲၩ့ပျီၩလၧယအီၪအ့ၬ. ဆၧလၧယအၪ့မၧၫ့အမၩဆၧနီၪ မိဒုၭကဲၪထၪ့ဆၧလီၫ.",
			"12": "<sup>12</sup> အဂဲးဘဲၫယီၩနၥံၪမိစဲၪ့ထၪ့ခွံၬ လၧဆၧၥုၪ့ဎွံၫၥၭယီၫ တၭ,ဆၧမိၥိၫ့နၥံၪလၧဆၧဎူၫဆၧဎၩ့လီၫ. ခိၪလီၩ့လ ဖၪ,ဒဲဆၧစီၩ့ခိၪလဖၪ မိကိၪ့ထၪ့လၧဆၧၥံၫကျံၩလၧ နၥံၪအမ့ၬယၫတၭ, ကယဲၥံၪ့လၧမံၩ့လၬကျၩနီၪမိဒဲၩ",
			"13": "<sup>13</sup> အစူၪထီးအလူၬလီၫ.- လၧဆၧဆူၪအလးနီၪၥံၪ့ၡိၫမိ မဲၪထၪ့ဒဲလၧဆၧဆူၪဆၧမဲၪအလးနီၪၥမံၫဟဒၭမိမဲၪ ထၪ့လီၫ. တၭမိကဲၪထၪ့ဆၧလၧယဟိဝၩအဂးလၧဆၧ အမံၩ့ဒဲဆၧအနဲၪ့အဆိၩအကၠၪလၧဆၧလဒၪ့ထ့ၬခွံၬ ဘၪနီၪလီၫ."
		},
		"56": {
			"1": "<sup>1</sup> ယဟိဝၩစံၭဘဲၫယီၩ, ထီးန့ဆၧစ့ၩရၫ့တီၩတၭ,မၩ ဆၧတီၩဆၧလီၩ့ဆံၭ. အဂဲးဘဲၫယီၩယဆၧထိးထဲၩ့ တၩ့ထဲၩ့အီၪဘူၭထၪ့ယူၭ, ဒဲယဆၧတီၩဆၧလီၩ့လၧ",
			"2": "<sup>2</sup> အမိအီၪဖျီၪထၪ့လီၫ.- ၦလၧအမၩဆၧယီၩၦၡၩဖိၪ လၧအဖီၪ့ထၬဝ့ၫနီၪ ၦလၧအထီးန့မးၥံၫအနံၩ ဘဲၫၥိၭ အထီးမၩၥၭလိၪဝ့ၫလဂ့ၩ, ဒဲယိအစူၪ ဘဲၫၥိၭအထီး မၩဆၧအၧၩ့လဂ့ၩနီၪဘၪဆိၪဂ့ၩဝ့ၫလီၫ.",
			"3": "<sup>3</sup> ၦလခီၫဘၩ့မုးဖိၪလၧအဒိၭနဲၩ့အၥၭ လၧယဟိဝၩ နီၪမွဲအထီးစံၭ, ယဟိဝၩမၩလၩ့ဖၭတၡါယူၭယၧၩ လၧအၡၩခမျၧးနီၪလဂ့ၩတၭ, ၦဖၫဆွံၪနီၪမွဲအထီးစံၭ,",
			"4": "<sup>4</sup> ယမွဲၥံၪ့ဎဲၫ့လထုၪ့နီၪလဂ့ၩ.- အဂဲးဘဲၫယီၩယဟိဝၩ စံၭ,ၦဖၫဆွံၪၥံၪလၧအထီးန့ယမးၥံၫအနံၩ, ဒဲရွံန့ဆၧ",
			"5": "<sup>5</sup> လၧအဘၪယၥၭ ဒဲဖီၪ့ထၬယဆၧအုၩ့လၩ့နီၪး- ယမိ ဖ့ၪလၫ့ဝ့ၫလၧအလး ဒဲအမံၩ့ဂ့ၩနဲၪ့ဒံၭဖိၪခွၫၥံၪ, ဒဲဖိၪ မုၪၥံၪလၧယဂံၪ့ဖၧၩ့, ဒဲလၧယဝၩ့အခိၪဒၧၩ့ အဖၧၩ့ လီၫ.ယမိဖ့ၪလၫ့ဝ့ၫအမံၩ့အဆိၩအကၠၪလၧအဆၧလ",
			"6": "<sup>6</sup> ဒၪ့ထ့ၬခွံၬဘၪလီၫ.- ၦလခီၫဘၩ့မုးဖိၪဆ့လၧအဒိၭနဲၩ့ အၥၭလၧယဟိဝၩ, ဘဲၫၥိၭအမိမၩအဆၧဒဲအဲၪယဟိ ဝၩအမံၩ့ဘဲၫၥိၭအမိကဲၪထၪ့အခ့ၫအၡၩ, ကယဲၦလၧ အထီးန့ မးၥံၫအနံၩလမၩစံၪစၪဘၪဝ့ၫတၭ, ဖီၪ့ထၬ",
			"7": "<sup>7</sup> ယဆၧအုၩ့လၩ့ထီးအလူၬနီၪး- ယမိဒုၭဂဲၫထၪ့အဝ့ၫ ၥံၪဒၪလ့ၬလၧယခိၪလီၩ့ဆံၫ့ဎံၪတၭ, ယမိဒုၭၥၭထိၬ အဝ့ၫၥံၪလၧယဆၧဘၩဆိၪဖၪအဂံၪ့ဖၧၩ့လီၫ. အဆၧ လုမ့ၪဒဲအဆၧလုလဖၪနီၪ ဘၪဆၧအၥၭတၭ, မိထၪ့ ဘၭလၧယဆၧလုလးအဖၫ့ခိၪး အဂဲးဘဲၫယီၩ ယဂံၪ့ မိဘၪဆၧကိၭဝ့ၫလၧဆၧဘၩဆိၪဖၪအဂံၪ့ လၧၦကိၭ",
			"8": "<sup>8</sup> ဆၨၩဒ့ၭအဂးလီၫ.- ကဆါယဟိဝၩလၧအဒုၭအီၪ ကီၪ့ၦအံၫစရ့လၭဖိၪ လၧအဘၪဆၧနၫ့ထၪ့ခွံၬဝ့ၫနီၪ စံၭဘဲၫယီၩ, ၦလၧအအီၪကီၪ့ယူၭလၧအအီၪအမ့ၬယၫ နီၪယမိဒုၭအီၪကီၪ့ၦဂူၫဂၩဆ့လၧအအီၪလီၫ.",
			"9": "<sup>9</sup> ကယဲဆၧဖိၪဆၧဎါလၧဆၧပျၩ့ဖၧၩ့ၥံၪဧ့, ဒဲဆၧဖိၪ ဆၧဎါလၧမံၩ့လၬကျၩ ထီးအလူၬၥံၪဧ့, ဂဲၫအၪ့ဆၧ",
			"10": "<sup>10</sup> ဆံၭ.- အၡၩခိၭဆၧမွဲၦမ့ၬဘျီၪထီးအလူၬ,လၥ့ၪယၫ ဘၪဆၧတၭ, မွဲထွံၪအုၭအၭထီးအလူၬတၭ,မၩ့ဆၧလ ၥ့ၪဘၪတၭ, မွဲအမံၫမးဆၧ,မံၫခံၫ့ဝ့ၫ, အဲၪဒိၭအမံၫမၪ",
			"11": "<sup>11</sup> လီၫ.- မွဲမၬ,ထွံၪနီၪၥၭကွံၩဆၧအၪ့တၭ, ၥ့ၪယၫဆၧ ဘျဲၩအၪ့အ့ၬ. အဝ့ၫၥံၪမွဲၦယူၬၥိၪ အနၫ့ဆါဒၪဝ့ၫနီၪ အနၪဆၧလၥ့ၪဘၪတၭ, ကၠၪအၥၭလဂၩလၧအဖၧၩ့ ၥၭဒၪဝ့ၫ,လဂၩလၧအၥၭကွံၩဆၧအဖၧၩ့, လဂၩလၧ",
			"12": "<sup>12</sup> အၥၭကွံၩဆၧအဖၧၩ့ဆုၬဆုၬလီၫ.- စံၭဝ့ၫ, ဂဲၫနၥံၪဝ့ၫ ဘီၪ,ယမိမၩန့စဘံၭထံၫတၭ, ပမိဘျဲၩအီၩလၧၥံၭထံၫ ဂၬထံၫတၭ,ကဲဂီၩလနံၩ မိမၩအၥၭဘဲၫမုဆၫလနံၩ ယီၩအၥိၭနီၪ, အၪနဲၪ့ဒိၪနဲၪ့ဒံၭလီၫ."
		},
		"57": {
			"1": "<sup>1</sup> ၦအတီၩအလီၩ့ဘၪဆၧမၩဂၭဂီၩ့တၭ, ၦၡၩထီးန့ လၧအၥၭနးဂၩအ့ၬ. တၭၦမၩဂ့ၩဆၧနီၪဘၪဆၧထုၭ ထၪ့ခွံၬလါနၫ့တၭ, ၦတီၩၦလီၩ့ဘၪထုၭခွံၬလၧဆၧ",
			"2": "<sup>2</sup> အၧၩ့နီၪ,ၦၡၩဆီၫ့မီၪ့ဝ့ၫနးဂၩအ့ၬ.- မွဲအမိလ့ၩနုၬ ဆၧလၧဆၧဎူၫဆၧဎၩ့အဖၧၩ့လီၫ. ၦလၧအလ့ၩဆုးလီၩ့ လၧအမ့ၬယၫနီၪမိအီၪပွံၭလၧအလးမံၫဖၧၩ့လီၫ.",
			"3": "<sup>3</sup> တၭနၥံၪဝ့ၫယီၩ, ၥုၭဘူၭနၥံၪအၥၭထီးယီၩ,ၦမၩက ဒၩၦမ့ၬအဖိၪလဖၪ, ၦမၩမၪၦဖိၪၦမၫ, ဒဲၦမဲၩဎွဲၩမုၪ",
			"4": "<sup>4</sup> အချံၫအၥၪၥံၪဧ့း- နၥံၪမၩကြၩ့ထမးပလၫလဂၩလဲၪ. နၥံၪအၩ့ထၪ့နၥံၪအနိၭဖၭလဲ, နၥံၪလဲၪ့ထၪ့နၥံၪအဖျ့ၩ လၧပလၫအလီၩ့လဲၪ. နၥံၪမွဲၦမၩမၪဆၧဖိၪ, ၦအၪ့",
			"5": "<sup>5</sup> လီၫဆၧအချံၫအၥၪနီၪမွဲအ့ၬဧၪ.- နၥံၪအၥၭဆီၪ့ထၪ့ လၧဆၧဂၩ့ဆၧဖၪ့အကျၩ လၧၥံၪ့ၥံၪကိၭထုၪ့ဒ့ၭအဖၫ့ လၬ,နၥံၪမၩၥံၫဖိၪၥၪလဖၪ လၧခိၪလီၩ့အဆူၭဖၧၩ့,",
			"6": "<sup>6</sup> လၧလိးအိၩဖၧၩ့နီၪမွဲအ့ၬဧၪ.- လၧခိၪလီၩ့ဆူၭအလိး ဖျ့ၫအကျၩနီၪနဂးအီၪလီၫ. အဝ့ၫၥံၪ, အဝ့ၫၥံၪမွဲဆၧ ဖၭန့လၧနဂးလီၫ. နလူၫလၩ့နဆၧလုအီၩလၧအဝ့ၫၥံၪ အဂး, နဂဲၫဆိၬဆၧမၩဘိၪ့ကိၪမုၬလီၫ. မွဲယၥုၪ့မိမံၫ့",
			"7": "<sup>7</sup> ယၥၭမိမံၫ့လၧဆၧနီၪလဖၪအကၠီၩ့ဆ့ဧၪ.- နအီၪက့ၪ နလးမံၫ လၧခိၪလီၩ့ဖၭထီၫလဖျိၪ့တၭ, ထီးဒၪလ့ၬန",
			"8": "<sup>8</sup> လ့ၩထၪ့လုထၪ့ဆၧလီၫ.- တၭလၧတရၫ့ဒဲအထုၪ့လ ဖၪအချိၫ့နီၪနအီၪက့ၪထၪ့နဆၧနၪ့ထၪ့ထဲၩ့လီၫ. အဂဲး ဘဲၫယီၩနနဲၪဖျီၪနနၫ့ဆါလၧၦဂူၫဂၩနီၪ, လမွဲဘၪယၧၩ တၭး နလ့ၩထၪ့တၭ, မၩလဲထၪ့နလးမံၫ, နအုၩ့လၩ့ ဆၧလၧအဝ့ၫၥံၪအၥိၭ, နအဲၪအဝ့ၫၥံၪအလးမံၫ, နတဲၩ့",
			"9": "<sup>9</sup> ဝဲၩအလးလၧအဂးလီၫ.- နလ့ၩလၧစဎွၩအအီၪဂုၪန ၥၭလၧၥိၪတၭ, မၩအၪထၪ့ၥိၪနၧၫ့မၧၫ့တၭ, နအၪ့မၧၫ့ လၩ့နၥီၫ့လဖၪလၧအယဲၩ့တၭ, နဆၪ့လၩ့နနၫ့ဆါလၧ ဖျႃဖၧၩ့လီၫ.",
			"10": "<sup>10</sup> နဖၧၩ့ၥၭယဲၩ့ဒဲဖၭဒိၪလၧနမၩဆၧလါနၫ့တၭ, နလ စံၭဘၪ, ယိလါဆၧအလးလအီၪဘၪနီၪတၭ, နဒၪန့ ဘၪနစူၪအၥၭမၧၫ့လီၫ. မၩအၥၭဘဲၫနီၪတၭ, နၥုၪ့",
			"11": "<sup>11</sup> အုၭၥၭအုၭဘၪအ့ၬ.- လၧနချဲၩ့ဘျံၭချဲၩ့ဘျၪတၭ, လ နၪ့ထၪ့ထဲၩ့ဘၪယၧၩတၭ, လထီးန့ဘၪလၧနၥၭနီၪ, န အၪ့ယိၪဆၧတၭ, နၥၭမဲၪပလၫလဂၩလဲၪ. မွဲယအီၪ လၩ့မါပံၭခီၫလၧဖျိၩ့နီၪတၭ, နလၥၭမဲၪဘၪယၧၩမွဲ",
			"12": "<sup>12</sup> အ့ၬဧၪ.- ယမိဒုၭနဲၪနဆၧတီၩဆၧလီၩ့ ဒဲနမၩဆၧလ ဖၪးအဂဲးဘဲၫယီၩမွဲအမိဒုၭအီၪထၪ့နခိးနတၩအ့ၬ.",
			"13": "<sup>13</sup> ထီးနအ့ၪကိၭထၪ့ဆၧတၭ, မွဲနဆၧအီၪကီၪ့မၩဖီၩ့မၩ ဖျ့ၭနၧၩဆံၭ. မွဲလါနၫ့တၭ, လံၩမိဆိၬခွံၬဝ့ၫထီးအလူၬ တၭ,အူၪဆၧလထံၪလူၬလီၫ. အ့ၪမွဲၦလၧအဒိၭနဲၩ့အ ၥၭလၧယၧၩမိန့ၥၫထံၫၥံၪခးၥံၪနီၪ, ဒဲမၩန့ယခိၪလီၩ့ ဆံၫ့ဎံၪလီၫ.",
			"14": "<sup>14</sup> တၭဆၧမိစံၭ,မၩထၪ့ထီၫ, မၩထၪ့ထီၫ,တဲၩ့ဝဲၩဖၧၩ့ ၥုၪ့ဖၧၩ့ၥၭ, အၪ့ထုၫ့ထၪ့ကယဲခၪ့ဘၪထၧၩ့အလးလၧ",
			"15": "<sup>15</sup> ယၡၩခမျၧး အဖၧၩ့ၥၭဖၧၩ့နီၪဆံၭ.- အဂဲးဘဲၫယီၩ ဆၧထၪ့ထီၫ, ဒဲဆၧအီၪထၪ့ထီၫလၧအအီၪဝ့ၫလၧဆၧ အဆိၩအကၠၪအဖၧၩ့နီၪ, အမံၩ့မွဲဆၧဆံၫ့ဎံၪလဂၩ စံၭဝ့ၫဘဲၫယီၩ, ယအီၪလၧဆၧထၪ့ထီၫ ဒဲလၧဆၧဆံၫ့ ဎံၪအလးဖၧၩ့ ဒဲလခီၫလၧၦအၥုၪ့ခါအၥၭလၩ့ ဒဲဆၪ့ လၩ့အၥၭအၥိၭ, ဘဲၫၥိၭယမိမၩမၧၫ့ထၪ့ၦဆၪ့လၩ့အ ၥၭ,ဒဲမၩမၧၫ့ထၪ့ၦလၧအၥုၪ့ခါအၥၭလၩ့လဖၪအၥၭ",
			"16": "<sup>16</sup> လီၫ.- အဂဲးဘဲၫယီၩ ယလဂဲးလိၬတ့ၭလိၬ လၩ့ဆိၩ လၩ့ကၠၪဘၪ,ယၥၭထၪ့လၩ့ဆိၩလၩ့ကၠၪဆ့အ့ၬ. အ ဂဲးဘဲၫယီၩ အ့ၪမွဲဘဲၫနီၪတၭ, ၦၡၩအၥၭမိလၩ့ပွံၭ လၩ့ထၩ့ၦၥၭလၧယတဲၩ့လၩ့ဝ့ၫလဖၪဒၪလ့ၬလီၫ.",
			"17": "<sup>17</sup> လၧအၥၭကွံၩဆၧအဆၧဒဲၩဘၭအကၠီၩ့, ယၥၭထၪ့ဝ့ၫ တၭ,ယထးဘၪအဝ့ၫတၭ, ကၠၪဒိၭချိၫ့ယၥၭ, ဒဲယၥၭ ခဲၩထၪ့လီၫ. အဂဲးဘဲၫယီၩမွဲအလ့ၩဆၧ, လ့ၩဒံၩ့ခံၫ့",
			"18": "<sup>18</sup> ဒံၩ့ခံၫ့ထီးဖၧၩ့ၥၭ, လၧအဘၪအၥၭလီၫ.- အဖၧၩ့ၥုၪ့ ဖၧၩ့ၥၭနီၪယဒၪဘၪယူၭတၭ, ယမိမၩဘျၪထဲၩ့ဝ့ၫတၭ, ယမိၥိၫ့ထၪ့ဝ့ၫ, ဒဲယမိမၩမုၬထၪ့ထဲၩ့ဝ့ၫ, ဒဲအၡၩလၧ",
			"19": "<sup>19</sup> အၥုၪ့အုၭအၥၭအုၭလဖၪလီၫ.- ယတဲၩ့လၩ့ၦၡၩအ နိၭဖျံၩအဆၧၥၪလီၫ. ဆၧဎူၫဆၧဎၩ့, ဆၧဎူၫဆၧဎၩ့, မွဲအအီၪလၧၦလၧအယဲၩ့ဒဲၦလၧအဘူၭဆံၭ, ယဟိဝၩ",
			"20": "<sup>20</sup> စံၭဝ့ၫဒၪးတၭယမိမၩဘျၪထဲၩ့ဝ့ၫလီၫ.- အ့ၪမွဲၦဆၧ ဒဲၩဘၭဖိၪလဖၪနီၪ မၩအၥၭဘဲၫမၫဆမံၭ လၧအဂဲၩ ဝၭဝ့ၫအၥိၭနီၪး အဂဲးဘဲၫယီၩ အီၪပွံၭဝ့ၫ လၥ့ၪဘၪ တၭ,အထံၫဆံပိၩ့ဖၪ့ထၪ့ဒုၭဂဲၫထၪ့ဖံၬ ဒဲဆၧဘံၪၥိၭ",
			"21": "<sup>21</sup> လီၫ.- ဆၧမုၬဆၧဎၩ့ လၧၦလတီၩလလီၩ့ဘၪအဂး အီၪနးဆံၭအ့ၬ, ယယွၩစံၭဝ့ၫဒၪ."
		},
		"58": {
			"1": "<sup>1</sup> ကိၭၡၭထၪ့လၧလူၥီၫနီၪဆံၭး လီၫ့ကီၩ့ဆၧလဂ့ၩး ထုၭထၪ့နလူဘဲၫခွ့ၩအၥိၭနီၪတၭ, လီၩဘၪယၡၩခ မျၧးအဆၧမၪ, ဒဲစယၫကူၭအၡၩဂံၪ့ဖိၪလၧအဆၧဒဲၩ",
			"2": "<sup>2</sup> ဘၭနီၪဆံၭ.- မွဲလါနၫ့အဝ့ၫၥံၪအၪ့ဎူၫအၪ့ဎၬယၧၩ လနံၩဘၪလနံၩတၭ, မွဲအၥၭထိၬဝ့ၫလၧဆၧၥ့ၪယၫ ယဖၧၩ့ၥၭ, ဘဲၫၦလဆၨၩလၧအမၩဆၧတီၩဆၧလီၩ့, ဒဲအလခွံၬၡိၭဘၪ အယွၩအဆၧစ့ၩရၫ့ အၥိၭနီၪလီၫ. အဝ့ၫၥံၪအၪ့ကံၩ့ဝ့ၫ ဆၧစ့ၩရၫ့လၧယၧၩတၭ,မုၬလၩ",
			"3": "<sup>3</sup> ဝ့ၫလၧဆၧၥုၭဘူၭအၥၭ လၧယွၩအအီၪနီၪလီၫ.- အ ဝ့ၫၥံၪစံၭဝ့ၫ, ပဒုၪဆၧအၪ့ဆၧအီၩတၭ,နလဒၪဘၪနီၪ, ပမၩၡၪ့မၩနၭပၥၭတၭ, နလၥ့ၪယၫဘၪနီၪမွဲဘၪလဲၪ. ယိခွါ,လၧနၥံၪဒုၪဆၧအၪ့ဆၧအီၩအမုလနံၩနီၪ, နၥံၪ ဒၪန့ဆၧမုၬလၩတၭ, နအၪ့မၧၫ့ၦၡၩမၩနၥံၪအဆၧမၩ",
			"4": "<sup>4</sup> ထီးအလူၬလီၫ.- ယိခွါ,လၧဆၧဂဲးလိၬတ့ၭလိၬ,ဒဲဆၧ အဲၪ့လိၬဆိၭချဲၩ့လိၬအဂးနီၪ, နၥံၪဒုၪဆၧအၪ့ဆၧအီၩ တၭ,နၥံၪမ့ၭဆၧလၧဆၧအၧၩ့အစူၪခိၪနီၪလီၫ. နၥံၪမိ ဒုၪဆၧအၪ့ဆၧအီၩ လၧမုဆၫလနံၩယီၩ ဘဲၫၥိၭနၥံၪ",
			"5": "<sup>5</sup> မိဒုၭနါဂၧၫ့နၥံၪအလူ လၧဆၧထၪ့ထီၫအ့ၬ.- အနီၪမွဲ ဆၧဒုၪဆၧအၪ့ဆၧအီၩလၧယရွံန့ဝ့ၫ, မုလနံၩလၧၦ မိမၩၡၪ့မၩနၭအၥၭဆ့ဧၪ, မွဲဘဲၫၥိၭၦမိၡီၫ့လၩ့အခိၪ ဘဲၫဖီးဘီၩ့အၥိၭ, ဒဲဘဲၫၥိၭအမိဒၩလၩ့ရၧၬအဆၧယၬ, ဒဲဖံၫ့ချၪလၧအဖၫ့လၬနီၪဆ့ဧၪ. မွဲနမိကိၭဆၧနီၪလမံၩ့ လၧဆၧဒုၪဆၧအၪ့ဆၧအီၩ ဒဲမုလနံၩလၧအဘၪယဟိ",
			"6": "<sup>6</sup> ဝၩအၥၭဆ့ဧၪ.- ဆၧဒုၪဆၧအၪ့ဆၧအီၩ လၧအဘၪ ယၥၭမွဲအယီၩ, ဆၧပၠၪလၩ့ခွံၬဆၧအၧၩ့အဖျံၩ, ဆၧ ဘဲၪ့လၩ့ခွံၬဆၧအွံၪဎၧၫ့တၭ, ဆၧမၩဂၭဖျ့ၭၦဘၪဆၧ မၩအၧၩ့ဝ့ၫ, ဒဲဆၧမၩခါခွံၬနိၪယိၭဘီၩ့ကိၭဘီၩ့ဒ့ၭနီၪ",
			"7": "<sup>7</sup> မွဲအ့ၬဧၪ.- မွဲဆၧကံၪ့ဘျ့ၭကိၪလၧၦဆၧၥၭဝံအၥၭအ ဂး,ဒဲၦၡၪ့ဖိၪယၬဖိၪ လၧအဘၪဆၧနၫ့ထၪ့ခွံၬဝ့ၫနီၪ, မွဲလၧနဂဲၫဆိၬထီၩ့ လၧနဂံၪ့ဖၧၩ့နီၪမွဲအ့ၬဧၪ. ထီးန အ့ၪဒၪဘၪၦအီၪဘိၪ့တၭ, နမိဒုၭကီၩ့ဒုၭၥိၭဝ့ၫ ဒဲလ ကၠၪဒိၭချိၫ့ဘၪနၥၭ လၧနဘူၭနထံးဒၪနဝ့ၫလီၫ.",
			"8": "<sup>8</sup> ထီးနီၪလဖၧၫ့နဆၧဖၩ့မိဖၩ့ထၪ့ဘဲၫ မုဆဲၪ့ထၪ့အၥိၭ တၭ, နဆၧမၩဘျၪထဲၩ့နၧၩနီၪ မိအီၪထၪ့ချဲၫ့ချံၭလီၫ. ထီးနီၪလဖၧၫ့ နဆၧတီၩ ဆၧလီၩ့ မိလ့ၩ လၧနမ့ၬယၫ တၭ, ယဟိဝၩအလၩအဖၩ့မိအီၪထိနၧၩလၧနလးခဲၫ့",
			"9": "<sup>9</sup> ဆ့လီၫ.- ထီးနီၪလဖၧၫ့နမိကိၭထၪ့တၭ,ယဟိဝၩမိစံၭ ဆၧၫ့ဆၧး နအ့ၪၥုၭထၪ့ခွံၬနိၪယိၭဘီၩ့လၧနကျၩ, ဒဲ ဆၧယူၬထၪ့နစူၪနိၩ့ဒဲချဲၩ့အၧၩ့ဆၧတၭ, ထီးနီၪလဖၧၫ့ နမိကိၭၡၭထၪ့ဆၧတၭ, အဝ့ၫဒၪမိစံၭဝ့ၫ,ယိခွါ, ယၧၩ",
			"10": "<sup>10</sup> လီၫ.- နၥၭအ့ၪယၫ့ၥၭၦလၧဆၧၥၭဝံအၥၭတၭ, မၩ မုၬထၪ့ၦလၧအဘၪၡၪ့ဘၪနၭတၭ, ထီးနီၪလဖၧၫ့နဆၧ ဖၩ့မိဖၩ့ထၪ့လၧဆၧခံၭကျၩတၭ, နဆၧခံၭမိမၩအၥၭ",
			"11": "<sup>11</sup> ဘဲၫမုထုၪ့အၥိၭနီၪး- ယဟိဝၩမိၥိၫ့နၧၩလထံၪဎးတၭ, မိဒုၭဘျဲၩအၪ့နၧၩလၧဆၧအလးဎဲၫ့ထၬၥံၪအဖၧၩ့,ဒဲ မိမၩဆီၪ့ထၪ့နဎွံၪလဖၪတၭး နမိမၩအၥၭဘဲၫကျိၭ ဘၪစီၪအၥိၭ, ဒဲဘဲၫထံၫထၪ့ဖျိၭလဖၧၩ့ လၧအထံၫလ",
			"12": "<sup>12</sup> လၩ့ၥံၭဘၪအၥိၭနီၪလီၫ.- တၭၦလၧအဘၪဆဲၫ့လၧ နၧၩလဖၪမိမၩထၪ့ထဲၩ့ဆၧအလးအီၪယူလဖၪ, နမိမၩ ထဲၩ့ဆၧအခၪ့ထံၭလဖၪ ဘၪဆဲၫ့လၧၦအၪဆၨၩတၭ, ဆၧမိကိၭနၧၩ လၧၦၡၩမၩထဲၩ့ဆၧလၩ့ဎီး, ၦၡၩမၩ ထဲၩ့ဖၧၩ့ၥုၪ့ဖၧၩ့ၥၭဘဲၫၥိၭၦၡၩမိအီၪဝ့ၫလီၫ.",
			"13": "<sup>13</sup> လၧမးၥံၫအနံၩနီၪနအ့ၪကၠၪပဲၩခွံၬနခၪ့ လၧနဆၧမုၬ လၩဒၪနဝ့ၫလၧယမုနံၩဆံၫ့ဎံၪအဖၧၩ့တၭ, နအ့ၪကိၭ မးၥံၫအနံၩလၧဆၧၥုၪ့ဎွံၫၥၭယီၫ, ယဟိဝၩအဆၧဆံၫ့ ဎံၪလၧဆၧယူၭယၪ့အလးတၭ, လဖိၬဘၪနဖၧၩ့ၥၭဒၪ နဝ့ၫ,ဒဲလဒၪန့ဘၪနဆၧမုၬလၩဒၪနဝ့ၫ ဒဲလချဲၩ့ဘၪန",
			"14": "<sup>14</sup> ဆၧချဲၩ့ဒၪနဝ့ၫတၭ,နအ့ၪမၩလၩဖၩ့ဝ့ၫတၭ,- ထီးနီၪ လဖၧၫ့နမိၥုၪ့ဎွံၫၥၭယီၫလၧယဟိဝၩအဖၧၩ့တၭ, ယမိ ဒုၭထူၬနၧၩ လၧဆၧအလးထၪ့ထီၫလၧဂၪ့ခိၪချိၫ့အဖၫ့ ခိၪတၭ, ယမိဒုၭအၪ့နၧၩ လၧနဖါစယၫကူၭအဆၧန့ ၥၫနီၪလီၫ. အဂဲးဘဲၫယီၩယဟိဝၩအနိၭချဲၩ့ဆၧလီၫ."
		},
		"59": {
			"1": "<sup>1</sup> ယိခွါၬ ယဟိဝၩအစူၪလၩ့ဖၨၪထဲၩ့ဘဲၫၥိၭအထိး ထဲၩ့တၩ့ထဲၩ့ဆၧလၥ့ၪဘၪနီၪမွဲအ့ၬး တၭအနါဎၧၫ့",
			"2": "<sup>2</sup> ဝ့ၫဘဲၫၥိၭအခိၭနၪဆၧလၥ့ၪဘၪနီၪဆ့အ့ၬ.- အ့ၪမွဲန ၥံၪအဆၧအၧၩ့လဖၪမၩလၩ့မုလၩ့ဖၭနၥံၪ လၧနၥံၪအ ယွၩတၭ, နၥံၪအဆၧဒဲၩဘၭဒုၭအီၪကဒုၩအမ့ၬလၧန",
			"3": "<sup>3</sup> ၥံၪအအီၪတၭ, မွဲအမိနါဂၧၫ့နၥံၪဆ့အ့ၬ.- အဂဲးဘဲၫ ယီၩနၥံၪအစူၪဘၪစံၪစၪလၧဆၧၥွံၪ, ဒဲနၥံၪအစူၪနိၩ့ လၧဆၧအၧၩ့လီၫ. နၥံၪအနိၭဖျံၩချဲၩ့ယူၭဆၧဘျံၭဆၧ",
			"4": "<sup>4</sup> ဘျၪယူၭ.တၭနၥံၪအဖျ့ၩ ချဲၩ့ဆၧအၧၩ့လီၫ.- ၦၡၩ ကိၭထၪ့လၧဆၧစ့ၩရၫ့တီၩအဂးနးဂၩအ့ၬ. တၭၦၡၩ လိၭခွးလၧဆၧမွဲဆၧတီၩအကၠီၩ့နးဂၩအ့ၬ. အဝ့ၫၥံၪ ဒိၭနဲၩ့အၥၭလၧဆၧပျီၩပျီၩတၭ, ချဲၩ့ဆၧဘျံၭဆၧဘျၪ လီၫ.ဒၧၩ့ထၪ့ဆၧမၩအၧၩ့တၭ, အီၪဖျဲၪန့ ဆၧအၧၩ့",
			"5": "<sup>5</sup> လီၫ.- ဂုၪဝ့ၫလၧဂူအၧၩ့အဒံၪတၭဒုၭဖၭထၪ့ဝ့ၫနီၪ, ဒဲ ထၭထၪလၧခၩ့အဒိၩ့လီၫ. ၦလၧအအၪ့အဒံၪနီၪမိၥံၫ ဝ့ၫတၭ,ဒံၪလၩ့ဘျ့ၭလဖျိၪ့နီၪ ဂူအၧၩ့မိဂဲၫထၪ့လၧအ",
			"6": "<sup>6</sup> ဖၧၩ့လဘီၩ့လီၫ.- အထၪလဖၪနီၪကဲၪထၪ့အကီၩ့အ ၥိၭအ့ၬး တၭမၩဘံၭအၥၭ လၧအဆၧမၩနီၪဆ့အ့ၬး အဆၧမၩလဖၪနီၪမွဲဆၧအၧၩ့အဆၧမၩတၭ, ဆၧမၩ",
			"7": "<sup>7</sup> အၧၩ့အီၪဝ့ၫ လၧအစူၪဖၧၩ့လီၫ.- အခၪ့စဲၪ့လၧဆၧ အၧၩ့အအီၪတၭ, မၩဝ့ၫချဲၫ့ချဲၫ့ ဘဲၫၥိၭအမိလူၫလၩ့ ဆၧၥွံၪလၧဆၧဒဲၩဘၭလအီၪဘၪတၭး အဆီၫ့မီၪ့ဆၧ နီၪမွဲဆၧအၧၩ့အဆၧဆီၫ့မီၪ့ ဆၧမၩအီၪယူ, ဒဲဆၧမၩ",
			"8": "<sup>8</sup> ဂၭဂီၩ့အီၪဝ့ၫလၧအဖၧၩ့ၥုၪ့ဖၧၩ့ၥၭလီၫ.- ဆၧဎူၫဆၧ ဎၩ့အဖၧၩ့ၥၭနီၪ အဝ့ၫၥံၪၥ့ၪယၫဘၪဝ့ၫအ့ၬ. ဆၧစ့ၩ ရၫ့တီၩအီၪလၧအဖၧၩ့ၥၭဖၧၩ့အ့ၬ. မၩကဲၪ့ကီၪ့အ ဖၧၩ့ၥၭတၭး ၦလၧအဖိၬဝ့ၫလဂၩလါလါၥ့ၪယၫဆၧ ဎူၫဆၧဎၩ့နးဂၩအ့ၬ.",
			"9": "<sup>9</sup> မၩအၥၭဘဲၫနီၪတၭ ဆၧစ့ၩရၫ့ အီၪယဲၩ့လၧပၧၩ, ဆၧတီၩဆၧလီၩ့လချႃၭန့ဘၪပၧၩတၭ, ပယိလါဆၧ ဖၩ့အဖၧၩ့ၥၭ,အ့ၪမွဲယိခွါ,ဆၧခံၭတၭး ပယိလါမုထုၪ့အဖၩ့တၭ,ပလ့ၩလၧဆၧခံၭကျၩလီၫ.-",
			"10": "<sup>10</sup> ပလုးဆၧ ဘဲၫၦမ့ၬဘျီၪလၧဆၧဒီၪ့အဂးတၭ, ဘဲၫၦလၧအမ့ၬၥၪ လအီၪဘၪအၥိၭနီၪပလုးဆၧလီၫ. ပခၪ့ဘၪထၧၩ့လၧ မုထုၪ့ဘဲၫလၧမုနၩလခီၫအၥိၭ, ပအီၪလၧဆၧခံၭၥၧၫ့",
			"11": "<sup>11</sup> အကျၩ,ဘဲၫၦၥံၫအၥိၭနီၪလီၫ.- ပဂၪ့ကိၭယၧၩ့ဆၧ ထီးအလူၬဘဲၫဖုၫထၫ့အၥိၭ, ၦဎွံၩ့လထံၪဎးဘဲၫထိၪလွံ အၥိၭလီၫ. ပယိလါဆၧစ့ၩရၫ့အဖၧၩ့ၥၭတၭ, အီၪ အ့ၬ.လၧဆၧထိးထဲၩ့တၩ့ထဲၩ့အဖၧၩ့ၥၭနီၪ, အီၪယဲၩ့ လၧပၧၩလီၫ.",
			"12": "<sup>12</sup> အဂဲးဘဲၫယီၩပဆၧအမၪ အၪထၪ့လၧနမ့ၬယၫတၭ, ပဆၧဒဲၩဘၭထိးအၥၭထၫ့ဒုၪဒၩပၧၩလီၫ. အဂဲးဘဲၫ ယီၩပဆၧအမၪအီၪလၧပၧၩတၭ, ပဆၧအၧၩ့ဆၧၥၫ့",
			"13": "<sup>13</sup> နီၪပၥ့ၪယၫလီၫ.- ပမၩမၪဆၧတၭ ချဲၩ့ဘျံၭချဲၩ့ဘျၪ ထၫ့ဒုၪဒၩယဟိဝၩတၭ, ကၠၪဒိၭချိၫ့ပၥၭ လၧပယွၩ တၭ,ပချဲၩ့ဆၧမၩအၧၩ့ဒဲလ့ၩဒၪဆၧ, ပကၩ့ကၩဆၧ",
			"14": "<sup>14</sup> ချဲၩ့ဘျံၭချဲၩ့ဘျၪဒဲလီၩဖျီၪထၪ့ဆၧလၧပၥၭလီၫ.- ဆၧ စ့ၩရၫ့ဂၧၩ့ထဲၩ့ လၧအလးခဲၫ့တၭ, ဆၧတီၩဆၧလီၩ့ ဆၧၫ့ထုၪ့ဝ့ၫလၧအယဲၩ့လီၫ. အဂဲးဘဲၫယီၩဆၧမွဲဆၧ တီၩလၩ့ထံၩဖါ လၧဖၧၩ့မု အဖၧၩ့တၭ, ဆၧတီၩဆၧ",
			"15": "<sup>15</sup> လီၩ့လ့ၩနုၬလၥ့ၪဘၪလီၫ.- မွဲမၬ, ဆၧမွဲဆၧတီၩလ အီၪဘၪတၭ, ၦလၧအစဲၪ့ထၪ့ခွံၬ လၧဆၧအၧၩ့နီၪဆၧ အၪ့ဂူၬန့အဆၧလီၫ. ယဟိဝၩဒၪဘၪဝ့ၫတၭ, ဆၧစ့ၩ ရၫ့လအီၪဘၪအကၠီၩ့နီၪ, မွဲဆၧအၧၩ့ လၧအမ့ၬယၫ လီၫ.",
			"16": "<sup>16</sup> မွဲအဒၪဘၪဝ့ၫလၧၦၡၩလအီၪဘၪတၭ, ထီၫမံၫထီၫ မၪဝ့ၫလၧၦအၪ့ကံၩ့အၪ့ယၫဆၧလအီၪဘၪး မၩအၥၭ ဘဲၫနီၪတၭ, အစူၪဒူၪဒၪဝ့ၫမၩဆၧထိးထဲၩ့တၩ့ထဲၩ့ဆၧ လၧအဂးတၭ, အဆၧတီၩဆၧလီၩ့ဒၪဝ့ၫနီၪ ဒုၭဒိၭနဲၩ့",
			"17": "<sup>17</sup> အၥၭဂုးခၧၫ့ဝ့ၫလီၫ.- အဝ့ၫဒၪၥိၭဆၧတီၩဆၧလီၩ့ဘဲၫ ဆၧၥၭနၫပဒၩ့အၥိၭနီၪတၭ, ဆၧထိးထဲၩ့တၩ့ထဲၩ့အ ခိၪလူၬၥုၭအီၪဝ့ၫလၧအခိၪဎွံၪတၭ, ကီၩ့ၥိၭဝ့ၫလၧဆၧ မၩဆၧၫ့ဆၧအၧၩ့အကီၩ့အၥိၭအဂးတၭ, ၥိၭထၪ့ဆၧ",
			"18": "<sup>18</sup> ထိၪဂဲၩၥၭဆီၪ့ ဘဲၫအဆဲၫ့လဘံၪ့အၥိၭနီၪလီၫ.- ဘဲၫ အဝ့ၫၥံၪမၩဆၧအၥိၭနီၪ အဝ့ၫဒၪမိဖ့ၪလၫ့ထဲၩ့ဆၧ, ဆၧၥၭခဲၩထၪ့လၧအဒုၪအဒၩလဖၪ, ဆၧလၧအကြၨၭ န့ဘၪလၧၦၡၩထၫ့ဒုၪဒၩဝ့ၫလီၫ. မိဖ့ၪထဲၩ့ၦထံၫယဲၩ့",
			"19": "<sup>19</sup> ခးယဲၩ့ဖိၪဆၧလၧအကြၨၭန့ဘၪလီၫ.- တၭအဝ့ၫၥံၪ မိၥၭမဲၪယဟိဝၩအမံၩ့လၧမုနုၬလခီၫ, ဒဲအလၩအဖၩ့ လၧမုထၪ့လခီၫလီၫ. အဂဲးဘဲၫယီၩဆၧအဒုၪအဒၩ အ့ၪဂဲၫဝ့ၫဘဲၫထံၫလုၬဘံၭဆၧအၥိၭနီၪတၭ, ယဟိဝၩ",
			"20": "<sup>20</sup> အၥၭမိပဒၩ့ထၬဝ့ၫလီၫ.- ထီးနီၪလဖၧၫ့ၦဎွ့ၩန့ထဲၩ့ဆၧ မိဂဲၫလၧဇံအိၫ့အဂး ဒဲလၧၦလၧအကၠၪလီၩ့အၥၭလၧ ဆၧမၩမၪလၧစယၫကူၭအဖၧၩ့လဖၪအဂး, ယဟိဝၩ",
			"21": "<sup>21</sup> စံၭဝ့ၫဒၪ.- တၭယဝ့ၫဒၪယီၩယအုၩ့လၩ့ဆၧလၧအဝ့ၫ ၥံၪမွဲအယီၩ, ယဟိဝၩစံၭဝ့ၫဒၪ, ယၥၭလၧအအီၪလၧ နလီၩ့တၭ, ယဆၧချဲၩ့လၧယအီၪက့ၪလၧနနိၭ, လစဲၪ့ ထၪ့ခွံၬဘၪလၧနနိၭ, လၧနချံၫနၥၪအနိၭလၧနချံၫနၥၪ အချံၫအၥၪအနိၭ, ထီးယီၩစူၩယၫအဆိၩဆိၩ,အကၠၪ ကၠၪ,ယဟိဝၩစံၭဝ့ၫဒၪ."
		},
		"60": {
			"1": "<sup>1</sup> ဂဲထုၪ့ဖၩ့ထၪ့ဆံၭ, အဂဲးဘဲၫယီၩနဆၧဖၩ့ဂဲၫယူၭ တၭ,ယဟိဝၩအလၩအဖၩ့နီၪ ဖၩ့ထၪ့ဘၪနၧၩလီၫ.",
			"2": "<sup>2</sup> အဂဲးဘဲၫယီၩ, ယိခွါ, ဆၧခံၭမိလုၬဘံၭဂၪ့ခိၪ, ဒဲဆၧ ခံၭၥၧၫ့ၦဆၨၩလဖၪလီၫ. အ့ၪမွဲယဟိဝၩမိဂဲၫထၪ့ဘၪ",
			"3": "<sup>3</sup> နၧၩတၭ, အလၩအဖၩ့မိအီၪဖျီၪလၧနလီၩ့လီၫ.- တၭ ၦဆၨၩလဖၪ မိလ့ၩဆၧလၧနဆၧဖၩ့အကျၩ, ဒဲစဎွၩ လဖၪလၧနဆၧဖၩ့ထၪ့ အဂိးၡ့ၭဂိးၡီၫအကျၩလီၫ.",
			"4": "<sup>4</sup> စၪ့ထၪ့နမ့ၬၥၪယိဝၬဖီၩ့ဒၪဘၪဆၧတၭ, ၦလဖၪနီၪ အီၪကိၩ့အီၪကီၪ့ထီးအလူၬတၭ, ဂဲၫဝ့ၫလၧနအီၪလီၫ. နဖိၪခွၫလဖၪ မိဂဲၫလၧအယဲၩ့တၭ, နဖိၪမုၪလဖၪနီၪမိ",
			"5": "<sup>5</sup> ဘၪဆၧလုအၪ့လုအီၩလၧနနဲၩ့ထံၭလီၫ.- ထီးနီၪလ ဖၧၫ့နမိဒၪဘၪ, ဒဲၥုၪ့ဎွံၫၥၭယီၫ, နၥုၪ့မိဝၭထိၬနၥၭမိဝၭ ထိၬ,ဒဲနၥုၪ့မိဖီးနၥၭမိဝၭလီၫ. အဂဲးဘဲၫယီၩမၫဆမံၭ အဆၧလၧၫ့ဆၧဎွ့ၩ မိထီၩ့လၧနအီၪ ၦဆၨၩလဖၪအ စူၪလးအခၪ့ခိၪမိဂဲၫလၧနအီၪလီၫ.",
			"6": "<sup>6</sup> ကလအူၭခမျၧးမိလုၬဘံၭနၧၩ, ကလအူၭဖိၪဂဲၫလၧ မံဒအၫ့ဒဲအံၩဖၫလီၫ. ကယဲၦလၧၡံဘၫနီၪမိဂဲၫဝ့ၫလီၫ. အဝ့ၫၥံၪမိဂဲၫဆိၬထီၫ့ဒဲလီၫဘၫ့တၭ, ယဟိဝၩအဆၧ စံၭထၪ့အၪ့အူၭနီၪ အဝ့ၫၥံၪမိလီၩလၩ့လၬလၩ့ လၧအ",
			"7": "<sup>7</sup> ၥၭဎွံၫလီၫ.- ကံဒၧၫအၥိၪအဒီၪ့ထီးအလူၬနီၪမိအီၪကီၪ့ လၧနအီၪ, နဘ့ယီၭအၥိၪဖၫလဖၪမိမၩနဆၧလီၫ. မိ ထၪ့ဘၭယဆၧလုအလး, ဆၧမိဘၪဆၧအၥၭတၭ,ယ",
			"8": "<sup>8</sup> လၩယဖၩ့အဂံၪ့နီၪယမိမၩလၩဖၩ့ဝ့ၫလီၫ.- ဆၧလဖၪ ယီၩလၧအယူၩဝ့ၫမၩအၥၭဘဲၫဆၧအုၪ့အၥိၭ, ဒဲဘဲၫ ထိၪလွံလၧအဂဲၫထဲၩ့လၧဆၧဖိးအၥိၭနီၪမွဲပလၫလဖၪ",
			"9": "<sup>9</sup> လဲၪ.- အဂဲးဘဲၫယီၩထံၫယဲၩ့ခးယဲၩ့နီၪမိယိလါယဖၧၩ့ ၥၭတၭ,တၫၡံၭအကဘၩ့အီၪဆိၫနဲၪ့, ဘဲၫၥိၭအမိဂဲၫ ထဲၩ့ဆိၬနဖိၪခွၫလဖၪ လၧအအီၪယဲၩ့, အကျိၪၥံၪစ့ၩ ၥံၪဒဲအထီၫ့ၥံၪလွ့ၫၥံၪအီၪလၧအၥိၭ လၧယဟိဝၩနယွၩ အမံၩ့အကၠီၩ့တၭ, လၧအံၫစရ့လၭ အဆၧဆံၫ့ဎံၪ လဂၩအကၠီၩ့နီၪ, အဂဲးဘဲၫယီၩအဝ့ၫဒၪမၩလၩဖၩ့ နၧၩလီၫ.",
			"10": "<sup>10</sup> ၦလခီၫဘၩ့မုးဖိၪ မိမၩထၪ့နခိၪဒၧၩ့တၭ,အဝ့ၫၥံၪ အစဎွၩမိမၩနဆၧလီၫ. အဂဲးဘဲၫယီၩယထးနၧၩလၧ ယၥၭထၪ့နီၪး အ့ၪမွဲယယၫ့ၥၭနၧၩ လၧယခိးယတၩ",
			"11": "<sup>11</sup> အကၠီၩ့လီၫ.- အခိးမွဲနတရၫ့ၥံၪမိအီၪဝဲထၪ့အၥၭလ ထံၪဎးလီၫ. လၧမုဆၫလခီၫမွဲဂ့ၩ,လၧမုနၩလခီၫမွဲဂ့ၩ, လကၭဘံၭထၬဘၪဝ့ၫတၭ, မွဲဘဲၫၥိၭ ၦမိဆိၬထၪ့ၦ ဆၨၩလဖၪအစူၪလးအခၪ့ခိၪလၧနအီၪ ဒဲၥိၫ့အဝ့ၫၥံၪ",
			"12": "<sup>12</sup> အစဎွၩလဖၪလီၫ.- အဂဲးဘဲၫယီၩ ၦဆၨၩလဆၨၩ, ဒဲဘၩ့မုးလဘၩ့မုးလၧအလမၩဘၪနဆၧနီၪ မိဂၭဂီၩ့ဝ့ၫ လီၫ.တၭၦဆၨၩလဖၪနီၪ မိအီၪယူဝ့ၫတၡါလ့ၬလီၫ.",
			"13": "<sup>13</sup> လ့ၭဘနၧၫ့အလၩအဖၩ့မိဂဲၫလၧနအီၪ, ၥံၪ့ၡိၫ, ၥံၪ့ ထိၭအၪ့, ၥံၪ့ၡိၫတအၫၡုၫလဖၧၩ့ဎး, ဘဲၫၥိၭအမိမၩ ဎံၫမၩလၩ ယလးဆံၫ့ဎံၪလီၫ. တၭယခၪ့အလးနီၪ",
			"14": "<sup>14</sup> ယမိမၩလၩမၩဖၩ့ဝ့ၫလီၫ.- ထီးနီၪလဖၧၫ့ၦလၧအမၩ အၧၩ့နၧၩအဖိၪခွၫလဖၪ မိဂဲၫထွံၩလၩ့အၥၭလၧနအီၪ တၭ,ၦလၧအမၩကြၩ့ထမးနၧၩနီၪ မိထွံၩလၩ့လၧနခၪ့ ထံၭတၭ, မိကိၭနၧၩလၧယဟိဝၩအဒိၩ့ အံၫစရ့လၭ",
			"15": "<sup>15</sup> အဆၧဆံၫ့ဎံၪလဂၩအဇံအိၫ့လီၫ.- လၧနဘၪဆၧ စဲၪ့ဒၪနၧၩ, ဒဲဆၧၥၭဂဲၫ့နၧၩတၭ,ၦလလ့ၩခၫ့ဂၬဘၪနၧၩ အလးနီၪ,ယမိအီၪက့ၪနၧၩ လၧဆၧအလၩအဖၩ့အဆိၩ အကၠၪ, ဆၧၥုၪ့ဎွံၫၥၭယီၫ လၧၦအၪဆၨၩအဂးလီၫ.",
			"16": "<sup>16</sup> တၭနမိအၪ့ဆူၭၦဆၨၩလဖၪအနူထံၫတၭ, နမိအၪ့ဆူၭ ဆၧလၧစဎွၩအနူတၭ, နမိၥ့ၪယၫလၧယၧၩယီၩယဟိ ဝၩမွဲနဆၧထိးထဲၩ့တၩ့ထဲၩ့, ဒဲဆၧဎွ့ၩန့ထဲၩ့နၧၩ မွဲ",
			"17": "<sup>17</sup> စယၫကူၭအဆၧဆီၪ့ဆၧဒိၪလဂၩလီၫ.- လၧထီးဘၩ့ အလးနီၪယမိဂဲၫဆိၬထီၫ့တၭ, လၧထၭအလးနီၪယမိ ဂဲၫဆိၬစ့ၩတၭ, လၧၥံၪ့အလးနီၪထီးဘၩ့တၭ,လၧလိး အလးနီၪထၭလီၫ. တၭယမိအီၪက့ၪ ၦယိနၧၩလဖၪ လၧဆၧဘၪလိၬအိၭလိၬ, ဒဲၦဒိၪလဖၪလၧဆၧတီၩဆၧ",
			"18": "<sup>18</sup> လီၩ့လီၫ.- ဆၧလနါဂၧၫ့လၧၩ့ဘၪဆၧမၩအၧၩ့လၧနခး ဖၧၩ့,ဒဲဆၧမၩယူဆၧမၩဂၭဂီၩ့ လၧနနဲၩ့ထံၭလဖၪအ ဖၧၩ့အီၪဆ့အ့ၬးနမိကိၭနခိၪဒၧၩ့လၧဆၧထိးထဲၩ့တၩ့ ထဲၩ့,ဒဲနတရၫ့ၥံၪလၧဆၧစံၭထၪ့အၪ့အူၭနီၪလီၫ.",
			"19": "<sup>19</sup> မုလမွဲလၧၩ့ဘၪနဆၧဖၩ့လၧမုဆၫလခီၫတၭ, လၩ အယုၩ့ယဲဖၩ့ထၪ့လၧနဂးအ့ၬး အ့ၪမွဲယဟိဝၩမိကဲၪ ထၪ့နဆၧဖၩ့အဆိၩအကၠၪတၭ, နယွၩမိကဲၪထၪ့နလၩ",
			"20": "<sup>20</sup> နဖၩ့လီၫ.- နမုလလၩ့နုၬလၧၩ့ဘၪတၭ,နလၩၥံၫလၧၩ့ အ့ၬ.အဂဲးဘဲၫယီၩယဟိဝၩမိကဲၪထၪ့နဆၧဖၩ့ အဆိၩ အကၠၪလၧနဂးတၭ, နဂၪ့ဆၧယၧၩ့ဆၧအမုနံၩလဖၪ",
			"21": "<sup>21</sup> နီၪမိလူၬလီၫ.- နၡၩခမျၧးနီၪ မိတီၩမိလီၩ့ထီးအလူၬ လီၫ.အဝ့ၫၥံၪမိန့ၥၫထံၫၥံၪခးၥံၪနီၪလၩ့ဆိၩလၩ့ကၠၪ, ဆၧအထဲၩ့လၧယၥုၪ့လၩ့ယဝ့ၫ, ယစူၪအမၩဆၧဘဲၫ",
			"22": "<sup>22</sup> ၥိၭယမိဒိၭဆၧလၩဆၧဖၩ့လီၫ.- ဆၧအဆံၭနီၪ,မိကဲၪ ထၪ့အထီၫ့တၭ, ဆၧအဂဲးဆါ မိကဲၪထၪ့ဆၧဆီၪ့လ ဆၨၩလီၫ.ယဝ့ၫဒၪယဟိဝၩယီၩ, ယမိဒုၭမၩအၥၭ လၧအဆၧၫ့အထီဒၪဝ့ၫနီၪချဲၫ့ချဲၫ့လီၫ."
		},
		"61": {
			"1": "<sup>1</sup> ကဆါယဟိဝၩအၥၭမုအီၪလၧယလီၩ့လီၫ. အဂဲး ဘဲၫယီၩယဟိဝၩဂုၪယူၭယၧၩ, ဘဲၫၥိၭယမိလီၩလၩ့ လၬလၩ့ဆၧၥၭထိၬအပရၧၫ့လၧၦၡၪ့ဖိၪယၬဖိၪး အဝ့ၫ ဒၪအၪ့မၧၫ့လၩ့ယၧၩ ဘဲၫၥိၭယမိမၩဘျၪထဲၩ့ၦၡၩအ ၥုၪ့ခါအၥၭလၩ့, ဘဲၫၥိၭယမိကိၭထၪ့ဆၧဂၭဖျ့ၭလၧၦ ဘၪဆၧအၪ့မၧၫ့ဎီးဝ့ၫအဂး, ဒဲဆၧဝဲထၪ့ထီၫ့အတရၫ့",
			"2": "<sup>2</sup> လၧၦဘၪစၧၩ့ထၬအဂးနီၪ,- ဘဲၫၥိၭယမိကိၭထၪ့နံၪ့ ဘၪယဟိဝၩအၥၭ, ဒဲပယွၩမၩဆၧၫ့ဆၧအၧၩ့အမုလ နံၩဘဲၫၥိၭယမိမၩမုၬထၪ့ထဲၩ့ကယဲၦလၧအၥုၪ့အုၭ",
			"3": "<sup>3</sup> အၥၭအုၭထီးအလူၬ,- ဘဲၫၥိၭယမိအီၪက့ၪလၩ့ဆၧ လၧၦလၧအၥုၪ့အုၭအၥၭအုၭ လၧဇံအိၫ့အဂး, ဘဲၫၥိၭ ယမိဖ့ၫလၫ့အၥရဖူၩ လၧဖံၫ့ချၪအလး, ဆၧၥၭထိၬ အၥိၪလၧအဆၧၥၭအုၭအလး, ဆၧစံၭထၪ့အၪ့အူၭ အဆဲၫ့လၧအၥၭဎၧၫ့အလးနီၪလီၫ. တၭဆၧမိကိၭဝ့ၫ လၧဆၧတီၩဆၧလီၩ့ အၥံၪ့လဖၪအလး လၧယဟိဝၩ ၥုၪ့လၩ့ဝ့ၫဘဲၫၥိၭအမိဘၪဆၧမၩလၩဖၩ့ဝ့ၫလီၫ.",
			"4": "<sup>4</sup> အဝ့ၫၥံၪမိမၩထဲၩ့ဆၧအလးလၩ့ဎီးလၧဖျိၩ့တၭ, မိ မၩထၪ့ထဲၩ့ဆၧအီၪယူၥံၪလၧဖျိၩ့တၭ, မိမၩထၪ့ထဲၩ့",
			"5": "<sup>5</sup> ဒိၩ့လၩ့ဎီးလဖၪ,ဆၧအီၪယူလၧဖျိၩ့ၥံၪနီၪလီၫ.- ၦလ ခီၫဘၩ့မုးဖိၪမိဆၧၫ့ထုၪ့ယိနၥံၪအၥိၪ အဒီၪ့လဖၪတၭ, ၦလခီၫဘၩ့မုးဖိၪအဖိၪလဖၪမိကဲၪထၪ့နၥံၪ အၡၩထဲၫ",
			"6": "<sup>6</sup> ဆၧ,ဒဲၦတဲၩ့ဝဲၩနၥံၪအစဘံၭမုလီၫ.- အ့ၪမွဲနၥံၪဝ့ၫ ယီၩ,ဆၧမိကိၭနၥံၪလၧယဟိဝၩ အၡၩလုဆၧ, ၦမိ ကိၭနၥံၪလၧ ၦမၩယွၩအဆၧလီၫ. နၥံၪမိအၪ့ၦဆၨၩ လဖၪအစူၪလးအခၪ့ခိၪတၭ, နၥံၪမိအီၪက့ၪဖိၫလိၫ",
			"7": "<sup>7</sup> နၥံၪအၥၭလၧအဝ့ၫၥံၪအလၩအဖၩ့အဖၧၩ့လီၫ.- လၧ နၥံၪဘၪဆၧမ့ၬမဲအကၠီၩ့နီၪ နၥံၪမိန့ဘၪဆၧနံၫစၩတၭ, လၧဆၧအီၪက့ၪမ့ၬမဲအလးနီၪ ဆၧၥုၪ့ဎွံၫၥၭယီၫလၧ နၥံၪအဂးအဖၧၩ့လီၫ. မၩအၥၭဘဲၫနီၪတၭ,အဝ့ၫၥံၪ မိန့ဘၪနံၫစၩလၧအခးဖၧၩ့ ဆၧၥုၪ့ထိၬၥၭထိၬအဆိၩ အကၠၪမိအီၪလၧအဝ့ၫၥံၪလီၫ.",
			"8": "<sup>8</sup> အဂဲးဘဲၫယီၩ ယဝ့ၫဒၪယဟိဝၩယီၩ ယအဲၪဆၧစ့ၩ ရၫ့တီၩတၭ, ယၥၭဂဲၫ့ဆၧအၪ့ဂူၬန့ဆီၪ့လၧဆၧအၧၩ့ အဖၧၩ့လီၫ. ယမိဖ့ၪလၫ့အခိးအတၩတၡါတၭ,ယမိ အုၩ့လၩ့ဆၧအုၩ့လၩ့ အဆိၩအကၠၪလၧအဝ့ၫၥံၪ",
			"9": "<sup>9</sup> လီၫ.- အဝ့ၫၥံၪအချံၫအၥၪနီၪၦၡၩမိၥ့ၪယၫဝ့ၫလၧၦ ဆၨၩလဖၪအကျၩတၭ,အဆၨၩအဆၬနီၪလၧၦခမျၧး အကျၩနီၪလီၫ. ကယဲၦလၧအဒၪဘၪဝ့ၫ မိအုၩ့လၩ့ လၧအမွဲအချံၫအၥၪ လၧယဟိဝၩဆိၪဂ့ၩယူၭဝ့ၫယူၭ လီၫ.",
			"10": "<sup>10</sup> ယမိၥုၪ့ဎွံၫၥၭယီၫလၧယဟိဝၩအဖၧၩ့ ဒိၪဒိၪလ့ၬ ယမိၥၭထိၬလၧယယွၩအဖၧၩ့နီၪလီၫ. အဂဲးဘဲၫယီၩ မွဲအဒုၭ ၥိၭယူၭယၧၩလၧဆၧထိးထဲၩ့တၩ့ထဲၩ့အဆဲၫ့ တၭ, ဒုၭလုၬထၪ့ယူၭယၧၩလၧဆၧတီၩဆၧလီၩ့အဝိၬ လိၫ့ဘဲၫတလၭမူၭအခွၫကယၧၩ့အၥၭဘဲၫၦလုဆၧအ ၥိၭနီၪဒဲဘဲၫတလၭမူၭအမုၪကယၧၩ့အၥၭ လၧအက",
			"11": "<sup>11</sup> ယၧၩ့ကယီၫအၥိၭနီၪလီၫ.- အဂဲးဘဲၫယီၩဘဲၫဂၪ့ခိၪ ဒုၭမဲၪထၪ့ဆၧအၥိၭတၭ, ဘဲၫကျိၭဒုၭမဲၪထၪ့ဆၧဎွံၪ အၥၭလၧအဖၧၩ့အၥိၭနီၪ, ကဆါယဟိဝၩမိဒုၭအီၪ ထၪ့ဆၧတီၩဆၧလီၩ့ ဒဲဆၧစံၭထၪ့အၪ့အူၭဆၧလၧၦ ကိၭဆၨၩဒ့ၭအမ့ၬယၫဘဲၫနီၪၥိၭလီၫ."
		},
		"62": {
			"1": "<sup>1</sup> လၧဇံအိၫ့အကၠီၩ့နီၪယလအီၪလၩ့မါပံၭဘၪး တၭ လၧယရုစလံၫ့အကၠီၩ့နီၪယလအီၪပွံၭဘၪ, ထီးလၧ အဆၧတီၩဆၧလီၩ့လ့ၩထၪ့ ဘဲၫဆၧယုၩ့ယဲအၥိၭ,ဒဲ အဆၧထိးထဲၩ့တၩ့ထဲၩ့ ဘဲၫမ့ၪဒိၩ့လၧအခဲၩဖၩ့ထၪ့",
			"2": "<sup>2</sup> အၥိၭနီၪလီၫ.- တၭၦဆၨၩလဖၪမိဒၪဘၪနဆၧတီၩ ဆၧလီၩ့,ဒဲစဎွၩထီးအလူၬန့ဘၪနလၩနဖၩ့လီၫ. တၭ ဆၧမိကိၭနၧၩလၧနမံၩ့ၥၫ့ လၧယဟိဝၩမိကိၭထၪ့လၧ",
			"3": "<sup>3</sup> အနိၭလခီၫနီၪလီၫ.- တၭနဝ့ၫဒၪနမိကဲၪထၪ့ ၥရဖူၩ အီၪလၧအဎံၫအလၩ လၧယဟိဝၩအစူၩဖၧၩ့, ဒဲစဎွၩ",
			"4": "<sup>4</sup> ခိၪဖုၪ့လၧနယွၩအစူၪဖၧၩ့လီၫ.- ဆၧလကိၭလၧၩ့ဘၪ နၧၩလၧဆၧစဲၪ့ဒၪခွံၬတၭ, နခးနီၪလအီၪယူဘၪး အ့ၪ မွဲဆၧမိကိၭနၧၩ လၧဆၧဘၪယၥၭ အီၪလၧအဖၧၩ့နီၪ တၭ,နခးနီၪလၧဆၧဖျၫ့လိၬနီၪလီၫ. အဂဲးဘဲၫယီၩယ ဟိဝၩမုၬလၩဆၧလၧနဖၧၩ့တၭ, နထံၫနခးမိဖျၫ့လိၬ",
			"5": "<sup>5</sup> အၥၭလီၫ.- အဂဲးဘဲၫယီၩဘဲၫဖိၪၥၪခွၫန့မၫလၧၦမုၪ နၩ့အၥိၭနီၪ, နဖိၪခွၫလဖၪ မိန့မၫလၧနၧၩဘဲၫနီၪၥိၭ တၭ,ဘဲၫတလၭမူၭအခွၫၥုၪ့ဎွံၫၥၭယီၫ လၧတလၭမူၭ အမုၪအကၠီၩ့အၥိၭနီၪ, နယွၩမိၥုၪ့ဎွံၫၥၭယီၫ လၧန ကၠီၩ့ဆ့လီၫ.",
			"6": "<sup>6</sup> ယအီၪက့ၪယူၭ ၦခိၭဆၧလဖၪလၧနခိၪဒၧၩ့အလီၩ့, ယရုစလံၫ့ဧ့,ၥံၫ့နံၩချီၩ့, ဒဲၥၫ့နၩချီၩ့အဝ့ၫၥံၪလဆိၩဒၪ အၥၭမိအီၪလၩ့မါပံၭအ့ၬ. ၦလၧအဒုၭနၪ့ထၪ့ထဲၩ့ယ",
			"7": "<sup>7</sup> ဟိဝၩၥံၪဧ့, အီၪလၩ့မါပံၭလဂ့ၩ,- ထီးအဝ့ၫဒၪလဒုၭ အီၪဂုးအီၪခၧၫ့ဒံၭဘၪ, ဒဲလအီၪက့ၪဒံၭဘၪယရုစလံၫ့ လၧဆၧစံၭထၪ့အၪ့အူၭလၧဂၪ့ခိၪချိၫ့တၭ, ထီးဒုၭအီၪ",
			"8": "<sup>8</sup> လၩ့မါပံၭအဝ့ၫလဂ့ၩ.- ယဟိဝၩဆိၪလၩ့အၥၭလၧ အစူၪထွ့ၪဒဲလၧအစူၪဒူၪဆီၪ့တၭ, မွဲမၬ,ယလဖ့ၪလၫ့ လၧၩ့ဘၪနဘုၪၥံၪဂူၫၥံၪ လၧဆၧအၪ့လၧနဒုၪနဒၩအဂး တၭ,ၦလခီၫဘၩ့မုးဖိၪ လအီၩလၧၩ့ဘၪ နစဘံၭထံၫ",
			"9": "<sup>9</sup> အၥၫ့လၧနမၩနဝ့ၫနီၪလီၫ.- အ့ၪမွဲၦလၧအကူၭဘုၪ လဖၪမိအၪ့အဆၧ, ဒဲစံၭထၪ့အၪ့အူၭယဟိဝၩလီၫ. ၦလၧအအၪ့ထုၫ့ကီၪ့(စဘံၭၥၪၥံၪ) မိအီၩအဆၧလၧ ယလးဆံၫ့ဎံၪအဝၩ့ဖၧၩ့လီၫ.",
			"10": "<sup>10</sup> စဲၪ့ဖျီၫ့ခွံၬ, စဲၪ့ဖျီၫ့ခွံၬလၧတရၫ့ဖၧၩ့လဖၪတၭ,တဲၩ့ ဝဲၩၦခမျၧးအဖၧၩ့ၥၭ, မၩထၪ့ထီၫ, မၩထၪ့ထီၫဖၧၩ့ၥၭ မုလဘီၩ့, အၪ့ထုၫ့ထၪ့လိးၥံၪမ့ၭၥံၪ, ဘီၩ့ထၪ့ထီၫၥုၭ",
			"11": "<sup>11</sup> ဖိၪအလၫ့လၧၦခမျၧးအဂးဆံၭ.- ယိခွါၬယဟိဝၩဒုၭ နါဂၧၫ့ဆၧဖိးလၧဂၪ့ခိၪအထုၬ, ဇံအိၫ့အဖိၪမုၪ, ယိခွါ, နဆၧထိးထဲၩ့တၩ့ထဲၩ့ဂဲၫထၪ့နီၪး ယိခွါ, အဝ့ၫအီၪ လၧအလံၩ့အလဲၫတၭ, ဆၧလၧအဖ့ၪဆၧၫ့ထဲၩ့နီၪအီၪ",
			"12": "<sup>12</sup> ဝ့ၫလၧအမ့ၬယၫလီၫ.- ဆၧမိကိၭအဝ့ၫၥံၪလၧၦဆံၫ့ဎံၪ လဆၨၩ, ၦဒိၭဎွ့ၩန့ထဲၩ့အၥၭလၧယဟိဝၩတၭ, ဆၧ မိကိၭနၧၩ, ဆၧအၪ့ဎူၫအၪ့ဎၬဝ့ၫ, ဒိၩ့လၧဆၧလစဲၪ့ဒၪ ခွံၬဘၪဝ့ၫလဖျိၪ့နီၪလီၫ."
		},
		"63": {
			"1": "<sup>1</sup> ၦလၧအဂဲၫစဲၪ့ထၪ့ခွံၬလၧအံဒၧၫ့, အီၪလၧအကီၩ့ အၥိၭဝီၩယုၩ့ယဲ လၧဘီဇရၫၦလၧအကီၩ့အၥိၭအီၪ လၧအဎံၫအလၩ, လၧအဂဲးဆီၪ့အဘၭဆီၪ့ အီၪလၧ အကယးကဖးနီၪ,မွဲပလၫလဂၩလဲၪ. ယၧၩ,ၦလၧအ လီၩလၩ့လၬလၩ့ဆၧတီၩဆၧလီၩ့, ဒိၪဒဲထီၫဘဲၫၥိၭယ မိထိးထဲၩ့တၩ့ထဲၩ့ဆၧလီၫ.",
			"2": "<sup>2</sup> နကီၩ့နၥိၭနီၪဝီၩဝ့ၫ, ဒဲနဆဲၫ့မၩအၥၭဘဲၫၦလၧ အယဲးစဘံၭၥၪအဆၧဖၩ့အၥိၭနီၪမွဲဘၪလဲၪ.",
			"3": "<sup>3</sup> ယယဲးစဘံၭၥၪအဆၧဖၧၩ့လဂၩဎးတၭ, လၧၦခ မျၧးလဖၪအကျၩနီၪအီၪဝ့ၫနးဂၩအ့ၬ. ယမိယဲးဝ့ၫလၧ ယၥၭထၪ့တၭ, ယမိယဲးထံၭဝ့ၫလၧယၥၭခဲၩထၪ့လီၫ. အဝ့ၫၥံၪအၥွံၪဎွံၪအၥၭ လၧယကီၩ့ယၥိၭအလီၩ့တၭ,",
			"4": "<sup>4</sup> မၩစံၪစၪယကီၩ့ယၥိၭထီးအလူၬလီၫ.- အဂဲးဘဲၫယီၩ ဆၧမၩဆၧၫ့ဆၧအၧၩ့အမုနံၩယဆီၫ့မီၪ့ယူၭတၭ, ယ",
			"5": "<sup>5</sup> ၡၩဘၪဆၧဎွ့ၩန့ထဲၩ့ဝ့ၫလဖၪအနံၪ့ဘၪယူၭ.- ယယိ ဆၧတၭ, ဆၧမၩဆၧၩ့ဆၧလအီၪဘၪး တၭယအီၪက့ၪ ယၥၭထီၫမံၫထီၫမၪ လၧဆၧဒုၭအီၪခၧၫ့ ဆၧလအီၪ ဘၪအကၠီၩ့နီၪလီၫ. တၭယစူၪဒူၪဒၪယဝ့ၫ ထိးထဲၩ့ တၩ့ထဲၩ့ဆၧလၧယဂးတၭ, ယၥၭခဲၩထၪ့ဒုၭအီၪခၧၫ့",
			"6": "<sup>6</sup> ယၧၩလီၫ.- ယယဲးလၩ့ယူၭၦခမျၧးလၧယၥၭထၪ့တၭ, ယဒုၭမၧၩ့ယူၭအဝ့ၫၥံၪ လၧယၥၭခဲၩထၪ့တၭ, ယဂါ လၩ့ခွံၬယူၭအၥွံၪလၧဂၪ့ခိၪအဖၫ့ခိၪလီၫ.",
			"7": "<sup>7</sup> ယဟိဝၩအဆၧအဲၪအခိးအတၩနီၪ ယမိဒုၭနၪ့ထၪ့ ထဲၩ့ဝ့ၫဆၧစံၭထၪ့အၪ့အူၭယဟိဝၩနီၪ ဘဲၫကယဲဆၧ လၧယဟိဝၩမၩဝ့ၫလၧပဂး, ဒဲအဆၧဂ့ၩဖၭဒိၪလၧအ မၩဝ့ၫလၧအံၫစရ့လၭအၡၩဂံၪ့ဖိၪအဂး ဘဲၫအယၫ့ ၥၭဆၧအၥိၭ, ဒဲဘဲၫအဆၧအဲၪအခိးအတၩ အၪအၪ",
			"8": "<sup>8</sup> လ့ၬအၥိၭနီၪလီၫ.- မွဲအစံၭဝ့ၫဒၪ, အဝ့ၫၥံၪမွဲတၡါယ ၡၩခမျၧးယဖိၪလဖၪလအၪ့လီၫဘၪဆၧတၭ, အခိးမွဲ အဝ့ၫဒၪကဲၪထၪ့အဝ့ၫၥံၪ အဆၧထိးထဲၩ့တၩ့ထဲၩ့ဝ့ၫ",
			"9": "<sup>9</sup> လီၫ.- လၧအဝ့ၫၥံၪအဆၧခိဆၧဝီၩထီးလူၬအဖၧၩ့နီၪ, အဝ့ၫဒၪဘၪဆၧခိဆၧဝီၩဆ့တၭး မူၭခိၪအၥီၫ့လၧအ အၪ့မၧၫ့လၩ့ဝ့ၫလၧအမ့ၬယၫနီၪ ထိးထဲၩ့တၩ့ထဲၩ့အ ဝ့ၫၥံၪလၧအအဲၪဝ့ၫ ဒဲအၥၭအီၪဝ့ၫအကၠီၩ့တၭ, ဎွ့ၩန့ ထဲၩ့ဝ့ၫဒဲမၩန့ဝ့ၫဒဲဆိၬဝ့ၫမုနံၩ လၧဖျိၩ့ထီးအလူၬလီၫ.",
			"10": "<sup>10</sup> မွဲလါနၫ့တၭ, အဝ့ၫၥံၪပိၩ့ထၪ့မၩဆၫ အၥၭမုဆံၫ့ဎံၪ နီၪးအခိးမွဲအဝ့ၫဒၪကဲၪထၪ့ ကဒၩထဲၩ့အဝ့ၫၥံၪအဒုၪ အဒၩတၭ, အနၫ့ဆါဒၪဝ့ၫ ဒုၭၥုၭထၫ့ဒုၪဒၩ အဝ့ၫၥံၪ လီၫ.",
			"11": "<sup>11</sup> ထီးနီၪလဖၧၫ့မွဲအနၫ့ထၪ့ထဲၩ့ မုနံၩလၧဖျိၩ့လဖၪ, စမိစ့ၭဒဲအၡၩခမျၧးလီၫ. ၦလၧအဒုၭဂဲၫထၪ့အဝ့ၫၥံၪ လၧမၫဆမံၭဖၧၩ့, ၦယိအၥိၪလဒီၪ့နီၪ မွဲအအီၪဝ့ၫခီၫ ခီၫလဲၪ.ၦလၧအအီၪက့ၪအၥၭမုဆံၫ့ဎံၪ လၧအဖၧၩ့နီၪ,",
			"12": "<sup>12</sup> မွဲအအီၪခီၫခီၫလဲၪ.- ၦလၧအၥိၫ့ဝ့ၫလၧစမိစ့ၭအစူၪ ထွ့ၪ,ဒဲလၧအစူၪဒူၪအစီၩ့အမၩ့ မၩထ့ဖၭထံၫ လၧအ ဝ့ၫၥံၪအမ့ၬယၫ, ဘဲၫၥိၭအမိမၩအမံၩ့အဆိၩအကၠၪ",
			"13": "<sup>13</sup> လၧအဂးဒၪဝ့ၫ,- ၦလၧအဒုၭလ့ၩထၪ့ဝ့ၫလၧဆၧယိၬ ဖၧၩ့ဘဲၫကၥ့ၪလဒုၩလၧၡါမုနၧၫ့ဖၫ လၧအခၪ့လဘၪ",
			"14": "<sup>14</sup> ထၧၩ့ဘၪအၥိၭနီၪ, မွဲအအီၪခီၫခီၫလဲၪ.- ဘဲၫချီလဒီၪ့ လ့ၩလၩ့လၧခိၪလီၩ့ဆူၭဖၧၩ့အၥိၭနီၪ ယဟိဝၩအၥၭ မုမိဒုၭအီၪပွံၭဝ့ၫလီၫ. နၥိၫ့နၡၩခမျၧးဘဲၫၥိၭ နမိမၩ လၩမၩဖၩ့နမံၩ့အၥိၭလီၫ.",
			"15": "<sup>15</sup> ယိလၩ့လၧမူၭခိၪတၭ, ဒၪဆၧလၧနဆၧဆံၫ့ဎံၪ,ဒဲန ဆၧလၩဖၩ့အီၪဝ့ၫအလးနီၪဆံၭ. နၥၭဆီၪ့ဒဲနစီၩ့ဒိၪန မၩ့ဒိၪမွဲအအီၪခီၫခီၫလဲၪ. နယၫ့ၥၭယၧၩ ဒဲနၥၭအီၪ",
			"16": "<sup>16</sup> ယၧၩနီၪ,မွဲဆၧမၩထၬဝ့ၫဆ့ဧၪ.- အဂဲးဘဲၫယီၩနမွဲပ ဖါလီၫ. အဂဲးဘဲၫယီၩ စအၫဘြဟၫ့ လၥ့ၪယၫဘၪ ပၧၩတၭ,အံၫစရ့လၭလယိၥ့ၪယၫဘၪပၧၩတၭ, နဝ့ၫ ဒၪယဟိဝၩဧ့, နမွဲပဖါ, ဆၧဎွ့ၩန့ထဲၩ့ပၧၩတၭ, နမံၩ့",
			"17": "<sup>17</sup> အီၪဝ့ၫအဆိၩဆိၩအကၠၪကၠၪလီၫ.- ယဟိဝၩဧ့, နမိဒုၭ ဂၭဖျိၭပၧၩ လၧနဖၧၩ့ၥုၪ့ဖၧၩ့ၥၭ, နမိမၩနီၩ့ပၥၭလၧ ပလၥၭမဲၪဘၪနၧၩနီၪမွဲဘၪလဲၪ. ဂဲၫထဲၩ့ထဲၩ့လၧနဎီး",
			"18": "<sup>18</sup> နၡၩအဂးနဆၧန့ၥၫအဆၨၩလဖၪနီၪဆံၭ.- နၡၩဆံၫ့ ဎံၪန့ၥၫဆၧလဆိဖိၪလီၫ. ပဒုၪပဒၩယဲးလၩ့ခွံၬ နဆၧ",
			"19": "<sup>19</sup> အလးဆံၫ့ဎံၪလီၫ.- ပဝ့ၫဒၪယီၩပအီၪခီၫလၧဖျိၩ့လၧ ၥၫ့လီၫ.နလပၧၩ့ဘၪအဝ့ၫၥံၪတၭ, အဝ့ၫၥံၪဘၪဆၧ ကိၭထၪ့နမံၩ့လၧအလီၩ့အ့ၬ."
		},
		"64": {
			"1": "<sup>1</sup> မွဲနမၩထ့ဖၭလါမူၭခိၪ, ဒဲဂဲၫလၩ့လါဘဲၫၥိၭခိၪလီၩ့",
			"2": "<sup>2</sup> ထိၩ့ချိၬမိဖံၪထၪ့လၧနမ့ၬယၫ.- ဘဲၫမ့ၪလၧအအၪ့ၥံၪ့ မုဎဲၫ့အၥိၭး ဘဲၫမ့ၪခဲၩဒုၭလၬထၪ့ထံၫအၥိၭနီၪ, ဘဲၫ ၥိၭနမိဒုၭၥ့ၪယၫနဒုၪနဒၩလၧနမံၩ့, ဘဲၫၥိၭၦဆၨၩလ",
			"3": "<sup>3</sup> ဖၪမိဝၭထိၬလၧနမ့ၬယၫဆံၭ.- လၧနမၩဆၧၥၭမဲၪအ လးလၧပလယိလါဘၪ အဖၧၩ့ၥၭနီၪ နဂဲၫလၩ့တၭ,",
			"4": "<sup>4</sup> ခိၪလီၩ့ထိၩ့ချိၬ ဖံၪထၪ့ဝ့ၫလၧနမ့ၬယၫလီၫ.- ခီၫလၧ ဂၪ့ခိၪကဲၪထၪ့ဝ့ၫအခၪ့ထံၭနီၪၦၡၩလနါဂၧၫ့ဘၪ,လၥ့ၪ ယၫဘၪလၧအနါတၭ, အမ့ၬလဒၪဘၪယွၩလၧနဖၫ့ခိၪ လၧအမၩဆၧဘဲၫနီၪ, လၧၦလၧအယိလါအဖၧၩ့ၥၭ",
			"5": "<sup>5</sup> အဂးလီၫ.- ၦလၧအမၩဆၧတီၩဆၧလီၩ့, ၦမိနၪ့ထၪ့ နၧၩလၧနဖၧၩ့ၥုၪ့ဖၧၩ့ၥၭနဖံၭၥိၭလိၬနၥၭလၧအဝ့ၫၥံၪ လီၫ.ယိခွါ, နၥၭခဲၩထၪ့ယူၭ, အဂဲးဘဲၫယီၩပမၩယူၭ ဆၧဒဲၩဘၭယူၭး ပအီၪလထံၪဎးလၧနဖၧၩ့တၭ,ပမိ",
			"6": "<sup>6</sup> ထီၩ့လၧဆၧထိးထဲၩ့တၩ့ထဲၩ့ပၧၩလီၫ.- အ့ၪမွဲပဝ့ၫ ဒၪထီးအလူၬယီၩ ပမၩပၥၭဘဲၫဆၧလဆံၫ့ဘၪအၥိၭ တၭ,ပဆၧတီၩဆၧလီၩ့ထီးအလူၬနီၪမၩအၥၭဘဲၫဆၧ အကီၩ့အၥိၭဘၪစံၪစၪအၥိၭး ပလၩ့ယံၭပဝ့ၫထီးအ လူၬဘဲၫၥံၪ့လၪအၥိၭနီၪတၭ, ပဆၧဒဲၩဘၭဆိၬထၪ့ခွံၬ",
			"7": "<sup>7</sup> ယူၭပၧၩဘဲၫလံၩအူၪခွံၬဆၧအၥိၭနီၪလီၫ.- တၭၦကိၭ ထၪ့နမံၩ့လအီၪဘၪ, ၦထိၪဂဲၩအၥၭဘဲၫၥိၭအမိဖီၪ့ထၬ နၧၩအီၪအ့ၬ. အဂဲးဘဲၫယီၩနအီၪက့ၪၥူၪခွံၬနမ့ၬ လၧ ပၧၩတၭ,နမၩဖံၪထၪ့ခွံၬပၧၩလၧပဆၧဒဲၩဘၭအကၠီၩ့ လီၫ.",
			"8": "<sup>8</sup> အ့ၪမွဲဘိၩ့နဲၪ့ယီၩ ယဟိဝၩဧ့, နမွဲပဖါလီၫ.ပဝ့ၫဒၪ ယီၩပမွဲကဖံၬတၭ,နဝ့ၫဒၪနမွဲၦၡၩတဲၩ့ဖၧၩ့လီၫ. တၭ",
			"9": "<sup>9</sup> ပမွဲဆၧလၧနမၩလၧနစူၪထီးအလူၬလီၫ.- ထီးၥၭခိထၪ့ ပၧၩဆီၪ့ဆီၪ့လ့ၬလဂ့ၩ, ယဟိဝၩဧ့, ထီးနၪ့ထၪ့ထဲၩ့ ပဆၧဒဲၩဘၭလၩ့ဆိၩလၩ့ကၠၪလဂ့ၩ. ယိခွါ, ယိဆၧ ဆံၭ,ပအၪ့ကံၩ့အၪ့ယၫလါနၧၩ, ပမွဲပဝ့ၫနၡၩခမျၧး",
			"10": "<sup>10</sup> ထီးအလူၬလီၫ.- နဒိၩ့ဆံၫ့ဎံၪလဖၪနီၪကဲၪထၪ့ၡါမု နၧၫ့ဖၫ,ဇံအိၫ့မွဲမံၩ့လၬၥီၪ့ကျၩ, ယရုစလံၫ့မွဲဆၧအီၪ",
			"11": "<sup>11</sup> ယူလီၫ.- ပဂံၪ့ဆံၫ့ဎံၪအီၪလၧအဎံၫအလၩထီးပဖါၥံၪ စံၭထၪ့အၪ့အူၭနၧၩလၧအဖၧၩ့နီၪ, မ့ၪအၪ့ခွံၬယူၭဝ့ၫ ယူၭ,တၭကယဲဆၧအလးလၧအဘၪပၥၭထီးအလူၬ",
			"12": "<sup>12</sup> ကဲၪထၪ့ဆၧအီၪယူယူၭလီၫ.- လၧဆၧလဖၪနီၪအကၠီၩ့ နမိအီၪဒၪနဆၧယဟိဝၩဧ့, မွဲနမိအီၪလၩ့မါပံၭတၭ, မၩၡၪ့မၩနၭပၧၩနၭနၭလ့ၬဆ့ဧၪ."
		},
		"65": {
			"1": "<sup>1</sup> ၦလၧအလအၪ့စၪ့ဘၪယဂဲးယကၠီၪ့တၭ, အၪ့ဎူၫ အၪ့ဎၬယၧၩ, ဒဲၦလၧအလအၪ့ဎူၫအၪ့ဎၬဘၪယၧၩ လဖၪနီၪဒၪန့ယၧၩလီၫ. တၭယစံၭၦလဆၨၩလၧဆၧ လကိၭထၪ့ဘၪလၧယမံၩ့, ယိခွါယၧၩဘီၪးယိခွါယၧၩ",
			"2": "<sup>2</sup> ဘီၪ.- ယယူၬထၪ့ယစူၪၥံၫ့နံၩချီၩ့လၧၦပိၩ့ထၪ့ဆၧ လဆၨၩ, ၦလၧအဖိၬဖၧၩ့ၥၭအလဂ့ၩဘၪဘဲၫအဆၧး",
			"3": "<sup>3</sup> ဆီၫ့မီၪ့ဒၪဝ့ၫအၥိၭ,- ၦလဆၨၩလၧအမၩၥၭထၪ့ဒၪ ယၧၩလၧယမ့ၬယၫလထံၪဎး လၧအလုထၪ့ဆၧလၧ ကျိၭဖၧၩ့, ဆူၭခဲၩဆၧနၧၫ့မၧၫ့လၧဆၧလုလးအၩ့ကတဲၩ",
			"4": "<sup>4</sup> အဖၫ့ခိၪး- လၧအဆၧၫ့နၩ့လၧဆၧၥွၪခိၪအကျၩ, လၧ အအီၪၥၫ့နၩချီၩ့လၧဆၧအိၩဖၧၩ့, လၧအအၪ့ထိၭယၪ,",
			"5": "<sup>5</sup> ဒဲဆၧလဆံၫ့ဘၪအၥၧၫ့အီၪဝ့ၫလၧအဖၧၩ့ဖၧၩ့,- ၦလၧ အစံၭ,ဆၧၫ့ထုၪ့လစီၪ့ဒၪ, ၥုၭဘူၭနၥၭလၧယအီၪလ ဂ့ၩ,အဂဲးဘဲၫယီၩယဆံၫ့ဎံၪနဲၪ့ဒံၭနၧၩလီၫ. အဝ့ၫၥံၪ မွဲမ့ၪခူၪလၧယနၫဖၧၩ့, ဒဲမ့ၪလၧအအၪ့ခွံၬဆၧၥံၫ့နံၩ",
			"6": "<sup>6</sup> ချီၩ့လီၫ.- ယိခွါ,ဆၧကွ့ၭအၥၭလၧယမ့ၬယၫ, ယအ့ၪ လဖ့ၪထဲၩ့ဘၪတၭ, ယလအီၪပွံၭဘၪယမိဖ့ၪထဲၩ့ဆၧ",
			"7": "<sup>7</sup> လၧအၥၭနၫၡါအဖၧၩ့လီၫ.- နၥံၪအဆၧဒဲၩဘၭ, ဒဲနၥံၪ အဖါလဖၪအဆၧဒဲၩဘၭလဖၧၫ့ဎး လၧနၥံၪအၥၭနၫ ၡါအဖၧၩ့ ယဟိဝၩစံၭဝ့ၫဒၪ, အဝ့ၫၥံၪဆူၭခဲၩဆၧနၧၫ့ မၧၫ့လၧခိၪလီၩ့ခိၪတၭ, အဝ့ၫၥံၪဒုၪဒွ့ၪယၧၩလၧဆၧ စီၩ့ခိၪအလီၩ့လီၫ. မၩအၥၭဘဲၫနီၪတၭ, ယမိတိၪ့ဖ့ၪ လၫ့အမၩဆၧလၧအခၪ့ထံၭနီၪ လၧအၥၭနၫၡါအဖၧၩ့",
			"8": "<sup>8</sup> လီၫ.- တၭယဟိဝၩစံၭဘဲၫယီၩ, ဘဲၫစဘံၭထံၫအၥၫ့ အီၪဝ့ၫလၧစဘံၭၥၪ အဆဲၩဖၧၩ့အၥိၭတၭ, ၦစံၭထီး မၩဂၭဂီၩ့လဂ့ၩး အဂဲးဘဲၫယီၩဆၧဆိၪဂ့ၩအီၪလၧအ ဖၧၩ့နီၪတၭ, ယမိမၩဘဲၫနီၪအၥိၭလၧယခ့ၫယၡၩအ",
			"9": "<sup>9</sup> ဂးဘဲၫၥိၭယထီးမၩဂၭဂီၩ့ထီးအလူၬလဂ့ၩလီၫ.- တၭ ယမိဒုၭဂဲၫထၪ့ဆၧအချံၫအၥၪ လၧစယၫကူၭဒဲဆၧန့ၥၫ ယခိၪလီၩ့လဖျိၪ့လၧယုဒၫတၭ,ယၡၩရွံန့ဖိၪမိန့ၥၫဝ့ၫ",
			"10": "<sup>10</sup> တၭ,ယခ့ၫယၡၩမိအီၪထီးနီၪလီၫ.- ၡၫရၧၫ့မိကဲၪထၪ့ ၥိၪအဖီၩ့, ဒဲအၫခီၫအခိၪလီၩ့ဆူၭနီၪလၧချီခိၬလၩ့အ လး,လၧယၡၩခမျၧး လၧအအၪ့ဎၬယူၭယၧၩအဂးနီၪ လီၫ.",
			"11": "<sup>11</sup> အ့ၪမွဲနၥံၪဝ့ၫဒၪယီၩ, နၥံၪမွဲၦလၧအစဲၪ့ဒၪခွံၬယဟိ ဝၩ, လၧအၥၭထၪ့ယခိၪလီၩ့ဆံၫ့ဎံၪ, လၧအတဲၩ့ဝဲၩ စပွဲခိၪလၧဂၭအဂးတၭ, လဲၩဎုၬဆၧလုအီၩလၧမံနံၫ",
			"12": "<sup>12</sup> အဂးနီၪ,- ယဝံထၪ့နၬထၪ့ယူၭနၥံၪလၧဖၩ့ၥံၪနၭၥံၪအ ဂးတၭ, နၥံၪထီးအလူၬမိခိၬလၩ့လၧဆၧမၩၥံၫနၥံၪအ ဂးလီၫ. အဂဲးဘဲၫယီၩယကိၭထၪ့တၭ,နၥံၪလစံၭဆၧၫ့ ဘၪ,ယချဲၩ့ဆၧတၭ နၥံၪခိၭနၪအ့ၬ. တၭနၥံၪမၩဆၧ အၧၩ့လၧယမ့ၬယၫတၭ, ဆၧလၧအလဘၪဘၪယၥၭ",
			"13": "<sup>13</sup> နီၪနၥံၪရွံန့ဝ့ၫလီၫ.- မၩအၥၭဘဲၫနီၪတၭ,ကဆါယဟိ ဝၩစံၭဘဲၫယီၩ, ယိခွါ,ယခ့ၫယၡၩမိအၪ့ဆၧနီၪ, အ့ၪ မွဲနၥံၪဝ့ၫဆၧမိၥၭဝံနၥံၪအၥၭလီၫ. ယိခွါ, ယခ့ၫယၡၩ မိအီၩဆၧနီၪ, အ့ၪမွဲနၥံၪဝ့ၫဆၧမိၥူၫအီၩနၥံၪအၥၭလၧ ထံၫလီၫ. ယိခွါ,ယခ့ၫယၡၩမိၥုၪ့ဎွံၫၥၭယီၫနီၪ, အ့ၪမွဲ",
			"14": "<sup>14</sup> နၥံၪဝ့ၫနၥံၪအမ့ၬမိမဲလီၫ.- ယိခွါ,ယခ့ၫယၡၩမိၥံၫကျံၩ ဆၧလၧအၥၭမုအကၠီၩ့နီၪး အ့ၪမွဲနၥံၪဝ့ၫနၥံၪမိဂၪ့ဝ့ၫ လၧဆၧၥၭအုၭအကၠီၩ့တၭး မိဂၪ့ကိၭၡၭထၪ့လၧၥုၪ့",
			"15": "<sup>15</sup> ခါၥၭလၩ့အကၠီၩ့လီၫ.- တၭနၥံၪမိအီၪက့ၪလၩ့ထးနၥံၪ အမံၩ့လၧဆၧဆိၪအၧၩ့အလးလၧယၡၩရွံန့ဖိၪအဂး လီၫ.တၭကဆါယဟိဝၩမိမၩၥံၫနၧၩတၭ, မိဖျိၬအခ့ၫ",
			"16": "<sup>16</sup> အၡၩအမံၩ့လမံၩ့ဒၪလီၫ.- ၦလၧအဆိၪဂ့ၩလၩ့အ ၥၭလၧခးဖၧၩ့နီၪ မိဘၪဆိၪဂ့ၩလၩ့အၥၭ လၧဆၧမွဲဆၧ တီၩအယွၩအမ့ၬယၫလီၫ. တၭၦလၧအဆိၪလၩ့အၥၭ လၧခးဖၧၩ့နီၪမိဘၪဆိၪလၩ့အၥၭ လၧဆၧမွဲဆၧတီၩ အယွၩအမ့ၬယၫလီၫ. အဂဲးဘဲၫယီၩဆၧခိဆၧဝီၩလၧ အခၪ့ထံၭလဖၪနီၪၥၭနၪ့ခွံၬယူၭအၥၭယူၭး အဂဲးဘဲၫ ယီၩဆၧလဖၪနီၪအီၪဘံၭခွံၬယူၭလၧယမ့ၬၥၪယူၭ.",
			"17": "<sup>17</sup> အဂဲးဘဲၫယီၩ,ယိခွါ, ယမၩကဲၪထၪ့မူၭခိၪအၥၫ့ဒဲ ဂၪ့ခိၪအၥၫ့တၭ, ဆၧအခၪ့ထံၭလဖၪနီၪ ဆၧလနၪ့ထၪ့ ထဲၩ့ဘၪဝ့ၫတၭ, လအီၪထၪ့လၧၩ့ဘၪလၧပၥၭခံဖၧၩ့",
			"18": "<sup>18</sup> နီၪလီၫ.- အ့ၪမွဲနၥံၪဝ့ၫဒၪယီၩၥုၪ့ထိၬၥၭထိၬဒဲၥုၪ့ဎွံၫၥၭ ယီၫလၧဆၧလၧယမၩကဲၪထၪ့ဝ့ၫအဖၧၩ့နီၪ လၩ့ဆိၩ လၩ့ကၠၪဆံၭ. အဂဲးဘဲၫယီၩ, ယိခွါ, ယမၩကဲၪထၪ့ ယရုစလံၫ့လၧဆၧၥုၪ့ဎွံၫၥၭယီၫအလး, ဒဲအၡၩခမျၧး",
			"19": "<sup>19</sup> လၧဆၧၥုၪ့ထိၬၥၭထိၬအလးနီၪလီၫ.- တၭယမိၥုၪ့ဎွံၫ ၥၭယီၫလၧယရုစလံၫ့အဖၧၩ့ ဒဲၥုၪ့ထိၬၥၭထိၬလၧယ ၡၩခမျၧးအဖၧၩ့လီၫ. တၭဆၧလနါဂၧၫ့လၧၩ့ဘၪဆၧ ဂၪ့အၥီၫ, ဒဲဆၧဂၪ့ခံးဂၪ့ကိၭၡၭထၪ့အၥီၫလၧအဖၧၩ့",
			"20": "<sup>20</sup> မိအီၪလၧၩ့အ့ၬ.- ထီးနီၪဖိၪဆံၭလၧအမုနံၩလဎွ့ၩဘၪ နီၪအီၪလၧၩ့အ့ၬ, ဒဲၦၥၭၡါလၧအနံၩအၥၫ့လဎွ့ၩဒံၭ ဘၪအီၪအ့ၬ. အဂဲးဘဲၫယီၩဖိၪၥၪအၥၭၡါအနံၪ့လ ယၩနီၪမိၥံၫတၭ, ၦဆၧဒဲၩဘၭဖိၪလၧအၥၭၡါလယၩ",
			"21": "<sup>21</sup> နီၪမိဘၪဆၧဆိၪအၧၩ့ဝ့ၫလီၫ.- အဝ့ၫၥံၪမိၥုၪ့ဂံၪ့ဒဲမိအီၪ ဝ့ၫလၧအဖၧၩ့တၭ, မိၥုၪ့စဘံၭမုအလးဒဲမိအၪ့ဆၧၥၪ",
			"22": "<sup>22</sup> လီၫ.- လမၩဘၪဂံၪ့လၧၦဂူၫဂၩအီၪဝ့ၫလၧအဖၧၩ့တၭ, လၥုၪ့လၩ့ဘၪဆၧလၧၦဂူၫဂၩအၪ့အဆၧၥၪး အဂဲးဘဲၫ ယီၩဘဲၫၥံၪ့လထံၭအမုနံၩအၥိၭနီၪ ယၡၩခမျၧးအမု နံၩမိအီၪဆ့လီၫ. တၭယၡၩရွံန့ဖိၪ မိအၪ့အဆၧမၩ",
			"23": "<sup>23</sup> လၧအစူၪယံၬယံၬလီၫ.- မိမၩဆၧပျီၩပျီၩအ့ၬ. အီၪဖျဲၪ ဆၧလၧအၪ့ယိၪဆၧအဂးနီၪဆ့အ့ၬ. အဂဲးဘဲၫယီၩ အဝ့ၫၥံၪမွဲဆၧအချံၫအၥၪ ဘၪဆိၪဂ့ၩ လၧယဟိဝၩ",
			"24": "<sup>24</sup> တၭ,အဆၨၩအဆၬအီၪလၧအဝ့ၫၥံၪအၥိၭလီၫ.- တၭ ဆၧမိမၩအၥၭ လၧအဝ့ၫၥံၪ လချႃၭကိၭထၪ့ဒံၭဘၪ တၭ,ယမိစံၭဆၧၫ့ဆၧလီၫ. အဝ့ၫၥံၪကိၭထၪ့ဝ့ၫအဘိၩ့",
			"25": "<sup>25</sup> ဘၭနီၪတၭ, ယမိခိၭနၪလီၫ.- ထွံၪမံၩ့ဒဲၥိၪဖိၪမိအၪ့အ ဆၪလစီၪ့ဎးတၭ, ဆၬလၥၧၫ့မိအၪ့လီခၫ့ဘဲၫချီအၥိၭ နီၪတၭ, ဂၪ့ခိၪအမုၬမိကဲၪထၪ့ဂူၥံၪအဆၧအၪ့လီၫ. ဆၧ လမၩအၧၩ့ဘၪတၭ,မၩဂၭဂီၩ့ဆၧလၧယခိၪလီၩ့ဆံၫ့ ဎံၪထၧၫ့ဖျိၪ့ယၫအလီၩ့နးစီၪ့အ့ၬ, ယဟိဝၩစံၭဝ့ၫဒၪ လီၫ."
		},
		"66": {
			"1": "<sup>1</sup> ယဟိဝၩစံၭဘဲၫယီၩ, မူၭခိၪမွဲယလးဆီၩ့ဆီတၭ, ဂၪ့ခိၪမွဲယခၪ့ယဲးလၩ့အလးလီၫ. ဂံၪ့လၧနၥံၪမိၥုၪ့လၧ ယဂးနီၪမွဲအအီၪခီၫခီၫလဲၪ. တၭယအီၪပွံၭအလးနီၪ",
			"2": "<sup>2</sup> မွဲအအီၪခီၫခီၫလဲၪ.- ဆၧလဖၪနီၪထီးအလူၬယစူၪဒၪ ယဝ့ၫမၩဝ့ၫတၭ, ဆၧလဖၪနီၪထီးအလူၬအီၪယူၭ, ယ ဟိဝၩစံၭဝ့ၫဒၪ, အ့ၪမွဲယမိယိၦလဂၩယီၩ, ၦလၧအ ၥုၪ့ဆၧၩ့အၥၭဆၧၩ့ ဒဲအၥုၪ့ခါအၥၭလၩ့, ဒဲၥၭမဲၪယ လူယထၫနီၪလီၫ.",
			"3": "<sup>3</sup> ၦလၧအမၩၥံၫချီဖၫလၧဆၧလုအလးနီၪ, မွဲၦလၧ အမၩၥံၫၦၡၩ, ၦလၧအလုထၪ့ၥိၪဖိၪနီၪမွဲၦလၧအမၩ ခါခွံၬထွံၪအခိၬ, ၦလၧအမၩဘိၪ့ဆၧမၩဘိၪ့ကိၪနီၪ, မွဲ ၦလၧအမၩဘိၪ့ထိၭအၥွံၪ, ၦလၧအဆူၭခဲၩဆၧနၧၫ့မၧၫ့ နီၪ,မွဲၦလၧအစံၭထၪ့အၪ့အူၭဆၧဂၩ့လီၫ.မွဲမၬ, အဝ့ၫ ၥံၪရွံန့ယူၭ အဖၧၩ့ၥၭဒၪဝ့ၫလဖၪယူၭ. တၭအၥၭမုၬ",
			"4": "<sup>4</sup> လၩယူၭလၧအဆၧဘၪၥၭလိၪအဖၧၩ့ယူၭ.- ယဝ့ၫဒၪ ယီၩယမိရွံန့ဆ့အဝ့ၫၥံၪအဆၧနၭဆၧၡၪ့တၭ, ဆၧလၧ အၥၭမဲၪဝ့ၫလဖၪနီၪယမိဒုၭဂဲၫဘၪဝ့ၫလီၫ. အဂဲးဘဲၫ ယီၩယကိၭထၪ့တၭ,ၦလစံၭဆၧၫ့ဘၪဆၧး ယချဲၩ့ဆၧ တၭၦလခိၭနၪဘၪဆၧး မွဲအမၩဆၧအၧၩ့လၧယမ့ၬ ယၫတၭ, အဝ့ၫၥံၪရွံန့ဆၧလၧအလဘၪဘၪယၥၭနီၪ လီၫ.",
			"5": "<sup>5</sup> ခိၭနၪယဟိဝၩ အလူအထၫဆံၭ, ၦလၧအဝၭထိၬ လၧအလူအကၠီၩ့ၥံၪဧ့, နၥံၪအထၧၫ့ဖုဝဲလၧအၥၭဂဲၫ့ နၥံၪတၭ, နၫ့ထၪ့ခွံၬနၥံၪလၧယမံၩ့အကၠီၩ့ စံၭဝ့ၫဒၪ, အ့ၪမွဲယဟိဝၩ ဘၪဆၧလၩဆၧဖၩ့ဆံၭ. အ့ၪမွဲအဝ့ၫ ဒၪမိဖိးထၪ့လၧနၥံၪ အဆၧၥုၪ့ထိၬၥၭထိၬအဂးလီၫ. တၭအဝ့ၫၥံၪအမ့ၬမိမဲလီၫ.",
			"6": "<sup>6</sup> ဆၧတုၩ့ထၪ့တုၩ့လၩ့အၥီၫလၧဒိၩ့ဖၧၩ့ ဆၧၥီၫလၧ ဆၧလုဂံၪ့ဖၧၩ့မၬလဲၪ, မွဲယဟိဝၩအလူလၧအမၩဆၧၫ့",
			"7": "<sup>7</sup> ဆၧအၧၩ့လၧအဒုၪအဒၩနီၪလီၫ.- ဇံအိၫ့အဖိၪမုၪအ ဂူၭလချႃၭဆၫဒံၭဘၪနီၪ အီၪဖျဲၪဆၧဘိၩ့အလချႃၭဘၪ",
			"8": "<sup>8</sup> ဆၧဂူၭဆၫဒံၭဘၪနီၪ ဖိၪၥၪခွၫအီၪဖျဲၪဝ့ၫဒၪလီၫ.- မွဲ",
			"9": "<sup>9</sup> ပလၫနါဂၧၫ့ဘၪယူၭ ဆၧဘဲၫနီၪၥိၭလမံၩ့ လဂၩလဲၪ. မွဲပလၫဒၪဘၪယူၭ ဆၧဘဲၫနီၪၥိၭလဖၪလဲၪ. ဆၧလၧ ဂၪ့ခိၪနီၪဒုၭအီၪဖျဲၪဆၧလနံၩဎးဆ့ဧၪ. ၦလဆၨၩမိ အီၪဖျဲၪလဖၧၫ့ဎးဆ့ဧၪ. အဂဲးဘဲၫယီၩထီးဇံအိၫ့ဘၪ ဆၧဂူၭဆၫတၭ, မိအီၪဖျဲၪန့အဖိၪလဖၪ ချဲၫ့မၬလီၫ. ယမိဒုၭဂဲၫလၧဆၧအီၪဖျဲၪအလးတၭ, လဒုၭအီၪဖျဲၪ ဘၪဆ့ဧၪ, ယဟိဝၩစံၭဝ့ၫဒၪး ဆၧလၧယဒုၭကဲၪထၪ့တၭ,လဒုၭအီၪဖျဲၪဘၪဆ့ဧၪ, နယွၩစံၭဝ့ၫဒၪ.-",
			"10": "<sup>10</sup> ၥုၪ့ထိၬ ၥၭထိၬလၧယရုစလံၫ့အၥိၭ, ဒဲၥုၪ့ဎွံၫၥၭယီၫဆ့ဘီၪ, ကယဲၦလၧအအဲၪဝ့ၫၥံၪဧ့, ကယဲၦလၧအၥုၪ့အုၭၥၭ အုၭလၧအၥိၭနၥံၪဝ့ၫဧ့, ၥုၪ့ဎွံၫၥၭယီၫဎုၬလၧအဝ့ၫၥံၪ",
			"11": "<sup>11</sup> အၥိၭဆံၭ.- ဘဲၫၥိၭနၥံၪမိအၪ့ဆူၭဆၧတၭ, ဘျဲၩအၪ့ လၧအနူဘၪဆဲၫ့လၧဆၧမၩမုၬထၪ့ထဲၩ့, ဘဲၫၥိၭနၥံၪမိ အၪ့ဆူၭန့ဆၧတၭ, ၥုၪ့ဎွံၫၥၭယီၫလၧအလၩအဖၩ့အ",
			"12": "<sup>12</sup> လၧၫ့အဎွ့ၩလီၫ.- အဂဲးဘဲၫယီၩယဟိဝၩစံၭဝ့ၫဘဲၫ ယီၩ,ယိခွါ, ယမိဒုၭဘၪဝ့ၫလၧဆၧမုၬဆၧဎၩ့ဘဲၫထံၫ မိၡါအၥိၭ, ဒဲၦဆၨၩလဖၪအလၩအဖၩ့ဘဲၫထံၫချိၬလၧ အလုၬဘံၭဆၧအၥိၭနီၪလီၫ. ထီးနီၪလဖၧၫ့နၥံၪမိအၪ့ ဆူၭဆၧတၭ,ဆၧမိဆိၬနၥံၪလၧအယးဒံၩ့း တၭဆၧမိ",
			"13": "<sup>13</sup> အဲၪဂါနၥံၪလၧခၪ့လုးခိၪအလီၩ့လီၫ.- ဘဲၫၦလၧအမိ မၩမုၬထၪ့ထဲၩ့ဝ့ၫအၥိၭနီၪ, ယဝ့ၫဒၪယီၩ ယမိမၩမုၬ ထၪ့ထဲၩ့နၥံၪဘဲၫနီၪၥိၭတၭ, နၥံၪမိဘၪဆၧမၩမုၬထၪ့",
			"14": "<sup>14</sup> ထဲၩ့နၥံၪလၧယရုစလံၫ့အဖၧၩ့လီၫ.- နၥံၪမိဒၪဘၪဆၧ တၭ,နၥံၪအၥၭမိၥုၪ့ဎွံၫၥၭယီၫတၭ, နၥံၪအဎွံၪၥံၪမိဂ့ၩ ထၪ့ဘဲၫနၪ့ၥံၪမံၩ့ၥံၪအၥိၭနီၪတၭ, ယဟိဝၩအစူၪမိ အီၪဖျီၪထၪ့လၧအခ့ၫအၡၩ အမ့ၬယၫတၭ, မိၥၭထၪ့ ဘၪအဒုၪအဒၩနီၪလီၫ.",
			"15": "<sup>15</sup> အဂဲးဘဲၫယီၩ, ယိခွါ,ယဟိဝၩမိဂဲၫလၧမ့ၪခဲၩအ ဖၧၩ့တၭ, အလဲၪ့မၩအၥၭဘဲၫလံၩၥဝံၭအၥိၭ,ဘဲၫၥိၭအ မိလူၬအၥၭထၪ့လၧၥၭခဲၩထၪ့အဖၧၩ့ ဒဲအဆၧအၪ့ၥီၪ့",
			"16": "<sup>16</sup> လၧမ့ၪလၪအကျၩလီၫ.- အဂဲးဘဲၫယီၩယဟိဝၩမိ လိၭခွးလၧဆၧဖံၭဆၧယၪ ထီးအလူၬလၧမ့ၪ,ဒဲလၧအနၭ လဘံၪ့နီၪတၭ, ၦဘၪဆၧမၩၥံၫဝ့ၫ လၧယဟိဝၩနီၪမိ",
			"17": "<sup>17</sup> အီၪအၪဂၩလီၫ.- ၦလၧအမၩဆံၫ့ဎံၪအၥၭ, ဒဲမၩဆံၫ့ ထၪ့အၥၭ, လၧကျိၭဖၧၩ့နီၪ, အီၪလၧၦလဂၩလၧဆၧ အၥၭခံဖၧၩ့အလးခဲၫ့, အၪ့ထိၭယၪ, ဒဲဆၧၥၭလိၪ, ဒဲ",
			"18": "<sup>18</sup> ယူနီၪ,မိဂၭဂီၩ့ဝ့ၫလစီၪ့ဎးယဟိဝၩစံၭဝ့ၫဒၪ.- တၭယ ဝ့ၫဒၪယီၩ ယၥ့ၪယၫအမၩဆၧ ဒဲအဆီၫ့မီၪ့ဆၧလီၫ. အဆၧၫ့အထီဘၪလၧယမိဒုၭအီၪကီၪ့ကယဲၦဆၨၩ,ဒဲ ၦချဲၩ့ဆၧအချိၬ ထီးအလူၬတၭ, အဝ့ၫၥံၪမိဂဲၫဝ့ၫတၭ,",
			"19": "<sup>19</sup> မိဒၪဘၪယလၩယဖၩ့လီၫ.- ယမိအီၪက့ၪဆၧအနဲၪ့ လၧအကျၩတၭ, ယမိအၪ့မၧၫ့လၩ့ၦလၧအဂၭဖျ့ၭလ ဖၪလၧၦဆၨၩလဖၪအအီၪ, လၧတၫၡံၭ, ပၧလၭ,ဒဲ လၧၭ,ၦလၧအခၭချံၪ,လၧတုဘလၭ, ဒဲယၫဝၫ့,ဒဲလၧ မၫဆမံၭနဲၩ့ အီၪလၧအယဲၩ့ယိၬ လၧအလနါဂၧၫ့ဘၪ ယဂဲးတၭ,လၧအလဒၪဘၪယလၩယဖၩ့နီၪလီၫ. တၭ အဝ့ၫၥံၪမိလီၩလၩ့လၬလၩ့ယလၩယဖၩ့ လၧၦဆၨၩ",
			"20": "<sup>20</sup> လဖၪနီၪအကျၩလီၫ.- တၭအဝ့ၫၥံၪမိဂဲၫဆိၬ နၥံၪအ ထၧၫ့ဖုဝဲထီးအလူၬ လၧဆၧမၩဘိၪ့ယဟိဝၩအဂး, လၧကယဲၦဆၨၩလဖၪအကျၩ, အီၪလၧကၥ့ၪခိၪဒဲလၧ လဲၪ့ဖၧၩ့,ဒဲဆၧဆူၭဖၧၩ့, ဒဲလၧကၥ့ၪလၩအခိၪ, ဒဲလၧ ကလအူၭအလီၩ့နီၪလၧယခိၪလီၩ့ဆံၫ့ဎံၪ, ယရုစလံၫ့ နီၪ,ယဟိဝၩစံၭဝ့ၫဒၪ, ဘဲၫၦအံၫစရ့လၭဂဲၫဆိၬဆၧ မၩဘိၪ့လၧထွ့ၫဆံၫ့ဎံၪအဖၧၩ့ လၧယဟိဝၩအဂံၪ့ဖၧၩ့",
			"21": "<sup>21</sup> အၥိၭနီၪလီၫ.- တၭယမိအၪ့မၩန့ဆ့လနၩ့နၩ့လၧအ ကျၩလၧအမိကဲၪထၪ့ၦလုဆၧဒဲၦလံဝဲၫဖိၪနီၪ, ယဟိ",
			"22": "<sup>22</sup> ဝၩစံၭဝ့ၫဒၪ.- အဂဲးဘဲၫယီၩဘဲၫမူၭခိၪအၥၫ့, ဒဲဂၪ့ခိၪအ ၥၫ့လၧယမိမၩကဲၪထၪ့ဝ့ၫအီၪလၧယမ့ၬယၫအၥိၭနီၪ, နၥံၪအချံၫအၥၪ, ဒဲနၥံၪအမံၩ့အၥၪ မိအီၪဘဲၫနီၪၥိၭ,",
			"23": "<sup>23</sup> ယဟိဝၩစံၭဝ့ၫဒၪ.- တၭဆၧမိမၩအၥၭလၧကယဲဆၧ ဖံၭဆၧယၪထီးအလူၬ မိဂဲၫဘိၪ့ဆၧဘၩဆၧလၧယမ့ၬ ယၫလၧလၩၥံၫအနံၩ, ဒဲမးၥံၫအနံၩ ကိၭဖၧၫ့ဒ့ၭး ယ",
			"24": "<sup>24</sup> ဟိဝၩစံၭဝ့ၫဒၪ.- တၭအဝ့ၫၥံၪမိလ့ၩထၪ့ဝ့ၫတၭ,မိဒၪ ဘၪၦအစွၪလၧအမၩမၪဘၪယၧၩလဖၪနီၪလီၫ. အဂဲး ဘဲၫယီၩ အဝ့ၫၥံၪအလိၪ့လၥံၫဘၪတၭ, မ့ၪလလၩ့ဖံၬ ဘၪတၭ, အဝ့ၫၥံၪမိကဲၪထၪ့ဆၧၥၭလိၪ လၧကယဲဆၧ ဖံၭဆၧယၪအမ့ၬယၫထီးအလူၬလီၫ."
		}
	}
};
module.exports = book;